INSERT INTO `wced_entry` VALUES (8027, "ka2", "409", "<entry page=""409"" id=""8027""><form id=""ka2"" lang=""ceb"">ka<sub>2</sub></form>
<hom>
<sense n=""1""><number>1</number><trans> linker between numeral and noun. </trans>
<eg><i lang=""ceb"">Tulu ka mansánas,</i><trans> Three apples. </trans></eg>
<eg><i lang=""ceb"">Líbu ka líbu,</i><trans> Thousands and thousands. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> between <ix>isig</ix> or <ix>masig</ix> and nouns. </trans>
<eg><i lang=""ceb"">Ísig nímu ka táwu,</i><trans> Your fellow men. </trans></eg>
<eg><i lang=""ceb"">Ang ílang masig ka áping,</i><trans> Each of their cheeks. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""ka_ug"" lang=""ceb""><abbr expan=""ka"" type=""lemma"">—</abbr> ug</form><trans> <ix>particle in expressing alternative situations</ix>: ‘be it ... or’. </trans>
<eg><i lang=""ceb"">Manágat giyud siya mag-ulan kag mag-ínit,</i><trans> He goes fishing rain or shine.
</trans></eg>
</sense></hom></entry>");
