INSERT INTO `wced_entry` VALUES (8031, "ka-2", "409", "<entry page=""409"" id=""8031""><form id=""ka-2"" lang=""ceb"">ka-<sub>2</sub></form>
<hom>
<sense n=""0""><trans> affix forming nouns which mean ‘one’s <pb n=""410""/>co-[noun]’. </trans>
<eg><i lang=""ceb"">Ákung kaklási,</i><trans> My classmate. </trans></eg>
<eg><i lang=""ceb"">Ákung katagilungsud,</i><trans> My fellow townsman. </trans></eg>
<eg><i lang=""ceb"">Ákung kaáway,</i><trans> My opponent.
</trans></eg>
</sense></hom></entry>");
