INSERT INTO `wced_entry` VALUES (8032, "ka-3", "410", "<entry page=""410"" id=""8032""><form id=""ka-3"" lang=""ceb"">ka-<sub>3</sub></form>
<hom>
<sense n=""0""><trans> affix added to adjectives. Adjectives plus <ix>ka-</ix> have these uses: </trans>
</sense>
<sense n=""1""><number>1</number><trans> as nouns which mean ‘the state of being [so-and-so]’. </trans>
<eg><i lang=""ceb"">Tungud sa ákung kasubù,</i><trans> Because of my sorrow. </trans></eg>
<eg><i lang=""ceb"">Ang katahum sa palíbut,</i><trans> The beauty of the surroundings. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> in exclamations. </trans>
<eg><i lang=""ceb"">Kagwápu sa ímung balay!</i><trans> What a beautiful house you have! </trans></eg>
<eg><i lang=""ceb"">Kadakù!</i><trans> How big it is! </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> after <ix>unsa</ix> to form a phrase: how (to what extent) s.t. is [adj.]. </trans>
<eg><i lang=""ceb"">Unsa kadakù?</i><trans> How big is it? </trans></eg>
<eg><i lang=""ceb"">Dì mabatbat kun unsa kangilngig,</i><trans> Words cannot describe how horrible it was.
</trans></eg>
</sense></hom></entry>");
