INSERT INTO `wced_entry` VALUES (8037, "ka-an2", "410", "<entry page=""410"" id=""8037""><form id=""ka-an2"" lang=""ceb"">ka-an<sub>2</sub></form>
<hom>
<sense n=""0""><trans> affix forming nouns </trans>
</sense>
<sense n=""1""><number>1</number><trans> added to adjectives to form nouns which mean ‘the quality of [adj.]’. </trans>
<eg><i lang=""ceb"">Kalampúsan,</i><trans> Success. </trans></eg>
<eg><i lang=""ceb"">Kalipáyan,</i><trans> Happiness. </trans></eg>
<eg><i lang=""ceb"">Ang íyang kasuk-ánun mauy usa ka kasukwahían sa íyang maáyung pamatásan,</i><trans> His quickness to anger is not in harmony with his good manners. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> added to nouns or adjectives to form nouns which refer to a group of [noun]’s. </trans>
<eg><i lang=""ceb"">Ang mga kabatáan,</i><trans> The children. </trans></eg>
<eg><i lang=""ceb"">Balay sa kahiláyan,</i><trans> Den of vice. </trans></eg>
<eg><i lang=""ceb"">Kanipáan,</i><trans> Nipa swamp. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> forming numbers, the multiples of ten’s. </trans>
<eg><i lang=""ceb"">Katluan,</i><trans> Thirty. </trans></eg>
<eg><i lang=""ceb"">Kapituan,</i><trans> Seventy.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (8037, "ka-an", "ka-an", "s", "");
INSERT INTO `wced_entry` VALUES (8038, "ka-an3 (←)", "410", "<entry page=""410"" id=""8038""><form id=""ka-an3_lx"" lang=""ceb"">ka-an<sub>3</sub> (←)</form>
<hom>
<sense n=""0""><trans> affix added to adjectives which refer to a state to form nouns which refer to the achievement of the state. </trans>
<eg><i lang=""ceb"">Way katin-áwan ang inyung burúka,</i><trans> Your case has not reached a clear resolution. </trans></eg>
<eg><i lang=""ceb"">Way kahusáyan ang inyung burúka ug isig pasángil,</i><trans> Your case will never be resolved if all you do is accuse each other.
</trans></eg>
</sense></hom></entry>");
