INSERT INTO `wced_entry` VALUES (8060, "kabang", "411", "<entry page=""411"" id=""8060""><form id=""kabang"" lang=""ceb"">kabang</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>spotted</tr>, <tr>splotched</tr>. </trans>
<eg><i lang=""ceb"">Ang ákung iring kabang putì ug itum,</i><trans> My pet cat is spotted white and black. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> unevenly painted or cut. </trans>
<eg><i lang=""ceb"">Kabang ang íyang tupi,</i><trans> His haircut is uneven. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> uneven in voice because of fright, adolescence, and the like. </trans>
<eg><i lang=""ceb"">Kabang ang íyang tíngug kay hápit na maulitáwu,</i><trans> His voice is uneven because he is an adolescent. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; a]</itype><trans> be <tr>splotched</tr>, <tr>uneven</tr>. </trans>
<eg><i lang=""ceb"">Nagkabang ang íyang nawung sa ap-ap,</i><trans> His face is splotched with fungus. </trans></eg>
</sense></hom>
<entry><form id=""kaxbang"" lang=""ceb""><abbr expan=""kábang"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B145]</itype><trans> intensely uneven or splotched. </trans>
<eg><i lang=""ceb"">Nagkábang ang íyang nawung sa pulbus,</i><trans> Her face was <corr sic=""splothced"">splotched</corr> with powder.
</trans></eg>
</sense></hom></entry></entry>");
