INSERT INTO `wced_entry` VALUES (8074, "kabayu", "411", "<entry page=""411"" id=""8074""><form id=""kabaxyuq"" lang=""ceb"">kabáyù</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>horse</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>paramour</tr> (slang). </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>knight in chess</tr>. </trans>
</sense>
<sense n=""4""><number>4</number><trans> face card showing a horse in Spanish cards, worth eleven. </trans>
</sense></hom>
<entry><form id=""kabaxyuq_sa_daxgat"" lang=""ceb""><abbr expan=""kabáyù"" type=""lemma"">—</abbr> sa dágat</form>
<hom>
<sense n=""0""><trans> <tr>sea horse</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kabaxyuq_sa_daxru"" lang=""ceb""><abbr expan=""kabáyù"" type=""lemma"">—</abbr> sa dáru</form>
<hom>
<sense n=""0""><trans> <tr>plow beam</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kabayuq"" lang=""ceb""><abbr expan=""kabayù"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>ride</tr>, bring s.t. on a horse. </trans>
</sense>
<sense n=""2""><number>2</number><trans> ride, mount on s.t. </trans>
<eg><i lang=""ceb"">Bansay siyang mukabayù sa bisiklíta,</i><trans> She rides a bicycle expertly. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6]</itype><trans> be on top of s.o. in wrestling or similar activity. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> have sexual <tr>intercourse</tr> with (slang). </trans>
<eg><i lang=""ceb"">Nakakabayù aku níyag kas-á,</i><trans> I have had intercourse with her once. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <itype>[b6]</itype><trans> be mobbed. </trans>
<eg><i lang=""ceb"">Gikabay-an sa mga batan-un ang mga artista,</i><trans> The movie stars were mobbed by the young people. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinabay-anay"" lang=""ceb"">kinabay-anay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c]</itype><trans> have intercourse. </trans>
<eg><i lang=""ceb"">Udtung tútuk, nagkinabay-anay pa gihápun!</i><trans> It’s high noon and they are still having intercourse! </trans></eg>
</sense></hom></entry>
<entry><form id=""kulukabaxyuq_kabayuqkabaxyuq"" lang=""ceb""><abbr expan=""kulukabáyù"" type=""lemma"">Culu-</abbr>, kabayùkabáyù</form>
<hom>
<sense n=""0""><trans> <corr><pos>n</pos> </corr></trans>
</sense>
