INSERT INTO `wced_entry` VALUES (8078, "kabiba, kabiba", "411", "<entry page=""411"" id=""8078""><form id=""kabiba_kabixba"" lang=""ceb"">kabiba, kabíba</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> carry s.t. strapped or slung over the shoulder. </trans>
<eg><i lang=""ceb"">Hasta bátà nga gamay kabibahan pa giyud ug putus,</i><trans> Even the small child has to carry a package over her shoulders. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6(1)]</itype><trans> wear s.t. wrapped around the torso. </trans>
<eg><i lang=""ceb"">Nagkabíba siyang nalígù,</i><trans> She took a bath with s.t. wrapped around her body. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> make into a <tr>shoulder strap</tr>. </trans>
</sense>
<sense n=""b""><number>b</number><trans> make into a <tr>chemise</tr> or s.t. to wrap around the body. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> shoulder strap. </trans>
</sense>
<sense n=""2""><number>2</number><trans> loose chemise or anything wrapped around the torso.
</trans>
</sense></hom></entry>");
