INSERT INTO `wced_entry` VALUES (8096, "kabir", "412", "<entry page=""412"" id=""8096""><form id=""kaxbir"" lang=""ceb"">kábir</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cover</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> put a cover on s.t. </trans>
<eg><i lang=""ceb"">Kabíri ang libru arun dì mahúgaw,</i><trans> Put cover on the book so it won’t get dirty. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> protect oneself from blows with the hands. </trans>
<eg><i lang=""ceb"">Mukábir siya dáyun kun dyában,</i><trans> He covers immediately if his opponent jabs him. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> cover the ball in a volleyball game. </trans>
