INSERT INTO `wced_entry` VALUES (8103, "kabit", "413", "<entry page=""413"" id=""8103""><form id=""kabit"" lang=""ceb"">kabit</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>cling to</tr>, <tr>hang on to</tr>. </trans>
<eg><i lang=""ceb"">Punù na kaáyu ang trák. Mukabit lang ta,</i><trans> The truck is already full. Let’s just hang on to the sides. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> join in on a transportation franchise on a minor basis. </trans>
<eg><i lang=""ceb"">Mukabit na lang sila sa ámung linya kay duruha ra man ka buuk ang ílang dyip,</i><trans> They have decided to let their jeep run on our line as they only have two. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> hook up to a telephone with another line. </trans>
</sense>
<sense n=""3""><number>3</number><trans> set decorations in another material. </trans>
<eg><i lang=""ceb"">Ang sinínà sa birhin gikabitan ug mga brilyanti,</i><trans> The dress of the image was inlaid with diamonds. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B126]</itype><trans> be late in planting (grab on to the tail end of the season). </trans>
<eg><i lang=""ceb"">Makabit giyud ning átung pagpugas tungud sa kadúgay sa ulan,</i><trans> We’ll be late sowing because the rains came late. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; a12]</itype><trans> take a paramour or lover. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> connection of public transportation, party line in telephone. </trans>
<eg><i lang=""ceb"">Bísi kaáyu ang tilipunu kay daghang kabit,</i><trans> The telephone is very busy because there are a lot of party lines. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> s.o. with whom one has extra-marital relations. </trans>
<eg><i lang=""ceb"">Nahibalu na giyud ang asáwa nga may kabit diay si Tiruy,</i><trans> The wife finally found out that Terry had a paramour. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> planted at the end of the season.
</trans>
</sense></hom></entry>");
