INSERT INTO `wced_entry` VALUES (8117, "kabu", "413", "<entry page=""413"" id=""8117""><form id=""kabuq"" lang=""ceb"">kabù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> dip water, <tr>scoop</tr> solids out of a container. </trans>
<eg><i lang=""ceb"">Kabuun ta ning túbig sa tangki,</i><trans> Dip the water out of the tank. </trans></eg>
<eg><i lang=""ceb"">Ayawg ikabù ang ímung básu sa bugas,</i><trans> Don’t use your glass to scoop the rice out. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2]</itype><trans> take in some water in tilting to one side. </trans>
<eg><i lang=""ceb"">Pagtakílid sa barku, nakakabù giyug diyútayng túbig,</i><trans> When the ship listed, it took in some water in the process. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fetch water. </trans>
<eg><i lang=""ceb"">Túa siya sa atábay, nagkabù,</i><trans> He’s at the well, fetching water. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a12]</itype><trans> make, use as water dipper. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used as a dipper or scoop. </trans>
</sense></hom>
