INSERT INTO `wced_entry` VALUES (8120, "kabug1", "414", "<entry page=""414"" id=""8120""><form id=""kabug"" lang=""ceb"">kabug<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. large fruit bat with a dark brown color, growing to a five or even seven-foot wingspan. The flesh is highly esteemed. </trans>
</sense></hom>
<entry><form id=""kabgan"" lang=""ceb"">kabgan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> abode of this sort of bat. </trans>
</sense></hom></entry>
<entry><form id=""kinabug"" lang=""ceb""><abbr expan=""kinabug"" type=""lemma"">-in-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> stay awake at night and sleep during the day like a bat. </trans>
<eg><i lang=""ceb"">Pirmi kung mabilar kay nagkinabug ang bátà,</i><trans> I’m always losing sleep because the child stays awake at night. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a k.o. triple-looped hitch used to fasten a line to a piece of wood so that it will not slip when the rope is pulled parallel to the wood. So called because the loops form what look like a bat’s claws holding to the wood.
</trans>
</sense></hom></entry></entry>");
