INSERT INTO `wced_entry` VALUES (8124, "kabuhi", "414", "<entry page=""414"" id=""8124""><form id=""kabuxhiq"" lang=""ceb"">kabúhì</form>
<hom>
<sense n=""0""><trans> (from <ix>búhì</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a pulsating thing located in the abdominal region which is what one feels when one experiences hyper-acidity or other sharp abdominal pains. The cause of these pains is thought to be the displacement of the <ix>kabúhì</ix>, most often in an upward direction, and treatment is by hot compresses and by massage (<ix>kalaykay</ix>) to put the <ix>kabúhì</ix> back in place. </trans>
<eg><i lang=""ceb"">Misáka ákung kabúhì sa kutukutu,</i><trans> My <ix>kabúhì</ix> rose to under my rib cage. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> this pulsating thing viewed as the seat of life. </trans>
<eg><i lang=""ceb"">Unsang urása nabugtù ang íyang kabúhì?</i><trans> What time did he expire (lit. was his <ix>kabúhì</ix> broken off)? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13P; a4b4]</itype><trans> have pains because of the <ix>kabúhì</ix>. </trans>
<eg><i lang=""ceb"">Gikabuhían (gikabúhì) aku,</i><trans> I have pains in the abdominal region. </trans></eg>
</sense></hom>
<entry><form id=""kabuhiq"" lang=""ceb""><abbr expan=""kabuhì"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kabuxhiq""><sc>kabúhì</sc></xr>, <i lang=""ceb"">v</i>. </trans>
</sense></hom></entry>
<entry><form id=""kabuhiun"" lang=""ceb""><abbr expan=""kabuhiun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to get pains caused by <ix>kabúhì</ix>.
</trans>
</sense></hom></entry></entry>");
