INSERT INTO `wced_entry` VALUES (8138, "kabya", "414", "<entry page=""414"" id=""8138""><form id=""kabya"" lang=""ceb"">kabya</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> move s.t. with a heavy sweeping motion of the arms as in moving water with a paddle or splashing. </trans>
<eg><i lang=""ceb"">Mukabya kag kusug arun matúlin ang barútu,</i><trans> Paddle hard to make the boat go fast. </trans></eg>
<eg><i lang=""ceb"">Ikabya (kabyáha) ngari ang gabayan arun ákung maabut,</i><trans> Splash the waterwings this way so I can reach them. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> move s.t. light with a sweeping motion. </trans>
<eg><i lang=""ceb"">Mikabya siya sa kurtína arun sa paglìlì,</i><trans> She moved the curtain aside to peep outside. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> fling water or grains out or into s.t. </trans>
<eg><i lang=""ceb"">Huy, kinsa may nagkabya ug túbig sa lagúna?</i><trans> Hey, who threw water out onto the lawn? </trans></eg>
<eg><i lang=""ceb"">Ayawg kabyáhig balas ang asíras,</i><trans> Don’t throw sand onto the sidewalk. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> toss a ball to a teammate using this k.o. motion. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of sweeping with the arms <pb n=""415""/>or flinging.
