INSERT INTO `wced_entry` VALUES (8151, "kading", "415", "<entry page=""415"" id=""8151""><form id=""kading"" lang=""ceb"">kading</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who gossips (slang). </trans>
<eg><i lang=""ceb"">Ang mga kading namínaw pag-áyu sa lális sa magtiáyun,</i><trans> The gossips listened with close attention to the couple’s quarrel. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> tell s.o. of, usually gossip (slang). </trans>
<eg><i lang=""ceb"">Kinsay nagkading nímung mabdus si Níla?</i><trans> Who told you that Nella was pregnant? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A12]</itype><trans> receive information<corr sic=""."">,</corr> usually gossip (slang). </trans>
<eg><i lang=""ceb"">Nakakading kung daghan kunug babáyi si Dyú,</i><trans> I have heard that Joe has many mistresses. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12; b6]</itype><trans> be, become a gossip (slang). </trans>
</sense></hom>
<entry><form id=""kaxding"" lang=""ceb""><abbr expan=""káding"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; c16]</itype><trans> talk idly, <tr>gossip</tr> together. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of gossiping idly (slang). </trans>
<eg><i lang=""ceb"">Dúgay nahuman ang ílang káding sa tilipunu,</i><trans> Their telephone conversation took a long time.
</trans></eg>
</sense></hom></entry></entry>");
