INSERT INTO `wced_entry` VALUES (8155, "kadlas", "415", "<entry page=""415"" id=""8155""><form id=""kadlas"" lang=""ceb"">kadlas</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having scratches on the surface. </trans>
<eg><i lang=""ceb"">Kadlas kaáyu ang pintal sa ímung awtu,</i><trans> The paint on your car is full of scratches. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> scratch, mark left on a surface. </trans>
<eg><i lang=""ceb"">Dílì mailhan ang kadlas,</i><trans> The scratch is invisible. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13P; a12b2]</itype><trans> put a scratch in s.t., make a break on a surface. </trans>
<eg><i lang=""ceb"">Hikadlasan ang tapalúdu sa awtu,</i><trans> The fender got scratched. </trans></eg>
</sense></hom>
<entry><form id=""kadlaxsun"" lang=""ceb""><abbr expan=""kadlásun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> full of scratches. </trans>
</sense></hom></entry>
<entry><form id=""kadlasaxnay"" lang=""ceb""><abbr expan=""kadlasánay"" type=""lemma"">-ánay</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#tubigtuxbig""><sc>tubigtúbig</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#tuxbig""><sc>túbig</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""kadlasan"" lang=""ceb""><abbr expan=""kadlasan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a leader of the defenders in a children’s game called <ix>tubigtúbig</ix>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> be the leader in this game.
</trans>
</sense></hom></entry></entry>");
