INSERT INTO `wced_entry` VALUES (8156, "kadlit", "415", "<entry page=""415"" id=""8156""><form id=""kadlit"" lang=""ceb"">kadlit</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> strike a match, put a match to s.t. </trans>
<eg><i lang=""ceb"">Kadlíti ang mga kandílà,</i><trans> Light the candles with a match. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> make a small incision or other motion analogous to striking a match. </trans>
<eg><i lang=""ceb"">Akuy mukadlit sa hubag,</i><trans> I will make an incision in the boil. </trans></eg>
<eg><i lang=""ceb"">Tambálan ang mikadlit sa buayáhun,</i><trans> A folk doctor made an incision in the palm of the child that had the mark of the crocodile. </trans></eg>
<eg><i lang=""ceb"">Gikadlítan ku kuntra sa buti,</i><trans> I was vaccinated against smallpox. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of striking a match. </trans>
</sense></hom>
<entry><form id=""way_kadlit"" lang=""ceb"">way <abbr expan=""kadlit"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> don’t strike any matches, humorously said when a man is urinating on analogy of what one says when pouring gasoline. </trans>
</sense></hom></entry>
<entry><form id=""kadlitaxnan"" lang=""ceb""><abbr expan=""kadlitánan"" type=""lemma"">-ánan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the side of a matchbox where matches are struck. </trans>
</sense></hom></entry>
<entry><form id=""kadlixtan"" lang=""ceb""><abbr expan=""kadlítan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> general name for surgeon fish so called because of the powerful sharp spines situated on each side of the caudal peduncle.
</trans>
</sense></hom></entry></entry>");
