INSERT INTO `wced_entry` VALUES (8158, "kadtu", "415", "<entry page=""415"" id=""8158""><form id=""kadtu"" lang=""ceb"">kadtu</form>
<hom>
<sense n=""0""><trans> <ix>short form</ix>: <bx>tu</bx>. </trans>
</sense>
<sense n=""1""><number>1</number><trans> that (far from speaker and hearer). </trans>
<eg><i lang=""ceb"">Kadtung balay sa unáhan kang Husi,</i><trans> That house up ahead is Joe’s. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> he, she (far away). </trans>
<eg><i lang=""ceb"">Wà man gud tu makasabut sa ákung sulti,</i><trans> He did not get what I said. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> that one that was past in time. </trans>
<eg><i lang=""ceb"">Ngánu man kadtu?</i><trans> Why did that happen? </trans></eg>
<eg><i lang=""ceb"">Kadtung ákung giingun,</i><trans> What I said. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> that was the case. </trans>
<eg><i lang=""ceb"">Dihà kadtuy higayun nga ...<corr>,</corr></i><trans> It <pb n=""416""/>happened one time that ... </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> he, she (referring to a person remote in time). </trans>
<eg><i lang=""ceb"">Nagtúu ang mga tulisan nga kadtu patay na,</i><trans> The bandits believed that he was already dead. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> followed by a verb: that time when. </trans>
<eg><i lang=""ceb"">Kadtung musumbag na siya, mulikay pud ku,</i><trans> When he would strike me, I would also dodge. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> the ones, those that are. </trans>
<eg><i lang=""ceb"">Kadtung nakaapil na walay lábut áning duláa,</i><trans> Those who have already tried it once are not to take part this time. </trans></eg>
</sense></hom>
<entry><form id=""niadtu"" lang=""ceb"">niadtu</form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>gen.</ix>: of that. </trans>
<eg><i lang=""ceb"">Ang tag-íya niadtung sakayána,</i><trans> The owner of that boat. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <ix>dat.</ix>: to, on that. </trans>
<eg><i lang=""ceb"">Ihátag niadtung tawhána,</i><trans> Give it to that man. </trans></eg>
<eg><i lang=""ceb"">Niadtung adláwa migíkan siya pára sa Manílà,</i><trans> On that day he left for Manila. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> formerly <ix>short for</ix> <bx>kaniadtu</bx>. </trans>
</sense></hom></entry>
<entry><form id=""adtu"" lang=""ceb"">adtu</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#niadtu""><sc>niadtu</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""naadtu"" lang=""ceb"">naadtu</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#niadtu""><sc>niadtu</sc></xr>.
</trans>
</sense></hom></entry></entry>");
