INSERT INTO `wced_entry` VALUES (8166, "kaga", "416", "<entry page=""416"" id=""8166""><form id=""kaxgaq"" lang=""ceb"">kágà</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> talking excessively of foolish things. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>lying</tr>, esp. boastfully. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23N]</itype><trans> talk foolishness excessively. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; b6(1)]</itype><trans> tell a lie, esp. a boastful one. </trans>
<eg><i lang=""ceb"">Nakapangágà (nakakágà) siya sa mga tagabúkid nga abugádu siya,</i><trans> He has led the gullible mountaineers to believe that he was a lawyer. </trans></eg>
<eg><i lang=""ceb"">Bísag unsa lay íyang gikágà (gipangágà) sa íyang giulitawhan,</i><trans> There was no limit to the lies he told the woman he was courting. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for a chicken to make clucking noise instead of fighting. </trans>
<eg><i lang=""ceb"">Ayaw ug isígig sábung ang sunuy tingálig mukágà nà,</i><trans> Don’t keep fighting the rooster. It will get so it will cackle instead of fighting. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A23N; b3]</itype><trans> grow timid like a chicken. </trans>
<eg><i lang=""ceb"">Ngánung kagáan man nímu nang gwápa nga may hitsúra ka man sab?</i><trans> Why are you scared to face that beautiful woman when you’re good-looking? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>empty talk</tr>. </trans>
<eg><i lang=""ceb"">Ísug kaáyug sinultihan, kágà man lang diay pulus,</i><trans> He talks so fiercely, but it’s nothing but all empty talk. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>liar</tr>, esp. a boastful one. </trans>
</sense>
<sense n=""3""><number>3</number><trans> cowardly, timid, chicken. </trans>
<eg><i lang=""ceb"">Kagáun kaáyu ning manúka dílì ángayng itárì,</i><trans> This cock is very cowardly. It is not fit for a cockfight. </trans></eg>
</sense></hom>
<entry><form id=""kagaxun"" lang=""ceb""><abbr expan=""kagáun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>talkative</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; b6]</itype><trans> be, become a boastful liar or timid.
</trans>
</sense></hom></entry></entry>");
