</sense>
<sense n=""2""><number>2</number> <itype>[b4]</itype><trans> <tr>abrade</tr>, <tr>wear off</tr>. </trans>
<eg><i lang=""ceb"">Wà pa kagdi ang ligid,</i><trans> The tire is not worn down yet. </trans></eg>
