INSERT INTO `wced_entry` VALUES (8210, "kaguku1", "418", "<entry page=""418"" id=""8210""><form id=""kaguqkuq"" lang=""ceb"">kagùkù<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> make a hollow thumping sound. </trans>
<eg><i lang=""ceb"">Ug mukagùkù ang sambag, hinug na,</i><trans> When the tamarind rattles, it’s ripe. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b3]</itype><trans> laugh with a deep, loud voice. </trans>
<eg><i lang=""ceb"">Nahikagùkù akug katáwa sa íyang isturya,</i><trans> I burst into loud laughter at his story. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> hollow sound in large fruits; chugging sound of trains in motion. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a large k.o. sweet pepper of the same type as is commercially grown in the States, so called because it makes hollow sounds if you tap it.
</trans>
</sense></hom></entry>");
