INSERT INTO `wced_entry` VALUES (8224, "kagutkut", "418", "<entry page=""418"" id=""8224""><form id=""kagutkut"" lang=""ceb"">kagutkut</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sound made by s.t. gnawing away at s.t. or scraping s.t. off. </trans>
<eg><i lang=""ceb"">Ang kagutkut sa ilagang gakitkit sa kumúda,</i><trans> The gnawing <pb n=""419""/>sound of the rats nibbling at the drawer. </trans></eg>
