<eg><i lang=""ceb"">Nikagutkut ang tísas pagsulat nákù sa islít,</i><trans> The piece of chalk made a scraping sound when I wrote on the slate. </trans></eg>
<eg><i lang=""ceb"">Ang kinagutkut sa limbas,</i><trans> The scraping sound of the carpenter’s file.
