INSERT INTO `wced_entry` VALUES (8230, "kaham", "419", "<entry page=""419"" id=""8230""><form id=""kaxham"" lang=""ceb"">káham</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>touch</tr> with the whole hand. </trans>
<eg><i lang=""ceb"">Ang mukáham sa pagkáun manghunaw,</i><trans> Whoever touches food should wash his hands. </trans></eg>
<eg><i lang=""ceb"">Ikáham (kaháma) ang íyang líug kun gihilantan ba,</i><trans> Feel her neck to see if she has a fever. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a12]</itype><trans> touch for sexual purposes. </trans>
<eg><i lang=""ceb"">Dúnay báyut nga nangáham nákù sa sinihan,</i><trans> A homosexual tried to touch me in the movie house. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> steal. </trans>
<eg><i lang=""ceb"">Wà hibaw-i ang mikáham sa mga aláhas,</i><trans> No one knows who stole the jewelry. </trans></eg>
</sense></hom>
<entry><form id=""kinaxham"" lang=""ceb""><abbr expan=""kináham"" type=""lemma"">-in-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> s.t. that is one’s favorite. </trans>
<eg><i lang=""ceb"">Ang kináham kung pagkáun,</i><trans> My favorite food. </trans></eg>
<eg><i lang=""ceb"">Kináham níyang basahúnun,</i><trans> His favorite reading matter. </trans></eg>
<eg><i lang=""ceb"">Kináham níyang prugráma,</i><trans> His favorite program. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> become one’s favorite.
