INSERT INTO `wced_entry` VALUES (8232, "kahangay1", "419", "<entry page=""419"" id=""8232""><form id=""kahangay"" lang=""ceb"">kahangay<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> dare touch s.t. forbidden. </trans>
<eg><i lang=""ceb"">Way mukahangay sa ákung gamit ayug latiguhun,</i><trans> Nobody dares touch my instruments for fear of getting whipped. </trans></eg>
<eg><i lang=""ceb"">Ayawg kahangyi nà kay wà pa mahuman,</i><trans> Don’t dare touch that because it’s not done.
</trans></eg>
</sense></hom></entry>");
