INSERT INTO `wced_entry` VALUES (8233, "kahangay2", "419", "<entry page=""419"" id=""8233""><form id=""kahangay2"" lang=""ceb"">kahangay<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; b6]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> do s.t. to while away the time or in one’s spare time. </trans>
<eg><i lang=""ceb"">Nagkahangay kug basabása samtang nagpaábut níya,</i><trans> I read the papers to while away the time while I was waiting. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> do s.t. as one’s avocation during spare time. </trans>
<eg><i lang=""ceb"">Nagkahangay siyag pangahintig mintiryu,</i><trans> She sells cemetery lots in her spare time.
</trans></eg>
</sense></hom></entry>");
