INSERT INTO `wced_entry` VALUES (8235, "kahas", "419", "<entry page=""419"" id=""8235""><form id=""kaxhas"" lang=""ceb"">káhas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; a2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> have the audacity to get or use s.t. without the consent of the proper person. </trans>
<eg><i lang=""ceb"">Gikáhas sa asáwa ang ílang tinígum arun ipalit ug tíbi,</i><trans> The wife had the nerve to take their savings to buy a T.V. set. </trans></eg>
<eg><i lang=""ceb"">Gikáhas níyag baligyà ang bábuy,</i><trans> He took it upon himself to sell the pig. </trans></eg>
<eg><i lang=""ceb"">Gikáhas ug lúgì sa íyang anak ang ílang kalubihan,</i><trans> His son had the nerve to harvest their coconuts. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> embezzle. </trans>
<eg><i lang=""ceb"">Ang tisuríru nga mikáhas sa pundu,</i><trans> The treasurer who embezzled the funds. </trans></eg>
</sense></hom>
<entry><form id=""pangaxhas"" lang=""ceb"">pangáhas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b5]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. one should not. </trans>
<eg><i lang=""ceb"">Ayaw giyug pangáhas ug paúlì nga mag-inusára sa kagabhíun,</i><trans> Don’t dare go home alone at night. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> abuse s.o. sexually. </trans>
<eg><i lang=""ceb"">Buut ku siyang pangahásan,</i><trans> I wanted to abuse her. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> dare do s.t. that takes courage. </trans>
<eg><i lang=""ceb"">Dì ku mangáhas pagtabuk samtang bahà pa,</i><trans> I don’t dare cross while the river is in flood stage. </trans></eg>
</sense></hom></entry>
<entry><form id=""mapangahaxsun"" lang=""ceb""><abbr expan=""mapangahásun"" type=""lemma"">mapaN-un</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> daring to do s.t. forbidden.
</trans>
</sense></hom></entry></entry>");
