INSERT INTO `wced_entry` VALUES (8239, "kahil1", "419", "<entry page=""419"" id=""8239""><form id=""kahil"" lang=""ceb"">kahil<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1b2]</itype><trans> <tr>touch</tr>, brush lightly against s.t. </trans>
