INSERT INTO `wced_entry` VALUES (8248, "kahun", "420", "<entry page=""420"" id=""8248""><form id=""kahun"" lang=""ceb"">kahun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>box</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> square or rectangular section in a rice paddy. </trans>
<eg><i lang=""ceb"">Napúlù ka kahun ang íyang pilapilan,</i><trans> There are ten square partitions in his rice paddy. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> group of fives in tallying (four vertical lines and one slanting line). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> make into a box. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> divide into square, rectangular sections. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A12]</itype><trans> obtain groups of fives. </trans>
<eg><i lang=""ceb"">Sa pag-iskutinyu wà gánì makakahun ang átung kandidátu,</i><trans> When the ballots were counted our candidate did not even get a score of five. </trans></eg>
</sense></hom>
<entry><form id=""kinahun"" lang=""ceb""><abbr expan=""kinahun"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> enclosed in boxes. </trans>
<eg><i lang=""ceb"">Mga kinahun nag íyang dala,</i><trans> The things were all enclosed in boxes. </trans></eg>
</sense></hom></entry>
<entry><form id=""kahunis"" lang=""ceb""><abbr expan=""kahunis"" type=""lemma"">-is</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kahun""><sc>kahun</sc></xr>, <bx>3</bx> (plural).
</trans>
</sense></hom></entry></entry>");
