<eg><i lang=""ceb"">Mu rag ísug apan kun suklan giyud, mukákak diay,</i><trans> He appears tough but if you challenge him, he runs away. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b3]</itype><trans> for a woman to squawk with displeasure. </trans>
<eg><i lang=""ceb"">Nagkákak <pb n=""421""/>ang asáwa kay dúgayng miulì ang bána,</i><trans> The wife is squawking because her husband came home late.
