INSERT INTO `wced_entry` VALUES (8281, "kalabat", "421", "<entry page=""421"" id=""8281""><form id=""kalaxbat"" lang=""ceb"">kalábat</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c]</itype><trans> reach up to an amount or length of time. </trans>
<eg><i lang=""ceb"">Ang húlaw nakakábat giyud ug tulu ka búlan,</i><trans> The dry season lasted for three months. </trans></eg>
<eg><i lang=""ceb"">Ikábat ug singkuwinta ka tápuk ang inasal,</i><trans> Make the roast pig do for fifty portions. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a]</itype><trans> <tr>go as far as</tr>. </trans>
<eg><i lang=""ceb"">Kabátun ku ang mga bitúun álang kanímu,</i><trans> I’ll go to the stars for you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> <tr>walk</tr> holding on s.t. </trans>
<eg><i lang=""ceb"">Gikabátan sa bátà ang mga silya,</i><trans> The child walked holding onto the chair. </trans></eg>
</sense></hom>
<entry><form id=""kalabatan"" lang=""ceb""><abbr expan=""kalabatan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. one holds onto while walking.
</trans>
</sense></hom></entry></entry>");
