INSERT INTO `wced_entry` VALUES (8290, "kalag", "422", "<entry page=""422"" id=""8290""><form id=""kalag"" lang=""ceb"">kalag</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>soul</tr>. </trans>
<eg><i lang=""ceb"">Kaluy-an mu ang kalag ni Luísa,</i><trans> Have mercy on the soul of Louisa. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> a person as reckoned for count. </trans>
<eg><i lang=""ceb"">Walà giyuy bisag usa ka kalag nagtikawtikaw sa íla,</i><trans> Not a soul stirred in the house. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <form id=""walay_kalag"" lang=""ceb"">walay <abbr expan=""kalag"" type=""lemma"">—</abbr></form><trans> </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>heartless</tr>, <tr>cruel</tr>. </trans>
<eg><i lang=""ceb"">Wà kay kág, wà kay kalúuy,</i><trans> You’re heartless, without mercy. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>ghost</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> human skeleton showing itself as a ghost. </trans>
<eg><i lang=""ceb"">Naingun kag kalag sa kaníwang,</i> You’re as thin as a skeleton. <form id=""kalag_sa_animas"" lang=""ceb""><abbr expan=""kalag"" type=""lemma"">—</abbr> sa animas</form><trans> thin as a soul in purgatory. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12b2]</itype><trans> for a ghost to haunt s.o. </trans>
<eg><i lang=""ceb"">Mamatay gánì ku kágun (kalgun) tikaw,</i><trans> If I die, I’ll haunt you. </trans></eg>
<eg><i lang=""ceb"">Hikalgan siya sa íyang asáwa,</i><trans> He was haunted by his wife’s ghost. </trans></eg>
</sense></hom>
<entry><form id=""pangalag"" lang=""ceb""><abbr expan=""pangalag"" type=""lemma"">paN-</abbr></form>
<hom>
<sense n=""0""> <itype>[b8]</itype><trans> for a ghost to come back to earth. </trans>
</sense></hom></entry>
<entry><form id=""kalagkaxlag"" lang=""ceb"">kalagkálag</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>All Souls’ Day</tr> or a small party of prayers and eating on All Souls’ Day, in honor of the dead. </trans>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#plasixbu""><sc>plasíbu</sc></xr>, <i lang=""ceb"">n, 1.</i> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> hold such a celebration on All Souls’ Day. </trans>
<eg><i lang=""ceb"">Káda adlaw sa minatay magkalagkálag giyud mi,</i><trans> Every year on All Souls’ Day we hold a celebration. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#plasixbu""><sc>plasíbu</sc></xr>, <i lang=""ceb"">v</i>. </trans>
</sense></hom></entry>
<entry><form id=""pangalagkaxlag"" lang=""ceb"">pangalagkálag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> go to s.o.’s home to celebrate the All Souls’ Day ritual. </trans>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#pamlasixbu""><sc>pamlasíbu</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""kalagkalag"" lang=""ceb"">kalagkalag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a4]</itype><trans> get a sickness caused by the soul of a departed relative. </trans>
<eg><i lang=""ceb"">Walay duktur nga makaáyus íyang sakit. Gikalagkalag man diay nà siyas íyang lúlu,</i><trans> No doctor can cure his disease. He is suffering from an affliction caused by the soul of his grandfather. </trans></eg>
</sense></hom></entry>
<entry><form id=""kalagnun"" lang=""ceb"">kalagnun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>spiritual</tr>.
</trans>
</sense></hom></entry></entry>");
