<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> portion of a field which has been plowed at one time. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; b5]</itype><trans> plow a certain portion of the field. </trans>
<eg><i lang=""ceb"">Nakakálang na sila sa katungà sa daruhan,</i><trans> They had already plowed half of the field. </trans></eg>
<eg><i lang=""ceb"">Ang duul sa sapà mauy ákung kalangun (kalangan) pag-úna,</i><trans> I’ll clear up the part near the river first.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (8321, "kálang", "kalang", "m", "nv");
INSERT INTO `wced_entry` VALUES (8322, "kal-ang", "423", "<entry page=""423"" id=""8322""><form id=""kal-ang"" lang=""ceb"">kal-ang</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>gap</tr>. </trans>
<eg><i lang=""ceb"">Adtu lapus sa kal-ang sa paril,</i><trans> Pass through the gap in the wall (or between the two walls). </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> distance in time or space between two things. </trans>
<eg><i lang=""ceb"">Ang kal-ang sa ílang pangidarun,</i><trans> The gap in their ages. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B5; c1]</itype><trans> be located with gaps in between. </trans>
<eg><i lang=""ceb"">Kal-ángi ang mga silya arun dílì magkinupyahánay,</i><trans> Place your chairs far apart so you won’t be copying from each other. </trans></eg>
</sense></hom>
<entry><form id=""kal-angan"" lang=""ceb""><abbr expan=""kal-angan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> space between two things. </trans>
<eg><i lang=""ceb"">Ang kal-angan sa sini ug iskuylahan gitukúran ug balay,</i><trans> A house is built in the space between the movie house and the school. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinal-angan"" lang=""ceb""><abbr expan=""kinal-angan"" type=""lemma"">-in-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place where there is the biggest gap.
</trans>
</sense></hom></entry></entry>");
