INSERT INTO `wced_entry` VALUES (8323, "kalangkalang", "423", "<entry page=""423"" id=""8323""><form id=""kalangkaxlang"" lang=""ceb"">kalangkálang</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> <tr>estimate</tr>, <tr>consider s.t. carefully</tr>. </trans>
<eg><i lang=""ceb"">Ikaw ra ang mukalangkálang ug makaáyu ba nímu,</i><trans> Weigh it carefully yourself whether it would do you any good. </trans></eg>
<eg><i lang=""ceb"">Aku ray mukalangkálang nga maígù ang pagkáun sa tanan,</i><trans> I’ll ration the food out so that it will go around. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> estimation, consideration. </trans>
<eg><i lang=""ceb"">Sa ákung kalangkálang mudaug giyud ang prutista ni Usminya,</i><trans> As I see it, Osmeña’s protest will be successful.
</trans></eg>
</sense></hom></entry>");
