INSERT INTO `wced_entry` VALUES (8325, "kalap2", "423", "<entry page=""423"" id=""8325""><form id=""kaxlap2"" lang=""ceb"">kálap<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>touch</tr>, <tr>tinker</tr>, <tr>play with s.t. forbidden</tr>. </trans>
<eg><i lang=""ceb"">Latusun ku ang magkáp sa gamitun,</i><trans> I’ll whip anyone who tinkers with the tools. </trans></eg>
<eg><i lang=""ceb"">Gikápan giyud ang tigib kay nagíbang,</i><trans> S.o. must have played with the chisel because it got nicked. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>tease</tr>, <tr>play a joke</tr> on s.o. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[AN]</itype><trans> engage in petty stealing. </trans>
<eg><i lang=""ceb"">Bantáyi siyang musulud kay mukáp nà,</i><trans> Watch him if he comes in because he lifts things. </trans></eg>
</sense></hom>
<entry><form id=""kalapkaxlap"" lang=""ceb"">kalapkálap</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3]</itype><trans> tinker, try one’s hand at s.t. new. </trans>
<eg><i lang=""ceb"">Namikaniku siya kay ganáhan mukapkáp ug makina,</i><trans> He became a mechanic because he likes to tinker with machines.
</trans></eg>
</sense></hom></entry></entry>");
