INSERT INTO `wced_entry` VALUES (8326, "kalapati", "423", "<entry page=""423"" id=""8326""><form id=""kalapaxti"" lang=""ceb"">kalapáti</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b5]</itype><trans> <tr>calk</tr>, make s.t. watertight by filling the seams or cracks. </trans>
<eg><i lang=""ceb"">Gikalapatíhan (gikalapáti) ang tanang sinumpayan sa káhuy nga mikang-a,</i><trans> All the wooden joints that came loose have been calked. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1; b6(1)]</itype><trans> be covered with s.t. sticky and dirty. </trans>
<eg><i lang=""ceb"">Nagkalapáti ang nawung sa bátà sa bábul gam,</i><trans> The child’s <pb n=""424""/>face is smeared with sticky bubble gum. </trans></eg>
<eg><i lang=""ceb"">Ayaw pagdúwà sa taguk sa nangkà kay makakalapáti (makapakalapáti) nà sa kamut mu,</i><trans> Don’t play with the sticky sap of jackfruit, as it will get your hands all sticky.
</trans></eg>
</sense></hom></entry>");
