INSERT INTO `wced_entry` VALUES (8334, "kalas1", "424", "<entry page=""424"" id=""8334""><form id=""kalas"" lang=""ceb"">kalas<sub>1</sub></form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>rake</tr> out s.t. that is growing, <tr>harrow</tr>. </trans>
<eg><i lang=""ceb"">Kinahanglan kalasun ang mga sagbut samtang wà pay ulan,</i><trans> You must rake out the weeds before the rains come. </trans></eg>
<eg><i lang=""ceb"">Ímung kalasan ug úna ang dapit sa sapà,</i><trans> First harrow the part which is near the brook. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[a12]</itype><trans> make into a harrow, rake. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b1c]</itype><trans> give the owner of gambling equipment a rake-off. </trans>
<eg><i lang=""ceb"">Kalasan námù ang ímung baráha kun magpúkir mi,</i><trans> You will get a rake-off for your cards when we play poker. </trans></eg>
<eg><i lang=""ceb"">Kalasi si Pidru,</i><trans> Give Pedro his rake-off. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rake, harrow. </trans>
</sense>
<sense n=""2""><number>2</number><trans> rake-off to the owner of gambling paraphernalia. </trans>
</sense></hom>
<entry><form id=""mangangalas"" lang=""ceb""><abbr expan=""mangangalas"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who lets people gamble with his equipment for a rake-off.
</trans>
</sense></hom></entry></entry>");
