INSERT INTO `wced_entry` VALUES (8337, "kalasikas", "424", "<entry page=""424"" id=""8337""><form id=""kalasixkas"" lang=""ceb"">kalasíkas</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> rustling sound like that produced by the motion of leaves. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3; c1]</itype><trans> produce this k.o. rustling sound. </trans>
<eg><i lang=""ceb"">Kasikása (ikasíkas) ang mga dáhun arun sila mahadluk,</i><trans> Rustle the leaves so they’ll be afraid. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1]</itype><trans> bustle about in preparation for s.t. </trans>
<eg><i lang=""ceb"">Mikasíkas ang mga tagibalángay kay nagkaduul na ang pyista,</i><trans> The people are bustling about with the fiesta approaching. </trans></eg>
<eg><i lang=""ceb"">Hápit ka na mugíkan, wà pa ka kakasíkas!</i><trans> It’s nearly time to leave and you haven’t made any preparations! </trans></eg>
</sense></hom>
<entry><form id=""kalasixkas_sa_panahun"" lang=""ceb""><abbr expan=""kalasíkas"" type=""lemma"">—</abbr> sa panahun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> doings, activities of constant and ordinary nature.
</trans>
</sense></hom></entry></entry>");
