INSERT INTO `wced_entry` VALUES (8340, "kalat, kalat1", "424", "<entry page=""424"" id=""8340""><form id=""kalat_kaxlat"" lang=""ceb"">kalat, kálat<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> cane with bamboo or rattan. </trans>
<eg><i lang=""ceb"">Kamau kang mukalat ug síya?</i><trans> Do you know how to cane a chair? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. caned from bamboo or rattan. </trans>
<eg><i lang=""ceb"">Buslut ang kalat sa katri,</i><trans> The caned portion of the bed is broken.
