<sense n=""3""><number>3</number><trans> spark, produce sparks. </trans>
<eg><i lang=""ceb"">Nagkayu ang ismiril sa dihang gidaítul ang amul,</i><trans> The sharpener gave off sparks when the bolo was pressed against it. </trans></eg>
