<entry><form id=""kinalayu"" lang=""ceb""><abbr expan=""kinalayu"" type=""lemma"">-in-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> boiled corn on the cob. </trans>
