INSERT INTO `wced_entry` VALUES (8388, "kaling", "426", "<entry page=""426"" id=""8388""><form id=""kaxling"" lang=""ceb"">káling</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB6; c1]</itype><trans> turn over on the side, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Mukáling ang kúlun nga ibutang sa lamísa nga way bangil kay língin ang lubut,</i><trans> If you put a clay pot on the table without a support it will turn over on its side because it is round-bottomed. </trans></eg>
<eg><i lang=""ceb"">Kalínga (ikáling) ang mga libru sa lamísa básin nadat-ugan ang sulat mu,</i><trans> Turn the books over on the side. Maybe the letter is just underneath them. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> move s.t. solid and heavy showing it one side at a time. </trans>
<eg><i lang=""ceb"">Kalíngun lang nátù ang pridyidir kay dì ta makadaug,</i><trans> Let’s just move the refrigerator by shoving it one side at a time because we cannot carry it. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> rock a small boat that has been grounded so it will move free. </trans>
<eg><i lang=""ceb"">Kalíngun nátù ang búti kay mitaub na,</i><trans> Let’s rock the boat to free it because the tide is beginning to come in.
</trans></eg>
