INSERT INTO `wced_entry` VALUES (8412, "kalma", "427", "<entry page=""427"" id=""8412""><form id=""kalma"" lang=""ceb"">kalma</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>calm</tr>. </trans>
<eg><i lang=""ceb"">Kalma kaáyu ang panahun run,</i><trans> It’s a very calm day. </trans></eg>
<eg><i lang=""ceb"">Kalma kaáyu siya taliwálà sa kakuyaw,</i><trans> He remains very calm in the face of danger. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>slow</tr>, <tr>deliberate</tr>, and sure in behavior. </trans>
<eg><i lang=""ceb"">Kalma kaáyu siyang nagtrabáhu bísag giapíki,</i><trans> He worked slowly and deliberately even if he was under pressure. </trans></eg>
<eg><i lang=""ceb"">Kalma siyag sinultihan,</i><trans> He speaks slowly and deliberately. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; a12]</itype><trans> become calm, be unruffled of feelings, be soothed in pain. </trans>
<eg><i lang=""ceb"">Kalma lang. Ayawg kasukù dáyun,</i><trans> Calm down. Don’t get mad right away. </trans></eg>
<eg><i lang=""ceb"">Nakalma (mikalma) na ang dágat. Mularga na kita,</i><trans> The sea has become calm now. Let’s go. </trans></eg>
<eg><i lang=""ceb"">Makakalma (makapakalma) sa sakit ning tambála,</i><trans> This medicine can soothe pain. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b4]</itype><trans> be becalmed. </trans>
<eg><i lang=""ceb"">Wà makairug ang barútung gikalmáhan,</i><trans> The sailboat was caught in a calm and could not move. </trans></eg>
</sense></hom>
<entry><form id=""kalmadu"" lang=""ceb""><abbr expan=""kalmadu"" type=""lemma"">-du</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> calm and collected. </trans>
</sense></hom></entry>
<entry><form id=""kalmanti"" lang=""ceb""><abbr expan=""kalmanti"" type=""lemma"">-nti</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>tranquilizer</tr>. </trans>
<eg><i lang=""ceb"">Kalmanti lang tung iniksiyun nga gihátag sa duktur,</i><trans> The injection that the doctor gave was only a tranquilizer.
</trans></eg>
</sense></hom></entry></entry>");
