INSERT INTO `wced_entry` VALUES (8416, "kalsu", "427", "<entry page=""427"" id=""8416""><form id=""kalsu"" lang=""ceb"">kalsu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> wedge s.t. into s.t. to make it hold or to make it come on or off. </trans>
<eg><i lang=""ceb"">Kalsúhun sa panday ang tabla nga gilansang sa bungbung,</i><trans> The carpenter will pry off the boards that were nailed to the walls. </trans></eg>
<eg><i lang=""ceb"">Kalsúhi ang ímung sapátus arun sayung isul-ub,</i><trans> Use a horn for your shoes so you won’t have any trouble putting them on. </trans></eg>
<eg><i lang=""ceb"">Ikalsu ning papil sa húnus arun dílì mabukas,</i><trans> Wedge this paper in the drawer so it won’t come open. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> wrench s.t. loose at the <pb n=""428""/>joints or s.t. tied around s.t. else. </trans>
<eg><i lang=""ceb"">Ang kawatan nakakalsu sa íyang mga kamut gíkan sa púsas,</i><trans> The thief managed to wrench his hands out of the cuffs. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> stick s.t. in the pocket. </trans>
<eg><i lang=""ceb"">Ayaw ikalsu (kalsúha) ang ímung daug. Iplantáda giyud sa lamísa,</i><trans> Do not pocket your winnings. You must keep them on the table. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> lever to pry s.t. off, open. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>shoehorn</tr>. </trans>
</sense></hom>
<entry><form id=""kalsadur"" lang=""ceb"">kalsadur</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>shoehorn</tr> or anything used for putting on the shoes.
</trans>
</sense></hom></entry></entry>");
