INSERT INTO `wced_entry` VALUES (8446, "kalunggu", "429", "<entry page=""429"" id=""8446""><form id=""kalunggu"" lang=""ceb"">kalunggu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> feathers just coming in. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>warts</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; b6]</itype><trans> for feathers to come in, either in young birds or after shedding. </trans>
<eg><i lang=""ceb"">Ug mangalunggu ang balhíbu, sakit nga hikápun,</i><trans> If the feathers are just coming in, it hurts the bird if you touch them. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B26; a4b4]</itype><trans> turn into a wart, be affected by a wart. </trans>
<eg><i lang=""ceb"">Ug makahikap kag kawunggug manuk, kawunggúhun ka,</i><trans> If you touch sprouting feathers, you will get warts. </trans></eg>
<eg><i lang=""ceb"">Gikalunggúhan (nangalunggu) ang tibuuk níyang bukubuku,</i><trans> His back is all covered with warts.
</trans></eg>
</sense></hom></entry>");
