INSERT INTO `wced_entry` VALUES (8449, "kalupu", "429", "<entry page=""429"" id=""8449""><form id=""kaluxpuq"" lang=""ceb"">kalúpù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> wrap s.t. around s.o. or oneself. </trans>
<eg><i lang=""ceb"">Kalupúi ang bátà kay tugnaw,</i><trans> Put s.t. around the child because it’s cold. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> make, use as a shoulder wrap. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to wrap around oneself. </trans>
<eg><i lang=""ceb"">Unsa may kalúpù mu ug paalut ka, tualya?</i><trans> What do you use around your shoulder if you get a haircut, a towel?
</trans></eg>
</sense></hom></entry>");
