INSERT INTO `wced_entry` VALUES (8450, "kalus", "429", "<entry page=""429"" id=""8450""><form id=""kalus"" lang=""ceb"">kalus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>fetch water</tr>. </trans>
<eg><i lang=""ceb"">Nakakalus na kug pára ikalígù,</i><trans> I’ve already fetched water for my bath. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get liquid out with a dipper. </trans>
<eg><i lang=""ceb"">Mukalus na lang ku ug sabaw,</i><trans> I’ll just ladle out soup for myself. </trans></eg>
<eg><i lang=""ceb"">Kalusun lang ni nátù arun maángay,</i><trans> Let us just ladle this out so we will have equal shares. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. used as a dipper. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>dipperful</tr>. </trans>
</sense></hom>
<entry><form id=""kaxlus"" lang=""ceb""><abbr expan=""kálus"" type=""lemma"">(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> intense action of fetching water. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kalus""><sc>kalus</sc></xr>, <i lang=""ceb"">2.</i> </trans>
</sense></hom></entry>
<entry><form id=""pangalus"" lang=""ceb""><abbr expan=""pangalus"" type=""lemma"">paN-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kalus""><sc>kalus</sc></xr>, <i lang=""ceb"">n1.</i>
</trans>
</sense></hom></entry></entry>");
