INSERT INTO `wced_entry` VALUES (8451, "kaluskus1", "429", "<entry page=""429"" id=""8451""><form id=""kaluskus"" lang=""ceb"">kaluskus<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ab]</itype><trans> <tr>scrape</tr> or <tr>scratch</tr> to remove s.t. from a surface. </trans>
<eg><i lang=""ceb"">Kuskúsag maáyu ang kan-un nga namilit sa kaldíru,</i><trans> Scrape out the rice that is sticking to the pot. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; b5]</itype><trans> scratch the hair hard with the hands. </trans>
<eg><i lang=""ceb"">Nagpanguskus siya sa kakatul sa íyang úlu,</i><trans> He kept on scratching because his head itched so intensely. </trans></eg>
<eg><i lang=""ceb"">Nakakuskus (nakapanguskus) siya sa íyang úlu tungud sa kalisud sa prublíma,</i><trans> He scratched his head due to the difficulty of the problem.
</trans></eg>
</sense></hom></entry>");
