INSERT INTO `wced_entry` VALUES (8454, "kalut", "429", "<entry page=""429"" id=""8454""><form id=""kaxlut"" lang=""ceb"">kálut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
