</sense></hom></entry>
<entry><form id=""kalut"" lang=""ceb""><abbr expan=""kalut"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> pit or hole dug up. </trans>
