INSERT INTO `wced_entry` VALUES (8462, "kama", "429", "<entry page=""429"" id=""8462""><form id=""kaxma"" lang=""ceb"">káma</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>bed</tr>, usually with mattress. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a large stack of s.t. piled in an orderly fashion. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; ab]</itype><trans> make one’s bed, make into a bed. </trans>
<eg><i lang=""ceb"">Magkáma ka sa katri inigmata nímu,</i><trans> Make your bed after you wake up. </trans></eg>
<eg><i lang=""ceb"">Kun walay láing higdáan mahímu rag kining tag-as nga bangkù kamáhun,</i><trans> You can use these benches as beds to lie on. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; c1]</itype><trans> stack into a neat way. </trans>
<eg><i lang=""ceb"">Ákù ning ikáma (kamáhun) ang káhuy sa sílung,</i><trans> I’ll pile this firewood under the house. </trans></eg>
</sense></hom>
<entry><form id=""kinaxma"" lang=""ceb""><abbr expan=""kináma"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> in a large neat stack. </trans>
</sense></hom></entry>
<entry><form id=""kamaxda"" lang=""ceb""><abbr expan=""kamáda"" type=""lemma"">-da</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kaxma""><sc>káma</sc></xr>, <i lang=""ceb"">2 n, v.</i> </trans>
</sense></hom></entry>
