INSERT INTO `wced_entry` VALUES (8497, "kambat", "431", "<entry page=""431"" id=""8497""><form id=""kambat"" lang=""ceb"">kambat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> <tr>tie</tr> or <tr>weave</tr> a network: </trans>
</sense>
<sense n=""a""><number>a</number><trans> around a bottle to protect it or across the mouth of s.t. to keep the contents from falling out. </trans>
<eg><i lang=""ceb"">Kambáta ang pagbáat sa bukag arun dílì kataktákan,</i><trans> Tie the basket up with a net over the mouth so that nothing can fall out of it. </trans></eg>
<eg><i lang=""ceb"">Átung kambátan ning dáma sa tubà,</i><trans> Let’s weave strips of rattan around the demijohn. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> to mend or patch s.t. </trans>
<eg><i lang=""ceb"">Gikambat nákù pagsursi ang midyas,</i><trans> I darned the socks by weaving a network.
</trans></eg>
</sense></hom></entry>");
