INSERT INTO `wced_entry` VALUES (8498, "kambaya", "431", "<entry page=""431"" id=""8498""><form id=""kambaxya"" lang=""ceb"">kambáya</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> reenforcing string tied crisscross over a kite’s frame to which the paper is pasted. </trans>
<eg><i lang=""ceb"">Butangig kambáya ang tabánug,</i><trans> Put reenforcing string on the kite. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> parallel lines crossing each other at right angles, forming a design similar to plaid. </trans>
<eg><i lang=""ceb"">Ang kambáya sa íyang bistídu pula ug birdi,</i><trans> Her dress has crisscrossing red and green lines. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> tie or put reenforcing string. </trans>
</sense></hom>
