INSERT INTO `wced_entry` VALUES (8500, "kambiyada", "431", "<entry page=""431"" id=""8500""><form id=""kambiyaxda"" lang=""ceb"">kambiyáda</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>transmission</tr> of cars and other automotive vehicles. </trans>
<eg><i lang=""ceb"">Ang kambiyáda sa íyang awtu may kwarta martsa,</i><trans> The transmission of his car has a fourth gear. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>change of key</tr> in a piece of music. </trans>
<eg><i lang=""ceb"">Nindut kaáyu pamináwun ang kambiyáda íning kantáha,</i><trans> This song is very melodious the way it changes keys. </trans></eg>
</sense></hom>
<entry><form id=""kambiyaxda_sa_haxngin"" lang=""ceb""><abbr expan=""kambiyáda"" type=""lemma"">—</abbr> sa hángin</form>
<hom>
<sense n=""0""><trans> <tr>change of wind</tr>. </trans>
<eg><i lang=""ceb"">Kining hilanáta dala sa kambiyáda sa hángin,</i><trans> This fever was brought on by the change of weather. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put or shift into gear, operate the gearshift. </trans>
</sense>
<sense n=""2""><number>2</number><trans> change the key in a piece of music. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B; b4]</itype><trans> for the wind to change.
</trans>
</sense></hom></entry></entry>");
