INSERT INTO `wced_entry` VALUES (8501, "kambiyu", "431", "<entry page=""431"" id=""8501""><form id=""kambiyu"" lang=""ceb"">kambiyu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>transmission</tr> of automotive vehicles. </trans>
<eg><i lang=""ceb"">Daut ug kambiyu ning awtu,</i><trans> This car has a defective transmission. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> stick shift of the transmission. </trans>
</sense>
<sense n=""1b""><number>1b</number><trans> gear. </trans>
<eg><i lang=""ceb"">Kambiyu sa primíra,</i><trans> First gear. </trans></eg>
<eg><i lang=""ceb"">Kining trakturáha may dusi ka kambiyu sa abanti,</i><trans> This tractor has twelve forward speeds. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> change of key within a piece of music. </trans>
</sense>
<sense n=""3""><number>3</number><trans> change of wind. </trans>
</sense>
<sense n=""4""><number>4</number><trans> money given as <tr>change</tr>. </trans>
<eg><i lang=""ceb"">Pila may kambiyu sa ímung písus?</i><trans> How much change did you get for your peso? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c6]</itype><trans> shift gears. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> change the key in music. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B; b4]</itype><trans> for the wind to change. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[AC; c]</itype><trans> <tr>exchange</tr> things with s.o., give s.t. in exchange. </trans>
<eg><i lang=""ceb"">Magkambiyu ta ug lingkuránan, ha?</i><trans> Let’s exchange seats, shall we? </trans></eg>
<eg><i lang=""ceb"">Singku písus ákung ikambiyu sa matag dulyár,</i><trans> I will give five pesos for every dollar. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number> <itype>[A23; c]</itype><trans> give s.o. his change. </trans>
<eg><i lang=""ceb"">Wà ku nímu kambiyúhi,</i><trans> You haven’t given me my change. </trans></eg>
</sense></hom>
<entry><form id=""kinambiyu"" lang=""ceb""><abbr expan=""kinambiyu"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. given in exchange for s.t. else.
</trans>
</sense></hom></entry></entry>");
