INSERT INTO `wced_entry` VALUES (8505, "kami", "431", "<entry page=""431"" id=""8505""><form id=""kami"" lang=""ceb"">kami</form>
<hom>
<sense n=""0""><trans> <tr>we</tr> (not including addressee). </trans>
<eg><i lang=""ceb"">Kami mubáyad ug makagustu,</i><trans> We pay if we like it. </trans></eg>
</sense></hom>
<entry><form id=""mi"" lang=""ceb"">mi</form>
<hom>
<sense n=""0""> short for <form id=""kami"" lang=""ceb"">kami</form><trans>. </trans>
<eg><i lang=""ceb"">Dílì mi mubutar ni Markus,</i><trans> We will not vote for Marcos. </trans></eg>
</sense></hom></entry>
<entry><form id=""naxmuq"" lang=""ceb"">námù</form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>gen</ix>. </trans>
<eg><i lang=""ceb"">Amahan námù, náa ka sa mga lángit...,</i><trans> Our Father, who art in heaven. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <pb n=""432""/><ix>short for</ix> <xr lang=""ceb"" target=""#kanaxmuq""><sc>kanámù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""kanaxmuq"" lang=""ceb"">kanámù</form>
<hom>
<sense n=""0""><trans> <ix>dat.</ix> </trans>
<eg><i lang=""ceb"">Ári kanámù ihátag,</i><trans> Give it to us. </trans></eg>
<eg><i lang=""ceb"">Ayaw língì kanámù,</i><trans> Don’t turn around to look at us. </trans></eg>
</sense></hom></entry>
<entry><form id=""axmuq"" lang=""ceb"">ámù</form>
<hom>
<sense n=""0""><trans> <ix>preposed gen.</ix> </trans>
</sense>
<sense n=""1""><number>1</number><trans> our. </trans>
<eg><i lang=""ceb"">Ang ámung irù,</i><trans> Our dog. </trans></eg>
<eg><i lang=""ceb"">Ámung ibaligyà,</i><trans> We will sell it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> my place, at home. </trans>
<eg><i lang=""ceb"">Si Pápa túa pa sa ámù,</i> Dad is at home. <form id=""tagaaxmuq"" lang=""ceb""><abbr expan=""tagaámù"" type=""lemma"">taga-</abbr></form><trans> one from our place. </trans></eg>
<eg><i lang=""ceb"">Si Pídu taga-Karkar, dílì tagaámù,</i><trans> Pedo is from Carcar. He is not from our place. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> the one that is ours. </trans>
<eg><i lang=""ceb"">Ang inyung irù putì, ang ámù itum,</i><trans> Your dog is white, ours is black. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <form id=""ang_axmuq_gud"" lang=""ceb"">ang <abbr expan=""ámù"" type=""lemma"">—</abbr> gud</form><trans> the thing that worries us. </trans>
<eg><i lang=""ceb"">Ang ámù gud ug mahibalu sa plánu ang amahan,</i><trans> The thing that worries us is that the father will know of the plans. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <form id=""verb_ug_axmuq"" lang=""ceb""><r>[<ix>verb</ix>]</r> ug ámù</form><trans> [do] by ourselves. </trans>
<eg><i lang=""ceb"">Magdúwà mig ámù,</i><trans> We’ll play by ourselves. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <form id=""sa_axmuq"" lang=""ceb"">sa ámù</form><trans> = <xr lang=""ceb"" target=""#kanaxmuq""><sc>kanámù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""amuxa"" lang=""ceb"">amúa</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#axmuq""><sc>ámù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""kamikaxmi"" lang=""ceb"">kamikámi</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> just us, no one special. </trans>
<eg><i lang=""ceb"">Kamikámi ray naglútù áni,</i><trans> We cooked this ourselves. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <form id=""kamikaxmi_ra"" lang=""ceb""><abbr expan=""kamikámi"" type=""lemma"">—</abbr> ra</form><trans> <ix>[nom. or dat.]</ix> be distantly related to us. </trans>
<eg><i lang=""ceb"">Kamikámi ra si (ni) Markus,</i><trans> Marcos is distantly related to us. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""kamikaxmi_ra"" lang=""ceb""><abbr expan=""kamikámi"" type=""lemma"">—</abbr> ra</form><trans> we are of the same caliber, age, in comparison. </trans>
<eg><i lang=""ceb"">Kamikámi ra si Ríta ug abilidad sa mat,</i><trans> Rita and I are about the same in math. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> do s.t. by ourselves. </trans>
<eg><i lang=""ceb"">Nagkamikámi lang mig puyù áning gamayng balay,</i><trans> We’re just living by ourselves in this small house.
</trans></eg>
</sense></hom></entry></entry>");
