INSERT INTO `wced_entry` VALUES (8524, "kampana", "432", "<entry page=""432"" id=""8524""><form id=""kampaxna"" lang=""ceb"">kampána</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>church bell.</tr> </trans>
</sense>
<sense n=""2""><number>2</number><trans> uvula. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> ring the bell. </trans>
<eg><i lang=""ceb"">Ug kampanáhan ang bunyag, dakù ang báyad,</i><trans> You have to pay a lot if you want them to ring the bell for the baptism. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b6]</itype><trans> install a bell. </trans>
</sense></hom>
<entry><form id=""kampanakampaxna"" lang=""ceb"">kampanakampána</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kampaxna""><sc>kampána</sc></xr>, <i lang=""ceb"">n 2.</i> </trans>
</sense></hom></entry>
<entry><form id=""kampanaxryu"" lang=""ceb""><abbr expan=""kampanáryu"" type=""lemma"">-ryu</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> belfry, bell tower. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b6(1)]</itype><trans> put a bell tower to a church. </trans>
</sense></hom></entry>
<entry><form id=""kampanilya"" lang=""ceb"">kampanilya<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> small bell. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> ring a small bell. </trans>
<eg><i lang=""ceb"">Kinsa guy ímung gikampanilyáhan dihà?</i><trans> Who are you ringing that bell at? </trans></eg>
</sense></hom></entry>
<entry><form id=""dikampaxna"" lang=""ceb""><abbr expan=""dikampána"" type=""lemma"">di-</abbr></form>
<hom>
<sense n=""0""><trans> having a small bell at one’s disposal. </trans>
</sense></hom></entry>
<entry><form id=""abugaxdu_dikampaxna"" lang=""ceb"">abugádu <abbr expan=""dikampána"" type=""lemma"">di-</abbr></form>
<hom>
<sense n=""0""><trans> a high-class lawyer (lit. one who uses a bell [to summon assistants]). </trans>
</sense>
<sense n=""2""><number>2</number><trans> anything high-class. </trans>
<eg><i lang=""ceb"">Púru dikampanilya ang ákung kahúguy,</i><trans> I only associate with high-class people. </trans></eg>
