INSERT INTO `wced_entry` VALUES (8527, "kampanya", "432", "<entry page=""432"" id=""8527""><form id=""kampanya"" lang=""ceb"">kampanya</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>campaign</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[ANC12; c]</itype><trans> campaign, talk in campaigning. </trans>
<eg><i lang=""ceb"">Nangampanya siyag pára itúkud ug iskuyláhan,</i><trans> He is campaigning for money to build a schoolhouse. </trans></eg>
<eg><i lang=""ceb"">Kampanyáhan tikaw básin adtu kang Markus butar,</i><trans> I’ll talk to you. Perhaps you’ll vote for Marcos. </trans></eg>
<eg><i lang=""ceb"">Kampanyáhan nátù si Markus,</i><trans> <pb n=""433""/>Let’s campaign for Marcos. </trans></eg>
<eg><i lang=""ceb"">Sa naandan bakak lang gihápuy ikampanya,</i><trans> As usual, they’ll tell a lot of lies in their campaign.
