INSERT INTO `wced_entry` VALUES (8542, "kamu", "433", "<entry page=""433"" id=""8542""><form id=""kamu"" lang=""ceb"">kamu</form>
<hom>
<sense n=""0""><trans> <tr>you</tr> (plural). </trans>
<eg><i lang=""ceb"">Kamung duhay gitawag,</i><trans> I called the two of you. <ix>short form in position other than predicate:</ix> <bx>mu.</bx> </trans></eg>
<eg><i lang=""ceb"">Kinahanglan magtuun giyud mu,</i><trans> You must study. </trans></eg>
</sense></hom>
<entry><form id=""kamukaxmu"" lang=""ceb"">kamukámu</form>
<hom>
<sense n=""1""><number>1</number><trans> just you all and no one else. </trans>
<eg><i lang=""ceb"">Kamukámu ras inyu run kay namaúlì na ang mga bisíta,</i><trans> You are the only ones left in the house now that the visitors have left. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> distant relative. </trans>
<eg><i lang=""ceb"">Kamukámu ra si Uyung kay mag-ágaw inyung isig ka amahan,</i><trans> You and Oyong are distant relatives because your fathers are cousins. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> do s.t. by yourselves. </trans>
<eg><i lang=""ceb"">Magkamukámu lang diay mug adtu ug dì mu mangimbitar,</i><trans> Are you going by yourselves and not invite anyone else along? </trans></eg>
</sense></hom></entry>
<entry><form id=""kamuhaxnun"" lang=""ceb"">kamuhánun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> related to you distantly or coming from the same place. </trans>
<eg><i lang=""ceb"">Kamuhánun mu si Isku kay tagadidtu pud siya,</i><trans> You and Esco are from the same place because he also comes from there. </trans></eg>
</sense></hom></entry>
<entry><form id=""ninyu"" lang=""ceb"">ninyu</form>
<hom>
<sense n=""0""><trans> <ix>gen.:</ix> your, by you. </trans>
<eg><i lang=""ceb"">Bahinbahina ni ninyu,</i><trans> Divide this among yourselves. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#kaninyu""><sc>kaninyu</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""kaninyu"" lang=""ceb"">kaninyu</form>
<hom>
<sense n=""0""><trans> <ix>dat.:</ix> you. </trans>
<eg><i lang=""ceb"">Kaninyung duha kinsay maáyung mukanta?</i><trans> Who sings better of the two of you? </trans></eg>
<eg><i lang=""ceb"">Muawhag ku kaninyu sa pagpaningkámut,</i><trans> I urge you to strive hard. </trans></eg>
</sense></hom></entry>
<entry><form id=""inyu"" lang=""ceb"">inyu</form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>preposed gen.:</ix> your, by you. </trans>
<eg><i lang=""ceb"">Ang inyung suliran,</i><trans> Your problem. </trans></eg>
<eg><i lang=""ceb"">Inyung buhátun,</i><trans> You all will do it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> belongs to you. </trans>
<eg><i lang=""ceb"">Inyu ba ni?</i><trans> Does this belong to you? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a12]</itype><trans> make, get, have s.t. for yourselves. </trans>
<eg><i lang=""ceb"">Kinta inyúhun na lang ang yútà bisag wà pa kabayri,</i><trans> In other words, you will have the land for yourselves even if you have not paid for it? </trans></eg>
</sense></hom></entry>
<entry><form id=""inyuinyu"" lang=""ceb"">inyuinyu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> do, have s.t. by, for yourselves. </trans>
<eg><i lang=""ceb"">Mag-inyuinyu man mug kartíyu ug dílì musampit ug pakitábang,</i><trans> You manage things by yourselves and don’t call on anyone else for help. </trans></eg>
</sense></hom></entry>
<entry><form id=""tagainyu"" lang=""ceb"">tagainyu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one coming from your place.
</trans>
</sense></hom></entry></entry>");
