INSERT INTO `wced_entry` VALUES (8573, "kanaka2", "435", "<entry page=""435"" id=""8573""><form id=""kanaxka2"" lang=""ceb"">kanáka<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a <tr>native Hawaiian woman</tr>, usually thought of as being big and heavy-set. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> of a kind that is tall or long and <tr>big</tr> in size. </trans>
<eg><i lang=""ceb"">Kanáka kaáyu ug tiil nang bayhána. Makahubas ug dánaw,</i><trans> That girl has huge feet. They’re big enough to dry up a pool. </trans></eg>
