INSERT INTO `wced_entry` VALUES (8575, "kanal", "435", "<entry page=""435"" id=""8575""><form id=""kanal"" lang=""ceb"">kanal</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>ditch</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the grooves on the sides of a bowling alley. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> dig a ditch. </trans>
<eg><i lang=""ceb"">Magkanal ku sa átung balisbísan,</i><trans> I’ll dig a ditch around the house. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B25; c16]</itype><trans> be thrown towards the ditch, bowling grooves. </trans>
<eg><i lang=""ceb"">Makanal (mukanal) pirmi ang búla inigdúwà níyag búling,</i><trans> The ball always rolls along the groove whenever he bowls. </trans></eg>
</sense></hom>
<entry><form id=""kanalkaxnal"" lang=""ceb"">kanalkánal</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> small linear depression running on or along a surface. </trans>
<eg><i lang=""ceb"">Kanalkánal sa lubut,</i><trans> Linear depression between the cheeks of the buttocks. </trans></eg>
<eg><i lang=""ceb"">Kanalkánal sa ilung,</i><trans> The depression running between the nose and the upper lips.
</trans></eg>
</sense></hom></entry></entry>");
