INSERT INTO `wced_entry` VALUES (8577, "kanap", "435", "<entry page=""435"" id=""8577""><form id=""kaxnap"" lang=""ceb"">kánap</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> <tr>spread</tr> over an area. </trans>
<eg><i lang=""ceb"">Ang tipdas mikánap (nakánap) sa tibuuk láwas,</i><trans> Measles spread all over his body. </trans></eg>
<eg><i lang=""ceb"">Ikánap (kanápun) níya ang íyang mga ahinti dinhi sa syudad,</i><trans> He will spread his salesmen over the city. </trans></eg>
<eg><i lang=""ceb"">Ang baul gikanápan sa túbig,</i><trans> Water spread all over the field. </trans></eg>
</sense></hom>
<entry><form id=""kanapkanap"" lang=""ceb"">kanapkanap</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>blurred</tr>, dim eyesight. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> for the eyesight to become blurred. </trans>
<eg><i lang=""ceb"">Mukanapkanap na giyud ang átung panan-aw kun magkatigulang na kita,</i><trans> As we grow older our eyesight becomes more and more blurred.
</trans></eg>
</sense></hom></entry></entry>");
