INSERT INTO `wced_entry` VALUES (8579, "kanat", "435", "<entry page=""435"" id=""8579""><form id=""kaxnat"" lang=""ceb"">kánat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> <tr>cover</tr> an area, length. </trans>
<eg><i lang=""ceb"">Mikánat (nakánat) ang balità sa daling panahun,</i><trans> The news spread in a short time. </trans></eg>
<eg><i lang=""ceb"">Nikánat ug usa ka líbu ang gastu,</i><trans> The expenses reached a thousand pesos. </trans></eg>
<eg><i lang=""ceb"">Kanátun (ikánat) ni nátung písì arun hikit-an ang gitas-un,</i><trans> We should unwind this rope to see how long it is. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> spread, breadth, length. </trans>
<eg><i lang=""ceb"">Taas ang kánat sa kaláyu,</i><trans> The spread of the fire covered a large area. </trans></eg>
</sense></hom>
<entry><form id=""kinaxnat_pinakaxnat"" lang=""ceb""><abbr expan=""kinánat"" type=""lemma"">-in-</abbr>, <abbr expan=""pinakánat"" type=""lemma"">pina-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> writing in longhand.
