INSERT INTO `wced_entry` VALUES (8582, "kanaway1", "435", "<entry page=""435"" id=""8582""><form id=""kanaxway"" lang=""ceb"">kanáway<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>wind</tr> that blows from a westward direction. </trans>
<eg><i lang=""ceb"">Kanáway sa amíhan,</i><trans> Northwest wind. </trans></eg>
<eg><i lang=""ceb"">Kanáway sa habágat,</i><trans> Southwest wind. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B5]</itype><trans> for the west wind to blow. </trans>
<eg><i lang=""ceb"">Ug mukanáway ang hángin, dílì ta mularga,</i><trans> If the wind blows from the west, we will not sail. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN]</itype><trans> sail before the west wind. </trans>
<eg><i lang=""ceb"">Nanganáway sila paglarga,</i><trans> They sailed before the west wind. </trans></eg>
</sense></hom>
<entry><form id=""kanawayan"" lang=""ceb""><abbr expan=""kanawayan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> direction from which the <ix>kanáway</ix> blows.
</trans>
</sense></hom></entry></entry>");
