INSERT INTO `wced_entry` VALUES (8584, "kanawkanaw", "435", "<entry page=""435"" id=""8584""><form id=""kanawkaxnaw"" lang=""ceb"">kanawkánaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2N]</itype><trans> be perceived at a great distance, extend into the distance. </trans>
<eg><i lang=""ceb"">Ang íyang tíngug mikanawkánaw sa mamingáwung kagabhíun,</i><trans> Her voice can be heard from way off in a distance coming through the stillness of the night. </trans></eg>
<eg><i lang=""ceb"">Nanganawkánaw ang kalapad sa humayan,</i><trans> The rice fields extended into the distance. </trans></eg>
<eg><i lang=""ceb"">Gamay na ang ayruplánung nanganawkánaw sa kalangítan,</i><trans> The airplane looked very small in the distance.
<pb n=""436""/>
</trans></eg>
</sense></hom></entry>");
