INSERT INTO `wced_entry` VALUES (8585, "kanay", "436", "<entry page=""436"" id=""8585""><form id=""kaxnay"" lang=""ceb"">kánay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23]</itype><trans> for a feeling to spread throughout one’s body. </trans>
<eg><i lang=""ceb"">Ang kabugnaw sa túbig mikánay ngadtu sa ákung tinái,</i><trans> The coolness of the water spread through my innermost bones. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23N; b6]</itype><trans> for a sound to reach out or come from a great distance. </trans>
<eg><i lang=""ceb"">Ang kagabhíun gikanáyan sa uwang sa irù,</i><trans> The stillness of the night was broken by the howling of the dog. </trans></eg>
</sense></hom>
<entry><form id=""kanaykaxnay"" lang=""ceb"">kanaykánay</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kaxnay""><sc>kánay</sc></xr>.
</trans>
</sense></hom></entry></entry>");
