INSERT INTO `wced_entry` VALUES (8599, "kandila", "436", "<entry page=""436"" id=""8599""><form id=""kandixlaq"" lang=""ceb"">kandílà</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>candle</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> use a candle. </trans>
<eg><i lang=""ceb"">Walay kuryinti karung gabíi, magkandílà na lang ta,</i><trans> There will be no electric current tonight, so we’ll just use candles. </trans></eg>
</sense></hom>
<entry><form id=""pangandixlaq"" lang=""ceb""><abbr expan=""pangandílà"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23]</itype><trans> be like a candle. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> be standing like a candle, bare and stripped. </trans>
<eg><i lang=""ceb"">Nangandílà ang kamaisan nga naagian sa dúlun,</i><trans> The corn stalks stood bare and stripped of everything after a swarm of locusts had passed over them. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> become skin and bones. </trans>
<eg><i lang=""ceb"">Nangandílà siya sa kaguul,</i><trans> She is all skin and bones now because of her sorrows. </trans></eg>
</sense>
<sense n=""c""><number>c</number><trans> be grades of one. </trans>
<eg><i lang=""ceb"">Nangandílà ang mga grádu sa iskálar,</i><trans> The scholarship student got all one’s (A’s). </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b6]</itype><trans> sell, make candles for sale. </trans>
<eg><i lang=""ceb"">Nangandílà si Nánay pára nga makakitag kwarta,</i><trans> Mother makes (or sells) candles to earn money. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2]</itype><trans> be kept standing for a long time. </trans>
<eg><i lang=""ceb"">Haskang nakapangandílà nákug pinaábut nímu,</i><trans> My! I waited and waited for you. </trans></eg>
</sense></hom></entry>
<entry><form id=""magkakandilaq_mangangandilaq"" lang=""ceb""><abbr expan=""magkakandilà"" type=""lemma"">mag-r-(→)</abbr>, <abbr expan=""mangangandilà"" type=""lemma"">maN-r-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> candle seller. </trans>
</sense></hom></entry>
<entry><form id=""kandilaxun"" lang=""ceb""><abbr expan=""kandiláun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> shaped like a candle. </trans>
<eg><i lang=""ceb"">Kandiláun siyag tudlù,</i><trans> She has long, slender fingers.
</trans></eg>
</sense></hom></entry></entry>");
