INSERT INTO `wced_entry` VALUES (8601, "kandilarya", "436", "<entry page=""436"" id=""8601""><form id=""kandilarya"" lang=""ceb"">kandilarya</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> church festival celebrated on the second of February (forty days after the Nativity) for the blessing of candles. It is in commemoration of the presentation of Christ in the Temple and the purification of the Blessed Virgin and marks the end of the Christmas season. </trans>
</sense>
<sense n=""2""><number>2</number><trans> candles blessed on this day, burnt during lightning storms. </trans>
</sense></hom>
<entry><form id=""pangandilarya"" lang=""ceb""><abbr expan=""pangandilarya"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> sing carols during candelaria (carols about the three Kings, not about the birth of Christ). </trans>
</sense>
<sense n=""2""><number>2</number><trans> spend this holiday s.w.
</trans>
</sense></hom></entry></entry>");
