INSERT INTO `wced_entry` VALUES (8611, "kanga", "437", "<entry page=""437"" id=""8611""><form id=""kaxngaq"" lang=""ceb"">kángà</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>stammered</tr> speech due to nervousness. </trans>
<eg><i lang=""ceb"">Kángà ang tubag sa maistra nga gipangutána sa supirbaysur,</i><trans> The teacher gave a stammering answer to the supervisor’s question. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B6; a12]</itype><trans> be rattled or stuttering in speech because of nervousness. </trans>
<eg><i lang=""ceb"">Nakángà (mikángà) ang sinultihan sa tistígus nga gipangutána,</i><trans> The witness stammered under interrogation. </trans></eg>
</sense></hom>
<entry><form id=""kangaqkangaq"" lang=""ceb"">kangàkangà</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kaxngaq.""><sc>kángà<corr sic="","">.</corr></sc></xr>
