INSERT INTO `wced_entry` VALUES (8612, "kang-a", "437", "<entry page=""437"" id=""8612""><form id=""kang-a"" lang=""ceb"">kang-a</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> slightly open, having come off, having a long crack. </trans>
<eg><i lang=""ceb"">Nanglìlì ang mga bátà sa kang-a sa pultahan,</i><trans> The children peeped through the small opening in the door. </trans></eg>
</sense></hom>
