<sense n=""0""> <itype>[B3(1); a12]</itype><trans> come off, develop a crack, get slightly opened. </trans>
<eg><i lang=""ceb"">Mikang-a ang kaban kay punù ug bisti,</i><trans> The trunk opened up a bit because it was chockful of clothes. </trans></eg>
<eg><i lang=""ceb"">Nagkang-a ang laminisyun sa playwud,</i><trans> The veneer came off the plywood.
</trans></eg>
</sense></hom></entry>");
