INSERT INTO `wced_entry` VALUES (8621, "kangu", "437", "<entry page=""437"" id=""8621""><form id=""kaxnguq"" lang=""ceb"">kángù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; c16]</itype><trans> <tr>shake</tr> s.t. erect, be shaken. </trans>
<eg><i lang=""ceb"">Kinsay nagkángù sa lamísa? Nayabu ang sabaw,</i><trans> Who shook the table? The soup spilled. </trans></eg>
<eg><i lang=""ceb"">Unsay nakakángù (nakapakángù) sa ímung ngípun?</i><trans> What caused your teeth to get loose? </trans></eg>
<eg><i lang=""ceb"">Nikángù ang bintánà paghampak sa makusug nga hángin,</i><trans> The window shook from the impact of the strong wind. </trans></eg>
<eg><i lang=""ceb"">Nagakakangù na ang úlu ni tátay, tigúlang na giyud,</i><trans> Dad’s head is becoming shaky. He’s growing old. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> be rattled by a question. </trans>
<eg><i lang=""ceb"">Mikangù ku adtung gipangutána kus abugádu,</i><trans> I got rattled when the lawyer put a question to me. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B6]</itype><trans> for an engine to sputter just before conking out. </trans>
<eg><i lang=""ceb"">Mikángù ang makina dáyung kamatay,</i><trans> The engine sputtered and then conked out. </trans></eg>
</sense></hom>
<entry><form id=""kanguqkanguq"" lang=""ceb"">kangùkangù</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> rickety and shaky. </trans>
<eg><i lang=""ceb"">Kangùkangù nga taytáyan, tigúlang,</i><trans> A rickety bridge, old man. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> be rickety or rickety and old.
</trans>
</sense></hom></entry></entry>");
