INSERT INTO `wced_entry` VALUES (8622, "kanhi", "437", "<entry page=""437"" id=""8622""><form id=""kanhi"" lang=""ceb"">kanhi</form>
<hom>
<sense n=""1""><number>1</number><trans> in former times. </trans>
<eg><i lang=""ceb"">Kanhi, sa wà pay gíra, barátu ang palalítun,</i><trans> <tr>Formerly</tr>, before the war, goods were cheap. </trans></eg>
<eg><i lang=""ceb"">Sa kanhing mga tyimpu,</i><trans> In olden times. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the one which was formerly. </trans>
<eg><i lang=""ceb"">Si kanhi Prisidinti Garsíya,</i><trans> Ex-President Garcia. </trans></eg>
<eg><i lang=""ceb"">Asáwa níya si kanhi Dga. Maríya Ríyis,</i><trans> His wife is the former Miss Reyes. </trans></eg>
<eg><i lang=""ceb"">Ang kanhing balay lungsud,</i><trans> The former town hall. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> at end of phrase: it was [so-and-so] long ago that s.t. or s.o. achieved a new status. </trans>
<eg><i lang=""ceb"">Naminyù siya sa Amirika tulu ka búlan kanhi,</i><trans> He got married in the States three months ago. </trans></eg>
</sense></hom>
<entry><form id=""kanhixay"" lang=""ceb"">kanhíay</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kanhi""><sc>kanhi</sc></xr>, <i lang=""ceb"">1.</i> </trans>
</sense></hom></entry>
<entry><form id=""kanhiaxnun"" lang=""ceb"">kanhiánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> the ones of former times. </trans>
<eg><i lang=""ceb"">Ang kanhiánung mga múda,</i><trans> The styles of former times.
</trans></eg>
</sense></hom></entry></entry>");
