INSERT INTO `wced_entry` VALUES (8624, "kaniadtu", "437", "<entry page=""437"" id=""8624""><form id=""kaniadtu"" lang=""ceb"">kaniadtu</form>
<hom>
<sense n=""0""><trans> <tr>formerly</tr>. </trans>
<eg><i lang=""ceb"">Kaniadtu ang pantalan didtu sa lawis,</i><trans> Formerly the pier was at the point. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> past event. </trans>
<eg><i lang=""ceb"">Nindut handúmun ang átung mga kaniadtu,</i><trans> It’s nice to think back on what we used to do years ago.</trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> former sweetheart. </trans>
<eg><i lang=""ceb"">Mipahíyum tu níya kay íya man tung kaniadtu,</i><trans> She smiled at him <pb n=""438""/>because he was her former sweetheart. </trans></eg>
</sense></hom>
<entry><form id=""niadtu_adtu"" lang=""ceb"">niadtu, adtu</form>
<hom>
<sense n=""0""><trans> short for <ix>kaniadtu</ix> in all uses but as <ix>n</ix>. </trans>
</sense></hom></entry>
<entry><form id=""kaniadtu_pa"" lang=""ceb""><abbr expan=""kaniadtu"" type=""lemma"">—</abbr> pa</form>
<hom>
<sense n=""0""><trans> long ago was the first time—i.e., [so-and-so] has been since long ago. </trans>
<eg><i lang=""ceb"">Kaniadtu pa aku mamaistra,</i><trans> I’ve been a teacher since way back. </trans></eg>
<eg><i lang=""ceb"">Kaniadtu pa ku kabalità ánà,</i><trans> I’ve known about that for ages. </trans></eg>
<eg><i lang=""ceb"">Kaniadtu pa aku makakità sa ingun,</i><trans> That time was the first time I saw the like.
</trans></eg>
</sense></hom></entry></entry>");
