INSERT INTO `wced_entry` VALUES (8632, "kanit", "438", "<entry page=""438"" id=""8632""><form id=""kaxnit"" lang=""ceb"">kánit</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC3; c16]</itype><trans> do, be in <tr>close succession</tr>, form a close line. </trans>
<eg><i lang=""ceb"">Mikánit ang mga duguung hitabù,</i><trans> Bloody events came one after another. </trans></eg>
<eg><i lang=""ceb"">Nagkánit lang ang mga balay sa daplin sa baybáyun,</i><trans> The houses are one right next to the other along the seashore. </trans></eg>
<eg><i lang=""ceb"">Kaníta (ikánit) pagláray ang mga silya,</i><trans> Put the chairs in a line close together. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> spread fast. </trans>
<eg><i lang=""ceb"">Nagkánit ang káyu sa silinganan,</i><trans> The fire has spread through the neighborhood. </trans></eg>
<eg><i lang=""ceb"">Nagkakánit na ang mga hulungíhung,</i><trans> The rumors have spread. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of spreading. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> in close, <tr>uninterrupted</tr> succession.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (8632, "kánit", "kanit", "m", "vna");
