INSERT INTO `wced_entry` VALUES (8636, "kankan", "438", "<entry page=""438"" id=""8636""><form id=""kankan"" lang=""ceb"">kankan</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> for movement of water to <tr>erode</tr> or <tr>wash</tr> s.t. away. </trans>
<eg><i lang=""ceb"">Ang balud kusug mukankan sa yútà,</i><trans> Waves are rapidly washing away the beach. </trans></eg>
<eg><i lang=""ceb"">Nakankanan ang bakilid,</i><trans> The slope is all eroded. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> remove soil or sand from an area. </trans>
<eg><i lang=""ceb"">Nagkankan siya sa lápuk nga naglúup sa kanal,</i><trans> He shoveled the mud which clogged the ditch. </trans></eg>
<eg><i lang=""ceb"">Átù ning kankánang dapíta arun mapátag,</i><trans> We’ll remove some of the soil from this place to make it level. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> eroded, worn away. </trans>
</sense></hom>
<entry><form id=""kinankan"" lang=""ceb""><abbr expan=""kinankan"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. that has been removed by eroding action.
</trans>
</sense></hom></entry></entry>");
