INSERT INTO `wced_entry` VALUES (8656, "kanukay", "439", "<entry page=""439"" id=""8656""><form id=""kanukay"" lang=""ceb"">kanukay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> <tr>disturb</tr> s.o.’s peace, disturb s.t. put in order. </trans>
<eg><i lang=""ceb"">Way láing makakanukay sa mga híman sa laburaturyu gawas sa tiglilimpiyu,</i><trans> No one may disturb the laboratory equipment except the janitor. </trans></eg>
<eg><i lang=""ceb"">Mu rag gikanukayng hulmígas ang syudad sa paglínug,</i><trans> After the earthquake the city looked like an anthill that had been disturbed. </trans></eg>
<eg><i lang=""ceb"">Kanukayun ka sa mga maniníngil ug daghan kag útang,</i><trans> Your creditors will keep disturbing you if you have lots of debts.
