INSERT INTO `wced_entry` VALUES (8671, "kapakapa", "440", "<entry page=""440"" id=""8671""><form id=""kapakaxpa"" lang=""ceb"">kapakápa</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>flap</tr> the wings or arms. </trans>
<eg><i lang=""ceb"">Nikapakápa siya sa túbig kay dílì maantigung mulanguy,</i><trans> He flapped his arms in the water because he did not know how to swim. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>jump</tr> up and down in happiness. </trans>
<eg><i lang=""ceb"">Nagkapakápa ang bátà sa kalípay,</i><trans> The child jumped up and down in happiness. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>fluttering</tr> or flapping of wings or arms. </trans>
<eg><i lang=""ceb"">Ang kapakápa sa mga manuk mauy nakapúkaw kanákù,</i><trans> I was awakened by the flapping of chicken wings.
