INSERT INTO `wced_entry` VALUES (8674, "kapal, kap-al", "440", "<entry page=""440"" id=""8674""><form id=""kaxpal_kap-al"" lang=""ceb"">kápal, kap-al</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>cover</tr>, <tr>coat</tr> s.t. with a thick layer. </trans>
<eg><i lang=""ceb"">Mukápal (makápal) nang buling sa ímung líug ug dì ka manglúgud,</i><trans> Your neck will be caked with dirt if you do not rub it when you bathe. </trans></eg>
<eg><i lang=""ceb"">Nakakápal ang abug sa mga silya,</i><trans> The dust has formed a thick layer on the chairs. </trans></eg>
<eg><i lang=""ceb"">Gikapálan ug lápuk ang tapalúdu,</i><trans> The fender got mud caked on it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for an emotion to appear all over the face. </trans>
<eg><i lang=""ceb"">Mikápal ang kalípay sa íyang nawung,</i><trans> His face shone with happiness.
</trans></eg>
