INSERT INTO `wced_entry` VALUES (8678, "kapar", "440", "<entry page=""440"" id=""8678""><form id=""kapar"" lang=""ceb"">kapar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> <tr>spend</tr> money belonging to s.o. else or on a purpose for which it was not supposed to be spent. </trans>
<eg><i lang=""ceb"">Mukapar (mangapar) nà siyag kwartang ipiyal níya,</i><trans> He is apt to spend money entrusted to him. </trans></eg>
<eg><i lang=""ceb"">Nakapar nákù ang igbalayad sa sugà,</i><trans> I spent the money I was supposed to pay the electric bill with. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> buy, take all of s.t. </trans>
<eg><i lang=""ceb"">Dì mi kapalit ug kaparun sa nigusyanti,</i><trans> We won’t be able to buy any if the merchant takes all of it. </trans></eg>
<eg><i lang=""ceb"">Kaparun námù ang tanang lingkuránan,</i><trans> We will take all the seats.
</trans></eg>
</sense></hom></entry>");
