INSERT INTO `wced_entry` VALUES (8679, "kapasidad", "440", "<entry page=""440"" id=""8679""><form id=""kapasidad"" lang=""ceb"">kapasidad</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>power</tr> one has to do s.t., power of a machine. </trans>
<eg><i lang=""ceb"">Sa kapasidad sa pagkaprisidinti, mabúhat nákù nà,</i><trans> As president it is within my powers to do that. </trans></eg>
<eg><i lang=""ceb"">Pilay kapasidad niíning pabrikáha?</i><trans> How much can this factory produce? </trans></eg>
<eg><i lang=""ceb"">Walà sa ákung kapasidad ang pagpahulam nímug kwarta,</i><trans> It’s not within my powers to lend you money. </trans></eg>
<eg><i lang=""ceb"">Susíhun giyud ang kapasidad sa mulún,</i><trans> We must check the borrower’s capacity to repay. </trans></eg>
<eg><i lang=""ceb"">Makinang may kapasidad nga kwarintay singku kabalyus,</i><trans> A motor with a <tr>capacity</tr> of 45 hp. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>amount</tr> s.t. has space to hold. </trans>
<eg><i lang=""ceb"">Ang sinihan may kapasidad nga dus míl ka táwu,</i><trans> The movie house has a capacity of two thousand people. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> have a certain <tr>power</tr> or <tr>capacity</tr> to hold.
</trans>
</sense></hom></entry>");
