INSERT INTO `wced_entry` VALUES (8680, "kapatas", "440", "<entry page=""440"" id=""8680""><form id=""kapatas"" lang=""ceb"">kapatas</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>foreman</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one who loafs on the job, esp. in hard manual work done by a group (humorous). </trans>
<eg><i lang=""ceb"">Dì mahuman kay daghan mang kapatas,</i><trans> It won’t get finished because there are too many supervisors. </trans></eg>
