</sense>
<sense n=""1""><number>1</number><trans> be a <tr>foreman</tr>, act as a foreman. </trans>
</sense>
<sense n=""2""><number>2</number><trans> act like a <tr>supervisor</tr> and not work.
</trans>
</sense></hom></entry>");
