INSERT INTO `wced_entry` VALUES (8681, "kapaw", "440", "<entry page=""440"" id=""8681""><form id=""kaxpaw"" lang=""ceb"">kápaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3; cP]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> come to the surface. </trans>
<eg><i lang=""ceb"">Mikápaw ang sílik sa íhu,</i><trans> The shark fin appeared above the water. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>rise up into</tr> s.t. </trans>
<eg><i lang=""ceb"">Mikápaw ang ayruplánu sa kapunawpunáwan,</i><trans> The airplane went up into outer space. </trans></eg>
<eg><i lang=""ceb"">Usa ka maitum nga láraw nakakápaw sa íyang hunàhúnà,</i><trans> A diabolical plan hatched in his mind. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for an emotion to show. </trans>
<eg><i lang=""ceb"">Nakápaw sa íyang nawung ang túmang kasukù,</i><trans> Intense anger showed on his face. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> amount that s.t. shows above a surface. </trans>
<eg><i lang=""ceb"">Ang kápaw sa submarínu,</i><trans> The amount of the submarine which appears above the water. </trans></eg>
</sense></hom>
<entry><form id=""salingkaxpaw"" lang=""ceb""><abbr expan=""salingkápaw"" type=""lemma"">saling-</abbr></form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#salingkaxpaw""><sc>salingkápaw</sc></xr>.
</trans>
</sense></hom></entry></entry>");
