INSERT INTO `wced_entry` VALUES (8682, "kapay", "440", "<entry page=""440"" id=""8682""><form id=""kapay"" lang=""ceb"">kapay</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pectoral fins</tr> on a fish. </trans>
</sense>
<sense n=""2""><number>2</number><trans> anything analogous that propels: <tr>wing</tr>, <tr>flipper</tr>. </trans>
<eg><i lang=""ceb"">Ang mga kapay nga gigámit sa mananáwum,</i><trans> The flippers the diver used. </trans></eg>
<eg><i lang=""ceb"">Kapay sa langgam,</i><trans> The wings of the bird. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> swim, fly with flapping motions. </trans>
<eg><i lang=""ceb"">Tiil na lay ikapay ug kapúyun na ka,</i><trans> Kick your feet to help you swim if you get tired. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> make <tr>flippers</tr>, wings for s.o. or s.t. </trans>
</sense></hom>
<entry><form id=""kapaykaxpay"" lang=""ceb"">kapaykápay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> flap s.t. repeatedly. </trans>
<eg><i lang=""ceb"">Nagkapaykápay ang kabaw sa íyang dunggan pag-ábug sa lángaw,</i><trans> The carabao flapped its ears to shoo off the flies.
</trans></eg>
</sense></hom></entry></entry>");
