INSERT INTO `wced_entry` VALUES (8685, "kapi1", "441", "<entry page=""441"" id=""8685""><form id=""kapi"" lang=""ceb"">kapi<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>coffee</tr> bean, plant, drink. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>brown</tr> in color. </trans>
<eg><i lang=""ceb"">Panaptun nga lútù kapi,</i><trans> A piece of dark brown cloth. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; b(1)]</itype><trans> make, prepare coffee. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; a12]</itype><trans> make into coffee, grind into coffee. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B2; a]</itype><trans> turn brown in color. </trans>
<eg><i lang=""ceb"">Kapihun ku ning ákung sinínà nga putì,</i><trans> I’ll dye my white dress brown. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A1]</itype><trans> wear s.t. brown. </trans>
<eg><i lang=""ceb"">Magkapi ang dúnay dibusiyun sa Karmin,</i><trans> A devotee of the Lady of Carmel wears brown. </trans></eg>
</sense></hom>
<entry><form id=""pangapi"" lang=""ceb""><abbr expan=""pangapi"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6(1)]</itype><trans> drink coffee. </trans>
