INSERT INTO `wced_entry` VALUES (8698, "kapital", "441", "<entry page=""441"" id=""8698""><form id=""kapital"" lang=""ceb"">kapital</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>capital letter.</tr> </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>capital city.</tr> </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>capital</tr>, <tr>resources</tr>. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> quality that is an asset to success. </trans>
<eg><i lang=""ceb"">Kapital na nímu nang ímung pangútuk,</i><trans> Your brains are an asset to you. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> write in capital letters. </trans>
<eg><i lang=""ceb"">Kapitala (ikapital) pagsuwat ang mga ngálan sa táwu,</i><trans> Write the names of persons in capital letters. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B126; a12]</itype><trans> make into a capital city. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> put up capital. </trans>
<eg><i lang=""ceb"">Niuprisir siya nga mauy mukapital sa manukan,</i><trans> He offered to put up the capital for a poultry business. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[c6]</itype><trans> use as a source of profit or benefit. </trans>
<eg><i lang=""ceb"">Ang kaálam ug katakus mauy maáyung ikapital sa panginabúhì,</i><trans> Knowledge and skill are assets in our struggle for existence. </trans></eg>
</sense></hom>
<entry><form id=""kapitalista"" lang=""ceb""><abbr expan=""kapitalista"" type=""lemma"">-ista</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> capitalist. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> be a capitalist or financier.
