INSERT INTO `wced_entry` VALUES (8705, "kapkap1", "442", "<entry page=""442"" id=""8705""><form id=""kapkap"" lang=""ceb"">kapkap<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> grow <tr>clinging</tr> onto s.t. </trans>
<eg><i lang=""ceb"">Bágun nga nagkapkap sa paril,</i><trans> A vine climbing on the wall. </trans></eg>
<eg><i lang=""ceb"">Dakù na ang dákit sa káhuy nga íyang gikapkápan,</i><trans> The strangling fig is larger than the tree it has grown around. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3N]</itype><trans> <tr>grope</tr> for s.t. </trans>
<eg><i lang=""ceb"">Nagkapkap (nagpangapkap) na lang kung naglakaw sa ngitngit,</i><trans> I had to grope my way in the dark. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b(1)]</itype><trans> search a body for s.t. </trans>
<eg><i lang=""ceb"">Gikapkápan sa gwardiya ang buut musulud,</i><trans> The guard searched those who wanted to get inside. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2N]</itype><trans> struggle to obtain s.t. </trans>
<eg><i lang=""ceb"">Mukapkap (mangapkap) giyud ang táwu arun mabúhì,</i><trans> A man has to struggle to live. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[AN; a2b2]</itype><trans> sneak into a house with the intention of having intercourse with a girl. </trans>
</sense></hom>
<entry><form id=""pangapkap"" lang=""ceb""><abbr expan=""pangapkap"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> grope. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> grope for s.t. to say. </trans>
<eg><i lang=""ceb"">Ang táwung namakak mangapkap sa unsay itubag,</i><trans> A person who lies <corr sic=""groped"">gropes</corr> for what to say.
</trans></eg>
</sense></hom></entry></entry>");
