<eg><i lang=""ceb"">Kapni (kapna) ang iring arun dì mahígal,</i><trans> Castrate the cat so it won’t get over-sexed. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b2]</itype><trans> <tr>take</tr> s.t. away from s.t., take a little bit out of s.t. </trans>
<eg><i lang=""ceb"">Gikapnan ang kík,</i><trans> The cake has had s.t. removed. </trans></eg>
<eg><i lang=""ceb"">Nakúlang ang ákung suklì kay gikapnan níya,</i><trans> I didn’t get enough change because she held some of it back. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> <tr>cut off</tr> a portion from a plant to make growth take place in a desirable part. </trans>
<eg><i lang=""ceb"">Kapni ang tabákù arun managkù ang dáhun,</i><trans> Cut off the terminal buds of the tobacco plant to make the leaves grow large. </trans></eg>
</sense></hom>
<entry><form id=""kinapnan"" lang=""ceb"">kinapnan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> castrated.
