INSERT INTO `wced_entry` VALUES (8762, "karapitsi", "444", "<entry page=""444"" id=""8762""><form id=""karapitsi"" lang=""ceb"">karapitsi</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sugarcane crushing apparatus composed of two steel rollers stood vertically on a platform, turned by a long piece of timber which is pulled by a carabao. The carabao is made to walk round and round to turn the rollers while the sugarcane stalks are fed into them one or two at a time, and the juice is squeezed out into a vat. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> crush and squeeze juice out of sugarcane stalks with the <ix>karapitsi</ix>. </trans>
</sense></hom>
<entry><form id=""karapitsihun_ug_baqbaq"" lang=""ceb"">karapitsihun ug bàbà</form>
<hom>
<sense n=""0""><trans> having a mouth like a <ix>karapitsi</ix>—i.e., a voracious eater.
</trans>
</sense></hom></entry></entry>");
