INSERT INTO `wced_entry` VALUES (8764, "karas", "444", "<entry page=""444"" id=""8764""><form id=""karas"" lang=""ceb"">karas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>rake</tr> out s.t. growing, <tr>harrow</tr>. </trans>
<eg><i lang=""ceb"">Karasa ang mga sagbut,</i><trans> Remove the weeds by raking. </trans></eg>
<eg><i lang=""ceb"">Karasi ang humayan human madáru,</i><trans> Harrow the paddy after you plow it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>scratch</tr> lightly. </trans>
<eg><i lang=""ceb"">Nakaras ang íyang buktun sa tunuk,</i><trans> His arm got scratched by the thorns. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> scratch out, <tr>cross off.</tr> </trans>
<eg><i lang=""ceb"">Karasun ku ang ngálan mu sa lista,</i><trans> I’ll cross your name off the list. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rake, harrow. </trans>
</sense>
<sense n=""2""><number>2</number><trans> light scratch. </trans>
</sense>
<sense n=""3""><number>3</number><trans> marks made to cross s.t. off.
</trans>
</sense></hom></entry>");
