INSERT INTO `wced_entry` VALUES (8765, "karas1", "444", "<entry page=""444"" id=""8765""><form id=""kaxras"" lang=""ceb"">káras<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for citrus to be acrid and biting. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for the throat to be raspy, dry, and sore. </trans>
