INSERT INTO `wced_entry` VALUES (8777, "karaw1", "445", "<entry page=""445"" id=""8777""><form id=""kaxraw"" lang=""ceb"">káraw<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> <tr>stir</tr> or <tr>shuffle</tr> s.t. around to mix it. </trans>
<eg><i lang=""ceb"">Gikáraw nákù ang mga pitsas sa madyung,</i><trans> I shuffled the mahjong pieces. </trans></eg>
<eg><i lang=""ceb"">Karáwa ang armirul arun dílì magbitulbitul,</i><trans> Mix the starch so it won’t get lumpy. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; c1]</itype><trans> <tr>shake</tr> back and forth. </trans>
<eg><i lang=""ceb"">Mukáraw ang mga dáhun sa balíli inighuyup sa hángin,</i><trans> The blades of grass will stir when the wind blows. </trans></eg>
<eg><i lang=""ceb"">Nagkaraw ang síga sa kandílà,</i><trans> The candle flame is flickering. </trans></eg>
<eg><i lang=""ceb"">Karáwa (ikáraw) ang langkay arun manglúpad ang mga máya,</i><trans> Shake the dry coconut fronds to scare away the rice birds. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN; a12]</itype><trans> touch or take things belonging to s.o. </trans>
<eg><i lang=""ceb"">Kinsa na puy nangáraw sa ákung midiyas?</i><trans> Who could have used my socks? </trans></eg>
<eg><i lang=""ceb"">Walay makapangáraw sa butang sa upisína,</i><trans> Nobody can touch things in the office. </trans></eg>
</sense></hom>
<entry><form id=""karawan"" lang=""ceb""><abbr expan=""karawan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to touch or take s.o.’s things. </trans>
</sense></hom></entry>
<entry><form id=""karawkaraw"" lang=""ceb"">karawkaraw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> move around continuously. </trans>
</sense>
<sense n=""2""><number>2</number><trans> busy oneself in household chores. </trans>
<eg><i lang=""ceb"">Bísi ku kay daghan kug karawkarawun sa balay,</i><trans> I’m busy because I have lots of things to do in the house.
</trans></eg>
</sense></hom></entry></entry>");
