INSERT INTO `wced_entry` VALUES (8793, "karga", "446", "<entry page=""446"" id=""8793""><form id=""karga"" lang=""ceb"">karga</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>load</tr>, put in or on a conveyance. </trans>
<eg><i lang=""ceb"">Suhúli ang nagkarga sa bukag sa trák,</i><trans> Pay the man who loaded the basket on the truck. </trans></eg>
<eg><i lang=""ceb"">Ikarga ring ságing sa balsa,</i><trans> Load these bananas on the sled. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A]</itype><trans> take a load. </trans>
<eg><i lang=""ceb"">Mukarga ug tris tuniládas ning tráka,</i><trans> This truck can take a load of three tons. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>charge</tr> a firearm or battery. </trans>
<eg><i lang=""ceb"">Gikargáhan nákù ang ripli,</i><trans> I loaded the rifle. </trans></eg>
<eg><i lang=""ceb"">Gikargáhan na ba ang ákung batiríya?</i><trans> Has my storage battery been charged? </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A]</itype><trans> hold a certain charge. </trans>
<eg><i lang=""ceb"">Dì na mukarga ning batiriyáha,</i><trans> This battery cannot be charged any further. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c1]</itype><trans> <tr>carry</tr> s.o. in one’s arms. </trans>
<eg><i lang=""ceb"">Akuy mukarga sa bátà kay nagkagúkam ka sa mga dad-unun,</i><trans> I’ll carry the baby for you. You’ve got enough to carry. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A1; c]</itype><trans> include figures in another figure. </trans>
<eg><i lang=""ceb"">Kinsay nagkarga sa sumáda karun sa lista sa miáging búlan?</i><trans> Who included today’s totals in last month’s list? </trans></eg>
<eg><i lang=""ceb"">Ikarga ni sa útang nákù,</i><trans> Add this to what I owe you. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A13; b6]</itype><trans> charge s.o. for s.t. falsely. </trans>
<eg><i lang=""ceb"">Gikargáhan siyag útang,</i><trans> He was falsely charged a debt. </trans></eg>
</sense>
<sense n=""5a""><number>5a</number><trans> charge interest on. </trans>
<eg><i lang=""ceb"">Ang ákung útang gikargáhan ug diyis pursiyintu,</i><trans> I was charged ten percent interest on my debt. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>load</tr>. </trans>
</sense></hom>
<entry><form id=""hustu_sa_karga"" lang=""ceb"">hustu sa <abbr expan=""karga"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>well prepared</tr>. </trans>
<eg><i lang=""ceb"">Antis mularga, hustu sa karga,</i><trans> Before venturing into s.t., everything should be prepared in advance. </trans></eg>
</sense></hom></entry>
<entry><form id=""traxk_dikarga"" lang=""ceb"">trák <abbr expan=""dikarga"" type=""lemma"">di-</abbr></form>
<hom>
<sense n=""0""><trans> cargo truck. </trans>
</sense>
<sense n=""2""><number>2</number> <form id=""karga_buxru_karga_buxrut"" lang=""ceb""><abbr expan=""karga"" type=""lemma"">—</abbr> búru, <abbr expan=""karga búrut"" type=""lemma"">búrut</abbr></form><trans> k.o. <tr>card game</tr>, similar to idiot’s delight. Each player gets five cards. The dealer pulls a card from the pack and puts it down face up. Each player follows suit. Whoever cannot follow suit must draw from the pack until he can. The one who puts down the highest card leads. The object is to rid oneself of his cards. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> play <ix>carga burro</ix>. </trans>
</sense></hom></entry>
<entry><form id=""karga_siraxda"" lang=""ceb""><abbr expan=""karga"" type=""lemma"">—</abbr> siráda</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> full, filled to capacity. </trans>
<eg><i lang=""ceb"">Wà mi makasakay kay pulus karga siráda ang mga trák,</i><trans> We did not manage to get a ride because the buses were filled to capacity. </trans></eg>
<eg><i lang=""ceb"">Karga siráda ang ákung tiyan adtung kaúna,</i><trans> My stomach was filled to bursting after that dinner. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; c1]</itype><trans> become full. </trans>
</sense></hom></entry>
<entry><form id=""pangarga"" lang=""ceb""><abbr expan=""pangarga"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> work as a laborer loading goods. </trans>
</sense></hom></entry>
<entry><form id=""kargaxda"" lang=""ceb""><abbr expan=""kargáda"" type=""lemma"">-da</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> action of loading cargo on a boat. </trans>
<eg><i lang=""ceb"">Ug way kargáda, wà say trabáhu ang mga kargadur sa piyir,</i><trans> If there is no loading to do, the stevedores are idle. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> supplies or materials issued to an army, workers, and the like. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> supply with materials or provisions. </trans>
<eg><i lang=""ceb"">Kargadáhan mug dúgang bála,</i><trans> You will be supplied with additional bullets. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> give supplies to. </trans>
<eg><i lang=""ceb"">Ang SWA mikargáda (nagkargáda) ug panaptun sa nasunúgan,</i><trans> The SWA supplied the fire victims with materials for clothing. </trans></eg>
</sense></hom></entry>
<entry><form id=""kargaxdu"" lang=""ceb""><abbr expan=""kargádu"" type=""lemma"">-du</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> loaded, full. </trans>
<eg><i lang=""ceb"">Dì na pasakyan ang trák. Kargádu na,</i><trans> The truck will take no more passengers. It’s full. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> drunk. </trans>
<eg><i lang=""ceb"">Ayaw na siyag paimna kay kargádu na,</i><trans> Don’t give him any more to drink because he’s already loaded. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> full of, having lots of. </trans>
<eg><i lang=""ceb"">Kargádu ug búnga ang nangkà,</i><trans> The jackfruit is full of fruits. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> most of. </trans>
<eg><i lang=""ceb"">Kargádu sa mga istudiyanti karun way batásan,</i><trans> Most of the students nowadays are ill-mannered. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> be present in large quantities. </trans>
<eg><i lang=""ceb"">Kargádug Insik sa Hungkung,</i><trans> Hong Kong is full of Chinese. </trans></eg>
<eg><i lang=""ceb"">Kargádu mga way kwarta ang nagpuyù dinhi,</i><trans> A lot of the people that live here don’t have money. </trans></eg>
<eg><i lang=""ceb"">Kargádug asin ang ímung timpla,</i><trans> You use a heck of a lot of salt in your cooking. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get to be loaded. </trans>
</sense>
<sense n=""2""><number>2</number><trans> get drunk. </trans>
</sense></hom></entry>
<entry><form id=""kargadur"" lang=""ceb""><abbr expan=""kargadur"" type=""lemma"">-dur(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who loads things onto a conveyance. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156; a12]</itype><trans> become a loader, stevedore. </trans>
</sense></hom></entry>
<entry><form id=""kargamintu"" lang=""ceb""><abbr expan=""kargamintu"" type=""lemma"">-mintu</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cargo</tr>, <tr>baggage</tr>.
</trans>
</sense></hom></entry></entry>");
