INSERT INTO `wced_entry` VALUES (8831, "karni", "448", "<entry page=""448"" id=""8831""><form id=""karni"" lang=""ceb"">karni</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>meat</tr>, <tr>flesh</tr> of animals (not fowl) used as food. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a woman viewed as having a nice body. </trans>
<eg><i lang=""ceb"">Kanay karni! Maáyung kusìkusíun,</i><trans> What a woman! It would be fun to pinch her all over. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> have meat for meals. </trans>
<eg><i lang=""ceb"">Talagsa na lang kitang makakarni panahun sa kwarisma,</i><trans> We rarely eat meat during Lent. </trans></eg>
<eg><i lang=""ceb"">Karung mga panahúna makarni na ang irù,</i><trans> Nowadays dog meat can be used as food. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> use s.t. for meat. </trans>
<eg><i lang=""ceb"">Ang usa ka bábuy átung aslun, ang usa karníhun,</i><trans> One pig will be roasted, the other will be cut into pieces for meat. </trans></eg>
</sense></hom>
<entry><form id=""karni_asaxdu"" lang=""ceb""><abbr expan=""karni"" type=""lemma"">—</abbr> asádu</form>
<hom>
<sense n=""0""><trans> roast meat. </trans>
</sense></hom></entry>
<entry><form id=""karni_nurti"" lang=""ceb""><abbr expan=""karni"" type=""lemma"">—</abbr> nurti</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> corned beef. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13]</itype><trans> have corned beef. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; a12]</itype><trans> make into corned beef. </trans>
</sense></hom></entry>
<entry><form id=""karni_puxra"" lang=""ceb""><abbr expan=""karni"" type=""lemma"">—</abbr> púra</form>
<hom>
<sense n=""0""><trans> lean meat. </trans>
</sense></hom></entry>
<entry><form id=""karnihan"" lang=""ceb"">karnihan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> meat section in the market. </trans>
</sense></hom></entry>
<entry><form id=""karnisixra_karnisixru"" lang=""ceb""><abbr expan=""karnisíra"" type=""lemma"">-síra</abbr>, <abbr expan=""karnisíru"" type=""lemma"">-síru</abbr></form>
