INSERT INTO `wced_entry` VALUES (8851, "kartiyu", "449", "<entry page=""449"" id=""8851""><form id=""kartixyu"" lang=""ceb"">kartíyu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; a]</itype><trans> be able to work out a problem, think one’s way out of a tight spot. </trans>
<eg><i lang=""ceb"">Wà siya makurnir kay maáyung mangartíyu,</i><trans> They couldn’t pressure him into marriage, because he was a quick thinker. </trans></eg>
<eg><i lang=""ceb"">Kartiyúhun nátù ang makina básig muandar,</i><trans> Let’s try to use our brains on this sewing machine. Maybe we can figure out how to make it go. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; a12]</itype><trans> accomplish s.t. with less than what one would normally have available. </trans>
<eg><i lang=""ceb"">Ug maáyu kang mukartíyu, makapaiskuyla ka sa ímung anak,</i><trans> If you handle your limited resources right, you can still send your son to school. </trans></eg>
<eg><i lang=""ceb"">Wà tay istrungkadur, átù lang kartiyúhun ug kutsilyu,</i><trans> We don’t have a screwdriver, but we’ll manage it with a knife. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13]</itype><trans> slap together a plan hastily. </trans>
<eg><i lang=""ceb"">Nagkartíyu lag usa ka dinalìdaling ripurt,</i><trans> He just waffled up a quick report. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> ability, thinking power to solve problems. </trans>
</sense></hom>
<entry><form id=""kartiyuxhan"" lang=""ceb"">kartiyúhan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having a knack for solving problems.
</trans>
</sense></hom></entry></entry>");
