INSERT INTO `wced_entry` VALUES (8876, "kasa", "450", "<entry page=""450"" id=""8876""><form id=""kaxsaq"" lang=""ceb"">kásà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c16]</itype><trans> produce a crackling, rustling sound. </trans>
<eg><i lang=""ceb"">Nagkásà ang mga ilagà sa táas sa atup,</i><trans> The rats are rustling up in the roof. </trans></eg>
<eg><i lang=""ceb"">Ayawg kasáa (ikásà) ang pagkúmut sa mga papil,</i><trans> Do not make the papers crackle when you crumple them. </trans></eg>
