<sense n=""2""><number>2</number> <itype>[B]</itype><trans> talk loudly, too garrulously. </trans>
<eg><i lang=""ceb"">Mukásà nà siya basta náay babáying mamínaw níya,</i><trans> He talks a lot and loud when there are women listening. </trans></eg>
<eg><i lang=""ceb"">Ngánung nakásà man mu dinhà?</i><trans> What are you chattering about over there? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> crackling, rustling sound. </trans>
</sense>
<sense n=""2""><number>2</number><trans> preparation for a party, esp. cooking, as evidenced by noise. </trans>
<eg><i lang=""ceb"">May kásà sa íla. May kumbira dagway,</i><trans> There’s the noise of preparations at their house. They must be planning a party. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> a chatterbox, talking too much.
