INSERT INTO `wced_entry` VALUES (8912, "kasku", "452", "<entry page=""452"" id=""8912""><form id=""kasku"" lang=""ceb"">kasku</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the <tr>framework</tr> and the main structure of s.t. without appendages. </trans>
<eg><i lang=""ceb"">Kasku sa sakayan,</i><trans> The hull of the boat. </trans></eg>
<eg><i lang=""ceb"">Kasku sa kutsi,</i><trans> The body of the car. </trans></eg>
<eg><i lang=""ceb"">Kasku sa táwu,</i><trans> The torso of a man. </trans></eg>
<eg><i lang=""ceb"">Kasku sa muskitíru,</i><trans> Walling of the mosquito net. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> a blunt-bowed wooden boat with square stern about <measure reg=""9.1 m"">30′</measure> long, towed or with a sail, used for lightering or for river or coastal transport. It is so called because it consists of little more than a hull. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> build the basic structure of s.t., use as the basic structure. </trans>
<eg><i lang=""ceb"">Wà pa ku makakasku sa ákung muskitíru kay wà pa kuy ilangitlángit,</i><trans> I haven’t made the sides of the mosquito net because I don’t have materials for the top.
</trans></eg>
</sense></hom></entry>");
