INSERT INTO `wced_entry` VALUES (8933, "kasway", "453", "<entry page=""453"" id=""8933""><form id=""kasway"" lang=""ceb"">kasway</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> k.o. deep-sea <tr>crab</tr> about the same size as the <ix>langbay</ix> and with longer claws. </trans>
<eg><i lang=""ceb"">Parti na gánì sa nigusyu kasway nà sa lápuk, hínay nga mangapay, lagsik mamiluk,</i><trans> When it comes to business, he is like a crab in the mud: he moves slowly but his eyes are constantly blinking (i.e. he is alert). </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> crab legs. </trans>
<eg><i lang=""ceb"">Walu ang kasway sa langbay,</i><trans> Sea crabs have eight legs. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> limbs of people. </trans>
<eg><i lang=""ceb"">Tag-as ug kasway ang taas nga táwu,</i><trans> A tall person has long limbs.
</trans></eg>
</sense></hom></entry>");
