INSERT INTO `wced_entry` VALUES (8938, "kat1", "453", "<entry page=""453"" id=""8938""><form id=""kaxt"" lang=""ceb"">kát<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> take or give a <tr>cut</tr> from an amount of money due s.o. </trans>
<eg><i lang=""ceb"">Kátan sa ahinti ang halin,</i><trans> The agent will take a cut from the proceeds. </trans></eg>
<eg><i lang=""ceb"">Kátan ang ahinti ug dyís pursintu,</i><trans> The agent will get a cut of ten percent. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> cut playing cards. </trans>
<eg><i lang=""ceb"">Kátun ang baráha paghumag saksak,</i><trans> The deck of cards is cut after it is shuffled. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> for a movie to have s.t. cut out of it. </trans>
<eg><i lang=""ceb"">Gikát sa sinsur ang hílas nga parti,</i><trans> The lewd scenes were cut out by the censors. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A; a12]</itype><trans> stop a recording to correct an error by re-recording. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[A; a2]</itype><trans> cut the ball in table tennis, hitting it with the edge of the paddle to make it spin. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> one’s share in a deal, commission. </trans>
</sense>
<sense n=""2""><number>2</number><trans> action of cutting in cards or table tennis. </trans>
</sense>
<sense n=""3""><number>3</number><trans> portions of a movie removed by the censors. </trans>
</sense>
<sense n=""4""><number>4</number><trans> recording. </trans>
<eg><i lang=""ceb"">Maáyu kaáyu mukanta. Usa lang ka kát, úki na,</i><trans> He is really a good singer. Just one recording, and it is O.K. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> single side of a record.
</trans>
</sense></hom></entry>");
