INSERT INTO `wced_entry` VALUES (8940, "kata", "453", "<entry page=""453"" id=""8940""><form id=""kaxta"" lang=""ceb"">káta</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for sounds to be <tr>rapid</tr>, in quick succession. </trans>
<eg><i lang=""ceb"">Kátà lang ininglis níya!</i><trans> He talks English so fast! </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B6; c1]</itype><trans> talk rapidly. </trans>
<eg><i lang=""ceb"">Mikátà lag tabian ay,</i><trans> There’s the babbler talking at full speed. </trans></eg>
<eg><i lang=""ceb"">Ug katáun (ikátà) nákù ang ákung sinultihan, dì mu kasabut,</i><trans> If I talk rapidly, you won’t understand. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B3(1)6]</itype><trans> make a series of sharp short sounds in quick succession. </trans>
<eg><i lang=""ceb"">Mikátà ang masinggan,</i><trans> The machine guns rattled. </trans></eg>
<eg><i lang=""ceb"">Makakátà gánì ang makinilya,</i><trans> If the typewriter makes a rapid popping noise. </trans></eg>
<eg><i lang=""ceb"">Mikátà na ang ákung gilung-ag ságing,</i><trans> The bananas I’m cooking are bubbling now. </trans></eg>
</sense></hom>
<entry><form id=""kata"" lang=""ceb""><abbr expan=""kata"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> talking rapidly.
</trans>
</sense></hom></entry></entry>");
