INSERT INTO `wced_entry` VALUES (8944, "katag", "453", "<entry page=""453"" id=""8944""><form id=""kaxtag"" lang=""ceb"">kátag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB16; c1]</itype><trans> <tr>spread</tr>, <tr>scatter</tr> out, cause s.t. to be scattered. </trans>
<eg><i lang=""ceb"">Ngánung nagkátag mu dihà. Tápuk mu ngari,</i><trans> Why are you scattered out all over? Come in close here. </trans></eg>
<eg><i lang=""ceb"">Ikaw nagkátag sa mais sa bululáran?</i><trans> Was it you that spread the corn out on the drying tray? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <ix>how good one is in s.t.</ix>: one’s ability as it appears after being tested in competition. </trans>
<eg><i lang=""ceb"">Hawud aku sa Pámas. Makatulu nga bist aktur. Kanà ang kátag ku,</i><trans> I’m one of the top actors. I won the FAMAS award as best actor three times. That’s how good I am.
</trans></eg>
</sense></hom></entry>");
