INSERT INTO `wced_entry` VALUES (8945, "katakata", "453", "<entry page=""453"" id=""8945""><form id=""katakaxta"" lang=""ceb"">katakáta</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for s.o. to be too eager to do work no one told him to do. </trans>
<eg><i lang=""ceb"">Katakáta ka man giyung mudáru. Hala tiwasag dáru tung umahan,</i><trans> You have been wanting to plow so much, so go ahead, plow the whole field. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> daring to do s.t. one is not supposed to do. </trans>
<eg><i lang=""ceb"">Katakáta giyud ning bayhána mulakaw magabíi nga mag-inusára,</i><trans> This woman is daring. She goes out all alone at night. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13P]</itype><trans> take s.t. onto oneself one shouldn’t. </trans>
<eg><i lang=""ceb"">Kinsay nagkatakáta (nagpakatakáta) ug lútù niíning bábuy nga wà may mandù nga lutúun?</i><trans> Who went and cooked this pork when nobody told you to do it?
</trans></eg>
</sense></hom></entry>");
