INSERT INTO `wced_entry` VALUES (8952, "katap", "454", "<entry page=""454"" id=""8952""><form id=""kaxtap"" lang=""ceb"">kátap</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; c1]</itype><trans> <tr>spread</tr> all over. </trans>
<eg><i lang=""ceb"">Mikátap ang mga táwu sa plása,</i><trans> People were all over the plaza. </trans></eg>
<eg><i lang=""ceb"">Ang usa ka galun nga pintal dílì makakátap sa pisami,</i><trans> A gallon of paint will not cover the entire ceiling. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> for vision or reasoning powers to be <tr>blurred</tr>. </trans>
<eg><i lang=""ceb"">Nagkátap ang ákung tinan-awan sa mga lúhà,</i><trans> My vision was not clear because of my tears. </trans></eg>
<eg><i lang=""ceb"">Mikátap ang íyang hunàhúnà sa hilabihang kasábà,</i><trans> He couldn’t think clearly because of the incessant din. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> be spread widely. </trans>
<eg><i lang=""ceb"">Kátap kaáyu ang balità,</i><trans> The news spread widely. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for vision or thoughts to get blurred.
</trans>
</sense></hom></entry>");
