INSERT INTO `wced_entry` VALUES (8955, "kataw", "454", "<entry page=""454"" id=""8955""><form id=""kataw"" lang=""ceb"">kataw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> supernatural sea creatures with the head and trunk of a beautiful woman and the tail of a fish, which play practical jokes on fishermen, kidnap them, or drive them crazy. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a12]</itype><trans> for a <ix>kataw</ix> to annoy a fisherman. </trans>
<eg><i lang=""ceb"">Dúna kunuy nagkataw ni Pidru sa íyang pagpamasul gabíi,</i><trans> They say a <tr>mermaid</tr> took an interest in Peter (played jokes or tried to lure him) last night while he was fishing. </trans></eg>
<eg><i lang=""ceb"">Gikataw nà siya maung nabúang,</i><trans> A mermaid went after him, and that’s why he went crazy.
