INSERT INTO `wced_entry` VALUES (8958, "kati, kati", "454", "<entry page=""454"" id=""8958""><form id=""kaxti_kaxtiq"" lang=""ceb"">káti, kátì</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> set s.t. into motion by providing a stimulus or catalyst. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>use</tr>, <tr>lure</tr> s.t. with a decoy or lure in hunting or fishing. </trans>
<eg><i lang=""ceb"">Katíhun nákù ang núkus íning uwang-úwang,</i><trans> I’ll lure squids with this artificial shrimp. </trans></eg>
<eg><i lang=""ceb"">Kining ákung sunuy mauy ikáti sa mga ihás manuk,</i><trans> We’ll use my cock to lure wild chickens. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A13SN; a12]</itype><trans> win a big amount in gambling with a small starting bet. </trans>
<eg><i lang=""ceb"">Nakakati (nakapangati) giyud kug bayinti sa ákung písu,</i><trans> I managed to win twenty pesos with my one peso. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b5]</itype><trans> <tr>prime a pump</tr> by pouring water in until suction is established. </trans>
<eg><i lang=""ceb"">Dílì muágay nang bumbáha ug dílì katíhun (katíhan),</i><trans> That pump won’t work unless it is primed. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; a]</itype><trans> <tr>induce vomiting</tr>. </trans>
<eg><i lang=""ceb"">Katía ang íyang pagsúka arun isúka ang hilu,</i><trans> Induce him to vomit so that he will vomit out the poison. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; a]</itype><trans> remove water that has gotten into the ears by priming with warm water. </trans>
<eg><i lang=""ceb"">Kinahanglan inadlaw ang túbig nga mukáti sa túbig nga nahasulud sa dalunggan,</i><trans> Use warm water to get the rest of the water inside your ears out. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A3P; a1]</itype><trans> <tr>stir up emotions</tr>. </trans>
<eg><i lang=""ceb"">Bantay ka lang sa ímung kakiriwan. Magkáti ka lang sa ákung pangísug,</i><trans> You’d better stop touching my things. You might stir up my anger. </trans></eg>
</sense></hom>
<entry><form id=""kati_katiq"" lang=""ceb""><abbr expan=""kati, katì"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> decoy. </trans>
</sense>
<sense n=""2""><number>2</number><trans> water used to prime a water pump. </trans>
</sense></hom></entry>
<entry><form id=""katihan_pangaxti_pangaxtiq"" lang=""ceb"">katihan, <abbr expan=""pangáti, pangátì"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>decoy</tr>, <tr>lure</tr> in fishing. </trans>
</sense></hom></entry>
<entry><form id=""katihanan"" lang=""ceb"">katihanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place where one catches or traps game or fish by using a decoy or lure. </trans>
</sense></hom></entry>
<entry><form id=""mangangaxtiq"" lang=""ceb""><abbr expan=""mangangátì"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> person who traps game. </trans>
</sense></hom></entry>
<entry><form id=""katikatiun_katiqkatiun_katikatihun"" lang=""ceb"">katikatiun, katìkatiun, katikatihun</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for a woman to be <tr>provocative</tr>. </trans>
<eg><i lang=""ceb"">Kanang bayhána katikatiun kaáyu sa íyang míni nga sinínà,</i><trans> That woman is provocative in her miniskirt. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> inciting trouble, butting in to create trouble. </trans>
<eg><i lang=""ceb"">Katìkatiun kang pagkatáwu. Dalì ra kang makaagig áway,</i><trans> You’re such a trouble-maker. It doesn’t take you long to find a quarrel.
</trans></eg>
</sense></hom></entry></entry>");
