INSERT INTO `wced_entry` VALUES (8991, "katsir", "455", "<entry page=""455"" id=""8991""><form id=""katsir"" lang=""ceb"">katsir</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>catcher</tr> in baseball. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a woman who tends to get pregnant. </trans>
<eg><i lang=""ceb"">Katsir kanang bayhána. Dílì hisaghirag bahag,</i><trans> That woman is very fertile. You must have to look at her to get her pregnant. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> a woman who will accept any suitor if she can get s.t. from him. </trans>
</sense>
<sense n=""4""><number>4</number><trans> a person that hangs around restaurants to pick up the leavings of the diners. </trans>
</sense>
<sense n=""4a""><number>4a</number><trans> fish that eats anything. </trans>
<eg><i lang=""ceb"">Ang bugáung katsir kaáyu<corr sic=""."">,</corr></i><trans> Jarbua is a fish that eats excrement. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> not missing out on any gossip. </trans>
<eg><i lang=""ceb"">Katsir kaáyung bayhána. Dì masipyatag tabì,</i><trans> That lady is good at ferreting out gossip. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B56; a2]</itype><trans> be, become a catcher in baseball, softball.
</trans>
</sense></hom></entry>");
