INSERT INTO `wced_entry` VALUES (8996, "katu", "455", "<entry page=""455"" id=""8996""><form id=""kaxtuq"" lang=""ceb"">kátù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13B; b4]</itype><trans> for dirt to cake on s.t., have dirt caked on it. </trans>
<eg><i lang=""ceb"">Nagkátù (gikatúan) lang ang lamísa sa abug,</i><trans> The table is thick with dust on it. </trans></eg>
<eg><i lang=""ceb"">Nagkátù ang buling sa kwilyu,</i><trans> The collar is caked with dirt. </trans></eg>
</sense></hom>
<entry><form id=""katuq"" lang=""ceb""><abbr expan=""katù"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> be dirty or untidy in one’s clothing. </trans>
<eg><i lang=""ceb"">Katù nà siyang mamistibisti,</i><trans> She dresses in a dirty and shabby way. </trans></eg>
</sense></hom></entry>
<entry><form id=""katuqkatuq"" lang=""ceb"">katùkatù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> make s.t. very dirty, untidy. </trans>
<eg><i lang=""ceb"">Ayaw mug katùkatù sa sála kay dúna tay bisíta,</i><trans> Don’t make the parlor untidy because we are going to have <pb n=""456""/>visitors. </trans></eg>
<eg><i lang=""ceb"">Dì ku mulaba sa ímung sinínà ug ímung katùkatuun (katùkatuan),</i><trans> I won’t wash your clothes if you make them very dirty.
</trans></eg>
</sense></hom></entry></entry>");
