<sense n=""0""><trans> <tr>common sense</tr>, ability to reason, knowledge. </trans>
<eg><i lang=""ceb"">Dílì ka makasabut? Háin gud nang ímung katukatu?</i><trans> You can’t understand? Where’s your head? </trans></eg>
<eg><i lang=""ceb"">Wà giyud nay katukatung bayhána kay wà katunub ug iskuyláhan,</i><trans> That woman is illiterate because she hasn’t gone to school.
</trans></eg>
</sense></hom></entry>");
