INSERT INTO `wced_entry` VALUES (9001, "katul1", "456", "<entry page=""456"" id=""9001""><form id=""katul"" lang=""ceb"">katul<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>itchy</tr>. </trans>
<eg><i lang=""ceb"">Katul ákung kamut. Kwarta na,</i><trans> My hands are itching. I must be due to get some money. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> having a social disease (lit. having an itch). </trans>
<eg><i lang=""ceb"">Ug katul ang gamítun nímung babáyi ...,</i><trans> If you happen to have sexual contact with a woman who has the itches ... </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> causing itch. </trans>
<eg><i lang=""ceb"">Katul ang dápaw sa mais,</i> The hairs on corn plants are itchy. <form id=""katul_ug_kamut"" lang=""ceb""><abbr expan=""katul"" type=""lemma"">—</abbr> ug kamut</form><trans> </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having hands that itch to steal. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; b4]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> itch, feel itchy. </trans>
<eg><i lang=""ceb"">Mukatul ang ákung pánit ug abugan,</i><trans> My skin itches if dust gets on it. </trans></eg>
<eg><i lang=""ceb"">Nangálut siya sa bukubuku kay gikatlan,</i><trans> He is scratching his back because he itches. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> feel a restless desire or craving to do s.t. </trans>
<eg><i lang=""ceb"">Makabatì gánì kug tukar, katlan dáyun ku,</i><trans> Whenever I hear music, I feel the itch (to dance). </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[b8]</itype><trans> feel the itch to have sex. </trans>
<eg><i lang=""ceb"">Ug katlan ka, pangrílis,</i><trans> If you feel the urge, go to the <ix>rílis</ix> (red light district). </trans></eg>
</sense></hom>
<entry><form id=""kaxtul"" lang=""ceb""><abbr expan=""kátul"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; b4]</itype><trans> itch intensely. </trans>
</sense></hom></entry>
<entry><form id=""katulkatul"" lang=""ceb"">katulkatul</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> skin disease that itches. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. which is enough to stimulate, but not satisfy and then displeases because it is inadequate. </trans>
<eg><i lang=""ceb"">Mu ra nay ihátag mung kwarta? Nagkatulkatul lang nà nákù,</i><trans> Is that all you’re giving me? It just makes me itch. It isn’t enough to satisfy.
</trans></eg>
</sense></hom></entry></entry>");
