INSERT INTO `wced_entry` VALUES (9015, "kaub", "456", "<entry page=""456"" id=""9015""><form id=""kaub"" lang=""ceb"">kaub</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB36; c1]</itype><trans> <tr>lie down</tr> on one’s belly, be turned over, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Mukámang na ang bátà kay makakaub na,</i><trans> The baby will soon be able to crawl because it can turn over now. </trans></eg>
<eg><i lang=""ceb"">Nakaub ang sakayang gihampak sa balud,</i><trans> The boat was turned over when it was lashed by big waves. </trans></eg>
<eg><i lang=""ceb"">Gikauban níya sa kaldíru ang íyang bánang libudsuruy,</i><trans> She left no food for her good-for-nothing husband (lit. she turned the pot upside down on him).
</trans></eg>
</sense></hom></entry>");
