INSERT INTO `wced_entry` VALUES (9018, "kaun", "457", "<entry page=""457"" id=""9018""><form id=""kaxun"" lang=""ceb"">káun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S3S; a]</itype><trans> <tr>eat</tr>. </trans>
<eg><i lang=""ceb"">Nagkaun ka na?</i><trans> Have you eaten? </trans></eg>
<eg><i lang=""ceb"">Nakakaun na kug amù,</i><trans> I have eaten monkey meat. </trans></eg>
<eg><i lang=""ceb"">Unsa may kan-un sa masakitun?</i><trans> What should the patient eat now? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[a3]</itype><trans> be eaten to get one to act in an unusual way. </trans>
<eg><i lang=""ceb"">Unsay nakáun sa táwu? Mangúhit man,</i><trans> What got into you that you touched me? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a2]</itype><trans> <tr>destroy</tr> by fire, erosion, corrosion. </trans>
<eg><i lang=""ceb"">Ang asidu mukáun ug tayà,</i><trans> Acid eats away rust. </trans></eg>
<eg><i lang=""ceb"">Ang balay gikaun sa kaláyu,</i><trans> The house was destroyed by the fire. </trans></eg>
<eg><i lang=""ceb"">Nahánaw siya kay gikaun man sa kangitngit,</i><trans> He suddenly vanished because he was engulfed in darkness. </trans></eg>
<eg><i lang=""ceb"">Gikaun ang túbu sa tayà,</i><trans> The pipe is corroded with rust. </trans></eg>
<eg><i lang=""ceb"">Dimungkug! Wà uruy kan-a sa kílat,</i><trans> The devil! Why didn’t lightning strike (lit. eat) him? </trans></eg>
<eg><i lang=""ceb"">Pangpang nga nakan-an sa balud,</i><trans> Cliff eroded by the waves. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12]</itype><trans> <tr>consume</tr>, <tr>use up</tr>. </trans>
<eg><i lang=""ceb"">Ang ímung plansa mukáun ug dakung kurinti,</i><trans> Your iron consumes a lot of electricity. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; ab7]</itype><trans> take a man in games of chess, checkers, and the like. </trans>
<eg><i lang=""ceb"">Wà pa kan-i ang ákung mga piyun,</i><trans> None of my pawns has been captured yet. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number> <itype>[b48]</itype><trans> when one returns the shuttlecock in <ix>takyan</ix> (by kicking it), for the return kick to be caught and kicked by the opponent. </trans>
<eg><i lang=""ceb"">Hikan-an ang ákung pátid kay ang ákung patid napatiran níya. Sa átù pa, hikan-an ku,</i><trans> My kick was returned (lit. eaten) because he returned the shuttlecock when I kicked it. In other words, I had my kick returned. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A]</itype><trans> for a man to have sexual relations with a blood relative. </trans>
<eg><i lang=""ceb"">Háyup ka mukáun kag kaugalíngung anak,</i><trans> You’re a beast. You have intercourse with your own child. </trans></eg>
</sense>
<sense n=""5a""><number>5a</number> <itype>[a3]</itype><trans> for a girl to be old enough to be had for sexual intercourse. </trans>
</sense>
<sense n=""6""><number>6</number> <itype>[b4]</itype><trans> for a fish to bite on one’s line. </trans>
<eg><i lang=""ceb"">Wà ku kan-i gabíi,</i><trans> I didn’t get a bite last night. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> food served. </trans>
<eg><i lang=""ceb"">Sa míting adúna usáhay puy káun,</i><trans> In the meeting they sometimes serve food. </trans></eg>
<eg><i lang=""ceb"">Sa pagpabulan lábut na ang káun,</i><trans> If you work as a maid, food is included. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> action of eating. </trans>
<eg><i lang=""ceb"">Tris díyas kung way káun,</i><trans> I went three days without food. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> consumption, amount of s.t. that is used up. </trans>
<eg><i lang=""ceb"">Dakug káun sa gasulína ning kutsíha,</i><trans> This car consumes a lot of gas. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <ix>in games of chess, checkers or drafts</ix>: a turn to take an opponent’s man. </trans>
<eg><i lang=""ceb"">Ákung káun, kúhà na ang ímung dáma,</i><trans> Now it’s my move to take your man. I have your king. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> action of taking a piece in mahjong which another player had discarded. </trans>
</sense>
<sense n=""4""><number>4</number><trans> biting of fish. </trans>
<eg><i lang=""ceb"">Kúsug ang káun sa isdà run,</i><trans> The fish are biting in force. </trans></eg>
</sense></hom>
<entry><form id=""pakaxun"" lang=""ceb""><abbr expan=""pakáun"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> <tr>feed</tr>, give to eat. </trans>
<eg><i lang=""ceb"">Pakan-a na ang mga bátà,</i><trans> Feed the children. </trans></eg>
<eg><i lang=""ceb"">Unsay átung ipakáun níla?</i><trans> What shall we give them to eat? </trans></eg>
</sense></hom></entry>
<entry><form id=""pinakaxun"" lang=""ceb""><abbr expan=""pinakáun"" type=""lemma"">pina-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. fed with s.t. special on a regular basis. </trans>
<eg><i lang=""ceb"">Ákung sunuy pinakáug karni,</i><trans> My rooster is given meat. </trans></eg>
</sense></hom></entry>
<entry><form id=""panagkaun"" lang=""ceb""><abbr expan=""panagkaun"" type=""lemma"">panag-(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23; a2]</itype><trans> for several to eat. </trans>
<eg><i lang=""ceb"">Gipanagkaun sa bilat sa ílang ina,</i><trans> The sons of bitches ate it. </trans></eg>
</sense></hom></entry>
<entry><form id=""paningaxun"" lang=""ceb""><abbr expan=""paningáun"" type=""lemma"">paniN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23]</itype><trans> feed on, look for s.t. to feed on. </trans>
<eg><i lang=""ceb"">Naningáun sa kahumayan ang mga langgam,</i><trans> The birds are feeding in the ricefield. </trans></eg>
</sense></hom></entry>
<entry><form id=""kan-anan"" lang=""ceb"">kan-anan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AP3]</itype><trans> eat s.w. regularly. </trans>
</sense></hom></entry>
<entry><form id=""kaunkaxun_kaunkaun"" lang=""ceb"">kaunkáun, kaunkaun</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; a12]</itype><trans> eat light snacks between meals. </trans>
<eg><i lang=""ceb"">Aníay mga biskwit ug kúkis kun gustu mung magkaunkáun (magkaunkaun),</i><trans> Here are some biscuits and cookies for your snacks. </trans></eg>
</sense></hom></entry>
<entry><form id=""kan-anan_kalan-an"" lang=""ceb"">kan-anan, kalan-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place to eat (eating table, dining room, restaurant). </trans>
</sense></hom></entry>
<entry><form id=""hingaxun"" lang=""ceb""><abbr expan=""hingáun"" type=""lemma"">hiN-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fond of eating. </trans>
<eg><i lang=""ceb"">Hingáun kug mga prútas,</i><trans> I’m fond of fruits. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinaxun"" lang=""ceb""><abbr expan=""kináun"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. eaten, consumed. </trans>
<eg><i lang=""ceb"">Kináun sa gabas,</i><trans> Sawdust (what was eaten by the saw). </trans></eg>
</sense></hom></entry>
<entry><form id=""kinan-an"" lang=""ceb"">kinan-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> way of eating. </trans>
</sense></hom></entry>
<entry><form id=""kakan-unun_kakaunun"" lang=""ceb"">kakan-unun, <abbr expan=""kakaunun"" type=""lemma"">ka-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> feel very much like eating. </trans>
<eg><i lang=""ceb"">Kakan-unun kug bága,</i><trans> I’m so angry I could eat coals. </trans></eg>
</sense></hom></entry>
<entry><form id=""makaxun"" lang=""ceb""><abbr expan=""makáun"" type=""lemma"">ma-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> food ready to eat. </trans>
<eg><i lang=""ceb"">Inig-ulì ni Máma, daghan siyag dáng makáun,</i><trans> When Mom comes home, she will bring lots of food. </trans></eg>
</sense></hom></entry>
<entry><form id=""pagkaxun"" lang=""ceb""><abbr expan=""pagkáun"" type=""lemma"">pag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> meal. </trans>
<eg><i lang=""ceb"">Maáyu sab tung pagkaúna dà,</i><trans> That was a good meal. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> food. </trans>
<eg><i lang=""ceb"">Unsay átung pagkáun dihà?</i><trans> What food do we have? </trans></eg>
</sense></hom></entry>
<entry><form id=""kan-un"" lang=""ceb"">kan-un</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> cooked rice or corn. </trans>
</sense></hom></entry>
<entry><form id=""kalan-un"" lang=""ceb"">kalan-un</form>
<hom>
<sense n=""1""><number>1</number><trans> food. </trans>
<eg><i lang=""ceb"">Kalan-un námù sa matag adlaw ihátag mu karung adláwa,</i><trans> Give us this day our daily bread. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> snacks. </trans>
</sense></hom></entry>
<entry><form id=""kumakaun"" lang=""ceb""><abbr expan=""kumakaun"" type=""lemma"">-um-r-(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> ready to eat. </trans>
</sense></hom></entry>
<entry><form id=""kumakaun_ug_taxwu"" lang=""ceb""><abbr expan=""kumakaun"" type=""lemma"">—</abbr> ug táwu</form>
<hom>
<sense n=""0""><trans> be very angry. </trans>
<eg><i lang=""ceb"">Ayaw mu pagsurangsurang kay kumakaug táwu ning ákung ginháwa,</i><trans> Don’t provoke me because I’m so angry I could eat s.o. right now.
</trans></eg>
</sense></hom></entry></entry>");
