INSERT INTO `wced_entry` VALUES (9019, "ka-un", "457", "<entry page=""457"" id=""9019""><form id=""ka-un"" lang=""ceb"">ka-un</form>
<hom>
<sense n=""0""><trans> affix added to nouns which refer to a time of day or of life to form nouns which mean ‘period of time that it is [so-and-so].’ </trans>
<eg><i lang=""ceb"">Kagabhíun,</i><trans> In the evening time. </trans></eg>
<eg><i lang=""ceb"">Manunggù ang mananagat sa sayung kabuntágun,</i><trans> The fishermen return in the early hours of the morning. </trans></eg>
<eg><i lang=""ceb"">Pribinihig kwarta ang ímung katigulangun,</i><trans> Set money aside for your old age. </trans></eg>
<eg><i lang=""ceb"">Kamatáyun,</i><trans> <tr>Death</tr>.
</trans></eg>
</sense></hom></entry>");
