INSERT INTO `wced_entry` VALUES (9020, "ka-un(→)", "457", "<entry page=""457"" id=""9020""><form id=""ka-unrx"" lang=""ceb"">ka-un(→)</form>
<hom>
<sense n=""1""><number>1</number><trans> affix added to verbs which refer to personal feelings to form adjectives which mean ‘be on the verge of, feel that one is going to do and cannot keep himself from it.’ </trans>
<eg><i lang=""ceb"">Kahilakun kaáyu ku,</i><trans> I was on the verge of tears. </trans></eg>
<eg><i lang=""ceb"">Kaihiun ku,</i><trans> I have to urinate very <pb n=""458""/>urgently. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> affix added to words referring to meteorological phenomena to form adjectives which mean [such-and-such] an event is about to burst forth. </trans>
<eg><i lang=""ceb"">Kaulanun kaáyu run,</i><trans> It’s just about to burst into rain now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> affix added to adjectives which refer to a state to form noun which refer to the achievement of the state. </trans>
<eg><i lang=""ceb"">Way katagbawun,</i><trans> There’s no satisfaction. </trans></eg>
<eg><i lang=""ceb"">Way katapusun ning trabahúa,</i><trans> There’s no end to this job.
</trans></eg>
</sense></hom></entry>");
