INSERT INTO `wced_entry` VALUES (9030, "kawang", "458", "<entry page=""458"" id=""9030""><form id=""kaxwang"" lang=""ceb"">káwang</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>futile</tr>. </trans>
<eg><i lang=""ceb"">Káwang lang ang paghílak kay nahitabù na,</i><trans> It is futile to cry because it is already over and done. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126; a12]</itype><trans> fail, be in vain. </trans>
<eg><i lang=""ceb"">Walà makáwang ang íyang ginadamgung kalampúsan,</i><trans> Her dreams of success were not in vain. They came true. </trans></eg>
<eg><i lang=""ceb"">Dílì ku kawángun ang ímung kinahanglan,</i><trans> I will never fail you if you need me.
