INSERT INTO `wced_entry` VALUES (9033, "kawas", "458", "<entry page=""458"" id=""9033""><form id=""kaxwas"" lang=""ceb"">káwas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get, bring out of a vehicle. </trans>
<eg><i lang=""ceb"">Tabángi kug káwas íring kahun gíkan sa trák,</i><trans> Help me unload the box from the truck. </trans></eg>
<eg><i lang=""ceb"">Nikáwas na ang tanang pasahíru sa barku,</i><trans> All the passengers have gotten off the ship. </trans></eg>
<eg><i lang=""ceb"">Ikáwas ang mga kargamintu sa dyíp,</i><trans> Unload the cargo off of the jeep first. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get, bring s.t. out of the water. </trans>
<eg><i lang=""ceb"">Mikáwas siya gíkan sa línaw,</i><trans> She came out of the water. </trans></eg>
<eg><i lang=""ceb"">Ikáwas ang báling,</i><trans> Pull in the net. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B2S4N]</itype><trans> for solids to come out of their container. </trans>
<eg><i lang=""ceb"">Mikáwas ákung tiil sa sapátus kay gitubúan,</i><trans> My feet came out of my shoes because I outgrew them. </trans></eg>
<eg><i lang=""ceb"">Iduut ang mga bulingun kay nanggáwas na nà sa bàbà,</i><trans> Press down on the laundry because it is coming out of the hamper. </trans></eg>
</sense></hom>
<entry><form id=""kaxwas_sa_kalindaryu"" lang=""ceb""><abbr expan=""káwas"" type=""lemma"">—</abbr> sa kalindaryu</form>
<hom>
<sense n=""0""><trans> for a woman’s age to get to be more than the days of the calendar (and thus be beyond the age of marriage). </trans>
<eg><i lang=""ceb"">Dì na tingáli siya maminyù kay nikáwas na man sa kalindaryu ang íyang idad,</i><trans> I doubt if she will get married because her age has outgrown the calendar. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> on dry land. </trans>
<eg><i lang=""ceb"">Mamatay ang isdà sa káwas,</i><trans> Fish won’t survive on dry land.
</trans></eg>
</sense></hom></entry></entry>");
