INSERT INTO `wced_entry` VALUES (9035, "kawat1", "458", "<entry page=""458"" id=""9035""><form id=""kaxwat"" lang=""ceb"">káwat<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3S; a2]</itype><trans> <tr>steal</tr> s.t. </trans>
<eg><i lang=""ceb"">Way mukáwat ánang rilu mung baratuhun,</i><trans> No one would steal that cheap watch of yours. </trans></eg>
<eg><i lang=""ceb"">Kawátun ku nà ug dì nímu ihátag,</i><trans> I’m going to steal it if you don’t give it to me. </trans></eg>
<eg><i lang=""ceb"">Gikawátan ang tindáhan,</i><trans> The store has been robbed. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2; b7]</itype><trans> steal space from s.t. </trans>
<eg><i lang=""ceb"">Nakakáwat ug duha ka pulgáda ang dapit nga ímung gigunting,</i><trans> You cut off about two inches when you cut it with the scissors. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23SN; b(1)]</itype><trans> do s.t. without s.o.’s knowledge or while he wasn’t watching. </trans>
<eg><i lang=""ceb"">Mikáwat ku pagtan-aw níya,</i><trans> I stole a glance at her. </trans></eg>
<eg><i lang=""ceb"">Mikáwat siyag lakaw samtang natúlug ku,</i><trans> He stole away while I was sleeping. </trans></eg>
<eg><i lang=""ceb"">Gikawátan nákù siyag haluk,</i><trans> I stole a kiss from her. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> steal a basket ball from s.o. while he is dribbling. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>theft</tr>. </trans>
<eg><i lang=""ceb"">Ísip káwat ang pagtípig sa kinit-an,</i><trans> It’s considered theft to keep what you have found. </trans></eg>
</sense></hom>
<entry><form id=""panghingaxwat"" lang=""ceb""><abbr expan=""panghingáwat"" type=""lemma"">panghiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b5]</itype><trans> charge s.o. with being a thief, usually with malicious intent. </trans>
<eg><i lang=""ceb"">Gipanghingáwat (gipanghingawátan) siya sa íyang agálun,</i><trans> Her employer falsely charged her with thievery. </trans></eg>
</sense></hom></entry>
<entry><form id=""kawatkawat"" lang=""ceb"">kawatkawat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN]</itype><trans> do s.t. surreptitiously, secretly, and repeatedly. </trans>
<eg><i lang=""ceb"">Mukawatkawat (mangawatkawat) giyud siyag káun ug bábuy <pb n=""459""/>bisag gidid-an,</i><trans> She eats pork secretly even though she’s not supposed to. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinawatkawat"" lang=""ceb"">kinawatkawat</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> s.t. done surreptitiously, secretly. </trans>
<eg><i lang=""ceb"">Kinawatkawat nga kalípay,</i><trans> Happiness (in love) stolen on the sly. </trans></eg>
</sense></hom></entry>
<entry><form id=""kawaxtan"" lang=""ceb""><abbr expan=""kawátan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>thief</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kinaxwat"" lang=""ceb""><abbr expan=""kináwat"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>loot</tr>, <tr>booty</tr>, <tr>spoils</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kinawatay"" lang=""ceb""><abbr expan=""kinawatay"" type=""lemma"">-in-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> outbreak of thievery. </trans>
</sense></hom></entry>
<entry><form id=""kawatun_kawatuxnun"" lang=""ceb""><abbr expan=""kawatun"" type=""lemma"">-un(→)</abbr>, kawatúnun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. to be stolen.
</trans>
</sense></hom></entry></entry>");
