INSERT INTO `wced_entry` VALUES (9048, "kawkaw", "459", "<entry page=""459"" id=""9048""><form id=""kawkaw"" lang=""ceb"">kawkaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ab2]</itype><trans> <tr>touch</tr> s.t. with the hands. </trans>
<eg><i lang=""ceb"">Dúnay nagkawkaw sa mga inutaw,</i><trans> S.o. put his dirty paws on these clothes. </trans></eg>
<eg><i lang=""ceb"">Hala kawkáwa nang bága,</i><trans> Go on, touch those glowing embers. </trans></eg>
<eg><i lang=""ceb"">Sa pagkawkaw lang mailhan ug pila ka búwan ang tiyan,</i><trans> You can tell just by feeling how many months the baby is in the stomach. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a2b2]</itype><trans> <tr>steal</tr> s.t. that one has access to. </trans>
<eg><i lang=""ceb"">Mahadluk kung mukawkaw sa pundu,</i><trans> I’m afraid to touch the fund. </trans></eg>
</sense></hom>
<entry><form id=""kawkawan_mangangawkaw"" lang=""ceb""><abbr expan=""kawkawan"" type=""lemma"">-an</abbr>, <abbr expan=""mangangawkaw"" type=""lemma"">maN-r-</abbr></form>
