<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; bc]</itype><trans> <tr>accuse</tr> s.o. </trans>
<eg><i lang=""ceb"">Gikawsáhan (gikawsahan) siyang naníkas,</i><trans> He was accused of embezzling. </trans></eg>
