INSERT INTO `wced_entry` VALUES (9063, "kaya", "460", "<entry page=""460"" id=""9063""><form id=""kaxya"" lang=""ceb"">káya</form>
<hom>
<sense n=""0""><trans> (slang) </trans>
</sense>
<sense n=""1""><number>1</number><trans> within one’s ability, easily tackled. </trans>
<eg><i lang=""ceb"">Ayaw na lag tábang. Káya ku ra ni kaáyu,</i><trans> Never mind helping me. I can easily tackle this job. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> within one’s financial capacity to shoulder. </trans>
<eg><i lang=""ceb"">Káya kaáyu nákù ang balur ánang awtúha,</i><trans> The car is very much within my reach. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12; a]</itype><trans> tackle, handle s.t. with ease. </trans>
<eg><i lang=""ceb"">Dì ku makakáya pag-alsa ánà,</i><trans> I can’t lift that thing easily. </trans></eg>
<eg><i lang=""ceb"">Kayáhun giyud nímu bísag labihang lisúra<corr sic="","">?</corr></i><trans> Are you going to force yourself to tackle it even if it’s very hard for you<corr sic=""."">?</corr> </trans></eg>
</sense></hom>
<entry><form id=""kayaxan"" lang=""ceb""><abbr expan=""kayáan"" type=""lemma"">-an</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having the means to spend for whatever one likes. </trans>
<eg><i lang=""ceb"">Dakù kaáyu ang íyang báy; kayáhan (kayáan) giyud tingáli,</i><trans> His house is very big; he must be rich.
</trans></eg>
</sense></hom></entry></entry>");
