INSERT INTO `wced_entry` VALUES (9066, "kayab", "460", "<entry page=""460"" id=""9066""><form id=""kaxyab"" lang=""ceb"">káyab</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB; c1P]</itype><trans> for cloth or the like to <tr>flap</tr>, cause it to do so. </trans>
<eg><i lang=""ceb"">Mikáyab (mipakáyab) siyag panyù paglarga sa barku,</i><trans> She waved her handkerchief as the boat moved away. </trans></eg>
<eg><i lang=""ceb"">Nagkáyab ang bandílà sa hángin,</i><trans> The flag waved in the breeze. </trans></eg>
<eg><i lang=""ceb"">Kayába (ikáyab) ang ímung kamut,</i><trans> <tr>Wave</tr> your hand. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1P]</itype><trans> raise a flag or unfurl a sail. </trans>
<eg><i lang=""ceb"">Kayába (ikáyab<corr>)</corr> ang bandílà, layag,</i><trans> Raise the flag, unfurl the sail. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2]</itype><trans> for a divinity to ascend into the heavens. </trans>
<eg><i lang=""ceb"">Mikáyab si Kristu sa lángit,</i><trans> Christ ascended into heaven. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the Ascension of Christ.
</trans>
</sense></hom></entry>");
