INSERT INTO `wced_entry` VALUES (9083, "kayha", "461", "<entry page=""461"" id=""9083""><form id=""kayhaq"" lang=""ceb"">kayhà</form>
<hom>
<sense n=""0""><trans> (usually pronounced <ix>kahà</ix>) </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>perhaps</tr>, <tr>possibly</tr>. </trans>
<eg><i lang=""ceb"">Kayhà mahikalimut pa usab siya kang Mirilin kun mahigugma siya sa láin,</i><trans> Perhaps he will forget Marilyn again if he falls in love with s.o. else. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""kayhaq_..._kayhaq"" lang=""ceb"">kayhà ... kayhà</form><trans> maybe because ... or perhaps because. </trans>
<eg><i lang=""ceb"">Nanghátag siya—kahà kay manggihatágun, kahà kay dihay giapas,</i><trans> He gave me s.t., maybe to be nice or maybe he was after s.t. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> in questions </trans>
</sense>
<sense n=""a""><number>a</number><trans> with no interrogative: by any chance, I wonder if. </trans>
<eg><i lang=""ceb"">Muanhi ba kahà siya?</i><trans> Will he come by any chance? </trans></eg>
<eg><i lang=""ceb"">Dílì siya makahúbad, aku pa kahà?</i><trans> Even he can’t translate it. Could I possibly do so? </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> with an interrogative: who (what, where, etc.) can it be? </trans>
<eg><i lang=""ceb"">Ginúu ku, unsa kahay nahitabù?</i><trans> My Lord! What can have happened? </trans></eg>
<eg><i lang=""ceb"">Unsáun ku kahà pagbáyad sa útang?</i><trans> How could I ever pay the debt? </trans></eg>
</sense>
<sense n=""c""><number>c</number><trans> maybe, approximately. </trans>
<eg><i lang=""ceb"">Magkinahanglan kahà kug tulu,</i><trans> I’ll need approximately three. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""man_kayhaq"" lang=""ceb"">man <abbr expan=""kayhà"" type=""lemma"">—</abbr></form><trans> since apparently [so-and-so] is the case. </trans>
<eg><i lang=""ceb"">Mutan-aw ka man kahà sa sini. Ngánung nía ka pa man?</i><trans> You said you were going to the movies. Why are you still here? </trans></eg>
</sense></hom>
<entry><form id=""kayhaan"" lang=""ceb""><abbr expan=""kayhaan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <corr><number>1</number> </corr>s.t. held doubtful or uncertain. </trans>
<eg><i lang=""ceb"">‘Makapasar kahà siya sa iksámin?’—‘Kayhaan pa,’</i><trans> ‘Will he pass the examination?’—‘It is still doubtful.’ </trans></eg>
<eg><i lang=""ceb"">‘Anus-a ka magpakasal níya?’—‘Sa kayhaan,’</i><trans> ‘When will you marry her?’—‘Someday (but when, I still do not know).’ </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> accidentally, unexpectedly. </trans>
<eg><i lang=""ceb"">Sa kayhaan nagkítà sila sa Manílà,</i><trans> By chance they met in Manila.
</trans></eg>
</sense></hom></entry></entry>");
