INSERT INTO `wced_entry` VALUES (9102, "kayut", "462", "<entry page=""462"" id=""9102""><form id=""kayut"" lang=""ceb"">kayut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[ANC; abcP]</itype><trans> <tr>hold</tr> or <tr>touch</tr> s.t., hold on to s.t. so as to be joined to it. </trans>
<eg><i lang=""ceb"">Ang bátà mikayut (nangayut) sa sinínà sa inahan,</i><trans> The child held his mother’s dress. </trans></eg>
<eg><i lang=""ceb"">Magkáyut tang tanan nga manglábang sa subà,</i><trans> We will all join hands together in crossing the river. </trans></eg>
<eg><i lang=""ceb"">Kayútun ku ning duha ka tabla,</i><trans> I will join these two boards together. </trans></eg>
<eg><i lang=""ceb"">Wà kuy kwartang makaytan,</i><trans> I can’t get my hands on any of the money. </trans></eg>
