INSERT INTO `wced_entry` VALUES (9109, "kiat", "463", "<entry page=""463"" id=""9109""><form id=""kiat"" lang=""ceb"">kiat</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>restless</tr> and inclined to rowdy or bouncy actions. </trans>
<eg><i lang=""ceb"">Nagsáyaw sila inubanan sa kiat nga tugtug,</i><trans> They danced to the bouncy music. </trans></eg>
<eg><i lang=""ceb"">Kiat ka man kaáyu dì nadam-ag,</i><trans> You jump about all the time so you slipped and fell. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> immodestly forward toward men. </trans>
<eg><i lang=""ceb"">Dalì makúhà ang babáying kiat,</i><trans> One easily gets a loose woman. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> doing s.t. carelessly because one’s attention jumps to other matters. </trans>
<eg><i lang=""ceb"">Wà magkadimáu paglútù kay kiat man kaáyu,</i><trans> The dinner came out awful because she was so careless and heedless. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> get to be rowdy, unreserved in manners or restlessly inattentive. </trans>
</sense>
<sense n=""a""><number>a</number><trans> get to be immodest, unreserved towards men. </trans>
<eg><i lang=""ceb"">Nakiat siya tungud sa íyang pagkuyugkúyug ánang taga Manílà,</i><trans> She has become immodest due to her association with that girl from Manila. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> be intensely restless, careless or immodest. </trans>
<eg><i lang=""ceb"">Mikíat lang paglakaw, binyáan ang dinung-ag,</i><trans> She just walked off without thinking what she was doing, leaving the food on the fire.
</trans></eg>
</sense></hom></entry>");
