INSERT INTO `wced_translation` (entryid, translation) VALUES (9109, "restless");
INSERT INTO `wced_entry` VALUES (9110, "kiaykiay", "463", "<entry page=""463"" id=""9110""><form id=""kiaykixay"" lang=""ceb"">kiaykíay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>sway</tr> the hips. </trans>
<eg><i lang=""ceb"">Nagkiaykíay ang hawayána,</i><trans> The Hawaiian dancer is swaying her hips. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP]</itype><trans> walk around to exhibit oneself. </trans>
<eg><i lang=""ceb"">Sabadu ipanudlay, Duminggu ikiaykíay (ipakiaykíay),</i><trans> Saturday is to make oneself up. Sunday is to promenade. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> swaying of the hips or metaphorically, a similar action. </trans>
<eg><i lang=""ceb"">Ang kiaykíay sa mga dáhun nga gihurusan sa huyúhuy,</i><trans> The playing of the leaves in the breeze.
</trans></eg>
</sense></hom></entry>");
