INSERT INTO `wced_entry` VALUES (9111, "kiba", "463", "<entry page=""463"" id=""9111""><form id=""kibaq"" lang=""ceb"">kibà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; ab7c]</itype><trans> for liquids to spill over the top of a container, cause them to do so. </trans>
<eg><i lang=""ceb"">Paghínay arun dílì mukibà ang túbig sa baldi,</i><trans> Walk carefully so the water in the pail won’t spill. </trans></eg>
<eg><i lang=""ceb"">Kibai nang básu kay punù ra,</i><trans> Spill some of the water out of the glass because it’s too full. </trans></eg>
<eg><i lang=""ceb"">Anhà ikibà sa masitíra ang túbig,</i><trans> Toss the water onto the potted plant. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> liquid spilt over the top of a container.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9111, "kibà", "kiba", "m", "vn");
INSERT INTO `wced_entry` VALUES (9112, "kibad", "463", "<entry page=""463"" id=""9112""><form id=""kibad"" lang=""ceb"">kibad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> get out of a place without losing time. </trans>
<eg><i lang=""ceb"">Pag-abut sa kubradur mikibad ku sa kusína,</i><trans> When the bill collector arrived, I left on the double through the kitchen door. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> move by swiftly. </trans>
<eg><i lang=""ceb"">Mikibad lang ang dyit sa íyang paghangad,</i><trans> The jet just zoomed by when he looked up.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9112, "kibad", "kibad", "m", "v");
INSERT INTO `wced_entry` VALUES (9113, "kibag", "463", "<entry page=""463"" id=""9113""><form id=""kibag"" lang=""ceb"">kibag</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> behaving in a strange and socially unacceptable way: <tr>tactless</tr> in speech, oblivious to the propriety of what one is saying or doing. </trans>
<eg><i lang=""ceb"">Kibag ang íyang pamisti kay way nakabadlung níya,</i><trans> She dresses immodestly because no one ever told her what was proper. </trans></eg>
<eg><i lang=""ceb"">Kibága nímu uy! Dì tu níya mutsátsa. Asáwa tu,</i><trans> You idiot! That wasn’t a maid. That was his wife. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> not to the point, not reasonable. </trans>
<eg><i lang=""ceb"">Kibag tung ímung tubag. Swítu kug unsay nahitabù. Tug-áni kug kinsa,</i><trans> You didn’t answer my question. I know what happened so just tell me who did it. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1a""><number>1a</number> <itype>[B6; c6]</itype><trans> be, become <tr>improper</tr> in one’s behavior. </trans>
<eg><i lang=""ceb"">Ug mag-ismágul ka sa simbahan kibagan giyud ang mga táwu,</i><trans> If you wear rubber slippers to church, the people will consider it bad manners. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[AP; aP]</itype><trans> do s.t. in a socially unacceptable way. </trans>
<eg><i lang=""ceb"">‘Ma! Nía na ag yàyà,’ mipakibag ug singgit ang bátà,</i><trans> ‘Mom! The old goat you were talking about has arrived,’ shouted the little girl thoughtlessly. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP; aP]</itype><trans> get off the point, be unreasonable.
</trans>
</sense></hom></entry>");
