INSERT INTO `wced_entry` VALUES (9116, "kibkib", "463", "<entry page=""463"" id=""9116""><form id=""kibkib"" lang=""ceb"">kibkib</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab7]</itype><trans> wear down s.t. bit by bit with the front teeth. </trans>
<eg><i lang=""ceb"">Ákù lang kibkíbun ning lubi kay gáhì nang kuskúsun,</i><trans> I’ll just bite the coconut meat from its shell because it’s hard to scrape it out. </trans></eg>
<eg><i lang=""ceb"">Ang punúan sa kapáyas gikibkiban sa bábuy,</i><trans> The pig has nibbled away at the trunk of the papaya tree. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
