INSERT INTO `wced_entry` VALUES (9117, "kibra", "463", "<entry page=""463"" id=""9117""><form id=""kibra"" lang=""ceb"">kibra</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; ab7]</itype><trans> be <tr>decreased</tr>, be <tr>diminished</tr>. <pb n=""464""/></trans>
<eg><i lang=""ceb"">Usa ka kalihúkang nakakibra (nakapakibra) sa ákung pagmahal,</i><trans> An action which makes my love for you grow less. </trans></eg>
<eg><i lang=""ceb"">Kibráhan ang takus kay mahal na man,</i><trans> They give you less in a package because the price is going up. </trans></eg>
<eg><i lang=""ceb"">Dakù na ang kibra sa ákung timbang,</i><trans> I have lost a lot of weight. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> in a card game like rummy, deal a player a card which will force him to put down or discard cards he is holding—i.e., cause an opponent’s hand to diminish. </trans>
<eg><i lang=""ceb"">Nakakibra siya sa ákung baráha ug nahátag ku ang ákung gikuptan,</i><trans> He dealt me a card such that I had to open, and I relinquished the cards I had been saving. </trans></eg>
</sense></hom>
<entry><form id=""kibrada"" lang=""ceb""><abbr expan=""kibrada"" type=""lemma"">-da</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>downgrade</tr>. </trans>
<eg><i lang=""ceb"">Giatángan sila sa kibráda,</i><trans> They were ambushed at the downgrade. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>decrease</tr>. </trans>
<eg><i lang=""ceb"">Kibráda sa mga prisyu,</i><trans> Lowering of prices. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for the road to <tr>descend</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for s.t. to move downward, becoming less.
</trans>
</sense></hom></entry></entry>");
