INSERT INTO `wced_entry` VALUES (9118, "kibu", "464", "<entry page=""464"" id=""9118""><form id=""kibuq"" lang=""ceb"">kibù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B246]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. in reaction. </trans>
<eg><i lang=""ceb"">Wà siya mukibù dihang gitiúnan na,</i><trans> He didn’t move a muscle or say a word when I aimed at him. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B126]</itype><trans> be <tr>affected</tr>. </trans>
<eg><i lang=""ceb"">Wà giyud makakibù (makapakibù) ang mga balud sa sakayan,</i><trans> The waves had no <tr>effect</tr> on the boat. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A2; b(1)]</itype><trans> show signs of recognition upon meeting s.o. </trans>
<eg><i lang=""ceb"">Dì man lang ta nímu kibuan,</i><trans> You go by me as if you don’t know me. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A2; b(1)]</itype><trans> for the shoulders to be shrugged. </trans>
<eg><i lang=""ceb"">Ígù lang ku gikibuan sa abága. Wà ku níya klarúhig unsa,</i><trans> All he did was shrug his shoulders. He didn’t give me a clear answer. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#kibaq""><sc>kibà</sc></xr>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> movement in reaction. </trans>
</sense>
<sense n=""2""><number>2</number><trans> liquid spilled over. </trans>
</sense></hom>
<entry><form id=""pakibuq"" lang=""ceb""><abbr expan=""pakibù"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> move a part of the body in reaction: shrug the shoulders, nod the head, and the like.
</trans>
</sense></hom></entry></entry>");
