INSERT INTO `wced_entry` VALUES (9119, "kibul", "464", "<entry page=""464"" id=""9119""><form id=""kibul"" lang=""ceb"">kibul</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> having a <tr>cropped</tr> or <tr>cut-off</tr> tail. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for s.t. else to be cropped <tr>short</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> cut a tail off or short, usually of animals but by extension, also of fowl. </trans>
<eg><i lang=""ceb"">Kibulun nátù ang íkug sa ituy,</i><trans> Let’s cut off the puppy’s tail. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> cut s.t. else short. </trans>
<eg><i lang=""ceb"">Buhuk nga kibulan,</i><trans> Hair which was cut short. </trans></eg>
</sense></hom>
<entry><form id=""kakixbul"" lang=""ceb""><abbr expan=""kakíbul"" type=""lemma"">ka-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> with the tail cut short. </trans>
<eg><i lang=""ceb"">Tan-áwa ra ang irù nagkakíbul lang ang íkug,</i><trans> Look at the dog with its tail cut short.
