INSERT INTO `wced_entry` VALUES (9122, "kibul3", "464", "<entry page=""464"" id=""9122""><form id=""kixbul3"" lang=""ceb"">kíbul<sub>3</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B3(1)46]</itype><trans> for the spines of sea urchins to <tr>go deep into</tr> the skin; for the flesh of sea shells to recede into the inner part. </trans>
