INSERT INTO `wced_entry` VALUES (9123, "kibut", "464", "<entry page=""464"" id=""9123""><form id=""kixbut"" lang=""ceb"">kíbut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for the anus to move in contracting. </trans>
<eg><i lang=""ceb"">Huypa ang lubut sa manuk dì ba mukíbut,</i><trans> Blow on the chicken’s rear. See if <corr sic=""if"">it</corr> doesn’t <tr>twitch</tr>. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> for any part of the body to twitch. </trans>
<eg><i lang=""ceb"">Dúnay kusug nga kalit lang mukíbut,</i><trans> There are muscles that suddenly just twitch. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for the mouth to move in chewing or speaking. </trans>
<eg><i lang=""ceb"">Mikíbut ang íyang ngábil pagyamyam,</i><trans> Her lips moved as she uttered her prayers. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B256]</itype><trans> for a mass of s.t. to move in a somewhat wriggling fashion. </trans>
<eg><i lang=""ceb"">Nagkíbut ang mga úlud sa ginamus,</i><trans> The worms are wriggling over the preserved fish. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> movement of the anus or lips. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>anus</tr>. </trans>
</sense>
<sense n=""2a""><number>2a</number> <form id=""kixbut_nixmu_kixbut_nixya"" lang=""ceb""><abbr expan=""kíbut"" type=""lemma"">—</abbr> nímu, <abbr expan=""kíbut níya"" type=""lemma"">níya</abbr></form><trans> expression showing complete disbelief (lit. your anus) (not refined usage). </trans>
<eg><i lang=""ceb"">Madátù sa ímung kíbut!</i><trans> We couldn’t become rich, and you know it. </trans></eg>
<eg><i lang=""ceb"">Buta sa íyang kíbut. Makakità bayà siya,</i><trans> Blind, my foot (lit. his ass)! He can see.
</trans></eg>
</sense></hom></entry>");
