INSERT INTO `wced_entry` VALUES (9132, "kigi", "465", "<entry page=""465"" id=""9132""><form id=""kigi"" lang=""ceb"">kigi</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> strip fiber from a plant by running it between two things that squeeze out all matter but the fiber. </trans>
<eg><i lang=""ceb"">Magkigi siya ug lánut arun himúung písì,</i><trans> He’ll strip abaca fibers to make them into rope. </trans></eg>
<eg><i lang=""ceb"">Gikighan níya ang íyang útang nákù,</i><trans> He worked off his debt by stripping abaca. </trans></eg>
</sense></hom>
<entry><form id=""kilighan"" lang=""ceb"">kilighan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> abaca stripper. </trans>
</sense>
<sense n=""2""><number>2</number><trans> debt to be worked off by stripping abaca.
</trans>
</sense></hom></entry></entry>");
