INSERT INTO `wced_entry` VALUES (9133, "kigkig", "465", "<entry page=""465"" id=""9133""><form id=""kigkig"" lang=""ceb"">kigkig</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B46]</itype><trans> twitch in death spasms. </trans>
<eg><i lang=""ceb"">Nikigkig ang manuk pagkaigù sa tarì,</i><trans> The cock twitched in its death spasm when the gaff hit it. </trans></eg>
<eg><i lang=""ceb"">Maáyu rag mukigkig nang malditúha nà,</i><trans> If that devil dies (twitch in a death spasm), that will be fine by me. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B]</itype><trans> become very thin such that the bones become prominent. </trans>
<eg><i lang=""ceb"">Mukigkig ka giyud ug sígi kang gapulaw,</i><trans> You will become all skin and bones if you keep staying up late at night. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>shiver</tr> or <tr>shudder</tr> due to cold, fright. </trans>
<eg><i lang=""ceb"">Mikigkig siya sa katugnaw,</i><trans> He shivered with cold. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b6]</itype><trans> for water shaken off the fur to land on one. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[b6]</itype><trans> for s.t. to scratch itself in front of one. </trans>
</sense></hom>
<entry><form id=""pangigkig"" lang=""ceb""><abbr expan=""pangigkig"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> shake water off the fur. </trans>
<eg><i lang=""ceb"">Nangigkig ang irù gíkan sa ulan,</i><trans> The dog shook water off its body when it came in from the rain. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> scratch the body vigorously. </trans>
<eg><i lang=""ceb"">Síging pangigkig ang irù nga gikarapáta,</i><trans> The dog which is infested by fleas is constantly scratching. </trans></eg>
</sense></hom></entry>
<entry><form id=""kigkixgun"" lang=""ceb""><abbr expan=""kigkígun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> of a thin sort and not tending to get fat by nature.
</trans>
</sense></hom></entry></entry>");
