<sense n=""0""><trans> complaint in a lawsuit. </trans>
<eg><i lang=""ceb"">Ang kíha gidismis kay kúwang sa ibidinsiya,</i><trans> The case was dismissed for insufficiency of evidence. </trans></eg>
