INSERT INTO `wced_entry` VALUES (9148, "kikik1", "466", "<entry page=""466"" id=""9148""><form id=""kixkik"" lang=""ceb"">kíkik<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> bird which makes the sound <ix>kíkik</ix> which is said to accompany an <ix>úngù</ix> or, in other versions, which is a form the <ix>úngù</ix> takes. </trans>
</sense>
<sense n=""2""><number>2</number><trans> illegitimate woman <tr>abortionist</tr> (slang). </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> <tr>gold digger</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B126]</itype><trans> turn into a <ix>kíkik</ix> bird. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ab2]</itype><trans> for a <ix>kíkik</ix> to harass s.o. </trans>
<eg><i lang=""ceb"">Ug dúnay magkíkik sa manganak, patay ang ianak,</i><trans> If a <ix>kíkik</ix> harasses a mother in labor, the baby will be stillborn. </trans></eg>
</sense></hom>
<entry><form id=""pangixkik"" lang=""ceb""><abbr expan=""pangíkik"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> for a <ix>kíkik</ix> to go about its evil business.
</trans>
</sense></hom></entry></entry>");
