INSERT INTO `wced_entry` VALUES (9157, "kilas", "466", "<entry page=""466"" id=""9157""><form id=""kilas"" lang=""ceb"">kilas</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> characterized by making rapid and shifting movements. </trans>
<eg><i lang=""ceb"">Kilas ang talabánug kay dílì balansi,</i><trans> The kite is unsteady because it is not balanced. </trans></eg>
<eg><i lang=""ceb"">Kilas nga tugtug,</i><trans> Fast and lively song. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> moving about too much, roaming about. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> flirting too much with the opposite sex. </trans>
<eg><i lang=""ceb"">Ikaw, kay babáying kilas, buut rag ása makatulug,</i><trans> Since you are a woman who lets herself go all the time, you would agree to sleep anywhere. </trans></eg>
<eg><i lang=""ceb"">Bisag minyù ka na, kilas gihápun ka sa mga babáyi,</i><trans> Even though you are married you go after women too much. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be, become unsteady and shifting in motion. </trans>
<eg><i lang=""ceb"">Unsa guy nindut ánang kasing nga nagkilas?</i><trans> What’s so good about that top? It is unsteady. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> roam about, move about too much, get to have loose morals. </trans>
<eg><i lang=""ceb"">Ayaw pagkilas. Paúlì dáyun human sa klási,</i><trans> Don’t go roaming about. Come straight home after school.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9157, "kilas", "kilas", "m", "av");
INSERT INTO `wced_entry` VALUES (9158, "kilat", "466", "<entry page=""466"" id=""9158""><form id=""kixlat"" lang=""ceb"">kílat</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>lightning</tr>. </trans>
</sense></hom>
<entry><form id=""kusug_pa_sa_kixlat"" lang=""ceb"">kusug pa sa <abbr expan=""kílat"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> faster than greased lightning. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> for lightning to flash. </trans>
<eg><i lang=""ceb"">Mukílat gánì, dúna giyuy dalugdug,</i><trans> Where there is lightning, there is thunder. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""kilaxtan"" lang=""ceb""><abbr expan=""kilátan"" type=""lemma"">-an</abbr></form><trans> curse hoping lightning strikes s.o., esp. for doing s.t. immoral. </trans>
<eg><i lang=""ceb"">Nagpabaliw ang amahan ug anak. Kilátan pa untà,</i><trans> The father and daughter are having sexual relations. May lightning strike them! </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b(1)]</itype><trans> have a <tr>lucky break</tr> in a seemingly impossible situation (lit. have lightning flash at one). </trans>
<eg><i lang=""ceb"">Mupalit kug tíkit sa swipstiks uruy. Ug kilátan dì madátù unyà ku,</i><trans> I’ll buy a sweepstakes ticket. Who knows. If I get a lucky break, I’ll be rich. </trans></eg>
<eg><i lang=""ceb"">Musúkul ta bísag maáyu sila. Básin pag kilátan nga makadaug,</i><trans> We will play against them, strong as they are. Who knows we might get a break and win. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b6]</itype><trans> be done with <tr>lightning speed</tr>. </trans>
<eg><i lang=""ceb"">Gipanggútum ang kabatáan kay gikilátan lang ang pagkáun sa lamísa,</i><trans> The children must have been hungry because they finished their food with a lightning speed. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangilat"" lang=""ceb""><abbr expan=""pangilat"" type=""lemma"">paN-(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> for lightning to be flashing intensely. </trans>
<eg><i lang=""ceb"">Dautan ang panahun kay nagpangilat,</i><trans> The weather is bad and the sky is ablaze with flashes of lightning. </trans></eg>
</sense></hom></entry>
<entry><form id=""kilatnun"" lang=""ceb""><abbr expan=""kilatnun"" type=""lemma"">-nun</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> with lightning speed.
</trans>
</sense></hom></entry></entry>");
