INSERT INTO `wced_entry` VALUES (9165, "kiligkilig", "467", "<entry page=""467"" id=""9165""><form id=""kiligkilig"" lang=""ceb"">kiligkilig</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> <tr>shudder</tr> from cold or on experiencing s.t. that raises goose bumps; <tr>shake</tr> the body. </trans>
<eg><i lang=""ceb"">Nagkiligkilig kung nagtan-aw sa sud-an nga tambuk,</i><trans> I got goose pimples seeing the fatty food. </trans></eg>
<eg><i lang=""ceb"">Gikiligkiligan ku sa irù human nákug lígù áni,</i><trans> The dog shook off his water on me after I had bathed him.
