INSERT INTO `wced_entry` VALUES (9168, "kilikiti", "467", "<entry page=""467"" id=""9168""><form id=""kilikixti"" lang=""ceb"">kilikíti</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> make s.t. into a tight roll. </trans>
<eg><i lang=""ceb"">Nagkilikíti siyag papil nga gam-ung pabílu sa ribintadur,</i><trans> She made fine, tight rolls of paper to make into firecracker fuses. </trans></eg>
