<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> make motions with the palms or fingers of the sort one makes in rolling s.t. </trans>
<eg><i lang=""ceb"">Arun paglínis sa tablíya, kilikitíha (kilikit-a) ug maáyu ang buluníyu,</i><trans> In order to dissolve the chocolate, twirl the stirring stick between the palms. </trans></eg>
