INSERT INTO `wced_entry` VALUES (9172, "kiling", "467", "<entry page=""467"" id=""9172""><form id=""kixling"" lang=""ceb"">kíling</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>lean</tr>, <tr>list</tr> to one side. </trans>
<eg><i lang=""ceb"">Nikíling ang sakayan paghampak sa dagkung balud,</i><trans> The boat tilted because the waves lashed at it. </trans></eg>
<eg><i lang=""ceb"">Nagkiling ang túri sa Písa,</i><trans> The tower of Pisa is leaning. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> defect to the opposite side. </trans>
<eg><i lang=""ceb"">Ang ámung partídu mauy íyang gikilíngan,</i><trans> He defected to our political party. </trans></eg>
</sense></hom>
<entry><form id=""kiling"" lang=""ceb""><abbr expan=""kiling"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> listing, tilting to one side. </trans>
<eg><i lang=""ceb"">Kiling ning lamisáha,</i><trans> This table is tilting to one side.
</trans></eg>
</sense></hom></entry></entry>");
