INSERT INTO `wced_entry` VALUES (9180, "kilu", "467", "<entry page=""467"" id=""9180""><form id=""kixlu"" lang=""ceb"">kílu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>kilogram</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>weight</tr> as it comes out on the scale. </trans>
<eg><i lang=""ceb"">Mu rang kilúha, dinhi sa átug sa íla,</i><trans> It’ll come out to be the same weight, on our scale or theirs. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[c1]</itype><trans> buy or sell s.t. by the kilogram. </trans>
<eg><i lang=""ceb"">Kilúha (ikílu) pagbaligyà ang bwáhan,</i><trans> Sell the fruits by the kilogram. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> weigh. </trans>
<eg><i lang=""ceb"">Kilúhun ni nákung ripulyu,</i><trans> I will weigh the cabbage. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B256; a12]</itype><trans> be a kilogram. </trans>
</sense></hom>
<entry><form id=""kiluhan"" lang=""ceb"">kiluhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> scales graduated in kilos. </trans>
</sense></hom></entry>
<entry><form id=""kinixlu_kinilu"" lang=""ceb""><abbr expan=""kinílu"" type=""lemma"">-in-</abbr>, <abbr expan=""kinilu"" type=""lemma"">-in-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. measured <pb n=""468""/>by the kilo. </trans>
</sense>
<sense n=""2""><number>2</number><trans> sex on a business-like basis (as one would buy a kilogram of s.t.). </trans>
<eg><i lang=""ceb"">Gustu mu bang mupalit na lang kug kinilu?</i><trans> You want me to go to a prostitute (buy flesh by the kilogram)?
</trans></eg>
</sense></hom></entry></entry>");
