INSERT INTO `wced_entry` VALUES (9185, "kilya", "468", "<entry page=""468"" id=""9185""><form id=""kilya"" lang=""ceb"">kilya</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> an edge that is square. </trans>
<eg><i lang=""ceb"">Háit ra ang kilya sa lamísa,</i><trans> The square edge of the table is too sharp. </trans></eg>
</sense>
