INSERT INTO `wced_entry` VALUES (9212, "kimut, kimut, kim-ut", "469", "<entry page=""469"" id=""9212""><form id=""kimut_kixmut_kim-ut"" lang=""ceb"">kimut, kímut, kim-ut</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> murky, or dark such that it is difficult to see. </trans>
