INSERT INTO `wced_entry` VALUES (9215, "kinahangan, kinahanglan", "469", "<entry page=""469"" id=""9215""><form id=""kinahaxngan_kinahanglan"" lang=""ceb"">kinahángan, kinahanglan</form>
<hom>
<sense n=""0""><trans> (from <ix>hangul</ix>) <tr>should</tr>, <tr>must</tr>, it is <tr>necessary</tr>. </trans>
<eg><i lang=""ceb"">Kinahanglan (kinahanglang) magtuun ka arun makapasar ka,</i><trans> You must study if you wish to pass. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. needed, <tr>required</tr> for a particular thing. </trans>
<eg><i lang=""ceb"">Pilay ímung kinahanglan?</i><trans> How much do you need? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; a]</itype><trans> need, require. </trans>
<eg><i lang=""ceb"">Kun mulangyaw kita magkinahanglan (manginahanglan) giyud kitag bísa,</i><trans> When we travel abroad we need to have a visa. </trans></eg>
<eg><i lang=""ceb"">Gikinahanglan ka sa míting,</i><trans> You are needed at the meeting. </trans></eg>
<eg><i lang=""ceb"">Kinahanglánun kaáyu ang bitamína sa bátà,</i><trans> Vitamins are very necessary for children. </trans></eg>
</sense></hom>
<entry><form id=""panginahanglan"" lang=""ceb""><abbr expan=""panginahanglan"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>needs</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kinahanglanun"" lang=""ceb""><abbr expan=""kinahanglanun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. <tr>required</tr> in general, for general use. </trans>
<eg><i lang=""ceb"">Mau kiniy mga kinahanglanun sa iskuylahan,</i><trans> These are the things we need for school.
</trans></eg>
</sense></hom></entry></entry>");
