INSERT INTO `wced_entry` VALUES (9216, "kinaiya", "469", "<entry page=""469"" id=""9216""><form id=""kinaixya"" lang=""ceb"">kinaíya</form>
<hom>
<sense n=""0""><trans> (from <ix>siya</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>characteristic</tr> traits of s.t. or s.o.; the way it (he) is. </trans>
<eg><i lang=""ceb"">Maáyug kinaíyang bayhána,</i><trans> A woman good in her ways. </trans></eg>
<eg><i lang=""ceb"">Kinaíya giyud niánang tawhána nga matúlug lang kun mahubug,</i><trans> It’s that man’s characteristic just to fall asleep when he is drunk. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>natural</tr> thing for s.o. </trans>
<eg><i lang=""ceb"">Kinaíya sa asáwa nga mangabughù,</i><trans> It is natural for wives to get jealous. </trans></eg>
<eg><i lang=""ceb"">Kinaíya man nang bun-ug nga mapáyuk,</i><trans> It is natural for a bruise to be bluish. </trans></eg>
<eg><i lang=""ceb"">Kay wà man makatunghà, kinaíya níya nga dílì makabasa,</i><trans> He never went to school, so naturally he can’t read. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> genitalia (euphemism). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1246]</itype><trans> become one’s <tr>habit</tr>. </trans>
<eg><i lang=""ceb"">Nakinaíya na nákù karun ang pagmata ug sayu sa buntag,</i><trans> I have gotten into the habit of getting up early in the morning. </trans></eg>
</sense></hom>
<entry><form id=""kinaiyaxhan"" lang=""ceb"">kinaiyáhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>nature</tr>, the natural things one observes in the world: the sky, sea, mountains, trees, et al. </trans>
</sense></hom></entry>
<entry><form id=""kinaiyanhun"" lang=""ceb"">kinaiyanhun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> pertaining to nature.
</trans>
</sense></hom></entry></entry>");
