INSERT INTO `wced_entry` VALUES (9228, "kingas", "470", "<entry page=""470"" id=""9228""><form id=""kixngas"" lang=""ceb"">kíngas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2S; b6]</itype><trans> move about too much, be careless, lack poise and grace. </trans>
<eg><i lang=""ceb"">Mukíngas ang nawung ánang bayhána ug náay mga laláki. Malukup ug língì,</i><trans> That woman becomes restless when there are men around. She has to keep turning around to look at them. </trans></eg>
<eg><i lang=""ceb"">Nagkíngas ka man gud maung hintumban lang ang ákung tiil,</i><trans> You were so rowdy, you stepped on my foot. </trans></eg>
<eg><i lang=""ceb"">Ngánung makíngas man ang nawung ánang maistráha ug ubsirbahan?</i><trans> Why does that teacher get fidgety when her superior observes her? </trans></eg>
<eg><i lang=""ceb"">Nagkakíngas lang mu. Tan-áwa dì nabyaan ang átung bálun,</i><trans> You were so careless. Look, you left our lunch behind. </trans></eg>
</sense></hom>
<entry><form id=""kingas"" lang=""ceb""><abbr expan=""kingas"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>rowdy</tr>, carelessly inattentive.
