<entry><form id=""kalumingking_kulumingking_kumingking"" lang=""ceb""><abbr expan=""kalumingking"" type=""lemma"">-alum-</abbr>, <abbr expan=""kulumingking"" type=""lemma"">-ulum-</abbr>, <abbr expan=""kumingking"" type=""lemma"">-um-</abbr></form>
