INSERT INTO `wced_entry` VALUES (9239, "kinhas", "470", "<entry page=""470"" id=""9239""><form id=""kinhas"" lang=""ceb"">kinhas</form>
<hom>
<sense n=""0""><trans> (from <ix>hunas</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> gather seashells on tidal flats. </trans>
<eg><i lang=""ceb"">Sayun nang kinhásun kay magmata,</i><trans> It’s an easy k.o. shell to gather because it is open. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> go around caroling for money (slang). </trans>
</sense></hom>
<entry><form id=""pangihas"" lang=""ceb""><abbr expan=""pangihas"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b]</itype><trans> gather shells. </trans>
<eg><i lang=""ceb"">Manginhas ta inighunas,</i><trans> Let’s gather shells when it’s low tide. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b5]</itype><trans> get hold of money by any means whatsoever, usually dubious. </trans>
<eg><i lang=""ceb"">Manginhas kug ipangmadyung diri sa bulsa sa ákung bána,</i><trans> I’m going through my husband’s pockets to find some change to play mahjong with. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> go caroling for money (slang). </trans>
</sense></hom></entry>
<entry><form id=""kinhasun"" lang=""ceb""><abbr expan=""kinhasun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>seashells</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kininhasan"" lang=""ceb""><abbr expan=""kininhasan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> seashells one has gathered. </trans>
</sense>
<sense n=""2""><number>2</number><trans> money acquired by dubious ways. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> <pb n=""471""/>money acquired by caroling.
</trans>
</sense></hom></entry></entry>");
