INSERT INTO `wced_entry` VALUES (9241, "kini1", "471", "<entry page=""471"" id=""9241""><form id=""kini"" lang=""ceb"">kini<sub>1</sub></form>
<hom>
<sense n=""0""><trans> short forms: <bx>ni, king</bx> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>this</tr> (near speaker and person spoken to). </trans>
<eg><i lang=""ceb"">Pila man ni?</i><trans> How much is this? </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""mau_kinig_kini"" lang=""ceb"">mau <abbr expan=""kinig"" type=""lemma"">-g</abbr> <abbr expan=""kini"" type=""lemma"">—</abbr></form><trans> expression used in lieu of giving reasons or excuses why s.o. failed to do s.t. or cannot do s.t. </trans>
<eg><i lang=""ceb"">Mau kinig kini, mau kanag kanà ... Sus, daghan kaáyug katarúngan,</i><trans> Because of this and this, and that and that ... there’s no end to reasons why he couldn’t do it. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> this one now. </trans>
<eg><i lang=""ceb"">Tinúud na karun kining ákù,</i><trans> What I am saying now is true. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> this well-known kind of. </trans>
<eg><i lang=""ceb"">Natural, kay láin man ning kumbira ug walay bayli ug ínum!</i><trans> Of course! Because a (lit. this) party is no good without dancing or drinking. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> he, she (person just referred to). </trans>
<eg><i lang=""ceb"">Átù ning tabangan,</i><trans> Let’s gang up on him. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <form id=""kini_nga"" lang=""ceb""><abbr expan=""kini"" type=""lemma"">—</abbr> nga</form><trans> pause word used when one is hesitant about plunging into things. </trans>
<eg><i lang=""ceb"">Kining, nía ku kay dúna kuy ihangyù,</i><trans> Err, I came here because I have a request. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> this action of, when one does. </trans>
<eg><i lang=""ceb"">Uh, unsa gud ning ámut na pud!</i><trans> What’s all this stuff about contributions again! </trans></eg>
</sense>
<sense n=""4b""><number>4b</number><trans> when, at that time you know well. </trans>
<eg><i lang=""ceb"">Pag-abut níya sa íla, kining pagsaka níya sa íla,</i><trans> When he arrived home, when he went up the stairs. </trans></eg>
</sense></hom>
<entry><form id=""niixni_niaxni"" lang=""ceb"">niíni, niáni</form>
<hom>
<sense n=""0""><trans> gen., dat. </trans>
<eg><i lang=""ceb"">Niíni, nakat-un aku pag-amping,</i><trans> Because of this, I learned to be careful. </trans></eg>
<eg><i lang=""ceb"">Ang amahan niíni,</i><trans> His father. </trans></eg>
</sense></hom></entry>
<entry><form id=""ixni_axni"" lang=""ceb"">íni, áni</form>
<hom>
<sense n=""0""><trans> short for <bx>niíni, niáni</bx>.
</trans>
</sense></hom></entry></entry>");
