INSERT INTO `wced_entry` VALUES (9252, "kinta1, kinta1, kinta", "472", "<entry page=""472"" id=""9252""><form id=""kinta_kintaq_kinta4"" lang=""ceb"">kinta<sub>1,</sub> kintà<sub>1,</sub> kintǎ</form>
<hom>
<sense n=""1""><number>1</number><trans> let’s just consider how it would be—perhaps it is so, perhaps not. </trans>
<eg><i lang=""ceb"">Naghátag sila arun kinta pagpakítà sa kadaghánan,</i><trans> They gave some perhaps just for appearances’ sake (or perhaps in all honesty). </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> supposing that it is or will be the case. </trans>
<eg><i lang=""ceb"">Kinta nagtúu kang kináwat ku kadtu. Unsay pagtúu mu kanákù—kawatan?</i><trans> Supposing you think I stole it. What do you think I am, a thief? </trans></eg>
<eg><i lang=""ceb"">Kinta ig-adtu ku didtu, bayran na ku nímu?</i><trans> Let’s say I go there. Will you pay me? </trans></eg>
<eg><i lang=""ceb"">Kinta bungatan kag dyís, hangyúag dus,</i><trans> If he offers to sell it for, say, ten, offer two for it. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> let’s say for the sake of the game or the story. </trans>
<eg><i lang=""ceb"">Ang nakakuhag dyís puntus, kinta, muy mananáug,</i><trans> The one who gets, say, ten points wins. </trans></eg>
<eg><i lang=""ceb"">Ang gilay-un sa ílang balay gíkan sa ámù, ingun kinta dinhi ug ngadtu sa Kapitulyu,</i><trans> Their house was about as far from ours as, say, it is from here to the Capitol. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pretending to be. </trans>
<eg><i lang=""ceb"">Naghilak kinta ka, ayaw paila nga nagkumidiya,</i><trans> You’re supposed to be crying. Don’t let on you’re joking. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> since [so-and-so] is, after all, the case. </trans>
<eg><i lang=""ceb"">Ikaw man kintay pinyalan dinhi—ayúha pagdá ning ímung mga sákup,</i><trans> You’re supposed to be in charge here, so treat your men fairly. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""kay_kinta"" lang=""ceb"">kay <abbr expan=""kinta"" type=""lemma"">—</abbr></form><trans> why, is [so-and-so] really the case (when it shouldn’t be)? </trans>
<eg><i lang=""ceb"">Kay kinta ikaw bay magbuut dinhi?</i><trans> Why, do you think you have the right to have the say here? </trans></eg>
<eg><i lang=""ceb"">Kay kinta siya ra giyuy taypist—mangítà tag láin,</i><trans> What the hell. Does he think he’s the only typist in the world? We’ll look for another one. </trans></eg>
<eg><i lang=""ceb"">Kay kinta patrabahúun pa giyud kug maduminggu?</i><trans> What? Do I have to work on Sundays, too? </trans></eg>
</sense></hom>
<entry><form id=""kintaxhay"" lang=""ceb"">kintáhay</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kinta""><sc>kinta<sub>1</sub></sc></xr>, <i lang=""ceb"">1, 2.</i>
</trans>
</sense></hom></entry></entry>");
