INSERT INTO `wced_entry` VALUES (9254, "kinta2", "472", "<entry page=""472"" id=""9254""><form id=""kintaq2"" lang=""ceb"">kintà<sub>2</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for horses, dogs to be sprightly, <tr>frisky</tr>. </trans>
<eg><i lang=""ceb"">Ang ákung kabáyù batan-un, abtik, ug kintà,</i><trans> My horse is young, alert, and frisky. </trans></eg>
