<eg><i lang=""ceb"">Mukintà ang kabáyù nga laki basta dúul sa bayi,</i><trans> The male horse becomes frisky if there is a female around. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> be, become self-confident in a showy, posturing way.
</trans>
</sense></hom></entry>");
