<sense n=""0""> <itype>[A; c1]</itype><trans> draw the knees and thighs together. </trans>
<eg><i lang=""ceb"">Mikípì paglingkud ang nagmíni,</i><trans> The girl wearing a mini skirt sat with her knees drawn together. </trans></eg>
<eg><i lang=""ceb"">Kipía (ikípì) ang ímung mga páa inigkanáug nímu sa hagdan,</i><trans> Keep your legs together as you go down the stairs. </trans></eg>
</sense></hom>
<entry><form id=""kipiqkipiq"" lang=""ceb"">kipìkipì</form>
<hom role=""n""><pos>n</pos>
