INSERT INTO `wced_entry` VALUES (9270, "kiput1", "473", "<entry page=""473"" id=""9270""><form id=""kixput"" lang=""ceb"">kíput<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB2; ab7]</itype><trans> for an opening to become closed or s.t. exposed to get to be covered or hidden, cause it to do so. </trans>
<eg><i lang=""ceb"">Si Dyúli ang mikíput sa lungag sa bungbung,</i><trans> Jolly closed up the hole in the wall. </trans></eg>
<eg><i lang=""ceb"">Mikíput (nakíput) ang íyang mga mata ug hinílak,</i><trans> Her eyes became mere slits from crying. </trans></eg>
<eg><i lang=""ceb"">Kipútun ku nang ímung dakung bàbà,</i><trans> I’ll shut that big mouth of yours. </trans></eg>
<eg><i lang=""ceb"">Kipúti ug gamay nang ímung mga páa,</i><trans> Keep your legs more together. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> <tr>disappear</tr> from one’s sight in a flash. </trans>
<eg><i lang=""ceb"">Wà gánì siya makatimbayà nákù. Mikíput lang,</i><trans> He didn’t even greet me. He just flashed by me. </trans></eg>
</sense></hom>
<entry><form id=""kiput"" lang=""ceb""><abbr expan=""kiput"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#kixput""><sc>kíput<sub>1</sub></sc></xr>, <i lang=""ceb"">2.</i> </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; b2]</itype><trans> for the surface of the water or ground to be high enough to bury s.t. standing erect. </trans>
<eg><i lang=""ceb"">Lawum na ang buhù kay mikiput na sa ímung úlu,</i><trans> The pit is now deep enough because it is higher than your head. </trans></eg>
<eg><i lang=""ceb"">Inigtáub kiptan ang bungsud,</i><trans> When it’s high tide, the sea rises above the fish corral. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakixput"" lang=""ceb""><abbr expan=""pakíput"" type=""lemma"">pa-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> woman who plays hard to get. </trans>
<eg><i lang=""ceb"">Dì dáyun nà musugut nímu kay pakíput nang dakù,</i><trans> She won’t accept your love right away because she is great at playing hard to get. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> for a woman to play hard to get.
</trans>
</sense></hom></entry></entry>");
