INSERT INTO `wced_entry` VALUES (9276, "kiraw", "473", "<entry page=""473"" id=""9276""><form id=""kixraw"" lang=""ceb"">kíraw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>mess</tr>, <tr>mix things up</tr>. </trans>
<eg><i lang=""ceb"">Gikíraw ang ákung aparadur unyà wà hipúsa,</i><trans> S.o. messed up my closet without putting the things back. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> steal s.t. </trans>
<eg><i lang=""ceb"">Putlan kug kamut ang mikíraw sa alkansiya,</i><trans> I’ll cut off the hands of whoever stole the piggy bank. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> activity, hum of business. </trans>
<eg><i lang=""ceb"">Ang kíraw sa balay sa kaslunun,</i><trans> The hum of activity in the bride-to-be’s place. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> noisy, with confusion. </trans>
<eg><i lang=""ceb"">Dílì ku gustu muistǎr sa siyudad kay kíraw kaáyu,</i><trans> I do not want to stay in the city because it is very noisy. </trans></eg>
</sense></hom>
<entry><form id=""kirawan"" lang=""ceb""><abbr expan=""kirawan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a petty thief. </trans>
</sense></hom></entry>
<entry><form id=""kirawkiraw"" lang=""ceb"">kirawkiraw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> move about busily doing little chores. </trans>
<eg><i lang=""ceb"">Sígi gihápun ka dihang kirawkiraw bisag gabíi na kaáyu?</i><trans> You’re still very busy taking care of little things even if it’s already late?
</trans></eg>
</sense></hom></entry></entry>");
