INSERT INTO `wced_entry` VALUES (9280, "kirig", "474", "<entry page=""474"" id=""9280""><form id=""kixrig"" lang=""ceb"">kírig</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B246]</itype><trans> go into violent <tr>convulsions</tr>, usually leading to death. </trans>
<eg><i lang=""ceb"">Nikírig ang ilagà nga nakakaun sa hilu,</i><trans> The rat went into convulsions after eating the poison. </trans></eg>
</sense></hom>
<entry><form id=""kirigkirig"" lang=""ceb"">kirigkirig</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B456; c1]</itype><trans> for the body (or part of the body) to move, shiver, move in convulsions. </trans>
<eg><i lang=""ceb"">Mikirigkirig ang íyang kamut,</i><trans> His hands are shaking. </trans></eg>
<eg><i lang=""ceb"">Nagkirigkirig ang láwas sa mananayaw,</i><trans> The dancer wiggled her body furiously.
