INSERT INTO `wced_entry` VALUES (9286, "kiriw", "474", "<entry page=""474"" id=""9286""><form id=""kixriw"" lang=""ceb"">kíriw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S]</itype><trans> <tr>wriggle</tr>, move rapidly in a wriggling motion. </trans>
<eg><i lang=""ceb"">Mikíriw ang íkug sa tùtù nga naputul,</i><trans> The house lizard’s tail squirmed when it was cut off. </trans></eg>
<eg><i lang=""ceb"">Tudlù nga nagkiriw sa tikla,</i><trans> Fingers that flew over the keyboard. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A]</itype><trans> cause s.t. to move or wriggle about. </trans>
<eg><i lang=""ceb"">Nagkíriw na lang mig agipu pag-ulì,</i><trans> We lighted our way home by shaking a glowing stick back and forth. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2S]</itype><trans> wriggle with the itch to do s.t. </trans>
<eg><i lang=""ceb"">Magkiriw sa pagsáyaw ang ákung tiil ug dúnay sunáta,</i><trans> My foot itches to dance when there is music. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> steal s.t. of little value. </trans>
<eg><i lang=""ceb"">Bantáyi nang sinsilyu kay kiríwun unyà,</i><trans> Keep an eye on that change because s.o. might swipe it. </trans></eg>
</sense></hom>
<entry><form id=""kiriwan"" lang=""ceb""><abbr expan=""kiriwan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to swipe things.
