INSERT INTO `wced_entry` VALUES (9302, "kisaw", "475", "<entry page=""475"" id=""9302""><form id=""kixsaw"" lang=""ceb"">kísaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make a soft, pleasant rustling sound. </trans>
<eg><i lang=""ceb"">Mukísaw lang ang kalasangan ug huypun sa hángin,</i><trans> The forest rustles only when the wind blows through it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> disturb the water. </trans>
<eg><i lang=""ceb"">Ayaw kisáwa ang túbig kay dúnay namasul,</i><trans> Don’t disturb the water because s.o. is fishing. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B46]</itype><trans> hum with activity. </trans>
<eg><i lang=""ceb"">Magkísaw ang kusína ug mapista,</i><trans> The kitchen hums with activity during fiestas. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b6]</itype><trans> stir up, disturb the peace<corr>.</corr> </trans>
<eg><i lang=""ceb"">Nakísaw ang ílang pamuyù sa parinting niípun,</i><trans> The relatives which moved in with them disturbed their peace. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> confuse s.o.’s mind. </trans>
<eg><i lang=""ceb"">Usa ka dakung suliran mikísaw sa íyang kaisípan,</i><trans> A serious problem is disturbing his thoughts. </trans></eg>
<eg><i lang=""ceb"">Kisáwan kaáyu ku niánang dúwà nga madyung,</i><trans> I find mahjong very confusing. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> sound of rustling or splashing. </trans>
</sense>
<sense n=""2""><number>2</number><trans> activity. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> disturbing or confusing. </trans>
</sense></hom>
<entry><form id=""kakixsaw"" lang=""ceb""><abbr expan=""kakísaw"" type=""lemma"">ka-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kixsaw""><sc>kísaw</sc></xr>, <i lang=""ceb"">n</i>.
</trans>
</sense></hom></entry></entry>");
