INSERT INTO `wced_entry` VALUES (9303, "kisaykisay", "475", "<entry page=""475"" id=""9303""><form id=""kisaykixsay"" lang=""ceb"">kisaykísay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c1]</itype><trans> thrash the arms and legs around in water to stay afloat or thrash the legs and arms about while lying on the back. </trans>
<eg><i lang=""ceb"">Bísag dì makamaung mulanguy basta mukisaykísay (mangisaykísay) lang dílì giyud malumus,</i><trans> Even if you don’t know how to swim, if you thrash your arms and legs about, you won’t drown. </trans></eg>
<eg><i lang=""ceb"">Nagkisaykísay ang bátà sa kúna,</i><trans> The baby thrashed its arms and legs about in its crib.
</trans></eg>
</sense></hom></entry>");
