INSERT INTO `wced_entry` VALUES (9304, "kisdum", "475", "<entry page=""475"" id=""9304""><form id=""kisdum"" lang=""ceb"">kisdum</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; b6]</itype><trans> for the sky to darken. </trans>
<eg><i lang=""ceb"">Nagkisdum ang panahun kay may bagyung muabut,</i><trans> The weather is gloomy because a typhoon is coming. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; a2]</itype><trans> for the face to get a gloomy and frowning expression. </trans>
<eg><i lang=""ceb"">Nagkisdum ang nawung. Nasukù tingáli,</i><trans> He has a dark expression on his face. He must be angry.
</trans></eg>
