INSERT INTO `wced_entry` VALUES (9319, "kita", "475", "<entry page=""475"" id=""9319""><form id=""kita"" lang=""ceb"">kita</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>we</tr>, <tr>us</tr> (including person addressed—nominative). </trans>
<eg><i lang=""ceb"">Kita ra giyud way láin,</i><trans> Just us. No one else. <ix>Short form in position other <pb n=""476""/>than predicate</ix>: <bx>ta</bx>. </trans></eg>
<eg><i lang=""ceb"">Kinahanglan kita (ta) magbantay giyud,</i><trans> We must be on the alert. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> I, me (humble). </trans>
<eg><i lang=""ceb"">Makaagi ba ta áning karsadáha?</i><trans> May I pass on this road? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> you (patronizing). </trans>
<eg><i lang=""ceb"">Nindut man lagi ta ug sinínà run!</i><trans> My! Aren’t we wearing a pretty dress today! </trans></eg>
</sense></hom>
<entry><form id=""kitakixta"" lang=""ceb"">kitakíta</form>
<hom>
<sense n=""1""><number>1</number><trans> just us, no one else. </trans>
<eg><i lang=""ceb"">Kitakíta ra bítaw. Way kauláwan,</i><trans> It’s just us. There won’t be anyone to cause us embarrassment. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> one who promotes a love affair by carrying messages, arranging meetings and the like. </trans>
</sense>
<sense n=""3""><number>3</number><trans> distant relative. </trans>
<eg><i lang=""ceb"">Kitakíta si Pítir kay púrus mag-ágaw ang átung isig ka apuhan,</i><trans> Peter is our distant kin because our grandfathers are cousins. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. by ourselves. </trans>
<eg><i lang=""ceb"">Bída, nagkitakíta man lang ta ug trabáhu áni,</i><trans> My, we are doing the work (by) ourselves. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be the go-between in a love affair. </trans>
<eg><i lang=""ceb"">Kanang magkitakíta ka makapahanig nímu sa impiyirnu,</i><trans> If you act as a go-between, you’ll be sent to hell to pave the way for the lovers. </trans></eg>
</sense></hom></entry>
<entry><form id=""kitahaxnun"" lang=""ceb"">kitahánun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> related to us distantly or just coming from the same place. </trans>
<eg><i lang=""ceb"">Ayaw ug duhadúha ug pangáyù ug hinábang kay kitahánun ra ta,</i><trans> Don’t hesitate to ask help from me because we are relatives. </trans></eg>
</sense></hom></entry>
<entry><form id=""naxtuq"" lang=""ceb"">nátù</form>
<hom>
<sense n=""1""><number>1</number><trans> gen. form. <ix>short form</ix>: <bx>ta</bx>. </trans>
<eg><i lang=""ceb"">Dílì nátù (ta) buhátun,</i><trans> Let’s not do it. </trans></eg>
<eg><i lang=""ceb"">Kumusta na man ang kásu ta?</i><trans> How is our case coming along? </trans></eg>
</sense></hom></entry>
<entry><form id=""ta_ka_ta_ikaw_ta_kamu"" lang=""ceb"">ta ka, ta ikaw, ta kamu</form>
<hom>
<sense n=""0""><trans> I will [do] to you, you are my [noun]. </trans>
<eg><i lang=""ceb"">Ihatud ta ka (tikaw, ta ikaw) sa pultahan,</i><trans> I will see you to the door. </trans></eg>
<eg><i lang=""ceb"">Amígu ta ka,</i><trans> You are my friend. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#kanaxtuq""><sc>kanátù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""kanaxtuq"" lang=""ceb"">kanátù</form>
<hom>
<sense n=""0""><trans> dat. form. </trans>
<eg><i lang=""ceb"">Kanátung tulu usa ray dawátun,</i><trans> Of us three, only one will be accepted.</trans></eg>
<eg><i lang=""ceb""> Tingáli gitudlus níya kanátù (nátù) ganíha,</i><trans> Perhaps he gave it to us a while ago. </trans></eg>
</sense></hom></entry>
<entry><form id=""axtuq"" lang=""ceb"">átù</form>
<hom>
<sense n=""1""><number>1</number><trans> gen. </trans>
<eg><i lang=""ceb"">Ang átung balay,</i><trans> Our house. </trans></eg>
<eg><i lang=""ceb"">Átung tan-áwun,</i><trans> Let’s see. </trans></eg>
<eg><i lang=""ceb"">Átù ra kini,</i><trans> This is just between us. </trans></eg>
</sense></hom></entry>
<entry><form id=""unsa_may_axtuq"" lang=""ceb"">unsa may <abbr expan=""átù"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> what would you like. </trans>
<eg><i lang=""ceb"">Unsa may átù, kukakúla u bir?</i><trans> What would you like, Coca-cola or beer? </trans></eg>
</sense></hom></entry>
<entry><form id=""sa_axtuq_pa"" lang=""ceb"">sa <abbr expan=""átù"" type=""lemma"">—</abbr> pa</form>
<hom>
<sense n=""0""><trans> in other words<corr>.</corr> </trans>
<eg><i lang=""ceb"">Sa átù pa, ay na lang ug anhi kay way trabáhu,</i><trans> In other words, don’t come because there will be no work. </trans></eg>
</sense></hom></entry>
<entry><form id=""laxin_pay_axtuq"" lang=""ceb"">láin pay <abbr expan=""átù"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> by the way. </trans>
<eg><i lang=""ceb"">Láin pay átù, nakapamahaw ka na?</i><trans> By the way, have you had your breakfast yet? </trans></eg>
</sense></hom></entry>
<entry><form id=""atuaxnun"" lang=""ceb"">atuánun</form>
<hom>
<sense n=""0""><trans> coming from our place. </trans>
<eg><i lang=""ceb"">Ayaw panigláin. Atuánun ra ta,</i><trans> Make yourself at home. You’re from our place. </trans></eg>
</sense></hom></entry>
<entry><form id=""inaxtuq"" lang=""ceb"">inátù</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> informal, like at home. </trans>
<eg><i lang=""ceb"">Inátù lang ning kaúna,</i><trans> This is a simple dinner, just like at home. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> behave, do s.t. with informality. </trans>
</sense></hom></entry>
<entry><form id=""tagaaxtuq"" lang=""ceb"">tagaátù</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one coming from our place.
</trans>
</sense></hom></entry></entry>");
