INSERT INTO `wced_entry` VALUES (9321, "kitaipuni", "477", "<entry page=""477"" id=""9321""><form id=""kitaipuxni"" lang=""ceb"">kitaipúni</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>detachable</tr>, <tr>removable</tr>. </trans>
<eg><i lang=""ceb"">Kitaipúni ang ákung pustísu,</i><trans> My false teeth are detachable. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c1]</itype><trans> be detachable, removable. </trans>
<eg><i lang=""ceb"">Maáyung kitaipuníhun (ikitaipúni) ang sira sa tindáhan,</i><trans> It’s good to have the doors of a store that are removable.
</trans></eg>
</sense></hom></entry>");
