<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. longline sea fishing, done with a main line (<ix>baháyan</ix>) to which individual leaders with hooks are attached, for catching large fish. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; a2]</itype><trans> fish with the <ix>kitang</ix>.
</trans>
</sense></hom></entry>");
