INSERT INTO `wced_entry` VALUES (9324, "kitara2", "477", "<entry page=""477"" id=""9324""><form id=""kitaxra2"" lang=""ceb"">kitára<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>tantrum</tr>, a fit of ill-temper or caprice. </trans>
<eg><i lang=""ceb"">Mau giyuy ilíhuk sa kitára niánang batáa kun maghimatayun ang búlan,</i><trans> She always throws a fit of temper whenever the moon is in the last quarter. </trans></eg>
</sense></hom>
<entry><form id=""kitaraxhun"" lang=""ceb"">kitaráhun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> temperamental.
</trans>
</sense></hom></entry></entry>");
