INSERT INTO `wced_entry` VALUES (9327, "kitid", "477", "<entry page=""477"" id=""9327""><form id=""kixtid"" lang=""ceb"">kítid</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> taking short and hurried steps, or stamping the feet in place. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; aP]</itype><trans> walk with short, hurried steps. </trans>
<eg><i lang=""ceb"">Ang bátà mikítid pagsunud sa íyang pápa,</i><trans> The child walked with short and rapid steps following his father. </trans></eg>
</sense></hom>
<entry><form id=""kitid"" lang=""ceb""><abbr expan=""kitid"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> short in length or height. </trans>
<eg><i lang=""ceb"">Kitid ang ákung lápis sa pagginámit,</i><trans> My pencil is worn short after being used so much. </trans></eg>
<eg><i lang=""ceb"">Ang magulang kitid kay sa manghud kay dì man kaáyu mukáun,</i><trans> The elder child is shorter than the younger one because he doesn’t eat much. </trans></eg>
<eg><i lang=""ceb"">Kitid na ang mga sinínà run,</i><trans> They are wearing short dresses these days. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#kixtid""><sc>kítid</sc></xr>, <i lang=""ceb"">v</i>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[AB; ab7]</itype><trans> shorten, <tr>become short</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kitidkitid"" lang=""ceb"">kitidkitid</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> stamp the feet in place. </trans>
<eg><i lang=""ceb"">Nagkitidkitid ang bátà kay wà paubana,</i><trans> The child stamped his feet because they would not take him along.
</trans></eg>
</sense></hom></entry></entry>");
