INSERT INTO `wced_entry` VALUES (9328, "kitikut", "477", "<entry page=""477"" id=""9328""><form id=""kitixkut"" lang=""ceb"">kitíkut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; ac]</itype><trans> <tr>squeeze</tr> into or <tr>penetrate</tr> deeply and slowly into a very tight space. </trans>
<eg><i lang=""ceb"">Ang kasakit mikitíkut sa ákung kahiladman,</i><trans> The pain creeped deep into my innermost self. </trans></eg>
<eg><i lang=""ceb"">Ákù giyud nang kitikútun ngadtu arun ku makadúul sa artista,</i><trans> I’ll squeeze through the crowd to the front so I can get near the actress.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9328, "kitíkut", "kitikut", "m", "v");
