INSERT INTO `wced_entry` VALUES (9337, "kituy", "477", "<entry page=""477"" id=""9337""><form id=""kixtuy"" lang=""ceb"">kítuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S]</itype><trans> for the fingers or toes to twitch. </trans>
<eg><i lang=""ceb"">Búhì pa ang gipusil kay nagkítuy (nagkituy) pa ang tudlù,</i><trans> The man that was shot is still alive because his fingers are twitching. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> play close and open <pb n=""478""/>the palm with a baby. </trans>
<eg><i lang=""ceb"">Inigkatulu ka búlan makakítuy na ang kamut sa bátà,</i><trans> At the age of three months a baby can open and close its palms on command. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> expression used to induce a baby to open and close its hands. </trans>
<eg><i lang=""ceb"">Kítuy nang kítuy. Báyad sa tútuy,</i><trans> Open your palms to pay for your titty.
</trans></eg>
</sense></hom></entry>");
