INSERT INTO `wced_entry` VALUES (9341, "kiwa, kiwag, kiwag", "478", "<entry page=""478"" id=""9341""><form id=""kiwaq_kiwag_kixwag"" lang=""ceb"">kiwà, kiwag, kíwag</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> awkward because of self-consciousness or not knowing how to do s.t. well. </trans>
<eg><i lang=""ceb"">Kiwag ta sa trabáhu ug bag-u pa,</i><trans> We do things awkwardly when we’re new at them. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> be awkward or clumsy. </trans>
<eg><i lang=""ceb"">Mukíwag ang átung panlihuklihuk basta maúlaw ta,</i><trans> One tends to be awkward if he feels self-conscious. </trans></eg>
</sense></hom>
<entry><form id=""kiwag"" lang=""ceb""><abbr expan=""kiwag"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> for s.t. long to stick out prominently. </trans>
<eg><i lang=""ceb"">Nagkiwag ang ímung káhuy nga gibugkus,</i><trans> Some of the pieces of wood you bundled are sticking out. </trans></eg>
<eg><i lang=""ceb"">Nagkiwag ang ayis pik sa íyang bulsa,</i><trans> The ice pick stuck out of his pocket. </trans></eg>
<eg><i lang=""ceb"">Ayaw ikiwag ang ímung mga tiil sa agiánan,</i><trans> Don’t stick your feet into the passageway.
</trans></eg>
</sense></hom></entry></entry>");
