INSERT INTO `wced_entry` VALUES (9344, "kiwaw", "478", "<entry page=""478"" id=""9344""><form id=""kiwaw"" lang=""ceb"">kiwaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> awkward, esp. in movement, but also, by extension, in speech and behavior. </trans>
<eg><i lang=""ceb"">Kiwawng linihukan,</i><trans> Awkward movements. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> feel awkward. </trans>
<eg><i lang=""ceb"">Makiwaw ang pagbúhat áni basta primíru pa,</i><trans> One usually does this awkwardly the first time around. </trans></eg>
<eg><i lang=""ceb"">Kiwawan kung mulakaw nga magbirmúda,</i><trans> I feel awkward going out with bermuda shorts on.
</trans></eg>
</sense></hom></entry>");
