INSERT INTO `wced_entry` VALUES (9345, "kiwi, kiwi", "478", "<entry page=""478"" id=""9345""><form id=""kiwiq_kixwiq"" lang=""ceb"">kiwì, kíwì</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c1]</itype><trans> grow stiff or cramped in the joints, twisted out of shape. </trans>
<eg><i lang=""ceb"">Mikiwì ang íyang bàbà sa pagpangyam-id,</i><trans> She screwed up her mouth into a frown. </trans></eg>
<eg><i lang=""ceb"">Mikiwì ang tabla nga nainitan pag-áyu,</i><trans> The board got twisted out of shape in the sun. </trans></eg>
<eg><i lang=""ceb"">Nangíwì ákung tudlù ug hinílut,</i><trans> My fingers got stiff from massaging so much.
</trans></eg>
</sense></hom></entry>");
