INSERT INTO `wced_entry` VALUES (9352, "kiyaw", "478", "<entry page=""478"" id=""9352""><form id=""kixyaw"" lang=""ceb"">kíyaw</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> k.o. bird that stays on the ground. It is nearly as big as a wild chicken, and good to eat, named for its sound. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the cry or sound emitted by the <ix>kíyaw</ix> bird. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B46; a]</itype><trans> emit the sounds of <ix>kíyaw.</ix> </trans>
</sense>
