INSERT INTO `wced_entry` VALUES (9353, "kiyud", "478", "<entry page=""478"" id=""9353""><form id=""kixyud"" lang=""ceb"">kíyud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> thrust the lower part of the body forward, as <corr>a </corr>male does in sexual intercourse. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[AC; b]</itype><trans> have sexual intercourse (coarse, though not as taboo as <ix>iyut</ix>). </trans>
</sense></hom>
<entry><form id=""kiyudkiyud"" lang=""ceb"">kiyudkiyud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> keep moving the belly forward. </trans>
