INSERT INTO `wced_entry` VALUES (9364, "klaru", "479", "<entry page=""479"" id=""9364""><form id=""klaxru"" lang=""ceb"">kláru</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> clear, clearly defined and easily made out. </trans>
<eg><i lang=""ceb"">Kláru ning ritratúha,</i><trans> This picture is clear. </trans></eg>
<eg><i lang=""ceb"">Kláru dinhi ang Buhul,</i><trans> You can see Bohol clearly from here.</trans></eg>
<eg><i lang=""ceb""> Kláru ang tútuy sa hugut nga bistídu,</i><trans> Her breasts stand out clearly in her tight dress. </trans></eg>
<eg><i lang=""ceb"">Kláru siyang bakákun,</i><trans> She is obviously a liar. </trans></eg>
<eg><i lang=""ceb"">Kláru ang tíngug níya sa tilipunu,</i><trans> Her voice on the phone was clear. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""klaxru_na_lang"" lang=""ceb""><abbr expan=""kláru"" type=""lemma"">—</abbr> na lang</form><trans> obviously, naturally. </trans>
<eg><i lang=""ceb"">Kláru na lang mangísug siyag dì ka mananghid,</i><trans> Naturally, she will get angry if you don’t ask permission. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> unequivocal, definite. </trans>
<eg><i lang=""ceb"">Way kláru tung inyung panagsábut,</i><trans> Your agreement hasn’t come to any definite results. </trans></eg>
<eg><i lang=""ceb"">Kláru na ang kadaúgan,</i><trans> Victory is clearly in our hands. </trans></eg>
<eg><i lang=""ceb"">Kláru pa sa adlaw nga musubang sa sidlakan,</i><trans> As sure as the sun will rise in the East. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for vision or optical instruments to enable the user to discern clearly. </trans>
<eg><i lang=""ceb"">Kláru pa ang ákung panan-aw,</i><trans> I can still see clearly. </trans></eg>
<eg><i lang=""ceb"">Kláru ang mikruskupyu,</i><trans> The microscope offers a clear view. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12B2]</itype><trans> see clearly; be, become distinct and clear. </trans>
<eg><i lang=""ceb"">Makakláru lang kug tan-aw ug dúnay kibídu,</i><trans> I can see clearly only if I wear glasses. </trans></eg>
<eg><i lang=""ceb"">Makláru ang litra ug gamítan ug linti,</i><trans> The letters will be clear if you use a magnifying glass. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB12; c1]</itype><trans> become clear, apparent; make s.t. clear. </trans>
<eg><i lang=""ceb"">Ug nagkláru ka pa dì ka untà dudáhan,</i><trans> Had you made yourself clear, you won’t have been suspected. </trans></eg>
<eg><i lang=""ceb"">Sa katapúsan nakláru na giyud kun kinsay sad-an,</i><trans> At last it came out clearly who was the guilty party. </trans></eg>
<eg><i lang=""ceb"">Klarúha (ikláru) unsay ímung túyù,</i><trans> Make it clear what you really want. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; c]</itype><trans> <tr>tell s.o. frankly</tr>. </trans>
<eg><i lang=""ceb"">Klarúhan ta kang dì nà mahímù,</i><trans> I’ll tell you frankly that that can’t be done. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; a12]</itype><trans> go ahead and really do s.t., not just do it half-way or a semblance of it. </trans>
<eg><i lang=""ceb"">Nag-igwad-igwad kang bayúta ka. Kláruha na lang nag sáyaw,</i><trans> You wiggle your fanny so much when you walk, you fairy. Why don’t you just dance and be done with it? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a3]</itype><trans> <tr>find out</tr> for sure, make out s.t. clearly. </trans>
<eg><i lang=""ceb"">Nagkláru lang kug mangadtu ba ta run,</i><trans> I’m just trying to get it clear if we’re going or not. </trans></eg>
<eg><i lang=""ceb"">Nakakláru ka ba unsay íyang gisulti?</i><trans> Did you hear clearly what she said? </trans></eg>
<eg><i lang=""ceb"">Makláru ba ang ákung pustísu?</i><trans> Are my false teeth really obvious? </trans></eg>
</sense></hom>
<entry><form id=""klaruhay"" lang=""ceb"">klaruhay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C]</itype><trans> have s.t. clear with each other, tell each other frankly. </trans>
<eg><i lang=""ceb"">Sa katapúsan nagkaklaruhay na giyud sila unsáun pagbáyad sa útang,</i><trans> In the end they got it clear how to pay the debt.
</trans></eg>
</sense></hom></entry></entry>");
