INSERT INTO `wced_entry` VALUES (9446, "kuan", "482", "<entry page=""482"" id=""9446""><form id=""kuan"" lang=""ceb"">kuan</form>
<hom>
<sense n=""1""><number>1</number><trans> <ix>pause word used to fill in when the speaker cannot think of the right word:</ix> um, well. </trans>
<eg><i lang=""ceb"">Kining, kuan, Day! Ikúhà kug bir!</i><trans> Err, um, you. Bring me some beer. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> as a verb (with any affixes). </trans>
<eg><i lang=""ceb"">Human nímu pagkuan, pánit, ímung kuanun, pikásun, aw kuanan úsà, hugásan,</i><trans> After you um, whatchamacallit, peel it, you, umm, cut it up, rather um, wash it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> word used to avoid saying a taboo word. </trans>
<eg><i lang=""ceb"">Maáyung kusiun sa kuan,</i><trans> It would be nice to pinch her in the — you know (the genitalia). </trans></eg>
<eg><i lang=""ceb"">Pwirting kuánay níla,</i><trans> My how they were busy doing IT. </trans></eg>
</sense></hom>
<entry><form id=""pakuankuxan"" lang=""ceb"">pakuankúan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; b6]</itype><trans> pretend to be s.t. </trans>
<eg><i lang=""ceb"">Nagpakuankúan siyang dátù,</i><trans> He was pretending to be rich.
</trans></eg>
</sense></hom></entry></entry>");
