INSERT INTO `wced_entry` VALUES (9450, "kuba", "482", "<entry page=""482"" id=""9450""><form id=""kuba"" lang=""ceb"">kuba</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b4]</itype><trans> for the chest to tighten from fright or from suddenly realizing s.t. frightening. </trans>
<eg><i lang=""ceb"">Mikuba ang ákung dughan kay dihay misinggit,</i><trans> I got a tight feeling in my chest because I heard a scream. </trans></eg>
<eg><i lang=""ceb"">Gikubahan ku kay dinhay ákung nabyaan,</i><trans> I felt my chest tighten because I forgot s.t. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a pang in the chest from fright. </trans>
</sense></hom>
<entry><form id=""kuxba"" lang=""ceb""><abbr expan=""kúba"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b(1)]</itype><trans> for the heart to beat in a pounding way. </trans>
<eg><i lang=""ceb"">Nagkúba ákung dughan humag túngas sa bakilid,</i><trans> My heart pounded after I climbed the slope. </trans></eg>
</sense></hom></entry>
<entry><form id=""kubakuba"" lang=""ceb"">kubakuba</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> for the chest to pound wildly, repeatedly. </trans>
<eg><i lang=""ceb"">Nagkubakuba ang ákung dughan samtang nagtíun ku sa liyun,</i><trans> My heart pounded wildly as I aimed at the lion.
</trans></eg>
</sense></hom></entry></entry>");
