INSERT INTO `wced_entry` VALUES (9452, "kubad", "482", "<entry page=""482"" id=""9452""><form id=""kubad"" lang=""ceb"">kubad</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for children to be moving around too much, making a nuisance of themselves. </trans>
<eg><i lang=""ceb"">Dì ta makasuwat dinhi kay kubad kaáyu ning mga bataána,</i><trans> I can’t write properly because these children are running about too much. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> engaging in vice constantly. </trans>
<eg><i lang=""ceb"">Kubad na kaáyu siya sa panúgal,</i><trans> He is a constant gambler. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> thoughtless or tactless in speech. </trans>
<eg><i lang=""ceb"">Naghisgut sa ákung kirída atubángan sa ákung <pb n=""483""/>asáwa. Dì ba nà kubad?</i><trans> He talked about my girl friend in front of my wife. That’s what I call stupid. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> asking questions when one knows the answer.</trans>
<eg><i lang=""ceb""> Kubára nímu uy. Nakakità sa ákung gidala, nangutána pa,</i><trans> You sure are stupid. You saw what I brought, so why ask? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> move around too much. </trans>
</sense>
<sense n=""2""><number>2</number><trans> engage in a vice constantly. </trans>
<eg><i lang=""ceb"">Nakubad siya sa babáyi,</i><trans> He became woman crazy. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> become thoughtless in action and speech. </trans>
</sense>
<sense n=""4""><number>4</number><trans> do things quickly in a rapid, careless manner. </trans>
<eg><i lang=""ceb"">Mikubad man lang tug ági,</i><trans> He just walked by in a flash. </trans></eg>
<eg><i lang=""ceb"">Nagkubad ang bàbà ni Dyíni nga nakig-áway,</i><trans> Jenny’s mouth rattled away as she fought. </trans></eg>
</sense></hom>
<entry><form id=""kuxbad"" lang=""ceb""><abbr expan=""kúbad"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> move about much too much. </trans>
</sense>
<sense n=""2""><number>2</number><trans> engage in a vice to an extreme degree. </trans>
<eg><i lang=""ceb"">Mikúbad ang pinalitay sa balúta,</i><trans> There was rampant vote buying. </trans></eg>
<eg><i lang=""ceb"">Manday natigúwang, mikúbad sa pamabáyi,</i><trans> In his old age, he has gotten worse and worse in his lust for women.
</trans></eg>
</sense></hom></entry></entry>");
