INSERT INTO `wced_entry` VALUES (9463, "kubir", "483", "<entry page=""483"" id=""9463""><form id=""kuxbir"" lang=""ceb"">kúbir</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> cover. </trans>
<eg><i lang=""ceb"">Kúbir sa magasin,</i><trans> Magazine cover. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> amount charged per setting in a dinner party at a restaurant. </trans>
<eg><i lang=""ceb"">Tagsingku písus ang kúbir sa parti,</i><trans> The party will be five pesos per person. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> cover s.t. </trans>
<eg><i lang=""ceb"">Kubíri ang libru,</i><trans> Put a cover on the book. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> take cover, shelter. </trans>
<eg><i lang=""ceb"">Mukúbir ta ánang batu inigpinusílay,</i><trans> Let’s take cover behind that rock when the firing starts. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; b]</itype><trans> cover up for s.t. </trans>
<eg><i lang=""ceb"">Bisag unsay íyang buhátun kubíran dáyun sa inahan arun dì hibaw-an sa amahan,</i><trans> Whatever he does his mother will cover it up, so the father won’t find out. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; b]</itype><trans> shield s.o. in a ball game. </trans>
<eg><i lang=""ceb"">Kubíri ku samtang magdríbul ku,</i><trans> Cover me while I dribble. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a3]</itype><trans> be put on a magazine cover. </trans>
<eg><i lang=""ceb"">Makúbir si Imilda sa Layip,</i><trans> Imelda will be on the cover of Life. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A]</itype><trans> give s.t. news or radio-TV coverage. </trans>
<eg><i lang=""ceb"">Ang istasiyun sa radyu diway-ar-ip mauy nikúbir sa dakung súnug sa dálan kulun,</i><trans> Station DYRF covered the big fire on Colon Street. </trans></eg>
</sense></hom>
<entry><form id=""kubirkuxbir"" lang=""ceb"">kubirkúbir</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> <form id=""walaq_dixliq_kuxbir"" lang=""ceb"">walà, dílì <abbr expan=""kúbir"" type=""lemma"">—</abbr></form> be direct, keep nothing concealed where propriety would require the opposite. </trans>
<eg><i lang=""ceb"">Wà siya magkubirkúbir sa íyang pagkadisgrasyáda,</i><trans> She made no bones about not being a virgin. </trans></eg>
</sense></hom></entry>
<entry><form id=""way_kuxbir"" lang=""ceb"">way <abbr expan=""kúbir"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>frank</tr>, without concealing anything (when one should).
</trans>
</sense></hom></entry></entry>");
