INSERT INTO `wced_entry` VALUES (9466, "kubit", "483", "<entry page=""483"" id=""9466""><form id=""kubit"" lang=""ceb"">kubit</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> touch s.o., curling the fingers to get his attention. </trans>
<eg><i lang=""ceb"">Milíngì ku kay dihay ningkubit nákù,</i><trans> I turned around because s.o. poked me. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> turn to s.o. influential for help. </trans>
<eg><i lang=""ceb"">Dúna ba tay makubit didtu sa kustums?</i><trans> Do we have anybody influential to help us out in the custom? </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A1; a2b2]</itype><trans> steal s.t. not of great value. </trans>
<eg><i lang=""ceb"">Bantayi nà kay kubitun unyà nà,</i><trans> Keep an eye on it because s.o. might lift it. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A2; a12]</itype><trans> get a woman for illicit sex. </trans>
<eg><i lang=""ceb"">Wà giyuy mukubit niánang tigulánga,</i><trans> No one wants to have an affair with that old woman. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> take the bait. </trans>
<eg><i lang=""ceb"">Kusug mukubit ang isdà ánang paúna,</i><trans> Fishes like to take that k.o. bait. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A12; b4]</itype><trans> catch a fish by hook and line. </trans>
<eg><i lang=""ceb"">Nakakubit ang mananagat ug íhu,</i><trans> The fisherman caught a shark. </trans></eg>
<eg><i lang=""ceb"">Gikubitan kug bugáung,</i><trans> I caught a jarbua. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A2; a12]</itype><trans> hook s.o. in marriage. </trans>
<eg><i lang=""ceb"">Nakakubit siyag sapíang bálu,</i><trans> She hooked a rich widower. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number> <form id=""kubit_ug_way_paun"" lang=""ceb""><abbr expan=""kubit"" type=""lemma"">—</abbr> ug way paun</form><trans> </trans>
</sense>
<sense n=""2c1""><number>2c1</number><trans> confirm s.t. bad the interlocutor suspects but doesn’t know for sure by assuming that he does know for sure and letting out s.t. to confirm it. </trans>
<eg><i lang=""ceb"">Wà tà ka hibaw-i, ningkubit ka sa tagà nga way paun. <pb n=""484""/>Nabistu na hinúun,</i><trans> I wouldn’t have known about you but you took the bait. Now I found out. </trans></eg>
</sense>
<sense n=""2c2""><number>2c2</number><trans> butt in in a conversation where one has no business or answer remarks intended for s.o. else. </trans>
<eg><i lang=""ceb"">Dílì ikaw ang gisultíhan, ngánung mukubit ka man dihà nga way paun?</i><trans> I wasn’t talking to you. Why do you butt in when I wasn’t talking to you? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fish caught with hook and line. </trans>
</sense></hom>
<entry><form id=""kuxbit"" lang=""ceb""><abbr expan=""kúbit"" type=""lemma"">(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> biting of fish. </trans>
<eg><i lang=""ceb"">Hínay ang kúbit basta way súg,</i><trans> Fish don’t bite if there is no current.
</trans></eg>
</sense></hom></entry></entry>");
