INSERT INTO `wced_entry` VALUES (9467, "kubkub1", "484", "<entry page=""484"" id=""9467""><form id=""kubkub"" lang=""ceb"">kubkub<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> dig away dirt scooping it with the hands or with a similar motion using an instrument. </trans>
<eg><i lang=""ceb"">Gikubkub sa irù ang gilubung níyang bukug,</i><trans> The dog dug up the bones he had buried. </trans></eg>
<eg><i lang=""ceb"">Ilang kubkúbun (kubkúban) ang daplin sa sapà arun mutubig,</i><trans> They will dig a shallow hole next to the river to get water. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> shallow well made by scooping sand out in the vicinity of the river, seashore, or above an underground spring. </trans>
</sense></hom>
<entry><form id=""kubkuxbay"" lang=""ceb""><abbr expan=""kubkúbay"" type=""lemma"">-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. narrow spade or a long pole used to dislodge rocks. </trans>
</sense></hom></entry>
<entry><form id=""kubkubun"" lang=""ceb""><abbr expan=""kubkubun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> s.t. one can easily scoop out to dig a hole.
</trans>
</sense></hom></entry></entry>");
