INSERT INTO `wced_entry` VALUES (9480, "kubul", "484", "<entry page=""484"" id=""9480""><form id=""kubul"" lang=""ceb"">kubul</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for s.t. cooked to come out tough or hardened. </trans>
<eg><i lang=""ceb"">Mukubul ang pánit sa giasal kun dì humdan ug túbig,</i><trans> The roast pig skin becomes tough if it has been roasted without daubing water on it. </trans></eg>
<eg><i lang=""ceb"">Nagkakubul na ang kindi nga ákung gilútù,</i><trans> The candy I’m cooking is gradually hardening. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> become hardened, insensitive. </trans>
<eg><i lang=""ceb"">Mikubul (nakubul) na ang íyang kasingkásing sa tanang biaybíay,</i><trans> Her feelings have become hardened to any and all insults. </trans></eg>
<eg><i lang=""ceb"">Nagkakubul ang ákung láwas sa katugnaw,</i><trans> My body is gradually becoming inured to the cold. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> hardened. </trans>
</sense>
<sense n=""2""><number>2</number><trans> hardened in feelings, insensitive. </trans>
<eg><i lang=""ceb"">Kubul siya sa mga pakilúuy,</i><trans> She is insensitive to pleas for mercy. </trans></eg>
</sense></hom>
<entry><form id=""kublan"" lang=""ceb"">kublan</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> invulnerable. </trans>
<eg><i lang=""ceb"">Dì nà siya dutlan ug bála kay kublan,</i><trans> Bullets can’t pierce him because he is invincible. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#kubul""><sc>kubul</sc></xr>, a. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> become invulnerable.
</trans>
</sense></hom></entry></entry>");
