INSERT INTO `wced_entry` VALUES (9485, "kubus", "484", "<entry page=""484"" id=""9485""><form id=""kubus"" lang=""ceb"">kubus</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> low in amount. </trans>
