INSERT INTO `wced_entry` VALUES (9486, "kubut", "485", "<entry page=""485"" id=""9486""><form id=""kubut"" lang=""ceb"">kubut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; b(1)]</itype><trans> hold, take hold of s.t. </trans>
<eg><i lang=""ceb"">Kinsay nagkubut sa lyábi?</i><trans> Who has the key? </trans></eg>
<eg><i lang=""ceb"">Magkúbut ta arun dì ta magkabúwag,</i><trans> We’ll hold hands so that we won’t be separated. </trans></eg>
<eg><i lang=""ceb"">Nawálà ang lápis nga ákung gikubtan,</i><trans> The pencil I was holding got lost. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[AN; b6(1)N]</itype><trans> hold on to s.t. to keep from falling. </trans>
<eg><i lang=""ceb"">Nangubut (mikubut) siya nákù kay danglug,</i><trans> He held on to me because it was slippery. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A3; b8]</itype><trans> get hold of s.t. to have it. </trans>
<eg><i lang=""ceb"">Wà pa ku makakubut ánang kantidára,</i><trans> I had not held such an amount (of money). </trans></eg>
<eg><i lang=""ceb"">Hikubtan sa pulis ang kawatan nga miiskápu,</i><trans> The policeman happened to get hold of the thief who was about to escape. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A2]</itype><trans> hold on by sticking to it. </trans>
<eg><i lang=""ceb"">Ang iskats tip mukubut kaáyu sa átung papitlan niíni,</i><trans> Scotch tape adheres well to whatever you stick it to. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> occupy, hold a certain position or office. </trans>
<eg><i lang=""ceb"">Ang katungdanan nga íyang gikubtan,</i><trans> The position he is holding. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b26]</itype><trans> handle, play, operate. </trans>
<eg><i lang=""ceb"">Maáyu siyang mukubut sa sista,</i><trans> She plays the guitar well. </trans></eg>
<eg><i lang=""ceb"">Sipii ang nagkubut sa íyang libru sa tindáhan,</i><trans> A CPA takes care of the accounts in their store. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b(1)]</itype><trans> keep a mistress. </trans>
<eg><i lang=""ceb"">Dúna siyay gikubtan nga hustis,</i><trans> He has a night club hostess for a mistress. </trans></eg>
</sense></hom>
<entry><form id=""kuxbut"" lang=""ceb""><abbr expan=""kúbut"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> wed s.o. on his deathbed by just having the couple hold hands and blessing them. </trans>
<eg><i lang=""ceb"">Kadaghan na makakúbut ang párì ug himatyung páris nga nabúhì,</i><trans> The priest has officiated at many deathbed weddings where the dying partner recovered. </trans></eg>
</sense></hom></entry>
<entry><form id=""kubtanan"" lang=""ceb"">kubtanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> handle. </trans>
</sense></hom></entry>
<entry><form id=""kinubtaxnan"" lang=""ceb"">kinubtánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> keepsake among close friends or sweethearts.
</trans>
</sense></hom></entry></entry>");
