INSERT INTO `wced_entry` VALUES (9497, "kudkud", "485", "<entry page=""485"" id=""9497""><form id=""kudkud"" lang=""ceb"">kudkud</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>grind</tr> into fine pieces by rubbing or scraping. </trans>
<eg><i lang=""ceb"">Kudkúra ang lubi,</i><trans> Grate the coconut. </trans></eg>
<eg><i lang=""ceb"">Kudkura ang yílu,</i><trans> Take some shavings off the ice. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; a2]</itype><trans> carry s.o. astride the hips (from the notion that the way the child is carried is analogous to the coconut put over the shredder). </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> <tr>file off</tr> metal to clean it or thin it before sharpening it. </trans>
<eg><i lang=""ceb"">Kinahanglan kudkúrun kanang tayà sa suwab únà baíra,</i><trans> You should scrape the rust off the blade before you whet it. </trans></eg>
</sense></hom>
<entry><form id=""kudkuran"" lang=""ceb"">kudkuran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> coconut shredder.
</trans>
</sense></hom></entry></entry>");
