<eg><i lang=""ceb"">Kinsay mukudlis sa ímung hubag?</i><trans> Who will make an incision in your boil? </trans></eg>
<eg><i lang=""ceb"">Gikudlísan sa bátà ang bungbung ug krayúla,</i><trans> The baby marked up the wall with crayons. </trans></eg>
