INSERT INTO `wced_entry` VALUES (9500, "kudlit", "485", "<entry page=""485"" id=""9500""><form id=""kudlit"" lang=""ceb"">kudlit</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make a <tr>scratch</tr>, <tr>pinprick</tr>, or line on s.t. </trans>
<eg><i lang=""ceb"">Kasingkásing nga gikudlit sa buktun, papil, káhuy,</i><trans> A heart <corr sic=""tatooed"">tattooed</corr> on the arm, drawn on the paper, carved into the tree. </trans></eg>
<eg><i lang=""ceb"">Gikudlítan sa duktur ang hubag,</i> The doctor made an incision in the boil. <itype>[A; b]</itype><trans> </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>vaccinate</tr>. </trans>
<eg><i lang=""ceb"">Nía na ang nars nga mukudlit sa mga bátà,</i><trans> Here is the nurse to vaccinate (lit. prick) the children. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> change the palm configuration of a child that has the mark of a crocodile on his palm (<ix>buayáhun</ix>) which betokens ill. </trans>
<eg><i lang=""ceb"">Kinahanglang kudlítan ang buayáhun arun kabuhíag anak,</i><trans> A child that bears the mark of the crocodile on his palm should have it extended so his parents will not have all their children die <pb n=""486""/>on them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>write</tr> s.t. (literary). </trans>
<eg><i lang=""ceb"">Bálak nga gikudlit sa íyang dágang,</i><trans> The poem that his pen produced. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> lines, <tr>scratches</tr>, <tr>pinpricks</tr>. </trans>
</sense></hom>
<entry><form id=""kudlit_sa_paxlad"" lang=""ceb""><abbr expan=""kudlit"" type=""lemma"">—</abbr> sa pálad</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>lines in the palm</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one’s fate or fortune as indicated by the palm. </trans>
</sense></hom></entry>
<entry><form id=""pakudlit"" lang=""ceb""><abbr expan=""pakudlit"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab]</itype><trans> have oneself <corr sic=""innoculated"">inoculated</corr> or have the lines on the palm extended. </trans>
</sense></hom></entry>
<entry><form id=""kudlitanan"" lang=""ceb""><abbr expan=""kudlitanan"" type=""lemma"">-anan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> person to be <corr sic=""innoculated"">inoculated</corr>, place to be punctured, surface to be written on. </trans>
</sense></hom></entry>
<entry><form id=""kinudlit"" lang=""ceb""><abbr expan=""kinudlit"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> marks made. </trans>
</sense></hom></entry>
<entry><form id=""magkukudlit"" lang=""ceb""><abbr expan=""magkukudlit"" type=""lemma"">mag-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who <corr sic=""innoculates"">inoculates</corr> or tattoos.
</trans>
</sense></hom></entry></entry>");
