INSERT INTO `wced_entry` VALUES (9505, "kugal", "486", "<entry page=""486"" id=""9505""><form id=""kugal"" lang=""ceb"">kugal</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for the meat of fruit or eggs to be completely separated from the skin or the pit. </trans>
<eg><i lang=""ceb"">Daling panítan ang sambag kugal,</i><trans> It’s easy to peel ripe tamarinds when the skin is separated from the flesh. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2]</itype><trans> for the flesh to separate from the peelings or pit. </trans>
<eg><i lang=""ceb"">Mukugal ang lísu sa abukádu basta mahinug na,</i><trans> The seed in the avocado gets loose when it is ripe. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; b6]</itype><trans> for a cough to loosen. </trans>
<eg><i lang=""ceb"">Tambal nga makakugal (makapakugal) ning ubúha,</i><trans> Medicine that can loosen this cough.
</trans></eg>
</sense></hom></entry>");
