INSERT INTO `wced_entry` VALUES (9506, "kugan", "486", "<entry page=""486"" id=""9506""><form id=""kugan"" lang=""ceb"">kugan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>dry crust</tr>, <tr>scab</tr> of a sore or wound. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B4; b(1)]</itype><trans> for a scab to form. </trans>
<eg><i lang=""ceb"">Maáyu na ang núka kay mikugang (gikugangan) na,</i><trans> The sore is healing because it is forming a scab.
</trans></eg>
</sense></hom></entry>");
