INSERT INTO `wced_entry` VALUES (9507, "kugang1", "486", "<entry page=""486"" id=""9507""><form id=""kugang"" lang=""ceb"">kugang<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>startled</tr>. </trans>
<eg><i lang=""ceb"">Hastang kugánga nákù paglagpak sa sira,</i><trans> God! How that slamming door startled me! </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; b4(1)]</itype><trans> startle, be startled. </trans>
<eg><i lang=""ceb"">Nakugang (nakugangan) ku sa pagbutu sa ribintadur,</i><trans> I was startled when the firecracker burst. </trans></eg>
</sense></hom>
<entry><form id=""kugangkugang"" lang=""ceb"">kugangkugang</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> skin eruptions on some parts of the body of various sizes, thought to be caused by fear, fright, or being startled. This disease is usually diagnosed in small children and the cure is smoke treatment with the <ix>kugangkugang</ix> herb. </trans>
</sense>
<sense n=""2""><number>2</number><trans> low-growing, woody herb of waste places used to treat children who have the skin eruptions also called <ix>kugangkugang</ix>. The <ix>kugangkugang</ix> is set on fire just after sundown, and the child is made to inhale the smoke. The treatment is repeated for three consecutive afternoons.
</trans>
</sense></hom></entry></entry>");
