INSERT INTO `wced_entry` VALUES (9516, "kugi", "486", "<entry page=""486"" id=""9516""><form id=""kuxgi"" lang=""ceb"">kúgi</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> do s.t. with a little extra effort. </trans>
<eg><i lang=""ceb"">Wà giyud ninyuy nakakúgig limpiyu sa salug, nu?</i><trans> None of you ever took the initiative to clean the floor, did you? </trans></eg>
<eg><i lang=""ceb"">Ákù giyud ning gikugíhan ug trabáhu arun mahuman dáyun,</i><trans> I put in extra effort to finish the work quickly. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> extra effort put into s.t. </trans>
<eg><i lang=""ceb"">Walay kúgi nga dílì musangput sa kaayúhan,</i><trans> If you put in effort, it is bound to result in good. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> taking to doing certain things which require effort, doing them with enthusiasm. </trans>
