INSERT INTO `wced_entry` VALUES (9534, "kuha", "487", "<entry page=""487"" id=""9534""><form id=""kuxhaq"" lang=""ceb"">kúhà</form>
<hom>
<sense n=""0""><trans> <tr>get</tr> and <tr>bring</tr>, get and <tr>take away</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3S; ab7]</itype><trans> get. </trans>
<eg><i lang=""ceb"">Magkúhà kug túbig pára nímu,</i><trans> I’ll get you some water. </trans></eg>
<eg><i lang=""ceb"">Kuháa (kwáa) na ning mga plátu,</i><trans> Come, take these plates away. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; ab7]</itype><trans> take away, <tr>remove</tr>. </trans>
<eg><i lang=""ceb"">Makakúhà ning syampúha sa kaspa,</i><trans> This shampoo removes dandruff. </trans></eg>
<eg><i lang=""ceb"">Nakúhà ang ákung kasukù pagpangáyù níyag pasaylu,</i><trans> My anger vanished when she apologized. </trans></eg>
<eg><i lang=""ceb"">Ayaw nig kuhái (kwái),</i><trans> Don’t take any of this. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A; ab4(1)]</itype><trans> <tr>perform an abortion</tr>, have a miscarriage. </trans>
<eg><i lang=""ceb"">Way mananambal nga mukúhà sa ímung gisabak,</i><trans> No doctor will perform an abortion on you. </trans></eg>
<eg><i lang=""ceb"">Nakuháan siya human madakdak,</i><trans> She had had a miscarriage after she slipped and fell. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3S; a]</itype><trans> obtain. </trans>
<eg><i lang=""ceb"">Mikúhà kug lúti sa subdibisyun,</i><trans> I bought a lot from the subdivision. </trans></eg>
<eg><i lang=""ceb"">Nakakuhà si Pilimun ug tambasákan,</i><trans> Filemon caught a mudskipper (fish). </trans></eg>
<eg><i lang=""ceb"">Kuháan ta kag apidábit,</i><trans> I’ll get an affidavit from you. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A2]</itype><trans> <tr>get goods on credit</tr>. </trans>
<eg><i lang=""ceb"">Kúhà ug bugas sa íyang tindáhan,</i><trans> Get some rice at his store on credit. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; a12]</itype><trans> <tr>hire</tr> for service. </trans>
<eg><i lang=""ceb"">Si Isku lay ákung kuháun arun pagpanday sa kusína,</i><trans> I’ll hire Isko to repair the kitchen. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>be able to do s.t.</tr> </trans>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A3S; a2]</itype><trans> catch what s.o. said. </trans>
</sense>
<sense n=""3b""><number>3b</number><trans> <tr>imitate</tr>, catch on how to do s.t. by following what s.o. else does. </trans>
<eg><i lang=""ceb"">Kuháun ku ang dúyug pinaági sa pagpamínaw sa pláka,</i><trans> I’ll pick up the accompaniment by listening to the record. </trans></eg>
</sense>
<sense n=""3c""><number>3c</number><trans> have the capacity to do the sexual act. </trans>
<eg><i lang=""ceb"">Mukúhà ug tulu ka ráwun ang íyang bána,</i><trans> Her husband can do it three times in a row. </trans></eg>
</sense>
<sense n=""3d""><number>3d</number><trans> manage to get a girl to engage in sexual acts. </trans>
<eg><i lang=""ceb"">Húmuk siyang makúhà,</i><trans> It’ll be no trouble to get her for sexual intercourse. </trans></eg>
<eg><i lang=""ceb"">Ug dì musugut, kuháa sa kusug,</i><trans> If she doesn’t agree to do it, rape her. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>achievable</tr>. </trans>
<eg><i lang=""ceb"">Kúhà nákù nang nutáha,</i><trans> That note is very much within my range. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> action of getting s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. one got. </trans>
<eg><i lang=""ceb"">Pilay ímung kúhà sa mat?</i><trans> What did you get in Math? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>production of a photo</tr>. </trans>
<eg><i lang=""ceb"">Dì maáyu ang kúhà kun ngitngit,</i><trans> The picture doesn’t come out good if it’s too dark. </trans></eg>
</sense></hom>
<entry><form id=""kuhaq"" lang=""ceb""><abbr expan=""kuhà"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>catch</tr> of fish or game. </trans>
<eg><i lang=""ceb"">Way kuhà ang mananagat,</i><trans> The fisherman came home without any fish. </trans></eg>
</sense></hom></entry>
<entry><form id=""hinguxhaq"" lang=""ceb""><abbr expan=""hingúhà"" type=""lemma"">hiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b(1)]</itype><trans> get one’s livelihood from. <pb n=""488""/></trans>
<eg><i lang=""ceb"">Way láing gihinguháan níya sa paggastu sa pag-iskuyla gawas sa pagpabúy,</i><trans> He had no other source of income for his studies other than his wages as a servant. </trans></eg>
</sense></hom></entry>
