INSERT INTO `wced_entry` VALUES (9535, "kuhil", "488", "<entry page=""488"" id=""9535""><form id=""kuhil"" lang=""ceb"">kuhil</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>touch lightly</tr> against s.t. </trans>
<eg><i lang=""ceb"">Ákung gilíngì kun kinsa ang nagkuhil sa ákung buktun,</i><trans> I looked back to see who had touched my arm. </trans></eg>
<eg><i lang=""ceb"">Ígù lang nakakuhil ang dyíp sa awtu. Wà gánì makadlasi,</i><trans> The jeep just brushed against the car. It wasn’t even scratched. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> touch and disturb. </trans>
<eg><i lang=""ceb"">Ug kuhilun ning mga butang mailhan nákù,</i><trans> If anyone touches these things I’ll know right away.
</trans></eg>
</sense></hom></entry>");
