INSERT INTO `wced_entry` VALUES (9536, "kuhin", "488", "<entry page=""488"" id=""9536""><form id=""kuhin"" lang=""ceb"">kuhin</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a <tr>cushion</tr> or soft pad for sitting or kneeling on. </trans>
</sense>
<sense n=""2""><number>2</number><trans> special church wedding where there is a special white cloth for the bride and groom to walk over. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> use, put s.t. as soft cushion. </trans>
<eg><i lang=""ceb"">Átung kuhinan ang lingkuránan sa dyíp,</i><trans> Let’s put cushions on the seats of the jeep. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> hold a special wedding. </trans>
<eg><i lang=""ceb"">Kuhinun (ikuhin) kunu ang kasal maung nangútang,</i><trans> The wedding will be special. That’s why they are going around borrowing money.
</trans></eg>
</sense></hom></entry>");
