INSERT INTO `wced_entry` VALUES (9537, "kuhir", "488", "<entry page=""488"" id=""9537""><form id=""kuhir"" lang=""ceb"">kuhir</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> reach a certain number of points agreed to as the winning score in billiards or pool. </trans>
<eg><i lang=""ceb"">Ug makakuhir siyag dyís, daug na kay mauy íyang wíting,</i><trans> If he gets ten (by hitting the number ten ball into the pocket), he will win because he needs ten points to reach the number we agreed to.
</trans></eg>
</sense></hom></entry>");
