INSERT INTO `wced_entry` VALUES (9538, "kuhit", "488", "<entry page=""488"" id=""9538""><form id=""kuxhit"" lang=""ceb"">kúhit</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>poke</tr>, <tr>jab</tr>, <tr>touch</tr> s.t. with the fingers or s.t. long to remove or obtain it. </trans>
<eg><i lang=""ceb"">Kuhíta nang búla nga nasaling-it sa sandayung,</i><trans> Poke the ball that is stuck in the gutter. </trans></eg>
<eg><i lang=""ceb"">Kuhíti akug bayábas,</i><trans> Knock a guava down for me. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> touch s.o. by curling the fingers to attract his attention. </trans>
<eg><i lang=""ceb"">Milíngì ku dihang may mikúhit nákù,</i><trans> I looked back when s.o. touched me. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[AN; a12]</itype><trans> <tr>approach s.o. influential to ask for a favor</tr>. </trans>
<eg><i lang=""ceb"">Ug mikúhit (nangúhit) ka pa nákù dì untà ka madá sa prisintu,</i><trans> Had you approached me you would not have been brought to the police station. </trans></eg>
</sense></hom>
<entry><form id=""kuhit"" lang=""ceb""><abbr expan=""kuhit"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> stick to get s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> thin, tapering stick with a slit in it used in the process of weaving designs to catch hold of strips of grasses or palms that are being woven. </trans>
</sense>
<sense n=""3""><number>3</number><trans> hook used in embroidery to catch hold of threads.
</trans>
</sense></hom></entry></entry>");
