INSERT INTO `wced_entry` VALUES (9545, "kuku", "488", "<entry page=""488"" id=""9545""><form id=""kuku"" lang=""ceb"">kuku</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>fingernails</tr>, <tr>toenails</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>claws</tr>, <tr>hooves</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b]</itype><trans> get caught or hit by the claws. </trans>
