INSERT INTO `wced_entry` VALUES (9556, "kul1", "488", "<entry page=""488"" id=""9556""><form id=""kuxl"" lang=""ceb"">kúl<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>phone call</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a summons to duty, need. </trans>
<eg><i lang=""ceb"">Dúnay kúl ang duktur bísag gabíi,</i><trans> A doctor gets calls even at night. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> a bet or <pb n=""489""/>bid shouted or called out (without giving money). </trans>
</sense>
<sense n=""4""><number>4</number><trans> <tr>invitation to drink at s.o.’s expense</tr>. </trans>
<eg><i lang=""ceb"">Adtu ta sa Dayamun Táwir kay ákù rung kúl,</i><trans> Let’s go to the Diamond Tower. It’s my treat. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>call on the phone</tr>. </trans>
<eg><i lang=""ceb"">Dúna ruy mukúl nákug lungdistans,</i><trans> S.o. will call me up long distance today. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>call s.o. to duty</tr>. </trans>
<eg><i lang=""ceb"">Gikúl siya sa armi,</i><trans> He was called into the army. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> give or accept a bet without showing cash. </trans>
<eg><i lang=""ceb"">Kúlun ku ang ímung pusta bisag pila,</i><trans> I’ll accept whatever bet you offer. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2; c1]</itype><trans> accept a challenge to a fight or contest. </trans>
<eg><i lang=""ceb"">Ug áway ímung gustu, mukúl ku,</i><trans> If you want a fight, I’ll take you up on it. </trans></eg>
</sense></hom>
<entry><form id=""kuxlay"" lang=""ceb""><abbr expan=""kúlay"" type=""lemma"">-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> system of betting without showing money.
</trans>
</sense></hom></entry></entry>");
