INSERT INTO `wced_entry` VALUES (9573, "kulambut", "489", "<entry page=""489"" id=""9573""><form id=""kulambut"" lang=""ceb"">kulambut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> tie a string across a row of strings, crisscross fashion, to make netting for s.t. to protect or secure it. </trans>
<eg><i lang=""ceb"">Magkulambut ku sa bàbà sa baskit sa itlug,</i><trans> I’ll crisscross strings across the mouth of the basket of eggs. </trans></eg>
<eg><i lang=""ceb"">Dì na mabungkag nang kartun kay gikulambútan na ug maáyu,</i><trans> This bundle of boxes won’t get untied because I have tied it securely in a crisscross fashion. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; ac1]</itype><trans> make or attach a leader in longline fishing. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> <tr>wrap</tr> oneself up entirely in a blanket. </trans>
<eg><i lang=""ceb"">Nagkulambut siya kay gitugnaw,</i><trans> He wrapped himself up with a blanket because he felt cold. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> string used in longline fishing connecting the hook with the main line or the leader with another ganging line. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>blanket</tr>.
</trans>
</sense></hom></entry>");
