INSERT INTO `wced_entry` VALUES (9586, "kulap, kulap", "490", "<entry page=""490"" id=""9586""><form id=""kulap_kuxlap"" lang=""ceb"">kulap, kúlap</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>dim</tr>, not affording much light; or for the eyes to be dim. </trans>
<eg><i lang=""ceb"">Ang kaháyag sa sugà nga lána kulap kaáyu,</i><trans> The light of the oil lamp is very dim. </trans></eg>
