<sense n=""0""> <itype>[B; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for light or vision to <tr>dim</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for one’s popularity to fade. </trans>
<eg><i lang=""ceb"">Nagkakulap na ang kabantug ni Ilbis Prisli,</i><trans> Elvis Presley’s popularity is fading. </trans></eg>
</sense></hom>
<entry><form id=""kulapkuxlap"" lang=""ceb"">kulapkúlap</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; c1]</itype><trans> <tr>blink</tr> the eyes. </trans>
<eg><i lang=""ceb"">Nagkuwapkúwap ang ákung mata sa kasulaw sa adlaw,</i><trans> My eyes are blinking in the glare of the sun.
</trans></eg>
</sense></hom></entry></entry>");
