INSERT INTO `wced_entry` VALUES (9590, "kulaput", "490", "<entry page=""490"" id=""9590""><form id=""kulaxput"" lang=""ceb"">kuláput</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> <tr>twine around</tr> s.t. </trans>
<eg><i lang=""ceb"">Putla nang kalabásà nga nagkuláput sa kapáyas,</i><trans> Cut down the squash that is entwined around the papaya tree. </trans></eg>
<eg><i lang=""ceb"">Ikuláput ang ímung buktun sa ákung líug,</i><trans> Twine your arm around my neck. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2SN; b6]</itype><trans> cling to s.t. by twining s.t. long around it. </trans>
<eg><i lang=""ceb"">Ungguy nga nagkulaput (nanguláput) sa sanga,</i><trans> A monkey clinging to the branch.
