</sense></hom>
<entry><form id=""kulixun_kuliaxnun"" lang=""ceb""><abbr expan=""kulíun"" type=""lemma"">-un</abbr>, <abbr expan=""kuliánun"" type=""lemma"">-ánun</abbr></form>
