<sense n=""0""><trans> confused due to old age. </trans>
<eg><i lang=""ceb"">Kuliánun na si Lúlu. Ábi níyag ang íya kung anak,</i><trans> Grandfather has gotten confused now. He thinks I’m his son.
</trans></eg>
</sense></hom></entry></entry>");
