INSERT INTO `wced_entry` VALUES (9615, "kulihad, kulihad", "491", "<entry page=""491"" id=""9615""><form id=""kulixhad_kuliqhad"" lang=""ceb"">kulíhad, kulìhad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; c]</itype><trans> loosen phlegm <pb n=""492""/>in the throat and expel it. </trans>
<eg><i lang=""ceb"">Humag pangíhì, nangulíhad siya ug nanglup-ad,</i><trans> After urinating he loosened his <corr sic=""phelgm"">phlegm</corr> and spat out. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23N; b]</itype><trans> <tr>clear out phlegm in the throat</tr> as a sign of derision or contempt. </trans>
<eg><i lang=""ceb"">Mangulíhad (mukulíhad) dáyun ang Dunyag náay pubring mangulitáwu sa íyang anak,</i><trans> The Doña clears her throat in contempt as soon as a poor man comes to pay a call on her daughter. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> derision and contempt. </trans>
<eg><i lang=""ceb"">Giantus ni Magdalína ang mga pagbiaybíay ug kulíhad sa katawhan,</i><trans> Magdalene endured all the people’s derision and contempt. </trans></eg>
</sense></hom>
<entry><form id=""kinulixhad"" lang=""ceb""><abbr expan=""kinulíhad"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. <tr>expectorated</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pangulixhad"" lang=""ceb""><abbr expan=""pangulíhad"" type=""lemma"">paN-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kulixhad""><sc>kulíhad</sc></xr>, <i lang=""ceb"">n</i>.
</trans>
</sense></hom></entry></entry>");
