INSERT INTO `wced_entry` VALUES (9620, "kulikta", "492", "<entry page=""492"" id=""9620""><form id=""kulikta"" lang=""ceb"">kulikta</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> <tr>collect</tr>, give payments, usually not for any pre-existing contractual obligations. </trans>
<eg><i lang=""ceb"">Nagkulikta siyag dilihinsya sa mga draybir,</i><trans> He is collecting protection money from drivers. </trans></eg>
<eg><i lang=""ceb"">Gikuliktáhan ku ug ámut pára sa simbahan,</i><trans> They collected a donation for the church from me. </trans></eg>
<eg><i lang=""ceb"">Písu ang ákung ikulikta,</i><trans> I’ll give one peso for the collection. </trans></eg>
