<sense n=""3""><number>3</number> <itype>[A1]</itype><trans> come to the part of the church service where the offering is collected. </trans>
<eg><i lang=""ceb"">Nagkulikta na pag-abut nákù,</i><trans> The offering was already being passed when I arrived. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> money collected from payments, dues, taxes, etc. </trans>
</sense>
<sense n=""2""><number>2</number><trans> items collected or gathered for one’s hobby. </trans>
