INSERT INTO `wced_entry` VALUES (9663, "kulkul", "494", "<entry page=""494"" id=""9663""><form id=""kulkul"" lang=""ceb"">kulkul</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> grow to be gnarled, curled up. </trans>
<eg><i lang=""ceb"">Mukulkul untà ang mga tudlù sa nagkúhà adtu,</i><trans> May the fingers of the person who stole it stiffen with arthritis. </trans></eg>
<eg><i lang=""ceb"">Mikulkul ang tinubúan sa káhuy,</i><trans> The tree grew into a gnarled mass. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> shrink back in fear. </trans>
<eg><i lang=""ceb"">Mukulkul sa kahadluk ang ímung irù ug pirming bunálan,</i><trans> Your dog will shrink back in fear if you constantly beat it. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> withdraw, back out from an undertaking out of apprehension. </trans>
<eg><i lang=""ceb"">Ngánung mikulkul ka sa ímung nigusyu?</i><trans> Why have you gone out of business? a curled up stiff. </trans></eg>
</sense></hom>
