INSERT INTO `wced_entry` VALUES (9664, "kultibar", "494", "<entry page=""494"" id=""9664""><form id=""kultibar"" lang=""ceb"">kultibar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>cultivate</tr> land for growing crops. </trans>
<eg><i lang=""ceb"">Kultibahun ku ning luyu sa balay arun tamnan kug mga utanun,</i><trans> I will dig up the back of my house to grow vegetables. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> use up, get rid of. </trans>
<eg><i lang=""ceb"">Ang ákung mga anak mauy mikultibar sa kík,</i><trans> My children ate all the cake. </trans></eg>
<eg><i lang=""ceb"">Ang banggiítang kwirpu sa mga sikríta mauy nakakultibar sa nanaghítak nga sugálan,</i><trans> The crack group of detectives rid the place of gambling dens. </trans></eg>
<eg><i lang=""ceb"">Kultibahun lang sa lídir sa kandidátu ang kwarta, dílì ipamalit ug balúta,</i><trans> The leader of the candidate just pockets all the money for himself. He won’t use it for buying ballots. </trans></eg>
</sense></hom>
<entry><form id=""kultibaxdu"" lang=""ceb"">kultibádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>cultivated land</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> all eaten up or drunk. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1246]</itype><trans> become cultivated land. </trans>
<eg><i lang=""ceb"">Ang yútà níya sa Mindanaw may kagulángan ug may nakultibádu na,</i><trans> He has forest lands in Mindanao and also some which are now cultivated.
</trans></eg>
</sense></hom></entry></entry>");
