INSERT INTO `wced_entry` VALUES (9669, "kulu1", "494", "<entry page=""494"" id=""9669""><form id=""kulu"" lang=""ceb"">kulu<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> use s.t. awkwardly because of unfamiliarity. </trans>
<eg><i lang=""ceb"">Daghan siyag sayup kay gikulhan pa sa bag-ung aybíim,</i><trans> He made lots of mistakes because he doesn’t have the feel for the new IBM machine yet. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be awkward, nervous. </trans>
<eg><i lang=""ceb"">Wà ka kulhi nga nikanta sa daghang táwu?</i><trans> Did you not feel nervous singing in front of all those people? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b4]</itype><trans> be unable to react upon seeing violence due to fear. </trans>
<eg><i lang=""ceb"">Gikúhan ku pagkakità nákus bátà nga naligsan,</i><trans> I was transfixed when I saw the child run over. </trans></eg>
</sense></hom>
<entry><form id=""kulhaxnun"" lang=""ceb"">kulhánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> operating s.t. awkwardly because of unfamiliarity. </trans>
</sense>
<sense n=""2""><number>2</number><trans> nervous, fearful, apprehensive. </trans>
<eg><i lang=""ceb"">Dì ka giyud makat-un ug dráyib kay kulhánun kaáyu ka,</i><trans> You’ll never learn how to drive, you’re so nervous. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> become nervous, fearful. </trans>
</sense></hom></entry>
<entry><form id=""kakulhaxnun"" lang=""ceb"">kakulhánun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fearfulness, timidity. </trans>
<eg><i lang=""ceb"">Tungud sa íyang kakulhánun wà gihápun siya makaabla níya,</i><trans> He is so timid he hasn’t brought himself to tell her he loves her.
</trans></eg>
</sense></hom></entry></entry>");
