INSERT INTO `wced_entry` VALUES (9671, "kulu", "494", "<entry page=""494"" id=""9671""><form id=""kuxluq"" lang=""ceb"">kúlù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B23(1); b4(1)]</itype><trans> <tr>shrink</tr> in length or width. </trans>
<eg><i lang=""ceb"">Panaptun nga dílì mukúlù,</i><trans> Cloth that doesn’t shrink<corr>.</corr> </trans></eg>
<eg><i lang=""ceb"">Kwáa ang sinugba sa dì pa makakúlù,</i><trans> Take the meat off the coals before it shrinks. </trans></eg>
<eg><i lang=""ceb"">Nainútil siya kay nakulúan ug ugat,</i><trans> He became disabled because he had contracted tendons. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B46; b34c1]</itype><trans> curl up, draw back. </trans>
<eg><i lang=""ceb"">Ug mukúlù ang tamalà sa bangag, lisud hisakpan,</i><trans> When the octopus shrinks into the hole, you can’t catch it easily. </trans></eg>
<eg><i lang=""ceb"">Kulúa (ikúlù) ímung tiil kay dúnay gustung muági,</i><trans> Pull your feet in because people want to go by. </trans></eg>
<eg><i lang=""ceb"">Namatay siya kay gikul-an sa dílà,</i><trans> She died because she swallowed her tongue (her tongue shrunk into the throat). </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> draw back in fear. </trans>
<eg><i lang=""ceb"">Mukúlù ka man lagi ug hanaan,</i><trans> You draw back in fear if s.o. threatens you. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> shrinkage. </trans>
</sense></hom>
<entry><form id=""igsaktu_hustu_sa_kuxluq"" lang=""ceb"">igsaktu, hustu sa <abbr expan=""kúlù"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> be a bit too large so that it fits after shrinkage. </trans>
<eg><i lang=""ceb"">Sagdig luag ang bistída kay hustu nà sa kúlù,</i><trans> Never mind if the dress is a little too loose because it will fit perfectly after it shrinks. </trans></eg>
</sense></hom></entry>
<entry><form id=""kuluqkuxluq"" lang=""ceb"">kulùkúlù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B6]</itype><trans> writhe, double up in pain. </trans>
<eg><i lang=""ceb"">Mikulùkúlù siya sa kasakit sa tiyan,</i><trans> He was doubled up with stomach pain.
</trans></eg>
</sense></hom></entry></entry>");
