INSERT INTO `wced_entry` VALUES (9677, "kuludkulud", "495", "<entry page=""495"" id=""9677""><form id=""kuludkuxlud"" lang=""ceb"">kuludkúlud</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> be <tr>undulating</tr> in little waves. </trans>
<eg><i lang=""ceb"">Kuludkúlud nga sín,</i><trans> Corrugated iron. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> undulation. </trans>
<eg><i lang=""ceb"">Kuludkúlud sa tuud,</i><trans> The rings in the stump. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[ABN; c1]</itype><trans> <tr>undulate</tr>, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Mikudkū́d (nangudkū́d) ang kahumayan,</i><trans> The ricefield is undulating. </trans></eg>
<eg><i lang=""ceb"">Ang midisína mauy mukudkū́d sa buhuk,</i><trans> The medicine will make the hair wavy. </trans></eg>
<eg><i lang=""ceb"">Nagkudkū́d ang linámang dikulur,</i><trans> The color is in an undulating pattern.
</trans></eg>
</sense></hom></entry>");
