INSERT INTO `wced_entry` VALUES (9678, "kulugkug", "495", "<entry page=""495"" id=""9678""><form id=""kulugkug"" lang=""ceb"">kulugkug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> insert s.t. slender into a narrow opening and work it around. </trans>
<eg><i lang=""ceb"">Akuy mikulugkug sa túbu nga nasampungan,</i><trans> I worked a stick around in the pipe that was clogged up. </trans></eg>
<eg><i lang=""ceb"">Gikulugkúgan níya sa húgaw ang hunsuy,</i><trans> He cleaned out the tar in the pipe.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9678, "kulugkug", "kulugkug", "m", "v");
INSERT INTO `wced_entry` VALUES (9679, "kulugpus", "495", "<entry page=""495"" id=""9679""><form id=""kulugpus"" lang=""ceb"">kulugpus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> fold the arms in any position with the forearms crossed as a sign of repose. </trans>
<eg><i lang=""ceb"">Nangulyugpus lang siya nga nagpaábut ug trák,</i><trans> He stood with his arms folded waiting for the bus. </trans></eg>
<eg><i lang=""ceb"">Nagpangulyugpus sa íyang mga buktun nga nangalíya sa mahal nga birhin,</i><trans> She prayed to the blessed Virgin with her arms crossed, hands on the shoulders. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> curl the legs up close to the body. </trans>
<eg><i lang=""ceb"">Íyang kulugpúsun ang íyang mga tiil ug tugnawun,</i><trans> He’ll curl up his feet if he feels cold. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do nothing in the face of a situation which calls for action. </trans>
<eg><i lang=""ceb"">Nangulyugpus lang siya samtang nagkapulíkì mig trabáhu,</i><trans> He just stood by with his arms folded while we went crazy with so many things to do. </trans></eg>
<eg><i lang=""ceb"">Magkiyugpus ba lang tang magtan-aw sa ílang kalisud?</i><trans> Shall we just stand by utterly indifferent to the situation?
</trans></eg>
</sense></hom></entry>");
