INSERT INTO `wced_entry` VALUES (9681, "kulukar", "495", "<entry page=""495"" id=""9681""><form id=""kulukar"" lang=""ceb"">kulukar</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AP; c]</itype><trans> place s.o. in a job. </trans>
<eg><i lang=""ceb"">Kunggrisman ang mikulukar (mipakulukar) nákù sa trabáhu,</i><trans> A politician procured me a job. </trans></eg>
<eg><i lang=""ceb"">Ikulukar ta kag maáyung trabáhu,</i><trans> I’ll find a good job for you. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; c1]</itype><trans> find, obtain s.t. for which there is fierce competition. </trans>
<eg><i lang=""ceb"">Kun mag-ulan kúlì kang makakulukar ug sakay,</i><trans> When it rains it is difficult to get public transportation. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> attend to s.t. so that it is done properly, in the proper situation. </trans>
<eg><i lang=""ceb"">Wà giyuy paryinting nagkulukar sa minatay,</i><trans> There was not a single relative to attend to the funeral. </trans></eg>
<eg><i lang=""ceb"">Sa nakulukar na ang minatay nag-áway dáyun sila sa kabílin,</i><trans> As soon as the body was laid to rest, they set out to fight over the inheritance. </trans></eg>
<eg><i lang=""ceb"">Ákung ikulukar ning ákung manghud úsà ku magminyù,</i><trans> I will see my younger brother through school before I get married. </trans></eg>
</sense></hom>
<entry><form id=""kulukaxdu"" lang=""ceb"">kulukádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> settled in a job, marriage, having a place to stay. </trans>
</sense></hom></entry>
<entry><form id=""kulukasiyun"" lang=""ceb"">kulukasiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> job, occupation. </trans>
</sense></hom></entry>
<entry><form id=""pangulukasiyun"" lang=""ceb""><abbr expan=""pangulukasiyun"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> go job hunting. </trans>
<eg><i lang=""ceb"">Muadtu siya sa siyudad mangulukasiyun,</i><trans> He will go to the city to look for a job.
</trans></eg>
</sense></hom></entry></entry>");
