INSERT INTO `wced_entry` VALUES (9698, "kulupug", "496", "<entry page=""496"" id=""9698""><form id=""kuluxpug"" lang=""ceb"">kulúpug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> attack in the manner of a mother hen attacking s.t. </trans>
<eg><i lang=""ceb"">Mikúpug ang himungáan sa midúul sa íyang mga pisù,</i><trans> The mother hen attacked the man who went near her chicks. </trans></eg>
<eg><i lang=""ceb"">Gikupúgan siya sa nasukù níyang asáwa,</i><trans> His wife set on him like an angry hen. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AC2; b(1)]</itype><trans> jump over one for sexual purposes. </trans>
<eg><i lang=""ceb"">Dinhà pa sa gawang mikúpug dáyun ang laláki sa pampam,</i><trans> They were hardly through the door when the man set upon the prostitute. </trans></eg>
