<sense n=""1""><number>1</number><trans> <tr>unlicensed</tr>. </trans>
<eg><i lang=""ceb"">Kulúrum nga pistúla, Unlicensed pistol. Kulúrum nga taksi,</i><trans> Cab without a franchise. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> without a name. </trans>
<eg><i lang=""ceb"">Kulúrum nang klasíha sa manuk,</i><trans> That kind (breed) of chicken has no name. </trans></eg>
