INSERT INTO `wced_entry` VALUES (9724, "kumari", "497", "<entry page=""497"" id=""9724""><form id=""kumaxri"" lang=""ceb"">kumári</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a woman who has one of the following relations to one: she is the mother, godmother, or mother-in-law of children to whom one also is a parent or godparent (but not one’s wife). </trans>
<eg><i lang=""ceb"">Kumári ku si Kurdaping sa tulu ka higayun: inahan siya sa ákung kinúgus, ug sa ákung linudhan, ug sa ákung binaláyi. Aku sad kumári níya,</i><trans> Cordaping is my <ix>kumári</ix> on three grounds: she is the mother of my godson, and of another son whom I sponsored in marriage, and the mother of my daughter-in-law. And for that reason I am also her <ix>kumári</ix>. </trans></eg>
</sense>
<sense n=""a""><number>a</number><trans> term of address to a person with whom one has a relation of <ix>kumári</ix>. </trans>
</sense>
<sense n=""b""><number>b</number><trans> friendly term of address to a woman of one’s own generation with whom one is familiar. <ix>Short form:</ix> <bx>mari</bx>. </trans>
<eg><i lang=""ceb"">Kumusta mari?</i><trans> <pb n=""498""/>How are you, dear? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; ac3]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be in the <ix>kumári</ix> relationship. </trans>
<eg><i lang=""ceb"">Gikakumári ku si Imilda kay siyay nagkúgus sa ákù pung gikúgus,</i><trans> Imelda became my <ix>kumári</ix> because she sponsored a baby which I also sponsored. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> call s.o. by this title. </trans>
<eg><i lang=""ceb"">Ayaw kug kulukumaríha dihà. Dì ka makapangútang nákù,</i><trans> Don’t bother calling me <ix>kumári</ix>. You can’t borrow another cent from me. </trans></eg>
</sense></hom>
<entry><form id=""kuxmari_kumablit"" lang=""ceb""><abbr expan=""kúmari"" type=""lemma"">—</abbr> kumablit</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a godmother who has some clandestine relationship with the father of her godchild.
</trans>
</sense></hom></entry></entry>");
