INSERT INTO `wced_entry` VALUES (9731, "kumbati", "498", "<entry page=""498"" id=""9731""><form id=""kumbaxti"" lang=""ceb"">kumbáti</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fight, battle on land. </trans>
<eg><i lang=""ceb"">Sígi pa gihápun ang kumbáti sa Byitnam,</i><trans> The war in Vietnam is still raging. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do battle or come to a physical fight. </trans>
<eg><i lang=""ceb"">Nagkakumbáti mi kay íya man kung gitulísuk,</i><trans> We came to a fight because she wagged her fingers at me. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> combat a vice or disease. </trans>
<eg><i lang=""ceb"">Ang mga ismaglir kinahanglang kumbatíhun sa átung kagamhánan,</i><trans> The government should combat smuggling. </trans></eg>
</sense></hom>
<entry><form id=""sugaq_nga_dikumbaxti"" lang=""ceb"">sugà nga <abbr expan=""dikumbáti"" type=""lemma"">di-</abbr></form>
<hom>
<sense n=""0""><trans> barn lantern.
