INSERT INTO `wced_entry` VALUES (9733, "kumbiksiyun", "498", "<entry page=""498"" id=""9733""><form id=""kumbiksiyun"" lang=""ceb"">kumbiksiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> seriously considered opinion. </trans>
<eg><i lang=""ceb"">Unsa may ímung kumbiksiyun báhin sa átung násud karun?</i><trans> What is your opinion about the state of our country<corr sic=""."">?</corr> </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> conviction or belief. </trans>
<eg><i lang=""ceb"">Way kumbiksiyun siya kay usáhay mulában sa trabahanti, unyà sa tag-íya,</i><trans> He’s a man of no conviction. Sometimes he sides with the workers and sometimes with the owners. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> conviction of crime. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a3]</itype><trans> convict of a crime.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9733, "kumbiksiyun", "kumbiksiyun", "m", "nv");
INSERT INTO `wced_entry` VALUES (9734, "kumbinar", "498", "<entry page=""498"" id=""9734""><form id=""kumbinar"" lang=""ceb"">kumbinar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> combine things that belong together or complement each other. </trans>
<eg><i lang=""ceb"">Kumbinahun ku ning dalag ug kapi,</i><trans> I’ll combine yellow and brown colors (in one dress). </trans></eg>
<eg><i lang=""ceb"">Maáyung kumbinahan ning bungbung adúbig táyil,</i><trans> Tiles would go well with this adobe wall. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> modify s.t. so that it goes with s.t. else. </trans>
<eg><i lang=""ceb"">Kumbinahi ning radiyu pára kuryinti,</i><trans> Adapt this radio to house current. </trans></eg>
<eg><i lang=""ceb"">Ang barútu kumbinahan ug makina,</i><trans> They’ll adapt a motor to put in this boat.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9734, "kumbinar", "kumbinar", "m", "v");
INSERT INTO `wced_entry` VALUES (9735, "kumbinasiyun", "498", "<entry page=""498"" id=""9735""><form id=""kumbinasiyun"" lang=""ceb"">kumbinasiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> combination of things that complement one another. </trans>
<eg><i lang=""ceb"">Nindut ug kumbinasiyun sa mga kulur ang ímung sinínà,</i><trans> Your dress has a beautiful combination of colors. </trans></eg>
<eg><i lang=""ceb"">Nindut ug kumbinasiyun ang adúbi ug batu,</i><trans> The rocks and adobe make a good combination. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> underhanded agreement. </trans>
<eg><i lang=""ceb"">Gibinuángan lang ta. Kumbinasiyun tung awáya,</i><trans> They made a fool out of us. It was a fixed fight. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> illusion produced by some device or sleight of hand. </trans>
<eg><i lang=""ceb"">Dì tu tinúud nga nagkumbitay siya sa pangpang. Kumbinasiyun lang tu,</i><trans> He isn’t really hanging from a cliff. It was just a camera trick. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> combination of a lock. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> rig s.t. up with a combination of things that complement each other. </trans>
<eg><i lang=""ceb"">Kumbinasiyunun nímu ang bilin ug sugang palungpálung,</i><trans> Rig the nativity scene up with blinking lights. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C; b2]</itype><trans> get in cahoots to do s.t. shady. </trans>
<eg><i lang=""ceb"">Kumbinasyuni ang pagadur ug magpatantu ka sa impliyádu,</i><trans> Make an agreement with the paymaster if you lend money to the employees.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9735, "kumbinasiyun", "kumbinasiyun", "m", "nv");
INSERT INTO `wced_entry` VALUES (9736, "kumbinasyun", "498", "<entry page=""498"" id=""9736""><form id=""kumbinasyun"" lang=""ceb"">kumbinasyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> combination shot in pool whereby the cue ball hits another ball into the pocket by deflecting off the target ball. </trans>
</sense></hom>
<entry><form id=""kumbinasyun_nga_pinasuxguq"" lang=""ceb""><abbr expan=""kumbinasyun"" type=""lemma"">—</abbr> nga pinasúgù</form>
<hom>
<sense n=""0""><trans> a combination shot where the target ball knocks the desired ball into the pocket instead of the cue ball. </trans>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#kumbinasiyun""><sc>kumbinasiyun</sc></xr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[c1]</itype><trans> make a combination shot in pool.
</trans>
</sense></hom></entry></entry>");
