INSERT INTO `wced_entry` VALUES (9738, "kumbininsiya", "498", "<entry page=""498"" id=""9738""><form id=""kumbininsiya"" lang=""ceb"">kumbininsiya</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> good gotten out of s.t. </trans>
