INSERT INTO `wced_entry` VALUES (9739, "kumbinsi, kumbinsir", "498", "<entry page=""498"" id=""9739""><form id=""kumbinsi_kumbinsi4r"" lang=""ceb"">kumbinsi, kumbinsǐr</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3P; a1]</itype><trans> convince, persuade. </trans>
<eg><i lang=""ceb"">Musugut lagi siya basta ayúhun lag kumbinsǐr,</i><trans> He will consent to it if you do a good job of convincing him. </trans></eg>
<eg><i lang=""ceb"">Kumbinsiha (kumbinsira) giyud ang kurti nga wà kay sà,</i><trans> You must convince the court that you are innocent. </trans></eg>
</sense></hom>
<entry><form id=""kumbinsixdu"" lang=""ceb"">kumbinsídu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> persuaded, convinced. </trans>
<eg><i lang=""ceb"">Hustu na. Kumbinsídu na ku,</i><trans> That’s enough. I’m convinced. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> become convinced.
