INSERT INTO `wced_entry` VALUES (9742, "kumbinyinti", "499", "<entry page=""499"" id=""9742""><form id=""kumbinyinti"" lang=""ceb"">kumbinyinti</form>
<hom role=""a""><pos>a</pos>
