INSERT INTO `wced_entry` VALUES (9744, "kumbira", "499", "<entry page=""499"" id=""9744""><form id=""kumbira"" lang=""ceb"">kumbira</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a <tr>feast</tr>, sumptuous party. </trans>
