INSERT INTO `wced_entry` VALUES (9763, "kumidiya", "500", "<entry page=""500"" id=""9763""><form id=""kumixdiya"" lang=""ceb"">kumídiya</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> play a joke on, tease s.o. with s.t. fabricated. </trans>
<eg><i lang=""ceb"">Ayawg hílak. Nagkumídiya ra bítaw ku,</i><trans> Don’t cry. I was only joking. </trans></eg>
<eg><i lang=""ceb"">Kumidiyáhi siyag itsa ug dinamíta nga dì mubutu,</i><trans> Play a joke on him by throwing a stick of dynamite at him that won’t go off. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bluff s.o. </trans>
<eg><i lang=""ceb"">Kumidiyáhi ang bátà nga dì ta mulakaw arun dì mukúyug,</i><trans> Fool the child into thinking that we aren’t going out so he won’t want to come with us. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b(1)]</itype><trans> for supernatural beings to play a prank or cause harm to s.o. </trans>
<eg><i lang=""ceb"">Nabúrut ang íyang tiyan kay gikumidiyáhan sa dílì ingun nátù,</i><trans> His stomach swelled because the spirits played a practical joke on him. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> joke played on s.o. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. bad that happens to one brought on by a supernatural being. </trans>
</sense></hom>
