<sense n=""0""> <itype>[A; c1]</itype><trans> commit oneself or s.t. </trans>
<eg><i lang=""ceb"">Dì ku mukumitir sa ákung kaugalíngun ánang sabúta,</i><trans> I won’t commit myself to that agreement. </trans></eg>
