INSERT INTO `wced_entry` VALUES (9785, "kumpaniya", "501", "<entry page=""501"" id=""9785""><form id=""kumpanixya"" lang=""ceb"">kumpaníya</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> business establishment. </trans>
