<sense n=""2""><number>2</number><trans> business partners. </trans>
<eg><i lang=""ceb"">Kumpaníya sila niadtu piru nagbúlag ug nigusyu,</i><trans> They used to be business partners but now they have split their business. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> habitual associate. </trans>
<eg><i lang=""ceb"">Pirmi nákù siyang kumpaníya sa pagpangharána,</i><trans> He is always with me when we go serenading. </trans></eg>
</sense>
