<sense n=""1""><number>1</number><trans> be partners or associates in business. </trans>
<eg><i lang=""ceb"">Nagkumpaníya sila niánang ílang tindáhan,</i><trans> They are partners in that store. </trans></eg>
<eg><i lang=""ceb"">Gikumpaniyáhan sa mag-ágaw ang pagpalit sa yútà,</i><trans> The cousins bought the land as co-partners. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be a constant companion or associate.
