INSERT INTO `wced_entry` VALUES (9789, "kumpara, kumparar", "501", "<entry page=""501"" id=""9789""><form id=""kumpara_kumparar"" lang=""ceb"">kumpara, kumparar</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC2; ac]</itype><trans> compare with. </trans>
<eg><i lang=""ceb"">Ug kumparahun kamung duha, wà kay dag-anan,</i><trans> If you two are compared, you have no chance of winning. </trans></eg>
<eg><i lang=""ceb"">Sayun ni ikumparar niadtu,</i><trans> This is easy compared to that. </trans></eg>
</sense></hom>
<entry><form id=""kumparasiyun"" lang=""ceb"">kumparasiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> comparison, act of comparison. </trans>
<eg><i lang=""ceb"">Way kumparasiyun nang duha,</i><trans> The two have no comparison. </trans></eg>
<eg><i lang=""ceb"">Sa ákung kumparasiyun lugum tung usa,</i><trans> As I look at them, one is darker than the other.
