INSERT INTO `wced_entry` VALUES (9790, "kumpari", "501", "<entry page=""501"" id=""9790""><form id=""kumpaxri"" lang=""ceb"">kumpári</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a male who has one of the following relations to one: he is either the father, godfather, or father-in-law of children to whom one also is a parent (but not one’s husband). </trans>
</sense>
<sense n=""2""><number>2</number><trans> term of address to a person with whom one has this relation or general term of address to s.o. of one’s own age with whom one feels intimate. <ix>short form:</ix> <bx>pari.</bx> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C; ac3]</itype><trans> be in this relationship. </trans>
</sense>
