INSERT INTO `wced_entry` VALUES (9791, "kumparsa", "501", "<entry page=""501"" id=""9791""><form id=""kumparsa"" lang=""ceb"">kumparsa</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> ensemble of plucked, stringed instruments. </trans>
</sense>
<sense n=""2""><number>2</number><trans> folk dance interlude at a dance. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> folk dance pageant, presented as a contest among groups in a school or among different schools. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; b(1)]</itype><trans> have music from a string band. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; b(1)]</itype><trans> present this sort of dance pageant.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9791, "kumparsa", "kumparsa", "m", "nv");
INSERT INTO `wced_entry` VALUES (9792, "kumpas1", "501", "<entry page=""501"" id=""9792""><form id=""kumpas"" lang=""ceb"">kumpas<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> being in <tr>harmony</tr> or correct timing with s.t. else. </trans>
<eg><i lang=""ceb"">Mikanta siya kumpas sa dúyug,</i><trans> She sang in time to the accompaniment. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> deliberate, slow, and poised in action. </trans>
<eg><i lang=""ceb"">Kaanindut niánang bayhána, kumpas kaáyu manlihuklihuk,</i><trans> That girl is very nice; she moves slowly and gracefully. </trans></eg>
<eg><i lang=""ceb"">Kumpas pinadulut ang íyang sinultihan,</i><trans> She is slow and careful in speech. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> beat, time. </trans>
<eg><i lang=""ceb"">Dílì ku makaagpas sa kumpas niánang sunatáha,</i><trans> I cannot catch onto the tempo of that song. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> acts, mannerism. </trans>
<eg><i lang=""ceb"">Mu ra man nà siyag buang sa íyang mga kumpas,</i><trans> She seems like a mad woman, the way she acts. </trans></eg>
</sense></hom>
<entry><form id=""kuntra_kumpas"" lang=""ceb"">kuntra <abbr expan=""kumpas"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> out of rhythm or tempo. </trans>
<eg><i lang=""ceb"">Kuntra kumpas ang ímung sinayawan,</i><trans> You are not dancing in time to the music. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; c1]</itype><trans> act or do s.t. in harmony or time. </trans>
<eg><i lang=""ceb"">Mikumpas siya pagpakpak uban sa sunáta,</i><trans> She clapped in time to the music. </trans></eg>
<eg><i lang=""ceb"">Nagkumpas ang duha ka bátà ug singgit,</i><trans> The two children shrieked in unison. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; a]</itype><trans> be, become deliberate and posed in action, cause s.t. to be slow and deliberate. </trans>
<eg><i lang=""ceb"">Mikumpas ang íyang tíngug (mikumpas siya sa íyang tíngug) sa nasukù na ku,</i><trans> Her voice became soft and measured as I grew angrier and angrier. </trans></eg>
<eg><i lang=""ceb"">Ug dì ka magkumpas, mahúlug ka,</i><trans> If you aren’t slow and deliberate, you’ll fall. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[C2; b]</itype><trans> keep up with what s.o. else does. </trans>
<eg><i lang=""ceb"">Makigkumpas man gud ning ákung anak ug unsay buhátun sa mga anak sa dátù,</i><trans> This child of mine wants to do whatever the rich people’s children do.
</trans></eg>
</sense></hom></entry></entry>");
