INSERT INTO `wced_entry` VALUES (9794, "kumpay1", "501", "<entry page=""501"" id=""9794""><form id=""kumpay"" lang=""ceb"">kumpay<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. grass growing wild or cultivated in wet places for hay: <bio>Panicum maximum</bio>. </trans>
<eg><i lang=""ceb"">Unsáun pa ang kumpay ug patay na ang kabáyù,</i><trans> Locking the barn door after the horse has been stolen. (Lit. What are they going to do with the hay after the horse is dead?) </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; a]</itype><trans> gather s.t. for animal fodder. </trans>
<eg><i lang=""ceb"">Humana silag pananggì, kumpáyun <pb n=""502""/>na nátù ang mais nga sinanggian,</i><trans> The harvest is over. Let’s gather the cornstalks to feed the water buffaloes. </trans></eg>
</sense></hom>
<entry><form id=""kumpaxyan"" lang=""ceb""><abbr expan=""kumpáyan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a field with hay.
</trans>
</sense></hom></entry></entry>");
