INSERT INTO `wced_entry` VALUES (9795, "kumpayut", "502", "<entry page=""502"" id=""9795""><form id=""kumpayut"" lang=""ceb"">kumpayut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; b]</itype><trans> cling to s.t. hanging from it with or without support from below. </trans>
<eg><i lang=""ceb"">Nagkumpayut ang ubang pasahíru kay kargádu ang trák,</i><trans> Some passengers clung to the sides because the truck was overloaded. </trans></eg>
<eg><i lang=""ceb"">Gikumpayútan siya sa íyang asáwa kay dì siya pagikánun,</i><trans> His wife clung to him because she didn’t want him to leave.
</trans></eg>
</sense></hom></entry>");
