</sense></hom></entry>
<entry><form id=""pangumpisal_pangumpixsal"" lang=""ceb""><abbr expan=""pangumpisal"" type=""lemma"">paN-</abbr>, <abbr expan=""pangumpísal"" type=""lemma"">paN-(←)</abbr></form>
