INSERT INTO `wced_entry` VALUES (9805, "kumpit1", "502", "<entry page=""502"" id=""9805""><form id=""kumpit"" lang=""ceb"">kumpit<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. full-bodied boat with a deep draft and without outriggers, wider than other native boats. They are used for long distance travel, esp. by Muslims in carrying on trade. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> travel, bring by <ix>kumpit</ix>.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9805, "kumpit", "kumpit", "s", "nv");
INSERT INTO `wced_entry` VALUES (9806, "kumpit2", "502", "<entry page=""502"" id=""9806""><form id=""kumpit2"" lang=""ceb"">kumpit<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> squeeze s.t. between two long things to hold it. </trans>
<eg><i lang=""ceb"">Nagkumpit siya sa íyang pinangkù,</i><trans> She held her hair bun in place with a hairclip. </trans></eg>
<eg><i lang=""ceb"">Kumpíta pagkúhà ang inánag mais,</i><trans> Take the roasted corn with tongs. </trans></eg>
<eg><i lang=""ceb"">Ikumpit kining duha ka lipak pagpunit sa ilagà,</i><trans> Pick up the rat with these two sticks. </trans></eg>
<eg><i lang=""ceb"">Gikumpítan sa asáwa ang láwas sa bána,</i><trans> The wife held her husband’s body firmly with her legs. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> hairclip. </trans>
</sense>
<sense n=""2""><number>2</number><trans> tongs. </trans>
</sense>
<sense n=""3""><number>3</number><trans> chopsticks.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9806, "kumpit", "kumpit", "s", "vn");
INSERT INTO `wced_entry` VALUES (9807, "kumpitinsiya", "502", "<entry page=""502"" id=""9807""><form id=""kumpitinsiya"" lang=""ceb"">kumpitinsiya</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> competition or competitor. </trans>
<eg><i lang=""ceb"">Mahal ning tindahána kay way kumpitinsiya,</i><trans> This store is expensive because there are no competitors. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; b]</itype><trans> be competing. </trans>
<eg><i lang=""ceb"">Mukumpitinsiya man nímu nang bag-ung istudiyanti,</i><trans> The new student is going to give you competition. </trans></eg>
<eg><i lang=""ceb"">Sa nigusyu ra sila nagkakumpitinsiya,</i><trans> They are rivals in business only. </trans></eg>
<eg><i lang=""ceb"">Gikumpitinsiyáhan ang Amirika sa Rusya sa pag-adtu sa búwan,</i><trans> Russia competed against America to get to the moon. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b]</itype><trans> outshine. </trans>
<eg><i lang=""ceb"">Nasukù siya kay nakumpitinsiyahan (nakumpitinsiyaan) man ang bag-u níyang sinínà,</i><trans> She got mad because s.o. else outshone her in her new dress.
</trans></eg>
</sense></hom></entry>");
