INSERT INTO `wced_entry` VALUES (9809, "kumpiyansa", "502", "<entry page=""502"" id=""9809""><form id=""kumpiyansa"" lang=""ceb"">kumpiyansa</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>confidence</tr> in s.o. or oneself. </trans>
<eg><i lang=""ceb"">Wà kuy kumpiyansa sa táwu nga bakákun,</i><trans> I have no confidence in a liar. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>confident</tr>. </trans>
<eg><i lang=""ceb"">Napildi siya kay kumpiyansa ra kaáyu,</i><trans> He lost because he was so over-confident. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> have trust or confidence in oneself or s.o. </trans>
<eg><i lang=""ceb"">Nagkumpiyansa siyang makadaug, maung wà na magpraktis,</i><trans> He was sure he could win so he didn’t practice. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> entrust s.t. to s.o. </trans>
<eg><i lang=""ceb"">Makumpiyansahan kahà nà siyag sikrítu?</i><trans> Do you think we can trust <pb n=""503""/>her with a secret? </trans></eg>
<eg><i lang=""ceb"">Ayawg ikumpiyansa nang ímung anak sa míd,</i><trans> Do not entrust your child to your maid. </trans></eg>
</sense></hom>
<entry><form id=""abuxsu_dikumpiyansa"" lang=""ceb"">abúsu <abbr expan=""dikumpiyansa"" type=""lemma"">di-</abbr></form>
<hom>
<sense n=""0""><trans> breach of confidence or of trust. </trans>
<eg><i lang=""ceb"">Ug isugílun nímu ang sikrítu, kanà abúsu dikumpiyansa,</i><trans> If you tell the secret, that will be a breach of confidence. </trans></eg>
<eg><i lang=""ceb"">Ang pagkawkaw mu sa sáping gibílin ku nímu mauy abúsu dikumpiyansa,</i><trans> It was a breach of trust for you to touch the money that had been left with you.
</trans></eg>
</sense></hom></entry></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9809, "kumpiyansa", "kumpiyansa", "m", "nav");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9809, "abúsu dikumpiyansa", "abusu dikumpiyansa", "s", "");
