INSERT INTO `wced_translation` (entryid, translation) VALUES (9809, "confident");
INSERT INTO `wced_entry` VALUES (9810, "kumpli", "503", "<entry page=""503"" id=""9810""><form id=""kumpli"" lang=""ceb"">kumpli</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> finish with one’s service or study. </trans>
<eg><i lang=""ceb"">Ang tanan kung mga bátà kumpli na sa ílang pagtuun,</i><trans> All my children have completed their studies now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> completely ruined, spoiled beyond use. </trans>
<eg><i lang=""ceb"">Mau pay pingag ang pinggan, ímu pung gibuak, kumpli na,</i><trans> The plate may have been chipped, but it was still useful. Now you broke it. So that’s it. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> all done, finished. </trans>
<eg><i lang=""ceb"">Kumpli na ang bayranan sa balay,</i><trans> My payments on the house are complete now. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> finish a term, one’s study. </trans>
<eg><i lang=""ceb"">Magpaábut lang ku hangtud makakumpli ku sa ákung sirbisyu,</i><trans> I’ll wait until I can complete my service. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2; b6]</itype><trans> retire from the armed forces. </trans>
<eg><i lang=""ceb"">Kapitan ang ranggung íyang gikumplihan,</i><trans> He retired a captain. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> be completely ruined beyond use. </trans>
<eg><i lang=""ceb"">Kumplíha na lang nà arun kailisdag bag-u,</i><trans> Finish it off, why don’t you, so we have to buy a new one. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kumplianyu""><sc>kumplianyu</sc></xr>.
</trans>
</sense></hom></entry>");
