INSERT INTO `wced_entry` VALUES (9812, "kumplikadu", "503", "<entry page=""503"" id=""9812""><form id=""kumplikaxdu"" lang=""ceb"">kumplikádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> complicated, difficult to untangle or understand. </trans>
<eg><i lang=""ceb"">Mas kumplikádu ang makina sa mutursiklu kay sa muturbáyik,</i><trans> The motorcycle has a more complicated motor than a motorbike. </trans></eg>
<eg><i lang=""ceb"">Kumplikádu ning kasúha,</i><trans> This is a complicated court case. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1245]</itype><trans> be, become complicated.
</trans>
</sense></hom></entry>");
