INSERT INTO `wced_entry` VALUES (9813, "kumplikar", "503", "<entry page=""503"" id=""9813""><form id=""kumplikar"" lang=""ceb"">kumplikar</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> for a disease to have complications. </trans>
<eg><i lang=""ceb"">Mikumplikar (nakumplikar) ang íyang plú ngadtus íyang kasingkásing,</i><trans> His flu developed complications of the heart. </trans></eg>
</sense></hom>
<entry><form id=""kumplikasiyun"" lang=""ceb"">kumplikasiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> complication in a sickness.
</trans>
</sense></hom></entry></entry>");
