INSERT INTO `wced_entry` VALUES (9814, "kumplimintu", "503", "<entry page=""503"" id=""9814""><form id=""kumplimintu"" lang=""ceb"">kumplimintu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. said or done out of respect or good manners. </trans>
<eg><i lang=""ceb"">Kumplimintu lang tung íyang pagdápit nímu kay silíngan man mu,</i><trans> She invited you out of courtesy because you’re her neighbor. </trans></eg>
<eg><i lang=""ceb"">Bísan wà nay gustu, gibaslan ku ang suwat ágig kumplimintu,</i><trans> Even though I don’t like her any more, I answered her letter for politeness’ sake. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> compliment, s.t. said in admiration or praise. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> say or do s.t. insincere out of politeness. </trans>
<eg><i lang=""ceb"">Mukumplimintu lang kug tambung sa íyang parti,</i><trans> I’ll just attend his party out of courtesy. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> say s.t. in admiration or praise. </trans>
<eg><i lang=""ceb"">Mikumplimintu siya nakù sa bag-u kung hirdu,</i><trans> She complimented me on my new hairdo.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9814, "kumplimintu", "kumplimintu", "m", "nv");
INSERT INTO `wced_entry` VALUES (9815, "kumplin", "503", "<entry page=""503"" id=""9815""><form id=""kumplixn"" lang=""ceb"">kumplín</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> complain about one’s grades in school. </trans>
<eg><i lang=""ceb"">Kun wà ka mahimuut sa ímung mga grádu, ngánung dì ka man mukumplin?</i><trans> If you aren’t satisfied with your grades why don’t you complain?
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9815, "kumplín", "kumplin", "m", "v");
INSERT INTO `wced_entry` VALUES (9816, "kumplitu", "503", "<entry page=""503"" id=""9816""><form id=""kumplixtu"" lang=""ceb"">kumplítu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> complete, having s.t. complete. </trans>
<eg><i lang=""ceb"">Kumplítu ang iskuyláhan sa mga kasangkápan,</i><trans> Our school is completely equipped. </trans></eg>
<eg><i lang=""ceb"">Kumplítu ang ákung gamitun sa pamanday,</i><trans> My tools for carpentry are complete. </trans></eg>
<eg><i lang=""ceb"">Kumplítu ta sa impliyádu,</i><trans> We have our full contingent of employees. </trans></eg>
<eg><i lang=""ceb"">Ang búhat nga kumplítu ihátag sa maistru,</i><trans> All papers that are complete should be turned in to the teacher. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB12; a]</itype><trans> be, become complete, make s.t. complete. </trans>
<eg><i lang=""ceb"">Mukumplítu kug báyad sa matrikula,</i><trans> I’ll pay the tuition fees in full. </trans></eg>
<eg><i lang=""ceb"">Kining istáma mauy mukumplítu sa ákung kuliksiyun,</i><trans> This stamp will make my collection complete. </trans></eg>
<eg><i lang=""ceb"">Nagkakumplítu na ang ngípun sa bátà,</i><trans> The child’s teeth are almost complete. </trans></eg>
<eg><i lang=""ceb"">Mu ray ikakumplítu námù ug ma Pasku,</i><trans> The only time the whole family can get together is on Christmas.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9816, "kumplítu", "kumplitu", "m", "av");
INSERT INTO `wced_entry` VALUES (9817, "kumplut", "503", "<entry page=""503"" id=""9817""><form id=""kumplut"" lang=""ceb"">kumplut</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> conspirator. </trans>
<eg><i lang=""ceb"">Ang kahíru usa sa mga kumplut sa pangílad sa sápì,</i><trans> The cashier was one of the people who plotted to swindle the money. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> person with whom one is intimate such that arrangements can be made on favored terms. </trans>
<eg><i lang=""ceb"">Giprumut siya kay kumplut man sa manidyǐr,</i><trans> He was promoted because he had made especial arrangements with the manager. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> conspire. </trans>
<eg><i lang=""ceb"">Nakigkumplut ang ismaglir sa pulis sa pagpalusut sa mga sigarilyung ismágul,</i><trans> The smuggler connived with the policeman to let in his smuggled cigarettes. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> become intimate with s.o. to make special illegal arrangements.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9817, "kumplut", "kumplut", "m", "nv");
INSERT INTO `wced_entry` VALUES (9818, "kumpra", "503", "<entry page=""503"" id=""9818""><form id=""kumpra"" lang=""ceb"">kumpra</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; a]</itype><trans> buy s.t. in quantity, go shopping. </trans>
<eg><i lang=""ceb"">Nakapangumpra ka na bag pára sa ímung kumbira?</i><trans> Have you bought the things for your party? </trans></eg>
<eg><i lang=""ceb"">Kumpráha ning tanang nía sa lista,</i><trans> Buy all the things on this list. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> things bought. </trans>
<eg><i lang=""ceb"">Unsa may ímung kumpra?</i><trans> What things did you buy? </trans></eg>
</sense></hom>
<entry><form id=""kumpradur"" lang=""ceb""><abbr expan=""kumpradur"" type=""lemma"">-dur(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> buyer, dealer in some commodity. </trans>
<eg><i lang=""ceb"">Mga kumpradur sa kupras,</i><trans> Dealers in copra. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> become a dealer. <ix>see also</ix> <xr lang=""ceb"" target=""#malapix""><sc>malapí</sc></xr>.
</trans>
</sense></hom></entry></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9818, "kumpra", "kumpra", "m", "vn");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9818, "kumpradur", "kumpradur", "s", "nv");
INSERT INTO `wced_entry` VALUES (9819, "kumprumisu", "503", "<entry page=""503"" id=""9819""><form id=""kumprumixsu"" lang=""ceb"">kumprumísu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> committal to s.t. onerous or objectionable from which there is no <pb n=""504""/>turning back. </trans>
</sense>
<sense n=""2""><number>2</number><trans> spouse or family as one’s responsibility. </trans>
<eg><i lang=""ceb"">Karun nga may kumprumísu ka na sa ímung kinabúhì, pagbinuutan na,</i><trans> Now that you’re married, you must resolve to be good. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> be committed to such objectionable situations. </trans>
<eg><i lang=""ceb"">Nagkumprumísu nákù ning pagkapalíta sa awtu kay dì kung kaabut sa dáta,</i><trans> It put me in a tight fix to buy this car because I can’t meet the installments. </trans></eg>
<eg><i lang=""ceb"">Ayawg paságad ug pirma kay tingálig makumprumísu ka,</i><trans> Don’t sign anything recklessly. It might get you into hot water. </trans></eg>
<eg><i lang=""ceb"">Nakumprumísu ku pagbúrd sa ákung bátà,</i><trans> I got myself into debt when my son took the bar exams.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9819, "kumprumísu", "kumprumisu", "m", "nv");
INSERT INTO `wced_entry` VALUES (9820, "kumprumitibu", "504", "<entry page=""504"" id=""9820""><form id=""kumprumitixbu"" lang=""ceb"">kumprumitíbu</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kumprumitixdu""><sc>kumprumitídu</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#kumprumitir""><sc>kumprumitir</sc></xr>.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9820, "kumprumitíbu", "kumprumitibu", "m", "");
INSERT INTO `wced_entry` VALUES (9821, "kumprumitir", "504", "<entry page=""504"" id=""9821""><form id=""kumprumitir"" lang=""ceb"">kumprumitir</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> promise, pledge. </trans>
<eg><i lang=""ceb"">Mikumprumitir ku nga mubáyad sa tápus búlan,</i><trans> I pledged to pay at the end of the month. </trans></eg>
<eg><i lang=""ceb"">Gikumprumitir na níya ang íyang kasingkásing sa láing táwu,</i><trans> She has already pledged her heart to another man. </trans></eg>
</sense></hom>
<entry><form id=""kumprumitixdu"" lang=""ceb"">kumprumitídu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> bound, committed to do s.t.
</trans>
</sense></hom></entry></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9821, "kumprumitir", "kumprumitir", "m", "v");
