INSERT INTO `wced_entry` VALUES (9822, "kumprunta", "504", "<entry page=""504"" id=""9822""><form id=""kumprunta"" lang=""ceb"">kumprunta</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2N; c]</itype><trans> ask or seek one’s opinion or advice on s.t. </trans>
<eg><i lang=""ceb"">Mikumprunta (nangumprunta) na mig abugádu íning ámung kásu,</i><trans> We consulted a lawyer about our case. </trans></eg>
<eg><i lang=""ceb"">Ngánung dì man nímu ikumprunta nang prublimáha sa ímung kumpisur?</i><trans> Why don’t you seek the advice of your father confessor regarding that problem? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> sound s.o. out to see how he feels about s.t. </trans>
<eg><i lang=""ceb"">Kumpruntaha si Tátay ug úyun ba siyang iprinda ang yútà,</i><trans> Ask father’s opinion if he will go along with mortgaging the land.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9822, "kumprunta", "kumprunta", "m", "v");
INSERT INTO `wced_entry` VALUES (9823, "kumpruntar", "504", "<entry page=""504"" id=""9823""><form id=""kumprunta4r"" lang=""ceb"">kumpruntǎr</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12; c]</itype><trans> set a timepiece. </trans>
<eg><i lang=""ceb"">Ikumpruntǎr ang rilu sa radiyu,</i><trans> Set your watch by the radio.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9823, "kumpruntǎr", "kumpruntar", "m", "v");
INSERT INTO `wced_entry` VALUES (9824, "kumpuni, kumpunir", "504", "<entry page=""504"" id=""9824""><form id=""kumpuni_kumpunir"" lang=""ceb"">kumpuni, kumpunir</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; abc]</itype><trans> do make-shift repairs. </trans>
<eg><i lang=""ceb"">Átù lang ning kumpunihun kay way bag-ung pyísa,</i><trans> We’ll just do make-shift repairs because we don’t have new spare parts. </trans></eg>
<eg><i lang=""ceb"">Kumpunihan lang ug pasta ang bangag sa tangu,</i><trans> Just put a temporary filling in this tooth. </trans></eg>
<eg><i lang=""ceb"">Ikumpunir lang ug tápak ning playwud sa bungbung,</i><trans> Just fix this wall with a piece of plywood.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9824, "kumpuni", "kumpuni", "s", "v");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9824, "kumpunir", "kumpunir", "s", "v");
INSERT INTO `wced_entry` VALUES (9825, "kumpurmi", "504", "<entry page=""504"" id=""9825""><form id=""kumpurmi"" lang=""ceb"">kumpurmi</form>
<hom>
<sense n=""1""><number>1</number><trans> depending on, in accordance with. </trans>
<eg><i lang=""ceb"">Ang gidak-ung palitun kumpurmi lang sa sukud,</i><trans> The size to buy depends on her measurements. </trans></eg>
<eg><i lang=""ceb"">‘Unsay ákung ihátag nímu?’—‘Aw, kumpurmi lang,’</i><trans> ‘What shall I give you?’—‘Oh, it depends on you (whatever you have).’ </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> according to what is necessary. </trans>
<eg><i lang=""ceb"">Nanghípus na sila sa ílang mga kumpurmi lang nga dad-unun,</i><trans> They were packing whatever it was that they used to take. </trans></eg>
<eg><i lang=""ceb"">Isigbáyad sila kumpurmi sa ílang nakúhà,</i><trans> Each one paid according to the amount he had borrowed. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> whatever happens to be at hand, whatever comes into the head. </trans>
<eg><i lang=""ceb"">Kumpurmi lay pangayúun ning batáa,</i><trans> This child asks for whatever enters his head. </trans></eg>
<eg><i lang=""ceb"">Kumpurmi sa íyang makítà íyang palitun,</i><trans> He buys whatever he sees. </trans></eg>
</sense>
<sense n=""1b1""><number>1b1</number><trans> different kinds or sorts. </trans>
<eg><i lang=""ceb"">Kumpurmi lang ang ílang gipamalit sa Karbun,</i><trans> They bought all different things in the market. </trans></eg>
</sense>
<sense n=""1b2""><number>1b2</number> <form id=""nanimaxhung_kumpurmi"" lang=""ceb"">nanimáhung <abbr expan=""kumpurmi"" type=""lemma"">—</abbr></form><trans> an odor to be so foul that words cannot describe it (lit. smells like anything and everything bad). </trans>
</sense>
<sense n=""2""><number>2</number><trans> be in agreement. </trans>
<eg><i lang=""ceb"">Bisag kaáway ta apan kumpurmi ku sa ímung idíya,</i><trans> We may be enemies, but I agree with your ideas. </trans></eg>
<eg><i lang=""ceb"">Kumpurmi ka ba nga sa Sabadu na lang ta mangadtu?</i><trans> Is it all right with you if we go on Saturday instead? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> same as. </trans>
<eg><i lang=""ceb"">Unsa ka dakù ang lungag nga tamnan ug ságing? Kumpurmi sa tamnan ug lubi,</i><trans> How large a hole do we make for planting bananas? The same size as the hole for planting coconut trees. </trans></eg>
<eg><i lang=""ceb"">‘Pila ka mitrus nga panaptun ang ímung palitun?’—‘Kumpurmi sa imúha,’</i><trans> ‘How many meters of cloth will you buy?’—‘The same as what you buy.’ </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> now look who’s talking. </trans>
<eg><i lang=""ceb"">‘Túa ag kawatan!’—‘Kumpurmi lag kinsay nadakpan,’</i><trans> ‘There you are, you thief!’—‘Look who’s talking? Who was arrested, anyway, me or you?’ </trans></eg>
<eg><i lang=""ceb"">Unsay dakug káun? Kumpurmig kinsay nakahurut ug usa ka bandihádu nátù!</i><trans> What do you mean eating too much! Look which one of us finished a whole platter off? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12]</itype><trans> be agreeable. </trans>
<eg><i lang=""ceb"">Ang mga táwu nga dílì mukumpurmi sa súgù silútan,</i><trans> Whoever doesn’t agree to follow the orders will be punished. </trans></eg>
<eg><i lang=""ceb"">Wà siya mukumpurmi sa plánu,</i><trans> He was not agreeable to the plan.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9825, "kumpurmi", "kumpurmi", "m", "v");
