INSERT INTO `wced_entry` VALUES (9826, "kumpurtabli", "504", "<entry page=""504"" id=""9826""><form id=""kumpurtabli"" lang=""ceb"">kumpurtabli</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> comfortable. </trans>
<eg><i lang=""ceb"">Kumpurtabli ning síya,</i><trans> This chair is comfortable. </trans></eg>
<eg><i lang=""ceb"">Kumpurtabli ílang kahimtang,</i><trans> They are in comfortable circumstances. </trans></eg>
<eg><i lang=""ceb"">Kumpurtabli ning sinináa. Dílì hugut, dílì galhà,</i><trans> This is a comfortable dress. It’s not tight, and it’s not hot. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> be comfortable.
</trans>
</sense></hom></entry>");
