INSERT INTO `wced_entry` VALUES (9832, "kumu", "505", "<entry page=""505"" id=""9832""><form id=""kuxmuq"" lang=""ceb"">kúmù</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>clenched fist</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <ix>interjection indicating a brusque rejection of one’s suggestion:</ix> <tr>go to hell!</tr> </trans>
<eg><i lang=""ceb"">‘Ikay manghúgas run, ha?’—‘Kúmù!’</i><trans> ‘You wash the dishes today, OK?’—‘Drop dead, will you?’ </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1N; ac1]</itype><trans> clench one’s fist, keep s.t. tightly in one’s palm. </trans>
<eg><i lang=""ceb"">Nangúmù siya sa hilabihang kalágut,</i><trans> He clenched his fists in anger. </trans></eg>
<eg><i lang=""ceb"">Kumúa nang kindi arun dì makítà,</i><trans> Keep the candy in your fist so that no one can see it. </trans></eg>
<eg><i lang=""ceb"">Kumúa (ikúmù) ang ímung kamut,</i><trans> Clench your fists. </trans></eg>
</sense></hom>
<entry><form id=""kinuxmuq"" lang=""ceb""><abbr expan=""kinúmù"" type=""lemma"">-in-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kuxmuq""><sc>kúmù</sc></xr>, <i lang=""ceb"">n</i>. </trans>
</sense></hom></entry>
<entry><form id=""kinumuxay"" lang=""ceb""><abbr expan=""kinumúay"" type=""lemma"">-in-ay</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C23]</itype><trans> clench fists at each other.
</trans>
</sense></hom></entry></entry>");
