INSERT INTO `wced_entry` VALUES (9837, "kumun", "505", "<entry page=""505"" id=""9837""><form id=""kumun"" lang=""ceb"">kumun</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> common, ordinary. </trans>
<eg><i lang=""ceb"">Kumun kaáyu nà dinhi. Daghan man gud,</i><trans> That’s awfully common here. There is so many of them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> ordinary, not special. </trans>
<eg><i lang=""ceb"">Kumun kaáyung pagkáun,</i><trans> Very ordinary food. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> shared equally among all the members of a group. </trans>
<eg><i lang=""ceb"">Kining yutáa wà pa mabáhin. Kumun kini,</i><trans> This land hasn’t been divided yet. It belongs to everyone in the family. </trans></eg>
<eg><i lang=""ceb"">Mísa karun nga kumun álang sa tanang kalag sa purgaturyu,</i><trans> This is a common mass for all souls in purgatory. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B126; a2]</itype><trans> become common. </trans>
<eg><i lang=""ceb"">Dílì madúgay makumun na sab ang tag-as nga sanínà,</i><trans> It won’t be long before long dresses get to be a common sight. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> make s.t. common property, shared by many in a group. </trans>
<eg><i lang=""ceb"">Ug way tistamintu, makumun ang kabílin,</i><trans> If there is no will, the inheritance becomes common property. </trans></eg>
</sense></hom>
<entry><form id=""sintixdu_kumun"" lang=""ceb"">sintídu <abbr expan=""kumun"" type=""lemma"">—</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> common sense.
</trans>
</sense></hom></entry></entry>");
