INSERT INTO `wced_entry` VALUES (9838, "kumun", "505", "<entry page=""505"" id=""9838""><form id=""kuxmun"" lang=""ceb"">kúmun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> crumple s.t. up into a ball, put s.t. that can be crumpled s.w. carelessly without folding it or smoothing it out. </trans>
<eg><i lang=""ceb"">Kumúna na lang nang mga sinínà sa malíta,</i><trans> Just throw those dresses into the suitcase any old way. </trans></eg>
<eg><i lang=""ceb"">Ayaw kumúna nang papil kay magámit pa ang luyu,</i><trans> Don’t crumple up those papers because we can still use the back. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a2]</itype><trans> wrap s.t. up by just crumpling the wrapper. </trans>
<eg><i lang=""ceb"">Kumúna lang ang mga hirpin sa panyù,</i><trans> Just wrap up the hairpins in the handkerchief. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> hold s.t. in the fist. </trans>
<eg><i lang=""ceb"">Kumúna pag-áyu ang kwarta arun dì mahúlug,</i><trans> Hold the money tightly in your fist so it won’t fall.
</trans></eg>
</sense></hom></entry>");
