INSERT INTO `wced_entry` VALUES (9849, "kumusta", "506", "<entry page=""506"" id=""9849""><form id=""kumusta"" lang=""ceb"">kumusta</form>
<hom>
<sense n=""0""><trans> how is (was, are, etc.). </trans>
<eg><i lang=""ceb"">Kumusta ka?</i><trans> How are you? </trans></eg>
<eg><i lang=""ceb"">Kumusta ang ímung pagbisíta?</i><trans> How was your visit? </trans></eg>
<eg><i lang=""ceb"">Kumusta ang ímung anak? Nakatápus na ba sa íyang pagtuun?</i><trans> How is your child? Has he finished his studies now? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; a1]</itype><trans> greet s.o. upon his arrival. </trans>
<eg><i lang=""ceb"">Mukumusta ku sa bag-ung abut,</i><trans> I’ll greet the new arrivals. </trans></eg>
</sense></hom>
<entry><form id=""pangumusta"" lang=""ceb""><abbr expan=""pangumusta"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; a1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> ask how s.o. is, send regards. </trans>
<eg><i lang=""ceb"">Aníay íyang sulat nangumusta kanátung tanan,</i><trans> Here’s a letter from him asking how we all are. </trans></eg>
<eg><i lang=""ceb"">Ipangumusta lang kung Pápa mu,</i><trans> Give your father my regards. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#kumusta""><sc>kumusta</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""pangumustahay"" lang=""ceb"">pangumustahay</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> exchange of greetings upon arrival. </trans>
</sense></hom></entry>
<entry><form id=""kumustamus"" lang=""ceb""><abbr expan=""kumustamus"" type=""lemma"">-mus</abbr></form>
<hom>
<sense n=""0""><trans> friendly greeting to s.o. familiar, after not meeting for some time.
</trans>
</sense></hom></entry></entry>");
