INSERT INTO `wced_entry` VALUES (9850, "kumut", "506", "<entry page=""506"" id=""9850""><form id=""kuxmut"" lang=""ceb"">kúmut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; ab2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> lay hands on any part of the body including the hair and squeezing or clawing at it. </trans>
<eg><i lang=""ceb"">Kumútun ku nang nawung mu,</i><trans> I’ll claw your face. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> crumple in the hands. </trans>
<eg><i lang=""ceb"">Kumúta ang papil úsà ilábay,</i><trans> Crumple the paper before throwing it away. </trans></eg>
<eg><i lang=""ceb"">Kalamì rang kumútun sa bátà,</i><trans> How I would love to squeeze that chubby baby. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> extract the juice of s.t. by squeezing. </trans>
<eg><i lang=""ceb"">Akuy mukúmut sa amirul nga bugas,</i><trans> I’ll get starch for the laundry by squeezing the cooked rice. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A; b]</itype><trans> put salt on s.t. and squeeze it to remove undesirable properties in the juice. </trans>
<eg><i lang=""ceb"">Kumúti ug asin ang paliya arun makúhà ang pait,</i><trans> Squeeze the bitter vegetable together with salt to remove its bitter taste. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> wash small pieces of clothing in a basin. </trans>
<eg><i lang=""ceb"">Kumúti ang mga kamisin sa kabatáan,</i><trans> Wash out the children’s undershirts. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A2; a12]</itype><trans> afflict with anguish, grief, etc. </trans>
<eg><i lang=""ceb"">Ang mapait níyang mga púlung mikúmut sa íyang kasingkásing,</i><trans> His bitter words clawed at her heart.
</trans></eg>
</sense></hom></entry>");
