INSERT INTO `wced_entry` VALUES (9852, "kun", "506", "<entry page=""506"" id=""9852""><form id=""kun"" lang=""ceb"">kun</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>if</tr>. </trans>
<eg><i lang=""ceb"">Kun mau kanà, iitsa ta ikaw sa kaláyu,</i><trans> If that is the case, I will toss you into the fire. </trans></eg>
<eg><i lang=""ceb"">Kun maarang, adtu na lang sa prusintu pangatarúngan,</i><trans> Please (lit. if it is all right), explain at the precinct. </trans></eg>
<eg><i lang=""ceb"">Ang ákung ngálan si Husi Krus kun adúnay isúgù,</i><trans> My name is Joe Cruz. At your service (lit. if you have anything to command). </trans></eg>
<eg><i lang=""ceb"">Kun wà pa nímu iúlì ang awtu, ikíha ta ka,</i><trans> If you hadn’t returned the car, I would have filed a case against you. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> when [so-and-so] happens. </trans>
<eg><i lang=""ceb"">Kun mulakaw na siya pahibalua ku,</i><trans> When he goes, tell me. </trans></eg>
<eg><i lang=""ceb"">Kun ting-init dinhi, ínit giyud,</i><trans> During the hot season it is really hot. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> if, whether. </trans>
<eg><i lang=""ceb"">Pangutan-a si Máma mu kun haúnun na ba ring kík,</i><trans> Ask your Mother if I should take the cake out of the oven. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <form id=""kun_dixliq"" lang=""ceb""><abbr expan=""kun"" type=""lemma"">—</abbr> dílì</form><trans> </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> if not. </trans>
</sense>
<sense n=""2b""><number>2b</number><trans> except. </trans>
<eg><i lang=""ceb"">Way láin makasulbad sa ákung suliran kun dílì ikaw,</i><trans> No one can solve my problem except you. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number> <form id=""dixliq_walaq_lang_..._kun_diq"" lang=""ceb"">dílì (walà) lang ... kun dì</form><trans> </trans>
</sense>
<sense n=""2c1""><number>2c1</number><trans> not only ... but also. </trans>
<eg><i lang=""ceb"">Wà lang gánì siya magmuru nákù, kun dì milingiw pa giyud,</i><trans> He not only frowned at me but even turned his back to me. </trans></eg>
</sense>
<sense n=""2c2""><number>2c2</number><trans> not ... but rather. </trans>
<eg><i lang=""ceb"">Sa ílang dríl dílì lámang káhuy ang gigámit kun dílì ripli giyud,</i><trans> In their drill they did not use wooden guns but rather real rifles. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <ix>expression to introduce an explanatory phrase:</ix> that is to say. </trans>
<eg><i lang=""ceb"">Ang mga gradwádu karun walay kadásig sa pagtuun kun sa pagtukì sa kinaadman,</i><trans> The recent graduates have no enthusiasm for study that is to say, to delve into knowledge.
</trans></eg>
</sense></hom></entry>");
