INSERT INTO `wced_entry` VALUES (9856, "kunat", "506", "<entry page=""506"" id=""9856""><form id=""kuxnat"" lang=""ceb"">kúnat</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> being tough and slightly elastic, difficult to chew. </trans>
<eg><i lang=""ceb"">Kúnat ang intiriyur sa bisiklíta,</i><trans> A bicycle tube is tough and slightly elastic. </trans></eg>
<eg><i lang=""ceb"">Kúnat ang tiratíra,</i><trans> Taffy is very tough and hard to chew. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; b6]</itype><trans> turn out to be tough and difficult to chew. </trans>
<eg><i lang=""ceb"">Way kaláki ang inasal nga magkúnat ang pánit,</i><trans> Roast pig is no good if the skin is tough. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> tweak and pull. </trans>
<eg><i lang=""ceb"">Kunáta ang dunggan sa inasal,</i><trans> Twist off the roast pig’s ear.
</trans></eg>
</sense></hom></entry>");
