INSERT INTO `wced_entry` VALUES (9857, "kunay", "506", "<entry page=""506"" id=""9857""><form id=""kuxnay"" lang=""ceb"">kúnay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kunaykuxnay""><sc>kunaykúnay</sc></xr>. </trans>
</sense></hom>
<entry><form id=""kunaykuxnay"" lang=""ceb"">kunaykúnay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> play around with a mass of s.t. with the hands. </trans>
<eg><i lang=""ceb"">Ang bátà nagkalingawg kunaykúnay sa lápuk,</i><trans> The child is having fun with the mud. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fondle, stroke. </trans>
<eg><i lang=""ceb"">Ganáhan mukunaykúnay si Tátay sa íyang hiniktan,</i><trans> Father likes to fondle his fighting cock. </trans></eg>
<eg><i lang=""ceb"">Gikunaykúnay sa irù ang íyang mga ituy,</i><trans> The dog is fondling its puppies. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> take good care of s.t. </trans>
<eg><i lang=""ceb"">Ug dúna kay kwarta, kunaykunáyun ka sa mga narsis,</i><trans> If you have money, the nurses will give you first class service.
</trans></eg>
</sense></hom></entry></entry>");
