INSERT INTO `wced_entry` VALUES (9860, "kundat", "506", "<entry page=""506"" id=""9860""><form id=""kundat"" lang=""ceb"">kundat</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC12; b]</itype><trans> play together vigorously, usually involving physical contact. </trans>
<eg><i lang=""ceb"">Ganáhan siyang mukundat sa mga bátà,</i><trans> He likes to engage in horseplay with the children. </trans></eg>
<eg><i lang=""ceb"">Gustung makigkundat ang irù sa bátà,</i><trans> The dog wants to play with the boy. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> move about noisily, in a fluttering or loud way, unbecoming to a woman. </trans>
<eg><i lang=""ceb"">Mikundat <pb n=""507""/>dáyun ang mga silbidúra pag-abut sa ílang mga súkì,</i><trans> The bar waitresses immediately flirted and acted noisily when their customers arrived. </trans></eg>
<eg><i lang=""ceb"">Gikundátan kaáyu ku sa íyang sinayawan,</i><trans> I consider her way of dancing boisterous and unbecoming. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> horseplay, boisterous actions. </trans>
</sense></hom>
<entry><form id=""kundatan"" lang=""ceb""><abbr expan=""kundatan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> moving about in an exuberant, boisterous way, unbecoming to a woman. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> get to have these characteristics of behavior. </trans>
<eg><i lang=""ceb"">Nakundatan na kaáyu ang ámung míd,</i><trans> Our maid has become flirtatious now.
</trans></eg>
</sense></hom></entry></entry>");
