<eg><i lang=""ceb"">Ang layinman mauy nagkundim íning kuniksiyúna kay dilikádu,</i><trans> The lineman declared this connection unfit for use because it’s dangerous. </trans></eg>
<eg><i lang=""ceb"">Ang mga libru lang nga dunut mauy kundima (ikundim),</i><trans> Declare the worn-out books unfit for use. </trans></eg>
</sense></hom>
