INSERT INTO `wced_entry` VALUES (9865, "kundina", "507", "<entry page=""507"" id=""9865""><form id=""kundina"" lang=""ceb"">kundina</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> treat s.o. with condescension and contempt. </trans>
<eg><i lang=""ceb"">Ayaw siya kundinaha nga usa ka patay gútum,</i><trans> Don’t look down on him for being extremely poor.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9865, "kundina", "kundina", "m", "v");
INSERT INTO `wced_entry` VALUES (9866, "kundina", "507", "<entry page=""507"" id=""9866""><form id=""kundixna"" lang=""ceb"">kundína</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> punishment, imprisonment for heavy offenses. </trans>
<eg><i lang=""ceb"">Napúlù ka túig ang kundína sa binilanggù,</i><trans> The prisoner was sentenced to ten years. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> pass a sentence for a heavy crime. </trans>
<eg><i lang=""ceb"">Nakakundína na siyag daghan,</i><trans> He has already sentenced many people to heavy punishment.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9866, "kundína", "kundina", "m", "nv");
INSERT INTO `wced_entry` VALUES (9867, "kundinar", "507", "<entry page=""507"" id=""9867""><form id=""kundina4r"" lang=""ceb"">kundinǎr</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a3]</itype><trans> be condemned by God to eternal wandering. </trans>
<eg><i lang=""ceb"">Magbalikbálik ang kalag nga nakundinar,</i><trans> A restless soul returns and haunts his place. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; a12]</itype><trans> be carried by bad influence. </trans>
<eg><i lang=""ceb"">Kun dílì pa ikaw mauy nagkundinar nákù dì untà ku maingun niíni karun,</i><trans> If it had not been for your bad influence, I wouldn’t be what I am now. </trans></eg>
<eg><i lang=""ceb"">Kundinahun ka na sab ánang tawhána sa súgal ug ínum,</i><trans> That good-for-nothing fellow will again drag you to gambling and drinking. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> condemn or convict a prisoner to severe punishment. </trans>
<eg><i lang=""ceb"">Tulu ka binilanggù gikundinahan sa kamatáyun,</i><trans> Three prisoners were condemned to die. </trans></eg>
</sense></hom>
