INSERT INTO `wced_entry` VALUES (9870, "kundisiyun", "507", "<entry page=""507"" id=""9870""><form id=""kundisiyun"" lang=""ceb"">kundisiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> manner or state of being. </trans>
<eg><i lang=""ceb"">Kumusta ang kundisiyun sa masakitun?</i><trans> How is the patient’s condition? </trans></eg>
<eg><i lang=""ceb"">Lisud ámung kundisiyun human ku papháa,</i><trans> Our situation has been difficult since I was fired. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> requirement, stipulations. </trans>
<eg><i lang=""ceb"">Mga kundisiyun sa kuntrátu,</i><trans> The conditions in the contract. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> grade given on condition that the student make up specified deficiencies.</trans>
<eg><i lang=""ceb""> May kundisiyun ku sa Mát,</i><trans> I have a conditional pass in Math. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> set conditions to s.t. </trans>
<eg><i lang=""ceb"">Nagkundisiyun ku nga makalakaw ka basta mupaúlì ug sayu,</i><trans> I make the condition that you can go out if you come home early. </trans></eg>
<eg><i lang=""ceb"">Unsa may ímung ikundisiyun kun magpahulam kag kwarta?</i><trans> What conditions do you impose when you loan money? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a12]</itype><trans> be given a conditional grade. </trans>
<eg><i lang=""ceb"">Nakundisiyun (nakakundisiyun) ku sa Histuri,</i><trans> I got a conditional pass in History. </trans></eg>
</sense></hom>
<entry><form id=""kundisiyunal"" lang=""ceb""><abbr expan=""kundisiyunal"" type=""lemma"">-al</abbr></form>
<hom>
<sense n=""0""><trans> conditional, dependent upon certain stipulations. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> be conditional. </trans>
<eg><i lang=""ceb"">Ug makundisiyunal ang pagsurindir, dílì dawátun,</i><trans> They will not accept any surrender hedged with conditions.
</trans></eg>
</sense></hom></entry></entry>");
