INSERT INTO `wced_entry` VALUES (9891, "kuniksyun", "508", "<entry page=""508"" id=""9891""><form id=""kuniksyun"" lang=""ceb"">kuniksyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> pull, connections. </trans>
<eg><i lang=""ceb"">May kuniksyun siya sa síti hul,</i><trans> He has connections in City Hall. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> connection in plumbing, wiring, telephone, and the like. </trans>
<eg><i lang=""ceb"">Naputul ang kuniksyun sa túbu,</i><trans> The connection in the pipeline broke. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> connections in transportation. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12]</itype><trans> be connected with influential people. </trans>
<eg><i lang=""ceb"">Muasinsu dáyun ang makakuniksyun ug pulitiku,</i><trans> A person who has connections with a politician can rise in the world. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b6]</itype><trans> have an electrical connection. </trans>
<eg><i lang=""ceb"">Mukuniksyun na ku sa minláyin,</i><trans> I will be connected to the main line. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> = <xr lang=""ceb"" target=""#kunik""><sc>kunik</sc></xr>.
</trans>
</sense></hom></entry>");
