<eg><i lang=""ceb"">Ang sakit sa ngípun mukuniktǎr sab ngadtu sa tampihak,</i><trans> When the tooth aches, the pain also seems to be in the temples. </trans></eg>
<eg><i lang=""ceb"">Ang Sibu ikuniktǎr ug taytáyan ngadtu sa Maktan,</i><trans> Cebu will be connected to Mactan by a bridge. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> connect a telephone, electric line. </trans>
</sense></hom>
<entry><form id=""kuniktaxdu"" lang=""ceb"">kuniktádu</form>
<hom>
