INSERT INTO `wced_entry` VALUES (9896, "kunis", "508", "<entry page=""508"" id=""9896""><form id=""kunis"" lang=""ceb"">kunis</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> tear apart, into shreds. </trans>
</sense></hom>
<entry><form id=""kuniskunis"" lang=""ceb"">kuniskunis</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> tear into pieces, into small bits. </trans>
<eg><i lang=""ceb"">Sa íyang kalágut gikuniskunis níya ang suwat,</i><trans> In her anger she tore the letter to shreds. </trans></eg>
<eg><i lang=""ceb"">Nakuniskunis ang íyang sinínà sa irù,</i><trans> Her dress got ripped to shreds by the dog. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> break the heart. </trans>
<eg><i lang=""ceb"">Túmang kaguul nga mikuniskunis sa ákung kasingkásing,</i><trans> The sorrow tore my heart to shreds.
</trans></eg>
</sense></hom></entry></entry>");
