INSERT INTO `wced_entry` VALUES (9905, "kunsabu", "508", "<entry page=""508"" id=""9905""><form id=""kunsaxbu"" lang=""ceb"">kunsábu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; c3]</itype><trans> plot or connive on the sly to do s.t. shady, or detrimental to s.o. </trans>
<eg><i lang=""ceb"">Nagkunsábu ang ubang impliyádu nga malagput ku,</i><trans> Some employees are conniving to see if they can get me kicked out. </trans></eg>
<eg><i lang=""ceb"">Nakigkunsábu ang tulisan sa gwardiya,</i><trans> The robbers connived with the security guard. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> co-partners in a shady act. </trans>
<eg><i lang=""ceb"">Kunsábu tu sila maung nakalusut sa kustum,</i><trans> They plotted together; <pb n=""509""/>that’s why it got through the Customs. </trans></eg>
</sense></hom>
<entry><form id=""kakunsaxbu"" lang=""ceb""><abbr expan=""kakunsábu"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>accomplice</tr> in conniving.
</trans>
</sense></hom></entry></entry>");
