INSERT INTO `wced_entry` VALUES (9908, "kunsidirar", "509", "<entry page=""509"" id=""9908""><form id=""kunsidirar"" lang=""ceb"">kunsidirar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> give especial consideration, give allowance for. </trans>
<eg><i lang=""ceb"">Mukunsidirar ku karun kay primíru pa nímung sayup,</i><trans> I’ll give you especial consideration this time because it’s your first mistake. </trans></eg>
<eg><i lang=""ceb"">Kunsidirahi pud ku, tsip, kay daghan kung anak,</i><trans> Please give me a chance, officer, because I have so many children. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> consider s.t. to be s.t. </trans>
<eg><i lang=""ceb"">Dì ka ba mukunsidirar nga maáyu ning panwildúha?</i><trans> Don’t you consider this a good wage? </trans></eg>
<eg><i lang=""ceb"">Gikunsidirar ku siyang inahan,</i><trans> I considered her a mother. </trans></eg>
</sense></hom>
<entry><form id=""kunsidirasiyun"" lang=""ceb"">kunsidirasiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> consideration, understanding of s.o. else’s problems. </trans>
<eg><i lang=""ceb"">Way kunsidirasiyun ang ákung agáwun. Bísan namatyan mi, wà giyud ku tugúti pagpaúlì,</i><trans> My master has no consideration for my problems. We had a death in the family, but I wasn’t allowed to go home. </trans></eg>
<eg><i lang=""ceb"">Kining kwartáha ági lag kunsidirasiyun sa dúgay nímung pagsirbisyu nákù,</i><trans> This money is in consideration for your long period of service to me. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> special benefits, considerations of employment. </trans>
<eg><i lang=""ceb"">Gamay túud ug swildu, apan daghan ug kunsidirasiyun,</i><trans> The salary is small, to be sure, but there is a lot of extras. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the way one thinks. </trans>
<eg><i lang=""ceb"">Sa ákung kunsidirasiyun dílì ángayng patrabahúun ang minur diidad,</i><trans> The way I look at it, a minor should not be made to work. </trans></eg>
</sense></hom></entry>
<entry><form id=""abaxhu_kunsidirar"" lang=""ceb"">abáhu <abbr expan=""kunsidirar"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> under advisement, with the expectation of giving it further thought. </trans>
<eg><i lang=""ceb"">Dawátun ku nang ímung tubag pagkakarun, apan báhu kunsidirasiyun,</i><trans> I’ll accept your answer, under advisement. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bound by the way s.o. else thinks. </trans>
<eg><i lang=""ceb"">Ang asáwa báhu kunsidirasiyun sa bána,</i><trans> The wife follows what her husband thinks best.
</trans></eg>
</sense></hom></entry></entry>");
