INSERT INTO `wced_entry` VALUES (9935, "kunsumisiyun", "510", "<entry page=""510"" id=""9935""><form id=""kunsumisiyun"" lang=""ceb"">kunsumisiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> intense grief that wastes away the body. </trans>
<eg><i lang=""ceb"">Ikay ákung kunsumisiyun, bataána ka,</i><trans> You’ll be the death of me. </trans></eg>
<eg><i lang=""ceb"">Kunsumisiyun ang gikamatyan sa asáwang gibiyáan,</i><trans> The wife wasted away and died of grief after she was abandoned. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B16; a4]</itype><trans> be afflicted with grief that wastes away the body. </trans>
<eg><i lang=""ceb"">Gikunsumisiyun (nagkunsumisiyun) ang inahan sa kamaldítu sa anak,</i><trans> The mother wasted in grief because of her wayward son. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1456; b3]</itype><trans> worry very much over a trifle. </trans>
<eg><i lang=""ceb"">Ngánung magkunsumisiyun ka man ánang druwínga ug dì giyud mahímù?</i><trans> Why do you have to worry yourself to death over that drawing if you can’t do it?
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9935, "kunsumisiyun", "kunsumisiyun", "m", "nv");
