INSERT INTO `wced_entry` VALUES (9937, "kunsumu", "510", "<entry page=""510"" id=""9937""><form id=""kunsuxmu"" lang=""ceb"">kunsúmu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> consumption. </trans>
<eg><i lang=""ceb"">Dakug kunsúmu ning awtúha,</i><trans> This car uses a lot of gas. </trans></eg>
<eg><i lang=""ceb"">Mínus karun kitag kunsúmu sa túbig,</i><trans> We use less water now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> provisions, food supplies. </trans>
<eg><i lang=""ceb"">Kun muadtu mu sa isla, pagdala ug kunsúmu kay way pagkáun didtu,</i><trans> If you go to the island, bring provisions because there is no food there. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> consume. </trans>
<eg><i lang=""ceb"">Mukunsúmu mig tagsa ka bákid bugas bulanbúlan,</i><trans> We consume a cavan of rice each month.
</trans></eg>
</sense></hom></entry>");
