INSERT INTO `wced_entry` VALUES (9939, "kunsuylu", "510", "<entry page=""510"" id=""9939""><form id=""kunsuylu"" lang=""ceb"">kunsuylu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. that makes s.t. unpleasant easier to bear. </trans>
<eg><i lang=""ceb"">Bug-at ning trabahúa apan kunsuylu sab ning magswildu tag sayu,</i><trans> The work is hard, but one thing that makes it easier to bear is that we are paid early. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> improvement, a happy sign in s.t. that had been distressing. </trans>
<eg><i lang=""ceb"">Sukad siya madapati sa tambal, may kunsuylu na ang íyang pangláwas,</i><trans> Since she has been taking that medicine, there has been an improvement in her health. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> situation that provokes enjoyment, fun. </trans>
<eg><i lang=""ceb"">Wà tay kunsuylu áning tindahánang magpalit kay púlus magmug-ut ang mga tindíra,</i><trans> We get no pleasure in buying in that store because the salesgirls are all unfriendly. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> advantageous. </trans>
<eg><i lang=""ceb"">Kunsuylu ning may awtu kay dílì lisud sa pagpaúlì,</i><trans> It is an advantage to have a car because it is no problem to get home. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A123P; a]</itype><trans> give consolation, make s.t. easier to bear. </trans>
<eg><i lang=""ceb"">Bísag sulat makakunsuylu na kaáyu sa kamíngaw ku kanímu,</i><trans> A letter from you would be enough to console me in my loneliness for you. </trans></eg>
<eg><i lang=""ceb"">Pabakasyuna siya pára ikunsuylu sa íyang kapakyásan sa burd,</i><trans> Give him a vacation to give him solace and comfort after his frustration in the board exams. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; b6]</itype><trans> for a situation to provoke excitement, delight. </trans>
<eg><i lang=""ceb"">Mukunsuylu ang dúwà ug payitpáyit ang tím,</i><trans> A game gets more fun if the teams are equally good. </trans></eg>
</sense></hom>
<entry><form id=""pakunsuylu"" lang=""ceb""><abbr expan=""pakunsuylu"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> give consolation. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. which can give consolation.
</trans>
</sense></hom></entry></entry>");
