INSERT INTO `wced_entry` VALUES (9941, "kuntak", "510", "<entry page=""510"" id=""9941""><form id=""kuntak"" lang=""ceb"">kuntak</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> contact, connection in an organization or high places. </trans>
<eg><i lang=""ceb"">Basta nigusyanti daghang kuntak,</i><trans> A businessman has to have lots of contacts. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> contact, get in touch with. </trans>
<eg><i lang=""ceb"">Kun makigkuntak ka níya, tawga lang sa tilipunu,</i><trans> If you want to get in contact with her, just call her on the telephone. </trans></eg>
<eg><i lang=""ceb"">Inig-abut sa mayur, kuntáka dáyun ku,</i><trans> As soon as the mayor arrives, contact me immediately.
