INSERT INTO `wced_entry` VALUES (9942, "kuntar", "510", "<entry page=""510"" id=""9942""><form id=""kunta4r"" lang=""ceb"">kuntǎr</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> keep score, count a score. </trans>
<eg><i lang=""ceb"">Tulu ka táwu ang mukuntǎr (magkuntǎr) sa buksing: ang ripiri ug ang duha ka huwis,</i><trans> In a boxing three persons keep the score: the referee and the two judges. </trans></eg>
<eg><i lang=""ceb"">Dílì tu níya kuntarun (ikuntǎr) kay páwul man,</i><trans> He won’t count that shot because they had called a foul. </trans></eg>
<eg><i lang=""ceb"">Ikuntǎr (kuntara) sa papil ang matag puntus níla,</i><trans> Mark a score for each point they make on a piece of paper. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> shout out the score. </trans>
<eg><i lang=""ceb"">Ikuntǎr (kuntara) ang matag puntus,</i><trans> Shout out the score every time s.o. makes a point.
<pb n=""511""/>
</trans></eg>
</sense></hom></entry>");
