INSERT INTO `wced_entry` VALUES (9944, "kuntimpuraryu", "511", "<entry page=""511"" id=""9944""><form id=""kuntimpuraryu"" lang=""ceb"">kuntimpuraryu</form>
<hom role=""n""><pos>n</pos>
