INSERT INTO `wced_entry` VALUES (9947, "kuntintu", "511", "<entry page=""511"" id=""9947""><form id=""kuntintu"" lang=""ceb"">kuntintu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> satisfied, contented. </trans>
<eg><i lang=""ceb"">Dì ku kuntintu sa ákung swildu,</i><trans> I’m not satisfied with my salary. </trans></eg>
