<eg><i lang=""ceb"">Wà ku makuntintu adtung kaúna,</i><trans> I wasn’t satisfied with that meal. </trans></eg>
</sense></hom>
<entry><form id=""kakuntintuhun"" lang=""ceb"">kakuntintuhun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> state of reaching contentment. </trans>
<eg><i lang=""ceb"">Dúnay mga babáyi nga way kakuntintuhun,</i><trans> There are women that are impossible to satisfy (sexually).
