INSERT INTO `wced_entry` VALUES (9955, "kuntrasinyas", "512", "<entry page=""512"" id=""9955""><form id=""kuntrasinyas"" lang=""ceb"">kuntrasinyas</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> password or secret signal. </trans>
<eg><i lang=""ceb"">Ug muhíngus ku, kuntrasinyas nà nga wíting ku,</i><trans> If I sniffle, it’s a sign that I’m about to go rummy. </trans></eg>
<eg><i lang=""ceb"">Unsay kuntrasinyas sa pagsúd sa kampu?</i><trans> What is the password to enter the camp? </trans></eg>
<eg><i lang=""ceb"">Dúnay kuntrasinyas ang balúta arun hibaw-an nga mibutar ka nákù,</i><trans> There’s a secret mark on the ballot so we know you voted for me. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3; c6]</itype><trans> give a word or secret signal.
</trans>
</sense></hom></entry>");
