INSERT INTO `wced_entry` VALUES (9956, "kuntrata, kuntratu", "512", "<entry page=""512"" id=""9956""><form id=""kuntraxta_kuntraxtu"" lang=""ceb"">kuntráta, kuntrátu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> written contract or verbal agreement. </trans>
<eg><i lang=""ceb"">Pilay kuntrátu sa matadíru íning ímung bábuy?</i><trans> What price have you agreed upon with the butcher for your pig? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[ANC2; c]</itype><trans> make a contract or verbal bargain. </trans>
<eg><i lang=""ceb"">Nagkuntrátu kug sakyanan pára sa átung ikskursiyun,</i><trans> I have already made an agreement for our transportation on the excursion. </trans></eg>
</sense></hom>
<entry><form id=""kuntrataxdu"" lang=""ceb"">kuntratádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> bound with a contract or oral agreement. </trans>
<eg><i lang=""ceb"">Kuntratádu na ning babúya,</i><trans> This pig has already been spoken for. </trans></eg>
</sense></hom></entry>
<entry><form id=""kuntratista"" lang=""ceb"">kuntratista</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who buys and sells things or services on a professional basis, contracting for the things bought or services rendered. </trans>
<eg><i lang=""ceb"">Kuntratista sa bábuy,</i><trans> One who buys and sells pigs. </trans></eg>
<eg><i lang=""ceb"">Kuntratista sa hákut,</i><trans> One who contracts to haul things. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> be, become a contractor of this sort.
</trans>
</sense></hom></entry></entry>");
