INSERT INTO `wced_entry` VALUES (9958, "kuntringkanti", "512", "<entry page=""512"" id=""9958""><form id=""kuntringkanti"" lang=""ceb"">kuntringkanti</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> opponents in a political election. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; ac3]</itype><trans> be opponents for electoral office. </trans>
<eg><i lang=""ceb"">Dì sila maáyung kuntringkantíhun kay manag-ágaw sila,</i><trans> They should not be made to oppose each other because they are cousins. </trans></eg>
<eg><i lang=""ceb"">Bag-ángang pulitiku ang ákung gikakuntringkanti,</i><trans> The man I fought against was a seasoned politician.
</trans></eg>
</sense></hom></entry>");
