INSERT INTO `wced_entry` VALUES (9960, "kuntrul", "512", "<entry page=""512"" id=""9960""><form id=""kuntru4l"" lang=""ceb"">kuntrǔl</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> control over s.o.’s actions, discipline. </trans>
<eg><i lang=""ceb"">Ang mayur way kuntrǔl sa kapulisan,</i><trans> The mayor has no control over his police force. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> control oneself or the actions of s.t. else. </trans>
<eg><i lang=""ceb"">Nagkuntrǔl lang giyud ku nga dì makapangísug,</i><trans> I did my best to control my temper. </trans></eg>
<eg><i lang=""ceb"">Wà na ku makakuntrǔl sa manubíla,</i><trans> I couldn’t control the wheel any longer. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C2]</itype><trans> exercise birth control. </trans>
<eg><i lang=""ceb"">Wà mi magkuntrǔl, maung daghan mig anak,</i><trans> We didn’t practice birth control so we had lots of children.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9960, "kuntrǔl", "kuntrul", "m", "nv");
INSERT INTO `wced_entry` VALUES (9961, "kuntrular", "512", "<entry page=""512"" id=""9961""><form id=""kuntrular"" lang=""ceb"">kuntrular</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> control s.t. </trans>
<eg><i lang=""ceb"">Kuntrulaha ang inyung mga bátà,</i><trans> Control your children. </trans></eg>
<eg><i lang=""ceb"">Gikuntrular sa mga Huk ang Sintral Lusun,</i><trans> The Huks control Central Luzon. </trans></eg>
<eg><i lang=""ceb"">Ang pamaligyag bugas gikuntrular sa mga Insik,</i><trans> The rice trade is controlled by the Chinese. </trans></eg>
</sense></hom>
<entry><form id=""kuntrulaxdu_kuntrulaxwu"" lang=""ceb"">kuntruládu, kuntruláwu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> in the control of. </trans>
<eg><i lang=""ceb"">Ang Kunggrísu kuntruládu sa Nasyunalista,</i><trans> The Congress is in the control of the Nacionalista Party. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> under control, subdued. </trans>
<eg><i lang=""ceb"">Kuntruládu na ang mga prísu nga nagráyut,</i><trans> The prisoners that rioted are now under control. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> done with control. </trans>
<eg><i lang=""ceb"">Kuntruládu ang íyang paghapak sa búla maung nasúd ni sa lungag,</i><trans> He drives the golf ball with control. That’s why it goes into the hole.
</trans></eg>
</sense></hom></entry></entry>");
