INSERT INTO `wced_entry` VALUES (9962, "kuntud1", "512", "<entry page=""512"" id=""9962""><form id=""kuntud"" lang=""ceb"">kuntud<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; b2c1]</itype><trans> decrease in amount or quantity. </trans>
<eg><i lang=""ceb"">Mukuntud (makuntud) ang tubà sa tinghangin,</i><trans> The coconut palm toddy yields less when it is windy. </trans></eg>
<eg><i lang=""ceb"">Dì siya makakuntud sa íyang pagkáun,</i><trans> She can’t cut down on her food intake.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9962, "kuntud", "kuntud", "s", "v");
INSERT INTO `wced_entry` VALUES (9963, "kuntud2", "512", "<entry page=""512"" id=""9963""><form id=""kuntud2"" lang=""ceb"">kuntud<sub>2</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for the surface of a piece of land to be uneven. </trans>
<eg><i lang=""ceb"">Ayúha pagpátag kay kuntud pa kanang dapíta dihà,</i><trans> Level that part carefully. It is still bulging there. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c12]</itype><trans> be, become uneven. </trans>
<eg><i lang=""ceb"">Ipapátag sa buldúsir kanang dápit nga nagkuntud,</i><trans> Have the bulldozer level that part where it is bulging.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9963, "kuntud", "kuntud", "s", "av");
INSERT INTO `wced_entry` VALUES (9964, "kuntudu", "512", "<entry page=""512"" id=""9964""><form id=""kuntuxdu"" lang=""ceb"">kuntúdu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> elaborate, having all the trimmings. </trans>
<eg><i lang=""ceb"">Kuntúdu siyang mamisti,</i><trans> She is dressed elaborately. </trans></eg>
<eg><i lang=""ceb"">Ang kuntúdu nga kumbira dakug gastu,</i><trans> An elaborate feast will incur great expense. </trans></eg>
</sense></hom>
<entry><form id=""kuntuxdu_ubligasiyun"" lang=""ceb""><abbr expan=""kuntúdu"" type=""lemma"">—</abbr> ubligasiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> job involving all chores there are to be done. </trans>
<eg><i lang=""ceb"">Ang ímung trabáhu dinhi kuntúdu ubligasiyun. Ímu ang tanang líhuk,</i><trans> Your work here includes anything there is to do. You must do <pb n=""513""/>everything. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> go about in grand style. </trans>
<eg><i lang=""ceb"">Kláru na lang nga makakuntúdu si Imilda kay milyunarya man,</i><trans> Of course Imelda can live in style because she is so rich.

</trans></eg>
</sense></hom></entry></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9964, "kuntúdu", "kuntudu", "m", "a");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9964, "kuntúdu ubligasiyun", "kuntudu ubligasiyun", "s", "nv");
INSERT INTO `wced_entry` VALUES (9965, "kunu", "513", "<entry page=""513"" id=""9965""><form id=""kunu"" lang=""ceb"">kunu</form>
<hom>
<sense n=""0""><trans> <ix>short form</ix>: <bx>nu</bx> </trans>
</sense>
<sense n=""1""><number>1</number><trans> it is <tr>said</tr>, s.o. said. </trans>
<eg><i lang=""ceb"">Namatay kunu ag pilútu,</i><trans> They say the pilot died. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <ix>with imperatives</ix>: particle used to person with whom one is familiar implying that he is not under obligation to obey it—i.e., is not a person one has a right to command: ‘please, do me a favor and ...’ </trans>
<eg><i lang=""ceb"">Itúnul kunu nang libru,</i><trans> Do me a favor and hand me the book. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> <ix>followed or preceded by verb</ix>: do [so-and-so] as a trial. </trans>
<eg><i lang=""ceb"">Ikuniktar kunu nátù ring alambri, tingáli ug muandar na ang makina,</i><trans> Try connecting this wire. Perhaps the engine will start. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> in conditions: on the chance that. </trans>
<eg><i lang=""ceb"">Madúgay pa ba nu ku dinhi kay muanhi siya,</i><trans> If I stay here long, he will come. </trans></eg>
<eg><i lang=""ceb"">Ákung gihípus kay básin kunu magámit unyà,</i><trans> I kept it on the chance that we might be able to use it later. </trans></eg>
</sense></hom>
<entry><form id=""kunhun"" lang=""ceb"">kunhun</form>
<hom>
<sense n=""0""><trans> take s.o. to be ignorant of s.t. </trans>
<eg><i lang=""ceb"">Akuy kunhun nímu nga kadúgay na nákù niíni,</i><trans> You take me for ignorant when I’ve been at this for such a long time. </trans></eg>
</sense></hom></entry>
<entry><form id=""pangunu"" lang=""ceb""><abbr expan=""pangunu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> show one is uncertain of s.t. by saying <ix>kunu</ix>. </trans>
<eg><i lang=""ceb""><corr sic=""Di"">Dì</corr> kaáyu siya sigúru kay nangunu,</i><trans> He’s not that certain because he said ‘they said’. </trans></eg>
</sense></hom></entry>
<entry><form id=""kunuxhay"" lang=""ceb"">kunúhay</form>
<hom>
<sense n=""1""><number>1</number><trans> allegedly, they say, but I’m not sure whether or not it is true. </trans>
<eg><i lang=""ceb"">Pipila ka mga pulitiku nga nagsabutsábut kunúhay tu,</i><trans> A few politicians who were allegedly making agreements under the table. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. to make a show of being a certain thing. </trans>
<eg><i lang=""ceb"">Arun pagrispitar nanghúnung kunúhay mi ug paghungit,</i><trans> In order to show respect we made a pretense of stopping eating for the moment. </trans></eg>
<eg><i lang=""ceb"">Nagpakítà siya sa íya kunúhay nga pagkamanggihunàhunáun,</i><trans> He is displaying his supposed thoughtfulness. </trans></eg>
<eg><i lang=""ceb"">Ayaw ug katáwa kay nangísug kunúhay ka,</i><trans> Don’t laugh. You’re supposed to be angry. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> be supposedly. </trans>
<eg><i lang=""ceb"">Ísug kunúhay ka—dì ka muhílak ug sugsúgun,</i><trans> You’re supposed to be brave. You shouldn’t cry if they tease you. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> particle giving an excuse for doing s.t. in preparation. </trans>
<eg><i lang=""ceb"">Namalit kunúhay mi sa dì pa musáka ang bili,</i><trans> We are buying food before the prices go up. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> particle belittling s.o.’s accomplishments. </trans>
<eg><i lang=""ceb"">Prisidinti kunúhay kanà siya sa kapunúngan,</i><trans> He’s the so-called president of their organization. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> particle of modesty detracting from one’s own or one’s family’s accomplishments. </trans>
<eg><i lang=""ceb"">Magsusúlat kunúhay kining ákung bána, ug kini mauy bugtung níyang pangítà,</i><trans> My husband is a writer, you know, and that’s how he earns his livelihood.
</trans></eg>
</sense></hom></entry></entry>");
