INSERT INTO `wced_entry` VALUES (9967, "kunukunu", "513", "<entry page=""513"" id=""9967""><form id=""kunuqkunuq"" lang=""ceb"">kunùkunù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c16]</itype><trans> speak haltingly, uncertainly, and in short syllables. </trans>
<eg><i lang=""ceb"">Nagkunùkunù siya pagbungat sa íyang hangyù,</i><trans> She made her request in a halting, unsure way. </trans></eg>
<eg><i lang=""ceb"">Ayawg kunùkunua (ikunùkunù) ang ímung pagsulti kay maklárung ginirbiyus ka,</i><trans> Don’t speak haltingly because everybody will see you’re nervous.
</trans></eg>
</sense></hom></entry>");
