INSERT INTO `wced_entry` VALUES (9968, "kunul", "513", "<entry page=""513"" id=""9968""><form id=""kunul"" lang=""ceb"">kunul</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B24]</itype><trans> fail to ripen or to grow. </trans>
<eg><i lang=""ceb"">Mikunul ang mga lubi nga tinanum nga naatul sa huwaw,</i><trans> Our coconuts didn’t grow because they were planted during the dry season. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> hardened because of failure to ripen. </trans>
<eg><i lang=""ceb"">Mikunul ang ságing kay ahat,</i><trans> The bananas failed to ripen and just hardened because they were picked too soon. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B]</itype><trans> become hardened, calloused from abuse. </trans>
<eg><i lang=""ceb"">Nakunul na lang giyud ang bátà sa pagbinúnal nímu,</i><trans> The child has gotten hardened because you’ve punished him so much. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A23]</itype><trans> be stubborn, uninterested in obeying orders. </trans>
<eg><i lang=""ceb"">Mukunul na lang nang batáag sugúun. Dílì muirug sa íyang nahimutangan,</i><trans> That child is just stubborn when you tell him to do s.t. He won’t move from his place. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23]</itype><trans> give a dull knock when s.t. hits. </trans>
<eg><i lang=""ceb"">Mikunul ang lápuk nga miigù sa sín,</i><trans> The mud went thunk as it hit the galvanized iron sheets. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> hardened from failure to ripen. </trans>
</sense>
<sense n=""2""><number>2</number><trans> hardened. </trans>
</sense>
<sense n=""3""><number>3</number> <form id=""kunul_ug_uxlu"" lang=""ceb""><abbr expan=""kunul"" type=""lemma"">—</abbr> ug úlu</form><trans> <tr>stubborn</tr>. </trans>
</sense>
<sense n=""4""><number>4</number><trans> for s.t. to lack the hardness needed to give bounce to things that hit it. </trans>
<eg><i lang=""ceb"">Ang nipis playwud kunul kaáyu untúlan sa búla,</i><trans> If a ball is hit against thin plywood, it won’t bounce well. </trans></eg>
</sense></hom>
<entry><form id=""kunuxlun"" lang=""ceb""><abbr expan=""kunúlun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> of a hard, shrivelled-up sort.
</trans>
</sense></hom></entry></entry>");
