<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kuluxnun""><sc>kulúnun</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#kuxlun""><sc>kúlun</sc></xr>.
</trans>
