INSERT INTO `wced_entry` VALUES (9970, "kunup", "513", "<entry page=""513"" id=""9970""><form id=""kunup"" lang=""ceb"">kunup</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B24]</itype><trans> disappear suddenly en masse. </trans>
<eg><i lang=""ceb"">Mukunup ang tipdas ug mahanginan,</i><trans> A measles rash will disappear if you expose it to the wind. </trans></eg>
<eg><i lang=""ceb"">Pag-abut sa prinsipal, mikunup ang mga maistrang nagtábì,</i><trans> When the principal arrived, the teachers just disappeared. </trans></eg>
<eg><i lang=""ceb"">Mikunup ang mga duut sa isdà nga gitugaw sa dinamíta,</i><trans> The schools of fish disappeared because of the dynamite fishing.
</trans></eg>
</sense></hom></entry>");
