INSERT INTO `wced_entry` VALUES (9971, "kunuskunus", "513", "<entry page=""513"" id=""9971""><form id=""kunuskunus"" lang=""ceb"">kunuskunus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3]</itype><trans> make a rustling sound. </trans>
<eg><i lang=""ceb"">Mukunuskunus gánì ang papil sa basúra náa giyuy ilagà,</i><trans> If the paper in the trash rustles, there must be a rat. </trans></eg>
<eg><i lang=""ceb"">Nagkunuskunus ang dáhun sa hángin,</i><trans> The leaves were rustling in the wind.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (9971, "kunuskunus", "kunuskunus", "m", "v");
INSERT INTO `wced_entry` VALUES (9972, "kunut", "513", "<entry page=""513"" id=""9972""><form id=""kunut"" lang=""ceb"">kunut</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>wrinkle</tr>, fold in s.t. </trans>
<eg><i lang=""ceb"">Daghang kunut ang íyang nawung,</i><trans> She has lots of wrinkles in her face. </trans></eg>
<eg><i lang=""ceb"">May kunut ang karsúnis,</i><trans> <pb n=""514""/>The trousers had pleats in them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> anus or female genitalia (humorous allusion). </trans>
</sense>
<sense n=""2a""><number>2a</number> <form id=""sa_ixmung_kunut"" lang=""ceb"">sa ímung <abbr expan=""kunut"" type=""lemma"">—</abbr></form><trans> expression of disbelief. </trans>
<eg><i lang=""ceb"">Diyis písus sa kunut mu, pára usa ka buuk nga gilabhan,</i><trans> What do you mean ten pesos? You only washed a single piece. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having wrinkles, not flat and smooth. </trans>
</sense></hom>
<entry><form id=""bira_sa_kunut"" lang=""ceb"">bira sa <abbr expan=""kunut"" type=""lemma"">—</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a4]</itype><trans> grow way over a marriageable age (lit. have one’s wrinkles pulled—humorous insult). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[ABN; a2]</itype><trans> for a piece of cloth or skin to be not flat and smooth, cause it to be so. </trans>
<eg><i lang=""ceb"">Mikunut ang tinahian sa sinínà,</i><trans> The dress is sewn with wrinkles at the seams. </trans></eg>
<eg><i lang=""ceb"">Nangunut ang nawung paghinunàhúnà,</i><trans> Her face is wrinkled from thinking so much. </trans></eg>
<eg><i lang=""ceb"">Nakunut ang papil pagkabasà,</i><trans> The paper got wrinkled when it got wet. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> gather pleats or ruffles and sew them into a piece of cloth. </trans>
</sense></hom></entry>
<entry><form id=""kunutun"" lang=""ceb""><abbr expan=""kunutun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>wrinkled</tr>.
</trans>
</sense></hom></entry></entry>");
