INSERT INTO `wced_entry` VALUES (9987, "kupil", "514", "<entry page=""514"" id=""9987""><form id=""kupil"" lang=""ceb"">kupil</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> indistinct in pronunciation, not intelligible. </trans>
<eg><i lang=""ceb"">Kupil siya ug sinultian kay miági man siya ug daut,</i><trans> He has been unable to talk understandably since he underwent a grave illness. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; a12]</itype><trans> for one’s speech to become impossible to understand. </trans>
<eg><i lang=""ceb"">Mukupil ning átung dílà usáhay basta kuyawan ta,</i><trans> We sometimes get tongue-tied when we get frightened. </trans></eg>
</sense></hom>
<entry><form id=""kuxpil"" lang=""ceb""><abbr expan=""kúpil"" type=""lemma"">(←)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> speaking rapidly and indistinctly. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; b6]</itype><trans> come to speak this way. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> talk back in self defense. </trans>
<eg><i lang=""ceb"">Ígù lámang siyang naníngud sa walay pagkúpil sa matag higayun nga hisgútan siya sa íyang kumpári,</i><trans> All he could do was stand idly by and listen whenever his friend would talk about him. (He was so ashamed.) </trans></eg>
</sense></hom></entry>
<entry><form id=""pakuxpil"" lang=""ceb""><abbr expan=""pakúpil"" type=""lemma"">pa-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> allow oneself to be left behind, outclassed or outdone. </trans>
<eg><i lang=""ceb"">Aku pay sapían dì giyud ku magpakúpil sa mga urug sa panaput,</i><trans> If I were rich, I would never allow myself to get left behind by the fashions. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> let s.t. go by without answering back. </trans>
<eg><i lang=""ceb"">Ang asáwa wà magpakúpil sa íyang bána,</i><trans> The wife wouldn’t let the husband get the last word in.
</trans></eg>
</sense></hom></entry></entry>");
