INSERT INTO `wced_entry` VALUES (9993, "kupras", "515", "<entry page=""515"" id=""9993""><form id=""kupras"" lang=""ceb"">kupras</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> copra, dried coconut meat. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> make, get copra. </trans>
<eg><i lang=""ceb"">Magkupras mig ipatimbang,</i><trans> We will make copra to sell by the kilo. </trans></eg>
<eg><i lang=""ceb"">Kuprásun ang kalubihan káda trimistri,</i><trans> The coconut plantation is harvested (made to copra) every four months. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a12]</itype><trans> get money from a candidate and then fail to vote for him. </trans>
<eg><i lang=""ceb"">Gikupras lang diay ang salapì sa kandidátu kay napildi man,</i><trans> The people must have pocketed the money and not voted for him because he lost.
</trans></eg>
</sense></hom></entry>");
