INSERT INTO `wced_entry` VALUES (10001, "kupungkupung, kupungkupung", "515", "<entry page=""515"" id=""10001""><form id=""kupungkupung_kupungkuxpung"" lang=""ceb"">kupungkupung, kupungkúpung</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> thick and dense plant or a cluster of plants. </trans>
