INSERT INTO `wced_entry` VALUES (10002, "kupus", "515", "<entry page=""515"" id=""10002""><form id=""kuxpus"" lang=""ceb"">kúpus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> squeeze to extract the juice from s.t. </trans>
<eg><i lang=""ceb"">Kupúsa ang kinagud lubi,</i><trans> Squeeze the juice out of the shredded coconut meat. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> squeeze s.t. together with s.t. to change the flavor. </trans>
<eg><i lang=""ceb"">Kupúsig súkà ang kinílaw,</i><trans> Squeeze the raw fish together with vinegar. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#kupus""><sc>kupus</sc></xr>. </trans>
</sense></hom>
<entry><form id=""kupus"" lang=""ceb""><abbr expan=""kupus"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> shrunken, shriveled after the juice has been extracted. </trans>
<eg><i lang=""ceb"">Kupus na ákung hubag,</i><trans> My boil has dried up now. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB2]</itype><trans> shrivel, shrink, usually because liquid has been removed, but by extension, because of disease; cause it to do so. </trans>
<eg><i lang=""ceb"">Mikupus ang karning gibulad,</i><trans> The meat shrunk as it was dried in the sun. </trans></eg>
<eg><i lang=""ceb"">Magkupus tag tambuk,</i><trans> Let’s fry fat meat until all of the lard comes out. </trans></eg>
<eg><i lang=""ceb"">Nagkakupus ang láwas sa tisísun,</i><trans> The tubercular’s body is shriveling up. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> shrink away in fear, from cold. </trans>
<eg><i lang=""ceb"">Mukupus nag ímung suklan,</i><trans> He’ll shrink away if you stand up to him. </trans></eg>
<eg><i lang=""ceb"">Mikupus siya sa katugnaw,</i><trans> He shrunk his body into a small ball because of the cold. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinupuxsan"" lang=""ceb""><abbr expan=""kinupúsan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> pulp left after extract has been removed. </trans>
</sense></hom></entry>
<entry><form id=""kinupsan_pinakupsan"" lang=""ceb"">kinupsan, pinakupsan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fat meat fried until all of the lard is removed and nothing but a crunchy mass remains.
</trans>
</sense></hom></entry></entry>");
