INSERT INTO `wced_entry` VALUES (10004, "kuput", "515", "<entry page=""515"" id=""10004""><form id=""kuxput"" lang=""ceb"">kúput</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> characterized by intense activity or movement. </trans>
<eg><i lang=""ceb"">Kúput kaáyu tu sila sa ílang priparasiyun sa pista,</i><trans> They were bustling about in preparation for the fiesta. </trans></eg>
<eg><i lang=""ceb"">Dalì rang mahuman ang trabáhu kay kúput man ang tanan,</i><trans> The work will get done in no time because everybody is working hard. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> intense movement. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; b(1)]</itype><trans> characterized by intensely active movement. </trans>
<eg><i lang=""ceb"">Nagkúput man lang ning lamuk dinhi sa inyu,</i><trans> This place is buzzing with mosquitoes.
</trans></eg>
</sense></hom></entry>");
