INSERT INTO `wced_entry` VALUES (10005, "kupuy", "515", "<entry page=""515"" id=""10005""><form id=""kupuy"" lang=""ceb"">kupuy</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> timid, shy, shrinking back. </trans>
<eg><i lang=""ceb"">Kupuy siyang pagkalaláki, mahadluk ug babáyi,</i><trans> He is a shy person. He is afraid of women. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; b6]</itype><trans> be, become timid or shy. </trans>
<eg><i lang=""ceb"">Mikupuy siyang gihagítan, gikasab-an sa asáwa,</i><trans> He just shrunk back when he was threatened, when his wife cussed him out.
</trans></eg>
</sense></hom></entry>");
