INSERT INTO `wced_entry` VALUES (10006, "kupya", "515", "<entry page=""515"" id=""10006""><form id=""kupya"" lang=""ceb"">kupya</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> copy, imitate, make a copy of s.t. </trans>
<eg><i lang=""ceb"">Kupyáhun ku nang ímung disáyin,</i><trans> I’ll copy your design. </trans></eg>
<eg><i lang=""ceb"">Unsa mang ritratúha ang gikupyáhan?</i><trans> For which picture did you have copies made? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a]</itype><trans> copy in an exam. </trans>
<eg><i lang=""ceb"">Nangupya siya. Maung nakapasar,</i><trans> He copied. That’s why he passed. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> copy. </trans>
<eg><i lang=""ceb"">Sitinta sintábus na ang kupya sa Bisayà,</i><trans> The Bisaya costs seventy cents a copy now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> print of a photo. </trans>
</sense></hom>
<entry><form id=""pakupya"" lang=""ceb""><abbr expan=""pakupya"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> have a photograph reproduced. </trans>
</sense></hom></entry>
<entry><form id=""kupyadur"" lang=""ceb""><abbr expan=""kupyadur"" type=""lemma"">-dur(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a copyist, one who makes written copies. </trans>
<eg><i lang=""ceb"">Náay kupyadur sa ámung upisína kusug kaáyung mumakinilya,</i><trans> There’s a copyist in our office who types very fast. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> one who imitates, <pb n=""516""/>copycat. </trans>
</sense>
<sense n=""3""><number>3</number><trans> one who copies in exams. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156]</itype><trans> be, become a copyist. </trans>
</sense></hom></entry>
<entry><form id=""kupyaxmus"" lang=""ceb""><abbr expan=""kupyámus"" type=""lemma"">-mus</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> a <tr>cheat</tr> in exams (colloquial). </trans>
<eg><i lang=""ceb"">Gibantayan pag-áyu sa maistra si Ális kay kupyámus kaáyu,</i><trans> The teacher watched Alice closely because she is known to copy.
</trans></eg>
</sense></hom></entry></entry>");
