INSERT INTO `wced_entry` VALUES (10018, "kurang", "516", "<entry page=""516"" id=""10018""><form id=""kurang"" lang=""ceb"">kurang</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> lesbian (derogatory). </trans>
</sense></hom>
