INSERT INTO `wced_entry` VALUES (10019, "kurangut", "516", "<entry page=""516"" id=""10019""><form id=""kurangut"" lang=""ceb"">kurangut</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> rough, rugged in surface. </trans>
<eg><i lang=""ceb"">Kurangut ug pánit,</i><trans> Rough-skinned. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> ugly-faced. </trans>
<eg><i lang=""ceb"">Ug kurangut tag dagway bawiun tas batásan,</i><trans> If you have an ugly face, compensate for it with a pleasant disposition. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> become craggy of surface. </trans>
<eg><i lang=""ceb"">Mukurangut (makurangut) ang ibabaw sa lamísag hiwáan,</i><trans> The surface of the table will become rough if you use it to slice things on. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> become ugly in face.
</trans>
</sense></hom></entry>");
