INSERT INTO `wced_entry` VALUES (10020, "kurapkurap", "516", "<entry page=""516"" id=""10020""><form id=""kurapkurap"" lang=""ceb"">kurapkurap</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B146]</itype><trans> for lights to flicker. </trans>
<eg><i lang=""ceb"">Nagkurapkurap ang lamparilya nga wà nay gás,</i><trans> The kerosene lamp is flickering because the kerosene is almost gone. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A13P]</itype><trans> grope in the dark. </trans>
<eg><i lang=""ceb"">Nagkurapkurap mi sa kangitngit,</i><trans> We were groping in the dark. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B4N]</itype><trans> for vision to become blurred. </trans>
<eg><i lang=""ceb"">Nagkurapkurap ang mata sa tigúwang,</i><trans> The vision of the old man is blurred.
</trans></eg>
</sense></hom></entry>");
