INSERT INTO `wced_entry` VALUES (10021, "kurapsiyun", "516", "<entry page=""516"" id=""10021""><form id=""kurapsiyun"" lang=""ceb"">kurapsiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> corruption in the government or in a corporation. </trans>
