INSERT INTO `wced_entry` VALUES (10027, "kuraw", "517", "<entry page=""517"" id=""10027""><form id=""kuxraw"" lang=""ceb"">kúraw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> stir or agitate to make it smooth and even. </trans>
<eg><i lang=""ceb"">Nagkúraw ku sa amirul arun dì matibug-uk,</i><trans> I’m stirring the starch so that it won’t form lumps. </trans></eg>
<eg><i lang=""ceb"">Kuráwa ang binulad arun mauga ug dalì,</i><trans> Stir the corn around so it will dry quickly. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> shuffle mahjong pieces. </trans>
</sense></hom>
<entry><form id=""kuxraw_ug_kinhasun"" lang=""ceb""><abbr expan=""kúraw"" type=""lemma"">—</abbr> ug kinhasun</form>
<hom role=""v""><pos>v</pos>
