<sense n=""0""> <itype>[A]</itype><trans> move with a wriggling motion. </trans>
<eg><i lang=""ceb"">Mukurayag ang kasing nga karagan,</i><trans> An unbalanced top wriggles. </trans></eg>
<eg><i lang=""ceb"">Nagkurayag ang mga wayawaya,</i><trans> The mosquito <corr sic=""larva"">larvae</corr> are wriggling.
</trans></eg>
