INSERT INTO `wced_entry` VALUES (10030, "kurayus", "517", "<entry page=""517"" id=""10030""><form id=""kuraxyus"" lang=""ceb"">kuráyus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B26N; b6]</itype><trans> be, become shriveled, wrinkled, withered. </trans>
<eg><i lang=""ceb"">Mikuráyus (nanguráyus) pag-áyu ang kusáhus sa hilabihang kaínit,</i><trans> The jerked meat shriveled up very much because it was left in the sun too long. </trans></eg>
<eg><i lang=""ceb"">Mikuráyus (nanguráyus) ang luy-a nga dúgay nang gihípus,</i><trans> The ginger got shriveled because it was left lying around too long. </trans></eg>
<eg><i lang=""ceb"">Makuráyus ang nawung basta tigúlang na,</i><trans> Your face wrinkles when you get old.
</trans></eg>
</sense></hom></entry>");
