INSERT INTO `wced_entry` VALUES (10046, "kuridas", "518", "<entry page=""518"" id=""10046""><form id=""kurixdas"" lang=""ceb"">kurídas</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> for a number of examples of an item to be bought or otherwise taken at random without selection. </trans>
<eg><i lang=""ceb"">Tagsingku písus ang gatus sa tamátis, apan kurídas. Walay pílì,</i><trans> Tomatoes are five pesos a hundred, but you take them at random. You’re not allowed to choose. </trans></eg>
<eg><i lang=""ceb"">Kurídas ang pagkasulud sa prútas sa baskit,</i><trans> They put the fruits in the basket without sorting them out. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> take a bunch without selecting. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> in billiards, make a carom with all the three balls in straight line but with the cue ball not bouncing off the sides of the billiard table. </trans>
</sense>
<sense n=""2b""><number>2b</number><trans> shoot two or more billiards into the pocket with one shot.
</trans>
</sense></hom></entry>");
