INSERT INTO `wced_entry` VALUES (10072, "kurna1", "519", "<entry page=""519"" id=""10072""><form id=""kurna"" lang=""ceb"">kurna<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> tow s.t. that cannot run on its own power. </trans>
<eg><i lang=""ceb"">Kurnáhun (ikurna) na lang nang dyíp ngadtu sa talyir,</i><trans> Better have the jeep towed to the repair shop. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> drag s.o. s.w. </trans>
<eg><i lang=""ceb"">Nangumprang gikurna ang mga bátà,</i><trans> Shopping dragging the children along. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a2]</itype><trans> find s.o. unexpectedly s.w. and pick him up. </trans>
<eg><i lang=""ceb"">Sundálu ang nagkurna sa tulisan ngadtu sa búkid,</i><trans> A soldier found the bandit unexpectedly in the mountains and picked him up. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> meet s.o. with goods of his own production on the way to market and buy them from him. </trans>
<eg><i lang=""ceb"">Ug makurna nímu ang kuhà sa mananagat, barátu ra,</i><trans> If you can buy the fish directly from the fisherman, it’s cheap. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> pick up a girl in a public place for promiscuous petting. </trans>
<eg><i lang=""ceb"">Adtu siya sa barátung sinihan mangurna,</i><trans> He goes to cheap movie houses and picks up s.o. to pet with. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number> <itype>[A; a12]</itype><trans> take a girl around for rides. </trans>
<eg><i lang=""ceb"">Gwápa tung ímung gikurna gabíi,</i><trans> The girl you took around last night was pretty. </trans></eg>
</sense></hom>
<entry><form id=""kurnaxda"" lang=""ceb""><abbr expan=""kurnáda"" type=""lemma"">-da</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kurna""><sc>kurna<sub>1</sub></sc></xr>, 1.
</trans>
</sense></hom></entry></entry>");
