INSERT INTO `wced_entry` VALUES (10093, "kursunada", "520", "<entry page=""520"" id=""10093""><form id=""kursunaxda"" lang=""ceb"">kursunáda</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> guts, courage, drive.</trans>
<eg><i lang=""ceb""> May kursunáda siya. Dì giyud mahadluk musulay,</i><trans> He has guts. He is not afraid to try. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> unashamed boldness, impudence. </trans>
<eg><i lang=""ceb"">May kursunáda giyung tawhána sa pagpangáyù ug umintu sa íyang súhul,</i><trans> That man had the nerve to ask for a raise in salary. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> have an interest in doing s.t. </trans>
<eg><i lang=""ceb"">Wà kuy kursunádang mubayli níya kay maut,</i><trans> I don’t feel like dancing with her because she is stuck up. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> a girl one is interested in. </trans>
<eg><i lang=""ceb"">Mutambung kug sigúru sa parti kay túa ang ákung kursunáda,</i><trans> I won’t fail to attend the party because a girl I am interested in will be there. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2N; bN]</itype><trans> get an interest, guts enough to do s.t. </trans>
<eg><i lang=""ceb"">Mukursunáda (mangursunáda) siyag hákut basta suhúlan,</i><trans> He’ll develop an interest in hauling the stuff if you pay him. </trans></eg>
<eg><i lang=""ceb"">Nakakursunáda ku human makainum,</i><trans> I became bold after I had a drink. </trans></eg>
<eg><i lang=""ceb"">Sapátus nga ákung gipangursunadáhan (gikursunadáhan),</i><trans> The shoes I was interested in.
</trans></eg>
</sense></hom></entry>");
