INSERT INTO `wced_entry` VALUES (10096, "kurta2", "520", "<entry page=""520"" id=""10096""><form id=""kurta2"" lang=""ceb"">kurta<sub>2</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for eggs or milk to be spoiled, usually from exposure to sun. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for the brain to be addled. </trans>
</sense>
<sense n=""3""><number>3</number><trans> for menstruation to stop or hardly flow. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for eggs or milk to get spoiled. </trans>
<eg><i lang=""ceb"">Mukurta ang gátas (itlug) ug dílì hipúsun sa pridyidir,</i><trans> Milk (eggs) spoil if you don’t keep them in the refrigerator. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for the mind to be addled. </trans>
<eg><i lang=""ceb"">Mikurta ang íyang útuk sa kahadluk,</i><trans> His brain became addled because of his extreme fright. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B246; b4]</itype><trans> for menstruation to stop suddenly before the proper time. </trans>
<eg><i lang=""ceb"">Mukurta ang dugù ug mag-útas ug káun ug aslum,</i><trans> Your menstrual flow will halt if you always eat lots of sour foods. </trans></eg>
</sense></hom>
<entry><form id=""kurtaxdu"" lang=""ceb""><abbr expan=""kurtádu"" type=""lemma"">-du</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kurta2""><sc>kurta<sub>2</sub></sc></xr>.
</trans>
</sense></hom></entry></entry>");
