INSERT INTO `wced_entry` VALUES (10098, "kurti1", "520", "<entry page=""520"" id=""10098""><form id=""kurti"" lang=""ceb"">kurti<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> measure of cloth cut in advance. </trans>
<eg><i lang=""ceb"">Tagpíla man ang kurti íning karsunisúna?</i><trans> How much is this pant, material per cut? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> shape, type of a face. </trans>
<eg><i lang=""ceb"">Nawung nga kurtig katsílà,</i><trans> A face with a Spanish shape. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> style in which s.t. is cut. </trans>
<eg><i lang=""ceb"">Nindut ug kurti ang ímung alut,</i><trans> Your hair is cut in a nice style. </trans></eg>
<eg><i lang=""ceb"">Wà ku makagustu sa kurti sa íyang bistídu,</i><trans> I don’t like the cut of her dress. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ab]</itype><trans> delineate a desired shape or pattern on s.t. to be cut or cut into a certain shape. </trans>
<eg><i lang=""ceb"">Akuy kurti sa panaptun ikay tábas,</i><trans> I’ll make the pattern on the cloth, you cut it. </trans></eg>
<eg><i lang=""ceb"">Kurtíhag kinasingkásing paggabas ang tabla,</i><trans> Saw the wood into the shape of a heart. </trans></eg>
<eg><i lang=""ceb"">Kurtíhan ta nang kílay mu,</i><trans> Let’s trim your eyebrows. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> cut a deck of cards. </trans>
<eg><i lang=""ceb"">Wà pa gániy nakakurti, íya nang gipanghátag ang mga baráha,</i><trans> No one has cut the cards, but he has already dealt. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; b6]</itype><trans> join in a pleasurable activity where one is not immediately concerned. </trans>
<eg><i lang=""ceb"">Samtang gikasab-an ag míd, mikurti sab ku,</i><trans> While they were cussing out the maid, I also put in my two bits. </trans></eg>
<eg><i lang=""ceb"">Gikurtíhan sa mayur ang ílang pag-isturyahánay,</i><trans> The mayor put his two bits into their conversation. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> participate in the giving of punishment, usually physical punishment. </trans>
<eg><i lang=""ceb"">Mikurti kug sumbag sa kawatan nga hidakpan,</i><trans> I joined in mauling the thief they caught. </trans></eg>
</sense>
<sense n=""3a1""><number>3a1</number> <itype>[b8]</itype><trans> be ganged up on. </trans>
<eg><i lang=""ceb"">Hikurtihan siya pag-adtu níyas Pásil,</i><trans> S.o. ganged up on him when he went to Pasil. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <itype>[A; b(1)]</itype><trans> acknowledge that s.o. has new wearing apparel or haircut by touching the new thing. <pb n=""521""/></trans>
<eg><i lang=""ceb"">Nakakurti na ku sa bag-ung sapátus ni Buy,</i><trans> I have already acknowledged Boy’s new shoes by stepping on them. </trans></eg>
<eg><i lang=""ceb"">Kurtíhi si Ramun kay bag-ug tupi,</i><trans> Slap Ramon on the head in acknowledgement of his haircut. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> use s.t. belonging to s.o. else usually for a brief period of time. </trans>
</sense>
<sense n=""4a""><number>4a</number><trans> try doing s.t. </trans>
<eg><i lang=""ceb"">Nakakurti na bitaw kug sakays mutur, piru nabanggà ku,</i><trans> I have tried driving a motorcycle, but I crashed. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; b]</itype><trans> refute s.t. said. </trans>
<eg><i lang=""ceb"">Kurtíhan ku nang ímung gisulti,</i><trans> I will refute what you said.
</trans></eg>
</sense></hom></entry>");
