INSERT INTO `wced_entry` VALUES (10102, "kurtin risir", "521", "<entry page=""521"" id=""10102""><form id=""kurtin_rixsir"" lang=""ceb"">kurtin rísir</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> preliminary boxing bouts before the main events. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> boxer who fights only in preliminary bouts, usually in four rounds. </trans>
