<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156; c]</itype><trans> be, become a curtain raiser. </trans>
<eg><i lang=""ceb"">Pirmi ka lang magkurtin rísir, wà giyud mamin-ibintir,</i><trans> You are always used as a curtain raiser. You never fight in a main event. </trans></eg>
<eg><i lang=""ceb"">Ang ímung áwit mauy ikurtin rísir sa dílì pa ang banggà,</i><trans> Your song will be made the curtain raiser for the contest.
