INSERT INTO `wced_entry` VALUES (10113, "kurukunghu", "521", "<entry page=""521"" id=""10113""><form id=""kurukunghu"" lang=""ceb"">kurukunghu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> being a simpleton and slightly crazy. </trans>
<eg><i lang=""ceb"">Lisud pasabtun ning mga táwu nga kurukunghu,</i><trans> It’s very difficult to get simpletons to understand. </trans></eg>
<eg><i lang=""ceb"">Naghúbù sa kadaghánan ang kurukunghu,</i><trans> The simpleton is getting undressed in public. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> be, become silly, witless, a simpleton.
</trans>
</sense></hom></entry>");
