INSERT INTO `wced_entry` VALUES (10114, "kurukuntung", "521", "<entry page=""521"" id=""10114""><form id=""kurukuntung"" lang=""ceb"">kurukuntung</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> eccentric in behavior, doing things deemed unusual if not improper. </trans>
<eg><i lang=""ceb"">Kurukuntung siya kay nagswitir ug ting-init,</i><trans> He is eccentric because he wears a sweater during hot weather. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B125; b6]</itype><trans> be, become eccentric.
</trans>
</sense></hom></entry>");
