INSERT INTO `wced_entry` VALUES (10115, "kurukuru", "521", "<entry page=""521"" id=""10115""><form id=""kurukuxru"" lang=""ceb"">kurukúru</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> for cocks to parry and stab on the wing. </trans>
<eg><i lang=""ceb"">Lúgus maila unsang manúka naigù sa nagkurukúru silang duha,</i><trans> It is hard to tell which rooster was hit while the two were parrying and stabbing at <corr sic=""each each"">each</corr> other on the wing. </trans></eg>
<eg><i lang=""ceb"">Midágan ag íyang sunuy dihang gikurukurúhan sa ákù,</i><trans> His rooster fled when mine parried and stabbed at it on the wing.
</trans></eg>
</sense></hom></entry>");
