INSERT INTO `wced_entry` VALUES (10116, "kurukutuk1", "521", "<entry page=""521"" id=""10116""><form id=""kurukutuk"" lang=""ceb"">kurukutuk<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sound made by chickens in summoning other chickens. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> for a rooster or hen to make a sound like <ix>kurukutuk.</ix> </trans>
<eg><i lang=""ceb"">Mingkurukutuk dáyun ang sunuy pagkakità sa himungáan,</i><trans> The rooster immediately called the hen when he saw her. </trans></eg>
<eg><i lang=""ceb"">Gikurukutukan sa himungáan ang íyang <pb n=""522""/>mga pisù,</i><trans> The mother hen called her chicks.
</trans></eg>
</sense></hom></entry>");
