INSERT INTO `wced_entry` VALUES (10118, "kurum", "522", "<entry page=""522"" id=""10118""><form id=""kuxrum"" lang=""ceb"">kúrum</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> quorum of a meeting. </trans>
</sense>
<sense n=""2""><number>2</number><trans> have a requisite number of people for a game of cards or other table game. </trans>
<eg><i lang=""ceb"">Kúrum na giyud ta, magmadyung na ta dáyun,</i><trans> We’ve got a quorum, so let’s start our mahjong at once. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> have an intimate get-together, esp. for drinks (slang). </trans>
<eg><i lang=""ceb"">Dúnay kúrum sa ámung balay karung gabíi,</i><trans> We’ll have a drinking session in our house tonight. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B13(1)6; b6]</itype><trans> form a quorum in a meeting or for a game. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[C; c]</itype><trans> have an intimate get-together among friends.
</trans>
</sense></hom></entry>");
