INSERT INTO `wced_entry` VALUES (10119, "kuruna", "522", "<entry page=""522"" id=""10119""><form id=""kuruxna"" lang=""ceb"">kurúna</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> crown of royalty or royalty in a pageant. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> garland put on the head. </trans>
</sense>
<sense n=""1b""><number>1b</number><trans> crown as a symbol of supremacy. </trans>
<eg><i lang=""ceb"">Maílug kahà ang kurúna sa átung kampiyun?</i><trans> Will anyone wrest the champion’s crown from him? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> wreath of flowers as an offering for the dead. </trans>
</sense>
<sense n=""3""><number>3</number><trans> priest’s tonsure. </trans>
</sense>
<sense n=""4""><number>4</number><trans> tails of a coin. </trans>
</sense>
<sense n=""5""><number>5</number><trans> the curved lower part of the anchor. </trans>
<eg><i lang=""ceb"">Ang kurúna sa angkla mauy mag-una pagbungad sa bunbun,</i><trans> The crown of the anchor touches the sand first. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> a small side-compartment in the fish corral (<ix>bungsud</ix>) into which the fish which were not caught in the main compartment are driven. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> crown royalty. </trans>
<eg><i lang=""ceb"">Ang gubirnadur mauy mikurúna sa hára,</i><trans> The governor crowned the beauty queen. </trans></eg>
<eg><i lang=""ceb"">Si Kristu gikurunáhan ug tunuk,</i><trans> Jesus Christ was crowned with thorns. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[a12]</itype><trans> make into a crown or wreath. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> put a wreath on a grave or coffin. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[b(1)]</itype><trans> tonsure a priest. </trans>
<eg><i lang=""ceb"">Gikurunáhan na ag manghud kung siminarista,</i><trans> My brother in the seminary has already been given his tonsure. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B256; a2]</itype><trans> for tails to come up in coin tossing. </trans>
<eg><i lang=""ceb"">Mukurúna (makurúna) gánì ni, ikaw na say antug,</i><trans> If this comes out tails, you take a turn in tossing. </trans></eg>
</sense></hom>
<entry><form id=""panguruxna"" lang=""ceb""><abbr expan=""pangurúna"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b(1)]</itype><trans> for the baby to crown in delivery. </trans>
<eg><i lang=""ceb"">Nangurúna na ang úlu sa bátà,</i><trans> The baby has already crowned.
</trans></eg>
</sense></hom></entry></entry>");
