INSERT INTO `wced_entry` VALUES (10123, "kurungkuntung", "522", "<entry page=""522"" id=""10123""><form id=""kurungkuntung"" lang=""ceb"">kurungkuntung</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> somewhat mentally retarded or not able to think. </trans>
<eg><i lang=""ceb"">Dílì makatumung sugúun ang táwung kurungkuntung,</i><trans> A person who is somewhat retarded cannot do errands properly. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> lose one’s common sense, ability to think reasonably. </trans>
<eg><i lang=""ceb"">Nakurungkuntung siya pagkabangkarúta sa íyang nigusyu,</i><trans> After he went bankrupt he began to act unreasonably—as if his mind were s.w. else.
