INSERT INTO `wced_entry` VALUES (10133, "kuryinti", "523", "<entry page=""523"" id=""10133""><form id=""kuryinti"" lang=""ceb"">kuryinti</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> electric current. </trans>
</sense>
<sense n=""2""><number>2</number><trans> electric wire. </trans>
<eg><i lang=""ceb"">Ang tabánug nasángit sa kuryinti,</i><trans> The kite is entangled in the electric wire. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A23; b]</itype><trans> shocked with electricity. </trans>
<eg><i lang=""ceb"">Kuryintihan kag hikápun nà nímu,</i><trans> You’ll get a shock if you touch that. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23]</itype><trans> give a feeling similar to a shock when the soft area within the elbow joint is hit. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[b(1)]</itype><trans> for s.o. not invited to be taken along to a party by s.o. who was invited (humorous). </trans>
<eg><i lang=""ceb"">Nitambung sad sila sa parti kay nakuryintihan tu sila,</i><trans> They attended the party as well because they were taken along by one of the invited guests. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2; b]</itype><trans> among children, for a child to do to the person nearest him, what s.o. did to him, and for the person who had that happen to him to go ahead and do it to another child, and so forth. </trans>
<eg><i lang=""ceb"">Nanghapak siya, dì gikuryintihan sab dáyun nákù ang ákung tupad,</i><trans> He slapped me, and so I slapped my seatmate. </trans></eg>
</sense></hom>
<entry><form id=""dikuryinti"" lang=""ceb""><abbr expan=""dikuryinti"" type=""lemma"">di-</abbr></form>
<hom>
<sense n=""0""><trans> <tr>electrified</tr>, operated by electricity. </trans>
</sense></hom></entry>
<entry><form id=""kuryintisyan"" lang=""ceb""><abbr expan=""kuryintisyan"" type=""lemma"">-syan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>electrician</tr> (humorous slang).
</trans>
</sense></hom></entry></entry>");
