INSERT INTO `wced_entry` VALUES (10141, "kusbat", "523", "<entry page=""523"" id=""10141""><form id=""kusbat"" lang=""ceb"">kusbat</form>
<hom>
<sense n=""1""><number>1</number><trans> in a <tr>mess</tr>, <tr>disorder</tr>. </trans>
<eg><i lang=""ceb"">Kusbat kaáyu ang ímung buhuk kay wà nímu bubhúig brilyantin,</i><trans> Your hair is a mess because you didn’t put any brilliantine in it. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> having a <tr>nasty</tr> expression on the face. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>tear</tr> s.t. apart with the hands or teeth. </trans>
<eg><i lang=""ceb"">Mga irù ang mikusbat sa baskit,</i><trans> The dogs tore the basket apart. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB1; ab4]</itype><trans> get in <tr>disarray</tr>, disordered; cause s.t. to become messy. </trans>
<eg><i lang=""ceb"">Kinsay nagkusbat íning butang sa lamísang mu rag giagiag bagyu?</i><trans> Who made this mess on the table? It looks as though a tempest had passed over it. </trans></eg>
<eg><i lang=""ceb"">Nagkusbat (gikusbátan) ang íyang nawung sa lápuk,</i><trans> His face was a mess with all the mud. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B; c1]</itype><trans> for the face to get a nasty expression on it. </trans>
<eg><i lang=""ceb"">Mikusbat ang íyang nawung pagkáun sa aslum,</i><trans> Her face screwed up when she ate the sour stuff.
</trans></eg>
</sense></hom></entry>");
