<eg><i lang=""ceb"">Sulúra ang nagkakuslad nga buhuk,</i><trans> Comb the louse-infested hair with a fine comb. </trans></eg>
<eg><i lang=""ceb"">Sígi lag pangáwut sa buhuk ang babáying gikuslad,</i><trans> The woman keeps scratching her hair because she is infested with lice.
</trans></eg>
</sense></hom></entry>");
