INSERT INTO `wced_entry` VALUES (10155, "kusmu", "524", "<entry page=""524"" id=""10155""><form id=""kusmu"" lang=""ceb"">kusmu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b6]</itype><trans> snort, blow air out through the nose and vocalize at the same time. </trans>
<eg><i lang=""ceb"">Gikusmúhan lang ku sa kabáyù,</i><trans> The horse snorted at me. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> snort. </trans>
</sense></hom>
<entry><form id=""pangusmu"" lang=""ceb""><abbr expan=""pangusmu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> snort in anger or as a sign of displeasure. </trans>
<eg><i lang=""ceb"">Nagpangusmu ang bána sa kalágut nga milakaw ang íyang asáwa,</i><trans> The husband snorted in anger upon hearing that his wife had gone out. </trans></eg>
<eg><i lang=""ceb"">Nakapangusmu ku sa kabahù sa patay nga ilagà,</i><trans> I snorted with displeasure at the smell of the dead rat.
</trans></eg>
</sense></hom></entry></entry>");
