INSERT INTO `wced_entry` VALUES (10158, "kusnit", "524", "<entry page=""524"" id=""10158""><form id=""kusnit"" lang=""ceb"">kusnit</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> rip into little pieces, pinch off a tiny portion from s.t. </trans>
<eg><i lang=""ceb"">Mikusnit kug gamay sa ímung sinugbang isdà,</i><trans> I pinched off a tiny portion from your broiled fish. </trans></eg>
<eg><i lang=""ceb"">Ayaw kusníta ang papil,</i><trans> Don’t rip up the paper. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pinch, tweak. </trans>
<eg><i lang=""ceb"">Kusníta ang íyang dunggan ug dì mamínaw,</i><trans> Tweak her ears if she doesn’t listen. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> action of ripping or pinching. </trans>
</sense>
<sense n=""2""><number>2</number><trans> amount pinched off from. </trans>
</sense></hom>
<entry><form id=""kusnitkusnit"" lang=""ceb"">kusnitkusnit</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1]</itype><trans> pinch s.t. softly many times over a surface to tickle or caress. </trans>
<eg><i lang=""ceb"">Duha ka babáyi ang mikusnitkusnit (nagkusnitkusnit) sa íyang áping didtu sa bar,</i><trans> Two women were pecking at his cheeks in the bar. </trans></eg>
</sense></hom></entry>
<entry><form id=""kinusnitan"" lang=""ceb""><abbr expan=""kinusnitan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> thing s.o. pinched. </trans>
<eg><i lang=""ceb"">Nagdugù ang ímung kinusnitan,</i><trans> The part of the skin that you pinched is bleeding.
</trans></eg>
</sense></hom></entry></entry>");
