INSERT INTO `wced_entry` VALUES (10159, "kusnut", "524", "<entry page=""524"" id=""10159""><form id=""kusnut"" lang=""ceb"">kusnut</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> wrinkled, crumpled. </trans>
<eg><i lang=""ceb"">Kusnut na kaáyu ning ákung sinínà,</i><trans> My clothes are very <pb n=""525""/>wrinkled. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a]</itype><trans> wrinkle, crumple. </trans>
<eg><i lang=""ceb"">Sa ákung kalágut gikusnut ku dáyun ang ákung papil,</i><trans> In my anger I immediately crumpled my paper. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> disarrange hair. </trans>
<eg><i lang=""ceb"">Ayawg kusnúta ang ímung buhuk,</i><trans> Don’t rumple your hair. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN; ab2]</itype><trans> take hold of s.o. with a pinch and a twist. </trans>
<eg><i lang=""ceb"">Mukusnut (mangusnut) ra ba ku dáyun kun akuy maglágut,</i><trans> I readily take hold and pinch when I am provoked. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> wrinkle in cloth, paper, and the like.
</trans>
</sense></hom></entry>");
