INSERT INTO `wced_entry` VALUES (10166, "kustar2", "525", "<entry page=""525"" id=""10166""><form id=""kusta4r2"" lang=""ceb"">kustǎr<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> last, take a certain length of time. </trans>
<eg><i lang=""ceb"">Mukustǎr ug dúgay ang karni basta ibutang sa ripridyirítur,</i><trans> Meat will stay fresh long if you keep it in the refrigerator. </trans></eg>
<eg><i lang=""ceb"">Makakustǎr sigúru ug dúgay ang pag-imbistigar sa krímin,</i><trans> The investigation of the crime may well take a long time. </trans></eg>
<eg><i lang=""ceb"">Kustahan giyud siyag tagurha ka túig sa íyang sapátus,</i><trans> His shoes last him two years.
</trans></eg>
</sense></hom></entry>");
