INSERT INTO `wced_entry` VALUES (10167, "kustiyada, kustiyar", "525", "<entry page=""525"" id=""10167""><form id=""kustiyaxda_kustiyar"" lang=""ceb"">kustiyáda, kustiyar</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12N; c]</itype><trans> go, travel to another place for a purpose. </trans>
<eg><i lang=""ceb"">Mangustiyáda (mangustiyar) silag panugal,</i><trans> They go to other places to gamble. </trans></eg>
<eg><i lang=""ceb"">Nagkustiya (nagkustiyáda) sila sa kabaryúhan ug pamaligyag panaptun,</i><trans> They traveled to the rural areas to sell dress material. </trans></eg>
</sense></hom>
<entry><form id=""pangustiyaxda_pangustiyar"" lang=""ceb""><abbr expan=""pangustiyáda, pangustiyar"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c]</itype><trans> venture into some undertaking. </trans>
<eg><i lang=""ceb"">Nangustiyáda (nangustiyar) siyag apil sa banggà sa áwit,</i><trans> He ventured to participate in the singing contest. </trans></eg>
<eg><i lang=""ceb"">Kining kantidára ígù nang ipangustiyáda (ipangustiyar) ug nigusyu,</i><trans> This amount is enough to venture into business with. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> make efforts, do whatever it takes. </trans>
<eg><i lang=""ceb"">Sa kawad-un mangustiyáda giyud ta arun mabúhì,</i><trans> Because of our poverty we must do whatever is necessary to make ends meet. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> going to other places for a purpose. </trans>
</sense>
<sense n=""2""><number>2</number><trans> venturing to do s.t. </trans>
</sense>
<sense n=""3""><number>3</number><trans> efforts expended to achieve s.t. </trans>
</sense></hom></entry>
<entry><form id=""kustiyadur"" lang=""ceb"">kustiyadur</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> one who ventures to go out to other places with a purpose.
</trans>
</sense></hom></entry></entry>");
