INSERT INTO `wced_entry` VALUES (10170, "kustumbri", "525", "<entry page=""525"" id=""10170""><form id=""kustumbri"" lang=""ceb"">kustumbri</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> customs, established practice of a group. </trans>
<eg><i lang=""ceb"">Kustumbri dinhi sa upisínang mangadyì úsà mutrabáhu,</i><trans> It is a custom in our office to say a prayer before we begin work. </trans></eg>
<eg><i lang=""ceb"">Kustumbri sa mga Pilipínu nga muamin sa mga tigúlang,</i><trans> It is the custom of Filipinos to kiss the hands of their old folks. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> characteristic nature of an individual. </trans>
<eg><i lang=""ceb"">Ngil-ad ug kustumbri nang babayhána, bintahúsa,</i><trans> That woman has a bad character. She takes advantage of others.
</trans></eg>
</sense></hom></entry>");
