INSERT INTO `wced_entry` VALUES (10174, "kusug", "525", "<entry page=""525"" id=""10174""><form id=""kusug"" lang=""ceb"">kusug</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>fast</tr>, <tr>rapid</tr>. </trans>
<eg><i lang=""ceb"">Kusug mudágan ang trín,</i><trans> The train travels fast. </trans></eg>
<eg><i lang=""ceb"">Kusug kaáyu ang dágan sa úras,</i><trans> Time flies very quickly. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> loud, heavy or forceful motion. </trans>
<eg><i lang=""ceb"">Kusug ang butu sa luthang,</i><trans> The bamboo cannon gave out a loud boom. </trans></eg>
<eg><i lang=""ceb"">Kusug kaáyu ang pagkahagbà ni Sísar,</i><trans> Caesar fell with a hard thug. </trans></eg>
<eg><i lang=""ceb"">Kusug nga bundak sa uwan,</i><trans> Heavy downpour. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> selling brisk. </trans>
<eg><i lang=""ceb"">Kusug kaáyu ang pálit áning tindahána,</i><trans> This store does a brisk business. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> avid doer of s.t. </trans>
<eg><i lang=""ceb"">Kusug siyang mangulikta ug silyu,</i><trans> He is fond of collecting stamps. </trans></eg>
<eg><i lang=""ceb"">Kusug siyang mukáug mangga,</i><trans> He loves to eat mangoes. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB3; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. fast, rapidly, become fast, rapid; cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Mikusug siya paglakaw kay nalít na siya,</i><trans> She walked quickly as she was already late. </trans></eg>
<eg><i lang=""ceb"">Kinsa may nagkusug ug patúyuk sa bintiladur?</i><trans> Who made the electric fan turn very fast? </trans></eg>
<eg><i lang=""ceb"">Nakusug (mikusug) ang pag-andar sa makina,</i><trans> The engine started to revolve faster. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. in a loud, heavy way; become loud, heavy. </trans>
<eg><i lang=""ceb"">Kusga (ikusug) pagsulti kay bungul nang ímung gikaatúbang,</i><trans> Talk loudly because the person you are conversing with is deaf. </trans></eg>
<eg><i lang=""ceb"">Dílì ni makakusug hangína,</i><trans> This won’t develop into a strong wind. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A12]</itype><trans> have strength to do s.t. </trans>
<eg><i lang=""ceb"">Káun pag-áyu arun makakusug kag dáru,</i><trans> Eat well so you’ll have the strength to plow. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B2; b(1)]</itype><trans> for sales to become brisk. </trans>
<eg><i lang=""ceb"">Ang pálit sa dulyar mauy gikusúgan <pb n=""526""/>karun,</i><trans> Dollar-buying is brisk business nowadays. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B2; b4]</itype><trans> do s.t. avidly, at a rate more than normal. </trans>
<eg><i lang=""ceb"">Mukusug siyag káun basta ganáhan,</i><trans> He eats plenty if he feels like it. </trans></eg>
<eg><i lang=""ceb"">Gidalì pagtabang ang bag-ung nanganak kay gikusgan sa dugù,</i><trans> The woman who has just delivered was treated as an emergency case because she was bleeding fast. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> dynamic strength, force. </trans>
<eg><i lang=""ceb"">Wà na kuy kusug itrabáhu tungud sa kagútum,</i><trans> I have lost my strength to work because of hunger. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> muscle. </trans>
<eg><i lang=""ceb"">Nangugdal ang kusug sa barbiládu,</i><trans> The weight lifter’s muscles bulged. </trans></eg>
</sense></hom>
<entry><form id=""pangusug"" lang=""ceb""><abbr expan=""pangusug"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> exert strength, do s.t. energetically. </trans>
<eg><i lang=""ceb"">Nangusug siyang miupunir sa ákung musiyun,</i><trans> He opposed my motion energetically. </trans></eg>
<eg><i lang=""ceb"">Wà maalsa ang lamísa kay wà ku makapangusug,</i><trans> I didn’t lift the table because I didn’t exert enough effort. </trans></eg>
<eg><i lang=""ceb"">Pangusgi pagpugung ang bátà arun dì kadágan,</i><trans> Hold the child securely so he can’t run away. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> tense one’s muscles. </trans>
<eg><i lang=""ceb"">Ayaw pangusug ug indyiksiyunan ka,</i><trans> Don’t tense your muscles if you are injected. </trans></eg>
</sense></hom></entry>
<entry><form id=""hinguxsug"" lang=""ceb""><abbr expan=""hingúsug"" type=""lemma"">hiN-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13N; b(1)]</itype><trans> do s.t. as quickly as one can, putting all one’s energy into it. </trans>
<eg><i lang=""ceb"">Naghingúsug (nanghingúsug) mi sa pagtiwas niíni dáyun,</i><trans> We are putting all our efforts into finishing this right away. </trans></eg>
<eg><i lang=""ceb"">Hayáhay sila samtang nanghingúsug pa ang ílang tindáhan,</i><trans> They lived in comfort as long as their store continued at its height of activity. </trans></eg>
<eg><i lang=""ceb"">Sa paghingúsug sa kampanya daghang mga ginamus ang nayagyag,</i><trans> At the height of the campaign, we witnessed lots of dirty linen being washed in public. </trans></eg>
<eg><i lang=""ceb"">kusgan a strong. Gamay apan kusgan,</i><trans> He is small but strong. </trans></eg>
</sense></hom></entry>
<entry><form id=""gikusugun_kakusgun"" lang=""ceb""><abbr expan=""gikusugun"" type=""lemma"">gi-un</abbr>, kakusgun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> speed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> loudness or intensity. </trans>
</sense>
<sense n=""3""><number>3</number><trans> briskness of sales. </trans>
</sense></hom></entry>
<entry><form id=""pakuxsug"" lang=""ceb""><abbr expan=""pakúsug"" type=""lemma"">pa-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> contest of strength. </trans>
<eg><i lang=""ceb"">Ang barbil pakúsug,</i><trans> Weight-lifting is a sport that involves a contest of strength. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> rough play. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> play rough.
</trans>
</sense></hom></entry></entry>");
