INSERT INTO `wced_entry` VALUES (10175, "kusukusu", "526", "<entry page=""526"" id=""10175""><form id=""kusukuxsu"" lang=""ceb"">kusukúsu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> rumple or rub s.t. in the hands. </trans>
<eg><i lang=""ceb"">Kusukusúha ang papil nga iílu,</i><trans> Rub the paper to soften it so you can use it for toilet paper. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; b5]</itype><trans> rub to remove dirt or stains in washing. </trans>
<eg><i lang=""ceb"">Kusukusúhag (kusukusúhig) maáyu ang sinabunan,</i><trans> Rub the clothes vigorously after you soap them. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A; a]</itype><trans> rub in washing the hair. </trans>
<eg><i lang=""ceb"">Kusukusúha ang buhuk arun mubulag maáyu ang syampu,</i><trans> Rub it well so that the shampoo will get nice and foamy. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A; a12]</itype><trans> twirl the beater in the palms to beat a chocolate drink. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> treat s.t. violently. </trans>
<eg><i lang=""ceb"">Gikusukúsu ang kalubihan sa kusug hángin,</i><trans> The coconut grove was lashed by the violent wind. </trans></eg>
<eg><i lang=""ceb"">Kusukusúhun ku kanang ímung bátang lampingásan,</i><trans> I’ll give that naughty child of yours a sound thrashing. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[a12]</itype><trans> beat soundly in a game. </trans>
<eg><i lang=""ceb"">Gikusukúsu námù ang ílang tím,</i><trans> We thrashed their team soundly. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#bulunixyu""><sc>buluníyu</sc></xr>.
</trans>
</sense></hom></entry>");
