INSERT INTO `wced_entry` VALUES (10176, "kusung", "526", "<entry page=""526"" id=""10176""><form id=""kusung"" lang=""ceb"">kusung</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for cloth or thin sheets to be wrinkled, crumpled, creased. </trans>
<eg><i lang=""ceb"">Ayawg sulati nang papíla kay kusung kaáyu,</i><trans> Don’t write on that paper. It’s all crumpled. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> wrinkle, crumple. </trans>
<eg><i lang=""ceb"">Kining panaptúna húmuk kaáyung makusung,</i><trans> This k.o. material wrinkles easily. </trans></eg>
<eg><i lang=""ceb"">Dì na ku musul-ub ning sinináa. Gikusungan na ku niíni,</i><trans> I won’t wear this dress any more. It looks so crumpled to me.
</trans></eg>
</sense></hom></entry>");
