INSERT INTO `wced_entry` VALUES (10187, "kutat", "527", "<entry page=""527"" id=""10187""><form id=""kutat"" lang=""ceb"">kutat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b4]</itype><trans> abate, for a flow to weaken<corr>.</corr> </trans>
<eg><i lang=""ceb"">Salámat kay mikutat na ang bagyu,</i><trans> Thank heavens, the wind has finally abated. </trans></eg>
<eg><i lang=""ceb"">Mikutat ang gátas sa inahan,</i><trans> The mother’s milk gave out. </trans></eg>
<eg><i lang=""ceb"">Walay pagkutat ang ági sa mga táwu sa háyà,</i><trans> The flow of people that passed by the bier did not subside. </trans></eg>
<eg><i lang=""ceb"">Ug kutatan ta sa bahà, mutabuk ta,</i><trans> When the flood subsides, we can cross.
</trans></eg>
</sense></hom></entry>");
