INSERT INTO `wced_entry` VALUES (10189, "kutay", "527", "<entry page=""527"" id=""10189""><form id=""kutay"" lang=""ceb"">kutay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; c]</itype><trans> string a line from one point to another. </trans>
<eg><i lang=""ceb"">Nagkutay kug písì pára hayháyan,</i><trans> I tied a rope for the clothesline. </trans></eg>
<eg><i lang=""ceb"">Ikutay ang mga bumbilya sa duha ka halígi,</i><trans> String the light bulbs up between the two posts. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B146; c]</itype><trans> place, arrange things in line. </trans>
<eg><i lang=""ceb"">Nagkutay siyag batu daplin sa alagían,</i><trans> He lined the pathway with stones. </trans></eg>
<eg><i lang=""ceb"">Nagkutay ang mga pumapálit sa tíkit,</i><trans> The people buying tickets were standing in a long line. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> line; row of. </trans>
<eg><i lang=""ceb"">Ang kutay sa bungtud milagbas sa duha ka baryu,</i><trans> The range of mountains stretches across the two barrios. </trans></eg>
<eg><i lang=""ceb"">Naputul ang kutay sa íyang hunàhúnà pagkadungug sa butu,</i><trans> The trend of his thought was interrupted when he heard the explosion. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> rope.
</trans>
</sense></hom></entry>");
