INSERT INTO `wced_entry` VALUES (10191, "kuti", "527", "<entry page=""527"" id=""10191""><form id=""kuti"" lang=""ceb"">kuti</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> intricate, requiring close attention and exactness. </trans>
<eg><i lang=""ceb"">Kuti kaáyu ang pagburda sa kamut,</i><trans> Hand embroidery is very intricate work. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> intricate and thus tiresome. </trans>
<eg><i lang=""ceb"">Kuti kaáyung pitsipitsing atubangun,</i><trans> Tiresome little details to take care of. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> thoroughly done, with attention to doing details. </trans>
<eg><i lang=""ceb"">Makuting imbistigasiyun,</i><trans> A thorough investigation. </trans></eg>
</sense></hom>
<entry><form id=""kuti_baxru"" lang=""ceb""><abbr expan=""kuti"" type=""lemma"">—</abbr> báru</form>
<hom>
<sense n=""0""><trans> trouble, bother. </trans>
<eg><i lang=""ceb"">Kuti báru kaáyu ang paghímug hamun,</i><trans> It’s a nuisance to make ham. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13B12; a2]</itype><trans> become intricate, complicated. </trans>
</sense></hom></entry>
<entry><form id=""kutikuxti"" lang=""ceb"">kutikúti</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> going into small details, fussing over minor details. </trans>
<eg><i lang=""ceb"">Ang ámung agáwun mukutikúti giyud ug inspiksiyun sa ámung ági,</i><trans> Our master inspects our output to the minutest detail. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> fuss, bother. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>inquisitive</tr> about every aspect of a thing. </trans>
<eg><i lang=""ceb"">Kutikúti siyang pagkabátà, sígi lang pangutána,</i><trans> He is a very inquisitive child. He keeps asking questions. </trans></eg>
</sense></hom></entry>
<entry><form id=""kutikutihan"" lang=""ceb"">kutikutihan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> fussy, paying attention to small details. </trans>
</sense></hom></entry>
<entry><form id=""makutixhun"" lang=""ceb"">makutíhun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> doing things with great attention to details. </trans>
<eg><i lang=""ceb"">Makutíhung tukì,</i><trans> A very detailed investigation. </trans></eg>
</sense></hom></entry>
<entry><form id=""kutihaxwu"" lang=""ceb"">kutiháwu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> meticulous, extremely or excessively careful in details. </trans>
<eg><i lang=""ceb"">Pulídu ang íyang búhat kay kutiháwu kaáyu,</i><trans> Her work is highly polished because she’s very meticulous. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> be very meticulous over details. </trans>
<eg><i lang=""ceb"">Ug dì ka makutiháwu daghang sayup nga mulusut,</i><trans> If you don’t get fussy over details lots of errors will make their way into the work.
</trans></eg>
</sense></hom></entry></entry>");
