INSERT INTO `wced_entry` VALUES (10196, "kutil", "527", "<entry page=""527"" id=""10196""><form id=""kuxtil"" lang=""ceb"">kútil</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> drink consisting of palm toddy (<ix>tubà</ix>) mixed with eggs and/or hot chocolate. </trans>
