<sense n=""1""><number>1</number><trans> mix a strong drink with a non-intoxicating <pb n=""528""/>beverage, esp. palm toddy with eggs and/or hot chocolate. </trans>
<eg><i lang=""ceb"">Káda buntag sayu magkútil giyud siyag itlug, tubà ug sikwáti,</i><trans> Early every morning he drinks an egg-cocktail. </trans></eg>
