<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sound of the strumming or plucking of the strings of musical instruments. </trans>
<eg><i lang=""ceb"">Náa tingáli mangharána kay náa may kutingkuting,</i><trans> There must be some serenaders now. I seem to hear the strumming of strings. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a1]</itype><trans> sound a stringed instrument by plucking or strumming. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> have lots of little things to do. </trans>
<eg><i lang=""ceb"">Daghan pa kug kutingkutingun sa báy,</i><trans> I have lots of little things to do in the house. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> things one might collect or little things to do.
</trans>
</sense></hom></entry>");
