INSERT INTO `wced_entry` VALUES (10204, "kutitub", "528", "<entry page=""528"" id=""10204""><form id=""kutixtub"" lang=""ceb"">kutítub</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> given to talking, loquacious. </trans>
<eg><i lang=""ceb"">Ang babáying kutítub bísag sa simbahan magpúnayg tabì,</i><trans> A talkative woman keeps babbling away, even in church. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> given to talking back, murmuring against, or making lots of unpleasant, irritating remarks. </trans>
<eg><i lang=""ceb"">Kutítub nang batáa. Ug kasab-an mutubag giyud,</i><trans> That child is big-mouthed. He talks back when you scold him. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> become talkative. </trans>
</sense>
<sense n=""2""><number>2</number><trans> be given to talking back, murmuring, or making lots of unpleasant remarks.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (10204, "kutítub", "kutitub", "m", "av");
INSERT INTO `wced_entry` VALUES (10205, "kutkut", "528", "<entry page=""528"" id=""10205""><form id=""kutkut"" lang=""ceb"">kutkut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> scrape off s.t. hard by rubbing on it back and forth. </trans>
<eg><i lang=""ceb"">Kutkúta ang takuling sa kaldíru,</i><trans> Scrape off the soot on the pot. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ab2]</itype><trans> paw s.t. up, dig s.t. up like a dog. </trans>
<eg><i lang=""ceb"">Daliag kutkut ang kamúti,</i><trans> Dig up the sweet potatoes fast. </trans></eg>
<eg><i lang=""ceb"">Gikutkut sa irù ang gilubung nga bukug,</i><trans> The dog dug up the buried bones. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> befriend a person for what one can get out of him, be a gold digger. </trans>
<eg><i lang=""ceb"">Gikutkut lang ang byúda sa palikíru,</i><trans> The gigolo was just getting what he could out of the widow. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN; a]</itype><trans> scratch an itch. </trans>
<eg><i lang=""ceb"">Nangutkut siya sa íyang úlu,</i><trans> He scratched his head. </trans></eg>
<eg><i lang=""ceb"">Kutkútun ku ning katul sa ákung tiil,</i><trans> I will scratch this itch on my feet. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[AN; a]</itype><trans> gnaw. </trans>
<eg><i lang=""ceb"">Nalúngag ang bungbung nga gikutkut sa balagtuk,</i><trans> Some rats gnawed a hole into the wall. </trans></eg>
<eg><i lang=""ceb"">Gikutkut ang ákung tiyan sa kagútum,</i><trans> Hunger gnawed at my stomach. </trans></eg>
</sense></hom>
<entry><form id=""kinutkut_kagutkut_kinagutkut"" lang=""ceb""><abbr expan=""kinutkut"" type=""lemma"">-in-</abbr>, <abbr expan=""kagutkut"" type=""lemma"">-ag-</abbr>, <abbr expan=""kinagutkut"" type=""lemma"">-inag-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sound of gnawing. </trans>
</sense></hom></entry>
<entry><form id=""kinutkutan"" lang=""ceb""><abbr expan=""kinutkutan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> gnawed part of the thing<corr>,</corr> having a gnawed part. </trans>
<eg><i lang=""ceb"">Ang kapáyas nga hinug dúnay kinutkutan sa kabug,</i><trans> The ripe papaya has a hole where the bat pecked on it.
</trans></eg>
</sense></hom></entry></entry>");
