INSERT INTO `wced_entry` VALUES (10206, "kutli", "528", "<entry page=""528"" id=""10206""><form id=""kutliq"" lang=""ceb"">kutlì</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab2]</itype><trans> break off s.t. soft by twisting it between the thumb and index finger. </trans>
<eg><i lang=""ceb"">Kutlía ang mga bátung,</i><trans> Break up the string beans into small pieces.
</trans></eg>
</sense></hom></entry>");
