INSERT INTO `wced_entry` VALUES (10207, "kutlig", "528", "<entry page=""528"" id=""10207""><form id=""kutlig"" lang=""ceb"">kutlig</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> detach or pick s.t. tiny between the fingers or teeth with a quick twisting or snapping motion. </trans>
<eg><i lang=""ceb"">Mikutlig si Tátay ug tabákù nga íyang gimaskáda,</i><trans> Father bit off a piece of tobacco to chew. </trans></eg>
<eg><i lang=""ceb"">Kutlíga lang ang mga udlut. Ayawg gabnúta,</i><trans> Just pick the young leaves gently. Don’t rip them off.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (10207, "kutlig", "kutlig", "m", "v");
INSERT INTO `wced_entry` VALUES (10208, "kutlu", "528", "<entry page=""528"" id=""10208""><form id=""kutluq"" lang=""ceb"">kutlù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> break off a flower, leaf, seed stalk, bud carefully. </trans>
<eg><i lang=""ceb"">Ángay na bang kutlúun ning buláka?</i><trans> Is this flower right to pluck? </trans></eg>
<eg><i lang=""ceb"">Kutlúag udlut ang tabákù arun mudagkù ang dáhun,</i><trans> We pluck the buds off the tobacco plant so the leaves will get bigger. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> reach for the stars (literary). </trans>
<eg><i lang=""ceb"">Kutlúun ku ang mga bitúun tungud kanímu,</i><trans> I’ll pluck the stars for you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; a2]</itype><trans> pick out a quotation, take s.t. from a certain source. </trans>
<eg><i lang=""ceb"">Sirmun nga gikutlù gíkan sa Salmu,</i><trans> Sermon taken from the Book of Psalms. </trans></eg>
<eg><i lang=""ceb"">Ay in is ang kutlúan níla sa balità,</i><trans> They get their news from the I.N.S. (International News Service). </trans></eg>
</sense></hom>
<entry><form id=""kinutluq"" lang=""ceb""><abbr expan=""kinutlù"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> quotation, s.t. gotten from a certain source. </trans>
</sense></hom></entry>
<entry><form id=""pangutluq"" lang=""ceb""><abbr expan=""pangutlù"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> action of harvesting rice.
</trans>
</sense></hom></entry></entry>");
