INSERT INTO `wced_entry` VALUES (10209, "kuts", "528", "<entry page=""528"" id=""10209""><form id=""kuxts"" lang=""ceb"">kúts</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> coach, usually for a team. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> coach a team. </trans>
<eg><i lang=""ceb"">Way nagkúts sa ákung diklamasiyun,</i><trans> Nobody coached me for my declamation. </trans></eg>
<eg><i lang=""ceb"">Unsang tíma ang ímung gikutsan?</i><trans> What team are you coaching? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B156; a12]</itype><trans> be a coach. </trans>
<eg><i lang=""ceb"">Nakúts siya sa ámung tím sa baskitbul,</i><trans> He used to be our basketball coach.
</trans></eg>
</sense></hom></entry>");
