INSERT INTO `wced_entry` VALUES (10210, "kutsara", "528", "<entry page=""528"" id=""10210""><form id=""kutsaxra"" lang=""ceb"">kutsára</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> tablespoon. </trans>
<eg><i lang=""ceb"">Gáwì sa kutsára ug tinidur igkáun nímu,</i><trans> Use a spoon and fork when you eat. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[a]</itype><trans> eat with a tablespoon. <pb n=""529""/></trans>
<eg><i lang=""ceb"">Kutsaráhun diay ang kúkis?</i><trans> Are you going to eat the cookies with a spoon? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> spoon s.t. out. </trans>
<eg><i lang=""ceb"">Kutsaráha ang harína,</i><trans> Get the flour out with a spoon. </trans></eg>
<eg><i lang=""ceb"">Gikutsára sa duktur ang gilúgus,</i><trans> The doctor took a spoonful of secretion from the girl that had been raped. </trans></eg>
</sense></hom>
<entry><form id=""pangutsaxra"" lang=""ceb""><abbr expan=""pangutsára"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> use a tablespoon on s.t., eat with a tablespoon. </trans>
</sense></hom></entry>
<entry><form id=""kutsarixta"" lang=""ceb"">kutsaríta</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> teaspoon. </trans>
</sense>
<sense n=""2""><number>2</number><trans> k.o. fleshy ornamental herbs grown for their colorful leaves as a border plant: <bio>Alternanthera spp</bio>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; a]</itype><trans> use, eat with a teaspoon. </trans>
</sense></hom></entry>
<entry><form id=""kutsarun"" lang=""ceb"">kutsarun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>ladle</tr>, large serving spoon. </trans>
<eg><i lang=""ceb"">Kutsarun ang isanduk sa linúgaw,</i><trans> Use a ladle to scoop out the porridge. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; a1]</itype><trans> dip out with a ladle. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[b6]</itype><trans> provide with a serving spoon or ladle. </trans>
<eg><i lang=""ceb"">Kutsaruni ang sabaw inigsilbi nímu,</i><trans> Provide a ladle for the soup when you serve it.
</trans></eg>
</sense></hom></entry></entry>");
