INSERT INTO `wced_entry` VALUES (10215, "kutsinu1", "529", "<entry page=""529"" id=""10215""><form id=""kutsixnu"" lang=""ceb"">kutsínu<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> unthinking about small but important details. </trans>
<eg><i lang=""ceb"">Kutsínu ning mutsatsáha kay nagbáli ang kutsára ug tinidur,</i><trans> What a careless maid. Her mind must be in the clouds because she put the tablespoons and forks on the table backwards. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1245; b6]</itype><trans> doing things without thinking. </trans>
<eg><i lang=""ceb"">Nagkakutsínu siya nga síging naghunàhúnà ug piknik,</i><trans> He doesn’t think about what he is doing because his mind is on the picnic.
</trans></eg>
</sense></hom></entry>");
