INSERT INTO `wced_entry` VALUES (10216, "kutsinu2", "529", "<entry page=""529"" id=""10216""><form id=""kutsixnu2"" lang=""ceb"">kutsínu<sub>2</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>dirty</tr> in one’s habits. </trans>
<eg><i lang=""ceb"">Kutsínung bataána, nagkupaykúpay sa íyang linúgaw,</i><trans> That child has dirty habits. He plays with his porridge. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; b6]</itype><trans> be, become uncleanly or dirty in one’s habits. </trans>
<eg><i lang=""ceb"">Gikutsináhan ku nímu dà, dúgay kang mag-ílis,</i><trans> I think you’re a slob because you rarely change your clothes.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (10216, "kutsínu", "kutsinu", "s", "av");
INSERT INTO `wced_translation` (entryid, translation) VALUES (10216, "dirty");
INSERT INTO `wced_entry` VALUES (10217, "kutsinu3", "529", "<entry page=""529"" id=""10217""><form id=""kutsixnu3"" lang=""ceb"">kutsínu<sub>3</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> be the one in a group that fails to do s.t. </trans>
<eg><i lang=""ceb"">Kutsínu ang way kwarta, dì kauban,</i><trans> Whoever doesn’t have any money will be left out. He cannot come along. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126; a2]</itype><trans> fail to do s.t. that others in a group get to do. </trans>
<eg><i lang=""ceb"">Makutsínu ang maulahig mata, dì na kapamahaw,</i><trans> Whoever wakes up late will be left out. He won’t have any breakfast. </trans></eg>
<eg><i lang=""ceb"">Nakutsínu siya kay wà makatápus sa pagtuun,</i><trans> She wound up the only one who didn’t finish her studies.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (10217, "kutsínu", "kutsinu", "s", "av");
INSERT INTO `wced_entry` VALUES (10218, "kutsiru", "529", "<entry page=""529"" id=""10218""><form id=""kutsixru"" lang=""ceb"">kutsíru</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> rig, coach <tr>driver</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3; a2]</itype><trans> be a rig driver. </trans>
<eg><i lang=""ceb"">Kinsa may nagkutsíru sa ímung tartanilya?</i><trans> Who is the driver of the rig you were riding on? </trans></eg>
</sense></hom>
