<hom>
<sense n=""1""><number>1</number><trans> infested with lice. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for a woman to have <pb n=""530""/>the <ix>karapáta</ix>, a k.o. louse spread by sexual contact. </trans>
<eg><i lang=""ceb"">Ayawg paduul ánang bayhána kay kutuun nà,</i><trans> Don’t get near that woman. She is full of lice in the genitals. </trans></eg>
