INSERT INTO `wced_entry` VALUES (10229, "kutub", "530", "<entry page=""530"" id=""10229""><form id=""kutub"" lang=""ceb"">kutub</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having wrinkles sewn into it. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B6]</itype><trans> for sewing to come out so that wrinkles appear in unintended places. </trans>
<eg><i lang=""ceb"">Mukutub (makutub) ang buktun sa ímung sinínà ug dì nímu ilagdà,</i><trans> The sleeves of your dress will come out wrinkled if you sew them directly without basting them.
</trans></eg>
</sense></hom></entry>");
