INSERT INTO `wced_entry` VALUES (10231, "kutubkutub", "530", "<entry page=""530"" id=""10231""><form id=""kutubkutub"" lang=""ceb"">kutubkutub</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> throbbing, low, booming sound. </trans>
<eg><i lang=""ceb"">Kutubkutub sa lansa,</i><trans> The put-put of the launch. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> make a low throbbing or booming sound from a distance. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> mumble words incoherently. </trans>
<eg><i lang=""ceb"">Sugúun gánì nà siya, mukutubkutub dáyun ang bàbà,</i><trans> When you ask her to do s.t., she immediately starts mumbling under her breath. </trans></eg>
<eg><i lang=""ceb"">Dì makláru ang pangadyì kay nagkutubkutub lang ang bàbà,</i><trans> You can’t understand the prayers because they are just mumbled.
</trans></eg>
</sense></hom></entry>");
