INSERT INTO `wced_entry` VALUES (10232, "kutud", "530", "<entry page=""530"" id=""10232""><form id=""kutud"" lang=""ceb"">kutud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b4]</itype><trans> for liquids to slow down or stop flowing at the source. </trans>
<eg><i lang=""ceb"">Mikutud na ang tubud,</i><trans> The stream dried up. </trans></eg>
<eg><i lang=""ceb"">Sustinihi lag pananggut ug dì pa makakutud ang buluk,</i><trans> Keep getting the juice from the bud before it stops flowing. </trans></eg>
<eg><i lang=""ceb"">Nagkakutud na giyud ang ákung gátas,</i><trans> My milk is growing less and less in quantity. </trans></eg>
<eg><i lang=""ceb"">Gikutdan na ang gúma,</i><trans> The rubber tree has ceased giving latex.
</trans></eg>
</sense></hom></entry>");
