INSERT INTO `wced_entry` VALUES (10235, "kutuy", "530", "<entry page=""530"" id=""10235""><form id=""kutuy"" lang=""ceb"">kutuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>pinch</tr> a comparatively small area of the skin, esp. with the nail of the thumb and a finger. </trans>
<eg><i lang=""ceb"">Mikutuy siya sa ákung buktun ágig paráyig,</i><trans> She pinched my arm as a sign of affection. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B146]</itype><trans> feel a sharp, steady pain in the stomach or pangs of hunger. </trans>
<eg><i lang=""ceb"">Wà man gud kuy pamáhaw, nagkutuy na ang ákung tiyan,</i><trans> I’ve had no breakfast, so I’m having hunger pangs now.
</trans></eg>
</sense></hom></entry>");
