INSERT INTO `wced_entry` VALUES (10236, "kuub", "530", "<entry page=""530"" id=""10236""><form id=""kuub"" lang=""ceb"">kuub</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>bent forward</tr> in body posture. </trans>
<eg><i lang=""ceb"">Ságad sa mga tigúlang kuub ug láwas,</i><trans> Most old people have bent bodies. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1; c1P]</itype><trans> be bent forward. </trans>
<eg><i lang=""ceb"">Nagkuub ang ímung láwas. Itísu</i><trans><corr sic=""."">,</corr> Your body is bent forward. Straighten up. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB]</itype><trans> be lying face down, place s.t. face down. </trans>
<eg><i lang=""ceb"">Nakuub ang bátà sa salug,</i><trans> The child was lying face down on the floor. </trans></eg>
<eg><i lang=""ceb"">Ikuub (kuuba) ang mga kaldíru,</i><trans> Place the pots face down. </trans></eg>
</sense></hom>
<entry><form id=""kuxub"" lang=""ceb""><abbr expan=""kúub"" type=""lemma"">(←)</abbr><sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#kuub""><sc>kuub</sc></xr>, <i lang=""ceb"">v2.</i>
</trans>
</sense></hom></entry></entry>");
