INSERT INTO `wced_entry` VALUES (10237, "kuub2", "530", "<entry page=""530"" id=""10237""><form id=""kuxub2"" lang=""ceb"">kúub<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> <tr>snuggle up</tr> under a blanket of the like. </trans>
<eg><i lang=""ceb"">Mikúub ku sa hábul pagtunghà sa kág,</i><trans> I curled up in a blanket when the ghost appeared. </trans></eg>
<eg><i lang=""ceb"">Gikuúban sa himungáan <pb n=""531""/>ang íyang mga pisù,</i><trans> The mother hen covered her chicks with her wings.
</trans></eg>
</sense></hom></entry>");
