INSERT INTO `wced_entry` VALUES (10238, "kuug", "531", "<entry page=""531"" id=""10238""><form id=""kuxug"" lang=""ceb"">kúug</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B346]</itype><trans> for the head to move to and fro or up and down with short, rapid movements. </trans>
<eg><i lang=""ceb"">Mikúug ang úlug dinágan,</i><trans> His head shook as he ran. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23]</itype><trans> go away hurriedly without turning the head to any direction but forward. </trans>
<eg><i lang=""ceb"">Mikúug lang siyag lakaw, wà gánì ku hulata,</i><trans> She went out straight away without waiting for me. </trans></eg>
</sense></hom>
<entry><form id=""kuugkuug"" lang=""ceb"">kuugkuug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B146]</itype><trans> shake involuntarily, as with weakness or disease. </trans>
<eg><i lang=""ceb"">Magkuugkuug nga maglakaw ang paralitiku,</i><trans> A paralytic trembles when he walks.
</trans></eg>
</sense></hom></entry></entry>");
