INSERT INTO `wced_entry` VALUES (10245, "kuut", "531", "<entry page=""531"" id=""10245""><form id=""kuxut"" lang=""ceb"">kúut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> thrust one’s hand into a small place to fish s.t. out or just feel it. </trans>
<eg><i lang=""ceb"">Mikúut siya sa íyang bulsa pagtan-aw ug náa pa bay sinsilyu,</i><trans> He felt around in his pocket to see if he had any more change. </trans></eg>
<eg><i lang=""ceb"">Kuútun sa duktur ang bátà ug maglísud ang pag-anak,</i><trans> The doctor pulls the baby out if it is a difficult delivery. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pick a pocket or handbag. </trans>
<eg><i lang=""ceb"">Gikuútan ku. Wà gánì kuy ikapamilíti,</i><trans> My pocket was picked. I don’t even have carfare. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> do s.t. underhanded, pull strings to get s.t. done. </trans>
<eg><i lang=""ceb"">Kuútun kung ímung aplikasiyun arun madáwat,</i><trans> I’ll pull some strings with your application to make sure it is accepted. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; a12]</itype><trans> fall back on s.t. </trans>
<eg><i lang=""ceb"">Maáyu gánì nga dúna tay gamayng tinipígang makúut,</i><trans> It’s a good thing that we have some small savings to fall back on. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; a12]</itype><trans> tap s.o. to liquidate him. </trans>
<eg><i lang=""ceb"">Gikúut ang impurmir sa mga girilyista,</i><trans> The guerrillas tapped the informer for liquidation. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[AN; ab2]</itype><trans> touch s.o.’s genitals. </trans>
<eg><i lang=""ceb"">Kuúta lang ug gustu ka,</i><trans> Go ahead and touch it if you want to. </trans></eg>
</sense>
<sense n=""7""><number>7</number> <itype>[A12; c1]</itype><trans> get in a blow or a shot in basketball under difficult circumstances. </trans>
<eg><i lang=""ceb"">Bísag maáyung gwardiya kuútun ni Martiris,</i><trans> Martires can outmaneuver the best of guards. </trans></eg>
</sense></hom>
<entry><form id=""panguxut"" lang=""ceb""><abbr expan=""pangúut"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pickpocketing</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>catching of sea life</tr> by sticking the hands into holes or crevices. </trans>
</sense></hom></entry>
<entry><form id=""kuutkuxut"" lang=""ceb"">kuutkúut</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> getting in shots or blows under difficult circumstances. </trans>
</sense></hom></entry>
<entry><form id=""kuluutun"" lang=""ceb""><abbr expan=""kuluutun"" type=""lemma"">-l-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> intricate, difficult. </trans>
<eg><i lang=""ceb"">Kuutun ning prublimáha. Dílì ni masulbad,</i><trans> This is a difficult problem. We can’t solve it. </trans></eg>
<eg><i lang=""ceb"">Kuutun na kaáyu ang túbig sa bangà kay hápit na mahurut,</i><trans> The water in the jar is very difficult to reach because it’s almost gone. </trans></eg>
<eg><i lang=""ceb"">Kuutun kaáyu ang mga tapuy nga íyang gigámit,</i><trans> He uses very difficult chords. </trans></eg>
<eg><i lang=""ceb"">Kuluutung nutáha,</i><trans> A difficult-to-reach note. </trans></eg>
</sense></hom></entry>
<entry><form id=""kuxut_sa_kuluutun"" lang=""ceb""><abbr expan=""kúut"" type=""lemma"">—</abbr> sa kuluutun</form>
<hom>
<sense n=""0""><trans> manage to do s.t. difficult by exerting oneself to the utmost (reach in to get the things difficult to get). </trans>
<eg><i lang=""ceb"">Bída ning may ámut, unyà way kwarta. Makakúut ta sa kuluutun,</i><trans> God! When they take up a collection, if we don’t have money, we have to come up with it somehow. </trans></eg>
</sense></hom></entry>
<entry><form id=""mangunguut"" lang=""ceb""><abbr expan=""mangunguut"" type=""lemma"">maN-r-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pickpocket</tr>.
</trans>
</sense></hom></entry></entry>");
