INSERT INTO `wced_entry` VALUES (10251, "kuyabug", "531", "<entry page=""531"" id=""10251""><form id=""kuyabug"" lang=""ceb"">kuyabug</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>nestling</tr>, a young bird that has not abandoned its nest. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1a""><number>1a</number><trans> <tr>neophyte</tr>, a beginner at s.t. </trans>
<eg><i lang=""ceb"">Usa lang ku ka kuyabug nga magsusúlat,</i><trans> I am only an amateur writer. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> young and inexperienced person. </trans>
<eg><i lang=""ceb"">Ayawg sagbat sa isturya sa mga dagkù kay kuyabug ka pa,</i><trans> Do not butt into the conversation of your elders because you are still a child. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> mistress, concubine. </trans>
<eg><i lang=""ceb"">Mahal níya ang íyang kuyabug kay sa asáwa,</i><trans> He loves his mistress more than his wife. </trans></eg>
</sense></hom>
<entry><form id=""panguyabug"" lang=""ceb""><abbr expan=""panguyabug"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
