INSERT INTO `wced_entry` VALUES (10257, "kuyamang", "532", "<entry page=""532"" id=""10257""><form id=""kuyaxmang"" lang=""ceb"">kuyámang</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S; b]</itype><trans> for insects to <tr>crawl</tr>. </trans>
<eg><i lang=""ceb"">Mikuyámang ang básul sa ákung buktun,</i><trans> The caterpillar crawled on my arm. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> spread slowly to an area. </trans>
<eg><i lang=""ceb"">Mikuyámang sa Sugbu ang pamúhat ug lílas,</i><trans> Film-making spread slowly in Cebu. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23; b(1)]</itype><trans> creep deep through one’s feelings. </trans>
<eg><i lang=""ceb"">Ang kalalim sa íyang haluk mikuyámang sa ákung kinahiladman,</i><trans> The sweetness of his kisses crept through my innermost senses.
</trans></eg>
</sense></hom></entry>");
