<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> long and sharp <tr>fingernails</tr>, <tr>claws</tr> of a bird, crab, etc. </trans>
<eg><i lang=""ceb"">Hikawrasan ku sa kuyamas sa iring,</i><trans> I got scratched by the sharp claws of the cat.
</trans></eg>
</sense></hom></entry>");
