INSERT INTO `wced_entry` VALUES (10259, "kuyamis", "532", "<entry page=""532"" id=""10259""><form id=""kuyaxmis"" lang=""ceb"">kuyámis</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the soft parts in a young coconut at a stage prior to the formation of meat (<ix>pútut</ix>) where the insides are edible and not bitter. Most coconuts are bitter when young (<ix>pútut</ix>), but there are varieties which have edible insides at this stage. </trans>
</sense>
<sense n=""2""><number>2</number><trans> a variety of coconut with orange-colored outside husk, smaller in size than the ordinary coconut.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (10259, "kuyámis", "kuyamis", "m", "n");
INSERT INTO `wced_entry` VALUES (10260, "kuyamud", "532", "<entry page=""532"" id=""10260""><form id=""kuyaxmud"" lang=""ceb"">kuyámud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> get an expression of distaste or dislike on the face. </trans>
<eg><i lang=""ceb"">Mikuyámud siya sa aslum nga sambag,</i><trans> She puckered her face at the sour tamarind. </trans></eg>
<eg><i lang=""ceb"">Ayaw ug kuyamúra (ikuyámud) ang ímung nawung ug sugúun ka,</i><trans> Don’t get a nasty expression on your face when I tell you to do s.t.
</trans></eg>
</sense></hom></entry>");
