INSERT INTO `wced_entry` VALUES (10263, "kuyanap", "532", "<entry page=""532"" id=""10263""><form id=""kuyaxnap"" lang=""ceb"">kuyánap</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> spread all over an area, for emotions or feelings to creep over one. </trans>
<eg><i lang=""ceb"">Ang katugnaw mingkuyánap sa tibuuk kung kalawásan,</i><trans> The cold spread throughout my body. </trans></eg>
<eg><i lang=""ceb"">Nagkuyánap lang ang mga nagkalainláing mga bágun sa ílang tugkaran,</i><trans> All different kinds of vines spread over his yard. </trans></eg>
<eg><i lang=""ceb"">Gikuyanápan ang ákung kasingkásing sa túmang kaguul,</i><trans> My heart is overwhelmed with grief.
</trans></eg>
</sense></hom></entry>");
