INSERT INTO `wced_entry` VALUES (10264, "kuyap", "532", "<entry page=""532"" id=""10264""><form id=""kuyap"" lang=""ceb"">kuyap</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> fainting spell. </trans>
<eg><i lang=""ceb"">Magpalit kug ítir kay tambal nà sa kuyap,</i><trans> I’ll buy a bottle of ether, as a medicine for dizzy spells. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> a condition of slight nausea and drowsiness caused by eating certain foods, esp. greasy ones. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A123P; b4]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>faint</tr>. </trans>
<eg><i lang=""ceb"">Gikuyapan ang babáyi nga napunáwan sa dugù,</i><trans> The woman fainted from loss of blood. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> feel slight nausea and drowsiness after eating s.t. </trans>
<eg><i lang=""ceb"">Kuyapan ku ug mukáun ug tinunuan,</i><trans> I feel somewhat nauseous and drowsy when I eat food cooked in coconut milk. </trans></eg>
</sense></hom>
<entry><form id=""kulayaxpan"" lang=""ceb""><abbr expan=""kulayápan"" type=""lemma"">-l-an(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> prone to fainting.
</trans>
</sense></hom></entry></entry>");
