INSERT INTO `wced_entry` VALUES (10265, "kuyapi", "532", "<entry page=""532"" id=""10265""><form id=""kuyapiq"" lang=""ceb"">kuyapì</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for fruit or seed to develop in a <tr>faulty</tr> way such that there is no flesh. </trans>
<eg><i lang=""ceb"">Kuyapì kaáyu ang mga ságing. Wà kaáyuy unud,</i><trans> The bananas are very thin. There’s not much flesh to them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for a person to be <tr>thin</tr>, <tr>emaciated</tr>. </trans>
<eg><i lang=""ceb"">Kuyapì kaáyu ning batáa kay naátas man,</i><trans> The child is very emaciated because he is undernourished. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> come out to be <tr>undeveloped</tr> and no good. </trans>
<eg><i lang=""ceb"">Mikuyapì (nakuyapì) ang ubang lísu sa kakaw kay kúwang sa abúnu,</i><trans> Some of the cacao seeds are thin and undeveloped because they lack fertilizer.
</trans></eg>
</sense></hom></entry>");
