INSERT INTO `wced_entry` VALUES (10268, "kuyaw", "532", "<entry page=""532"" id=""10268""><form id=""kuyaw"" lang=""ceb"">kuyaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>frightful</tr>, <tr>dreadful</tr>. </trans>
<eg><i lang=""ceb"">Labihang kuyáwa ang ákung damgu gabíi,</i><trans> My dream last night was very dreadful. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>dangerous</tr> to the extent of inspiring fright. </trans>
<eg><i lang=""ceb"">Anáa sa kuyaw nga kahimtang ang pasyinti,</i><trans> The patient is in a <tr>critical</tr> condition. </trans></eg>
<eg><i lang=""ceb"">Kuyaw ning tubíga kay húgaw,</i><trans> This water is dangerous because it is dirty. </trans></eg>
<eg><i lang=""ceb"">Kuyaw ang dálan sa Tulídu,</i><trans> The road to Toledo is hazardous. </trans></eg>
<eg><i lang=""ceb"">Kuyaw nà siyag masukù,</i><trans> That man is dangerous when he gets angry. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> unusually <tr>skillful</tr>, <tr>awesome</tr> in his ability (slang). </trans>
<eg><i lang=""ceb"">Kuyaw nang tawhána mupingpung,</i><trans> That man plays pingpong frightfully well. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> <tr>terribly</tr>, unusually good and attractive (slang). </trans>
<eg><i lang=""ceb"">Kuyaw ka manguyab bay, blúsil man,</i><trans> You’ve got yourself a hell of a girl. She’s an American. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A123P]</itype><trans> feel <tr>scared</tr>, <tr>frightened</tr>. </trans>
<eg><i lang=""ceb"">Gikuyawan ku pagkahúlug nímu,</i><trans> I was frightened when you fell. </trans></eg>
<eg><i lang=""ceb"">Gikuyawan ku dihang dihà na ku atubángan sa daghang táwu,</i><trans> I felt nervous when I was standing before a large audience. </trans></eg>
</sense></hom>
<entry><form id=""panguyaw"" lang=""ceb""><abbr expan=""panguyaw"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b8]</itype><trans> be terribly frightened. </trans>
<eg><i lang=""ceb"">Gipanguyawan ku,</i><trans> I was frightened out of my wits. </trans></eg>
</sense></hom></entry>
<entry><form id=""pakuyaw"" lang=""ceb""><abbr expan=""pakuyaw"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6(1)]</itype><trans> <tr>frighten</tr> s.o. </trans>
<eg><i lang=""ceb"">Mikalit ka lag labang sa karsáda, nagpakuyaw ka lang nákù,</i><trans> You suddenly dashed across the street, giving me a terrible fright. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to <tr>startle</tr>, <tr>scare</tr>, or <tr>frighten</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kakuyaw"" lang=""ceb""><abbr expan=""kakuyaw"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>terror</tr>, <tr>fright</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kuyawkuxyaw"" lang=""ceb"">kuyawkúyaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for s.t. grave to be touch-and-go. </trans>
<eg><i lang=""ceb"">Kuyawkúyaw pa malibri ba ang masakitun,</i><trans> It’s touch-and-go if the patient will recover. </trans></eg>
<eg><i lang=""ceb"">Kuyawkúyaw tung ákung iksámin,</i><trans> It’s touch-and-go as to how I did on the exams. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13; b4]</itype><trans> feel apprehensive and nervous. </trans>
<eg><i lang=""ceb"">Hápit na ang iliksiyun. Gikuyawkuyáwan <pb n=""533""/>na ang mga kandidatu,</i><trans> Election is near and the candidates are now becoming troubled and uneasy. </trans></eg>
</sense></hom></entry>
<entry><form id=""kuluyaxwan_kuyawaxnun"" lang=""ceb""><abbr expan=""kuluyáwan"" type=""lemma"">-l-an(←)</abbr>, <abbr expan=""kuyawánun"" type=""lemma"">-ánun</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> easily frightened. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> be, become easily frightened.
</trans>
</sense></hom></entry></entry>");
