INSERT INTO `wced_entry` VALUES (10270, "kuyba", "533", "<entry page=""533"" id=""10270""><form id=""kuyba"" lang=""ceb"">kuyba</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>cave</tr>, hollowed out portion in the sides of a slope or cliff. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1B12; b5]</itype><trans> become a cave, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Ang mga miníru mauy nagkuyba sa bungtud,</i><trans> Miners dug out a cave in the side of the mountain. </trans></eg>
<eg><i lang=""ceb"">Nagkakuyba na man ning dapíta nga gisigíhag káwut,</i><trans> This place is fast turning into a cave because they keep digging in it.
</trans></eg>
</sense></hom></entry>");
