INSERT INTO `wced_entry` VALUES (10271, "kuydawu", "533", "<entry page=""533"" id=""10271""><form id=""kuydaxwu"" lang=""ceb"">kuydáwu</form>
<hom>
<sense n=""0""><trans> <tr>watch out!</tr> be careful! </trans>
<eg><i lang=""ceb"">Kuydáwu! May kurinti nà,</i><trans> Be careful! That’s a live wire. </trans></eg>
<eg><i lang=""ceb"">Paubanun ku ikaw apan kuydáwu kun maghásul ka didtu,</i><trans> I’ll let you come with me, but watch out if you make a nuisance of yourself. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> responsibility one must personally answer to. </trans>
<eg><i lang=""ceb"">Tagáan tikawg libru. Ang pagpasar ímu nang kuydáwu,</i><trans> I’ll give you books. But it is your lookout to see that you pass. </trans></eg>
<eg><i lang=""ceb"">Kúmu sirínu ímung kuydáwug dúnay mawā̀ dinhi,</i><trans> As the night watch, it’s your responsibility if s.t. gets lost here. </trans></eg>
<eg><i lang=""ceb"">Ug magminyù ka, may kuydáwu ka na sa kinabúhì,</i><trans> If you marry, you have responsibilities on you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""way_kuydaxwu"" lang=""ceb"">way <abbr expan=""kuydáwu"" type=""lemma"">—</abbr></form><trans> nothing to worry about. </trans>
<eg><i lang=""ceb"">Wà nay kuydáwu. Púru lang nà panghásì,</i><trans> That’s nothing to worry about. They are just empty threats. </trans></eg>
</sense></hom>
<entry><form id=""kulukuydaxwu_kuydawukuydaxwu"" lang=""ceb""><abbr expan=""kulukuydáwu"" type=""lemma"">Culu-</abbr>, kuydawukuydáwu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> hesitation, inhibition. </trans>
<eg><i lang=""ceb"">Wà miy kuydawukuydáwu nga mangáun sa íla,</i><trans> We are not hesitant about going to their place to eat. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1456]</itype><trans> for s.o. to do s.t. without inhibitions. </trans>
<eg><i lang=""ceb"">Ang mga nars dì magkulukuydáwu paghíkap sa láwas sa mga masakitung laláki,</i><trans> Nurses do not have inhibitions about touching the bodies of male patients.
</trans></eg>
</sense></hom></entry></entry>");
