INSERT INTO `wced_entry` VALUES (10274, "kuylaw", "533", "<entry page=""533"" id=""10274""><form id=""kuylaw"" lang=""ceb"">kuylaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> provoking the feeling of nervous excitement, almost fright. </trans>
<eg><i lang=""ceb"">Kuylaw kaáyu nang muági na ta sa sigsag,</i><trans> It is nerve-racking to negotiate the zigzag curves. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b4]</itype><trans> be nervously excited. </trans>
<eg><i lang=""ceb"">Gikuylawan ku pagkadawat sa rás nga tiligram,</i><trans> I was nervous when I got the rush telegram.
</trans></eg>
</sense></hom></entry>");
