INSERT INTO `wced_entry` VALUES (10275, "kuymi", "533", "<entry page=""533"" id=""10275""><form id=""kuymi"" lang=""ceb"">kuymi</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>umpire</tr> in a cockfight or in jai-alai. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B156; c1]</itype><trans> act as a <tr>referee</tr> in jai-alai or a cockfight. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b8]</itype><trans> <tr>eavesdrop in a quarrel</tr>. </trans>
<eg><i lang=""ceb"">Ngánung midúul man mu sa magtiáyung nag-áway? Kamuy mikuymi?</i><trans> Why did you go near the couple quarreling? Did you want to referee their quarrel or s.t.?
</trans></eg>
</sense></hom></entry>");
