INSERT INTO `wced_entry` VALUES (10276, "kuyug", "533", "<entry page=""533"" id=""10276""><form id=""kuxyug"" lang=""ceb"">kúyug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; ac1]</itype><trans> <tr>go together</tr> with. </trans>
<eg><i lang=""ceb"">Kinsay mukúyug nákù sa sini?</i><trans> Who’ll accompany me to the movies? </trans></eg>
<eg><i lang=""ceb"">Ayaw kuyúga pagdispatsar ang púlus daut,</i><trans> Don’t sell any one buyer all bad ones. </trans></eg>
<eg><i lang=""ceb"">Unsa may ímung kuyúgun sa búkid?</i><trans> What will you get out of accompanying me to the mountains? </trans></eg>
<eg><i lang=""ceb"">Walà sukad siya ikúyug (kuyúga) sa íyang amahan,</i><trans> His father never had taken him along. </trans></eg>
<eg><i lang=""ceb"">Kuyúgi siya kay mahadluk,</i><trans> Go with her because she is scared. </trans></eg>
</sense></hom>
<entry><form id=""kuxyug_sa_lupad"" lang=""ceb""><abbr expan=""kúyug"" type=""lemma"">—</abbr> sa lupad</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A23]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> plunge imprudently into s.t. uncertain after having been persuaded. </trans>
<eg><i lang=""ceb"">Way maáyung sangpútan ang mga táwung mukúyug lang dáyun sa lupad bísag hanap,</i><trans> No good can come to people who do not look before they leap (go along with the flight even if they cannot see). </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> abide with the decision of the majority. </trans>
<eg><i lang=""ceb"">Dì lang ku mutambung sa míting. Mukúyug lang ku sa lupad ug unsay masabútan,</i><trans> I will not attend the meeting. I’ll abide with whatever decision they reach. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>companion</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>together with</tr>. </trans>
<eg><i lang=""ceb"">Miláyas siya kúyug sa íyang trátu,</i><trans> She went away together with her boy friend. </trans></eg>
</sense></hom></entry>
<entry><form id=""kuyug"" lang=""ceb""><abbr expan=""kuyug"" type=""lemma"">(→)</abbr></form>
<hom>
<sense n=""0""> <form id=""kuyug_babuy"" lang=""ceb""><abbr expan=""kuyug"" type=""lemma"">—</abbr> babuy</form><trans> </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who always tags along. </trans>
</sense></hom></entry>
<entry><form id=""kuyugkuxyug"" lang=""ceb"">kuyugkúyug</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>gang mate</tr>, regular companion. </trans>
</sense>
<sense n=""2""><number>2</number><trans> going together with a gang regularly. </trans>
<eg><i lang=""ceb"">Ang kuyugkúyug mau usáhay ang sinugdánan sa gúbut,</i><trans> Going out with a group regularly is often the beginning of trouble.
</trans></eg>
</sense></hom></entry></entry>");
