INSERT INTO `wced_entry` VALUES (10279, "kuyus", "533", "<entry page=""533"" id=""10279""><form id=""kuyus"" lang=""ceb"">kuyus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[BN]</itype><trans> <tr>shrivel</tr> and <tr>wrinkle</tr> up. </trans>
<eg><i lang=""ceb"">Tigúlang na giyud si Túnay kay nanguyus na ang mga áping,</i><trans> Tonay has grown really old because her face has become all wrinkled. </trans></eg>
<eg><i lang=""ceb"">Ímu pang ilámas nang luy-a nga nakuyus na kaáyu?</i><trans> You’re going to use that wrinkled up piece of ginger? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B2]</itype><trans> get shrunk or diminished in quantity. </trans>
<eg><i lang=""ceb"">Mikuyus (nakuyus) na ang íyang nawung nga naghubag,</i><trans> Her swollen face has shrunk now. </trans></eg>
<eg><i lang=""ceb"">Punù man untà ning sáku sa bugas. Ngánung dalì ra kaáyung nagkakuyus?</i><trans> This sack was so full of rice. Why has it shrunk so rapidly? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23]</itype><trans> shrink back, lack guts. </trans>
<eg><i lang=""ceb"">Ísug siyang musulti apan mukuyus ug suklan,</i><trans> He talks big, but when s.o. stands up to him, he shrinks away.
</trans></eg>
</sense></hom></entry>");
