INSERT INTO `wced_entry` VALUES (10280, "kuyuskus", "533", "<entry page=""533"" id=""10280""><form id=""kuyuskus"" lang=""ceb"">kuyuskus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2N]</itype><trans> <tr>shrink</tr> and curl up. </trans>
<eg><i lang=""ceb"">Karun <pb n=""534""/>nga mikyuskus (nakyuskus) na ang kusáhus wà na makapunù sa palanggána,</i><trans> Now that the jerked meat that we set out to dry has curled up, it no longer fills the basin. </trans></eg>
<eg><i lang=""ceb"">Ang túmang kaínit mauy nakakuyuskus (nakapakuyuskus) sa mga dáhun,</i><trans> The intense heat caused the leaves to wither and curl up.
</trans></eg>
</sense></hom></entry>");
