INSERT INTO `wced_entry` VALUES (10282, "kuyut2", "534", "<entry page=""534"" id=""10282""><form id=""kuyut2"" lang=""ceb"">kuyut<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; b6(1)]</itype><trans> <tr>get hold of s.t.</tr> </trans>
<eg><i lang=""ceb"">Nagkúyut ang magtiáyun,</i><trans> The couple held hands. </trans></eg>
<eg><i lang=""ceb"">Nawálà ang paypay nga ákung gikuytan (gikuyutan),</i><trans> I lost the fan I was holding. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[AN; b]</itype><trans> hold on to s.t. for support. </trans>
<eg><i lang=""ceb"">Dì ku mukuyut (manguyut) nímu, wà kay umuy,</i><trans> I won’t hold on to you (for support). You have no strength. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>hold</tr>, <tr>occupy</tr> a certain position or office. </trans>
<eg><i lang=""ceb"">Ang katungdánan nga ákung gikuytan pait kaáyu,</i><trans> I am holding down a very difficult job. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A]</itype><trans> <tr>play</tr>, <tr>operate</tr> s.t. </trans>
<eg><i lang=""ceb"">Mukuyut sad nà siyag bayulin,</i><trans> He also plays the violin.
</trans></eg>
</sense></hom></entry>");
