INSERT INTO `wced_entry` VALUES (10311, "kwarta1", "535", "<entry page=""535"" id=""10311""><form id=""kwarta"" lang=""ceb"">kwarta<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>money</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> it’s going to be a profit, a point, be in the bag. </trans>
<eg><i lang=""ceb"">Ug masyát nà ni Mumar run, kwarta na,</i><trans> If Mumar sinks that ball, the game will be in the bag. </trans></eg>
<eg><i lang=""ceb"">Ug alas ning mabúnut ku, kwarta,</i><trans> If the card I’m going to draw turns out to be an ace, it’s going to help me a lot. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>buy</tr>, <tr>purchase</tr> s.t. </trans>
<eg><i lang=""ceb"">Mukwarta kug kindi pára sa bátà,</i><trans> I’ll buy some candy for the child. </trans></eg>
<eg><i lang=""ceb"">Unsay ímung kwartáhun sa tindáhan<corr sic="","">?</corr></i><trans> What are you going to buy in the store? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; b8]</itype><trans> make money out of s.t.; secure money. </trans>
<eg><i lang=""ceb"">Nakakwarta kug arang-arang sa ákung nigusyu,</i><trans> I have made quite a profit from my business. </trans></eg>
<eg><i lang=""ceb"">Makwartahan (makwarta) ra gihápun ni nátung tinígum nga papil,</i><trans> We can still make some money out of the waste paper we are saving. </trans></eg>
</sense></hom>
<entry><form id=""pangwarta"" lang=""ceb""><abbr expan=""pangwarta"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b5]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> engage in s.t. as a means of earning money. </trans>
<eg><i lang=""ceb"">Mangwarta ku sa Nigrus inigtingtápas sa tubu,</i><trans> I’ll go to Negros to earn some money during the season for harvesting sugar cane. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> earn money illegally, immorally. </trans>
<eg><i lang=""ceb"">Nakwartáhan nang mayúra kay nangwarta sa íyang katungdánan,</i><trans> That mayor became wealthy because he enriched himself in office. </trans></eg>
<eg><i lang=""ceb"">Ayaw mug apil ánang Ápag kay tingálig pangwartáhun (pangwartáhan) lang mu niánà,</i><trans> Don’t pay AFAG (Anderson’s Filipino-American Guerillas) a membership fee. They’ll just get money out of you for nothing. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> means of getting money, esp. for a living. </trans>
</sense></hom></entry>
<entry><form id=""kwartaxhan"" lang=""ceb"">kwartáhan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> moneyed, wealthy. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> become wealthy.
</trans>
</sense></hom></entry></entry>");
