INSERT INTO `wced_entry` VALUES (10315, "kwartu1", "535", "<entry page=""535"" id=""10315""><form id=""kwartu"" lang=""ceb"">kwartu<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>room</tr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>bedroom</tr>. </trans>
<eg><i lang=""ceb"">Ang sála ug kan-anan náa sa ubus ug ang mga kwartu sa itáas,</i><trans> The living and dining rooms are on the first floor and the bedrooms are upstairs. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; a2]</itype><trans> make a room or partition in a house. </trans>
<eg><i lang=""ceb"">Dakù pa ning lugaráha. Makakwartu pa bisag duha,</i><trans> This is quite a large space. We can even make two rooms here. </trans></eg>
<eg><i lang=""ceb"">Ímu man ning gibungbúngan. Kwartúhun nímu ni?</i><trans> You are putting up walls here. Are you partitioning it off into a room?
