<eg><i lang=""ceb"">Mukwartu anyu na siya sa hayiskul sa sunud túig,</i><trans> She will be in her fourth year in high school next year. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; a1]</itype><trans> <tr>divide into four equal parts</tr>. </trans>
<eg><i lang=""ceb"">Kwartúha ning usa ka kílung bábuy,</i><trans> Divide this kilo of pork into four parts.
