INSERT INTO `wced_entry` VALUES (10329, "kwistiyun", "536", "<entry page=""536"" id=""10329""><form id=""kwistiyun"" lang=""ceb"">kwistiyun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>question</tr> raised in a class, meeting, examination. </trans>
<eg><i lang=""ceb"">Píla ka kwistiyun ang tís?</i><trans> How many questions are there in the test? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> problem, thing wrong with s.t. </trans>
<eg><i lang=""ceb"">Ang kwistiyun gud nímu dílì ka man mamínaw ug tambag,</i><trans> The problem with you is you never listen to advice. </trans></eg>
<eg><i lang=""ceb"">Way kwistiyun nang sayúpa. Gamay ra kaáyu,</i><trans> That error is no problem. It’s a very minor one. </trans></eg>
<eg><i lang=""ceb"">Dì gud nà pait kaáyu. Kwistiyun lang nà sa ánad,</i><trans> It’s really not difficult. It’s just a question of getting used to it. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> controversy, dispute. </trans>
<eg><i lang=""ceb"">Mupalit ka niánang yutáa nga nag-atubang kanà karun ug dakung kwistiyun?</i><trans> You are going to buy that land when it is being seriously questioned at the present time? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac6]</itype><trans> ask questions in a class or session. </trans>
<eg><i lang=""ceb"">Mukwistiyun giyud ku basta dì kung kasabut,</i><trans> I ask questions when I don’t understand. </trans></eg>
<eg><i lang=""ceb"">Kwistiyunun ka gánì sa maistra, tubag dáyun,</i><trans> When your teacher questions you, answer immediately. </trans></eg>
<eg><i lang=""ceb"">Kini ang ákung ikwistiyun sa tís,</i><trans> I’ll have this question in the test. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; c1]</itype><trans> be a problem or difficulty. </trans>
<eg><i lang=""ceb"">Maáyu ang plánu, ang nakakwistiyun lang kay way kwarta,</i><trans> It is a good plan, but the problem is there is no money. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c1]</itype><trans> raise s.t. to challenge or dispute. </trans>
<eg><i lang=""ceb"">Wà kahay mukwistiyun niíning inyung gibúhat?</i><trans> Don’t you think anybody will question what you did? </trans></eg>
</sense></hom>
<entry><form id=""kwistiyunabli"" lang=""ceb""><abbr expan=""kwistiyunabli"" type=""lemma"">-abli</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> open to suspicion, having s.t. anomalous or dishonest about it. </trans>
<eg><i lang=""ceb"">Kwistiyunabli nga transaksiyun,</i><trans> A questionable transaction. </trans></eg>
<eg><i lang=""ceb"">Kwistiyunabli kaáyu ang kagíkan ánang bayhána,</i><trans> The real background of that woman is open to suspicion.
</trans></eg>
</sense></hom></entry></entry>");
