INSERT INTO `wced_entry` VALUES (10345, "kyuum", "536", "<entry page=""536"" id=""10345""><form id=""kyuxum"" lang=""ceb"">kyúum</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; c1]</itype><trans> for s.t. with a horizontal opening to <tr>close</tr> tightly. </trans>
<eg><i lang=""ceb"">Mukyúum ang imbaw ug matugaw,</i><trans> Clams shut tight when they are disturbed. </trans></eg>
<eg><i lang=""ceb"">Makyúum nang samára,</i><trans> That wound will close. </trans></eg>
<eg><i lang=""ceb"">Nagkakyúum ang mga dáhun sa akasya nga nagkagabíi na,</i><trans> The acacia leaves are slowly closing up as night is drawing near. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> keep the mouth shut and <pb n=""537""/>not talk. </trans>
<eg><i lang=""ceb"">Mukyúum nà siya ug hisagpaan,</i><trans> She’ll shut up if you slap her. </trans></eg>
<eg><i lang=""ceb"">Kyuúmun (ikyúum) ku lang ang tinúud nga nahitabù,</i><trans> I’ll just keep my mouth shut as to what really happened. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B; a1P]</itype><trans> be doubled up in fear or pain. </trans>
<eg><i lang=""ceb"">Mikyúum siya sa pagkaigù níya sa kutukutu,</i><trans> He doubled up from pain when he was hit in the solar plexus. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> tightly closed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> keeping the mouth shut.

</trans>
</sense></hom></entry>");
